INSERT INTO `TuanTuanApp_activity` VALUES (914,'“2014国际迷你古典”系列音乐会之一  “弦舞英伦”英国阿劳达弦乐四重奏音乐会','http://www.hall.tsinghua.edu.cn/upload/20140122104505.jpg','1993-01-01','2014-03-16 19:00:00','蒙民伟音乐厅','演出：吴氏策划','票价：10/20/40/60/100元/VIP ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：“2014国际迷你古典”系列音乐会之一  “弦舞英伦”英国阿劳达弦乐四重奏音乐会\n \n                      \n                    <p class=\"text2\">时间：2014-3-16 19:00:00<p></p>\n \n                      地点：蒙民伟音乐厅<br/>\n</p>\n<p class=\"text2\">演出：吴氏策划</p>\n<p class=\"text2\">票价：10/20/40/60/100元/VIP <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p style=\"text-align: center\">\n<span style=\"line-height:220%;\"><span style=\"font-size: 18px\">“2014国际迷你古典”系列音乐会之一</span></span></p>\n<p style=\"text-align: center\">\n<span style=\"line-height:220%;\"><span style=\"font-size: 18px\">“弦舞英伦”英国阿劳达弦乐四重奏音乐会</span></span></p>\n<p style=\"text-align: center\">\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">“阿劳达四重奏演奏家之间独特的对话与沟通能力在当今音乐界是难能可贵和至为重要。”<br/>\n<em>— 奥利佛·威利，</em><em>Kuss</em><em>四重奏第二小提琴</em><br/>\r\n	</span></span></p>\n<p align=\"left\">\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">克里斯蒂娜·普拉茨-科斯塔，第一小提琴<br/>\r\n	米兰·贝尔金克，第二小提琴<br/>\r\n	罗瑟琳·劳顿，中提琴<br/>\r\n	艾丽娜·卡佩莱蒂，大提琴</span></span></p>\n<p align=\"left\">\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\"></span></span></p>\n<p align=\"center\">\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\"></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">艺术家简介：</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">   四位音乐家曾是伦敦皇家音乐学院的硕士同窗好友，他们怀着对室内乐和弦乐四重奏的同样热忱成立了阿劳达弦乐四重奏。他们的演奏技艺娴熟，散发着年轻活力而成熟稳健，在传承经典的同时富于时代个性，代表着当代年轻古典弦乐四重奏的最高水平。阿劳达四重奏兼具西班牙的热情、斯洛文尼亚的传统、英国的典雅和意大利的浪漫。他们将来自欧洲四国的不同音乐文化精致地融合在四重奏的气质和演奏中，使他们的音乐有着与众不同的个性和魅力。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">    他们曾先后受教于英国贝司演奏家卓·索恩（Jon Thorne）、德国大提琴演奏家奥利佛·威利（Oliver Wille）和贝尔西亚四重奏（Belcea Quartet），并在英国小提琴家理查德·爱尔兰（Richard Ireland）、范布鲁弦乐四重奏（RTÉ Vanbrugh Quartet）、美国艾舍尔弦乐四重奏（Escher String Quartet），以及英国的恩达林（Endellion）、纽约的艾默森（Emerson）、英国的皇帝（Emperor）、捷克的维汉（Wihan）弦乐四重奏等室内乐名家门下拓宽音乐视野，精进演奏技巧。在英国，阿劳达四重奏被誉为“代表皇家音乐学院最高音乐水平的年轻四重奏”。科林·戴维斯爵士闻听他们的骄人乐绩，曾亲自邀请他们演出并给予指点。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">    作为英国室内乐的新星，他们曾入选竞争激烈的波茨南斯基四重奏项目。在此项目支持下，阿劳达四重奏得以拜师皇家音乐学院及全英最著名的器乐和四重奏教授。阿劳达四重奏曾在普鲁夏科夫英国国际音乐家大师课程师从匈牙利著名四重奏教授丽塔·瓦格纳（Rita Wagner）；赴德国汉诺威音乐戏剧传媒学院大提琴家奥利佛•威利门下深造室内乐硕士进修课程。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">    阿劳达四重奏的演出遍布英国、法国、德国、奥地利、意大利、挪威等地各大音乐厅。2012年他们赴西班牙和意大利各大音乐重镇巡演，并先后亮相伦敦里伯切斯特音乐艺术节和圣艾德蒙德音乐节、德国阿伦塞普音乐节、意大利诺玛音乐节等。同年，阿劳达四重奏在伦敦沃尔夫·沃芬森（Wolfe Wolfinsohn）弦乐四重奏比赛中被授予“最值得推荐乐团”奖。他们是Pro Corda项目的驻场四重奏乐团，也是伦敦皇家音乐学院“室内乐奖金”获得者并在皇家音乐学院教授四重奏课程。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">   2013年，阿劳达四重奏受邀在法国普拉德斯帕布罗·卡萨尔斯（Pablo Casals）音乐节和奥地利欧洲文化论坛及音乐节上演出，赢得乐迷和评论界的一致喝彩。维也纳音乐厅艺术总监及执行总经理贝恩哈德·凯赫斯（Bernhard Kerres）称赞“他们活力四射，技艺精湛，配合默契，是当代最优秀的年轻四重奏中之一”。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">   “阿劳达（Alauda）”是云雀的拉丁语名字，而海顿的“云雀”正是阿劳达四重奏演奏的第一首乐曲。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\"></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\"></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">演出曲目：</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\"><strong>第十七号降B大调弦乐四重奏“狩猎” </strong>莫扎特</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">String Quartet No. 17 in B-flat major K. 458, \"The Hunt\"Wolfgang Amadeus Mozart</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\"><strong>第四号E小调弦乐四重奏 </strong>门德尔松</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">String Quartet No. 4 in E minor, Op. 44, No. 2  Felix Mendelssohn</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\"><strong>E小调随想曲</strong>门德尔松</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\">Capriccio in E minor Felix Mendelssohn</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\"></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size: 14px\"> （演出曲目以实际为准，演出时长约80分钟，无中场休息）</span></span></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(915,'陈佩斯经典舞台喜剧 青春版《阳台》','http://www.hall.tsinghua.edu.cn/upload/20140122112252.jpg','1993-01-01','2014-03-15 19:30:00','新清华学堂','演出：大道喜剧院','票价：20/40/60/100/150/200元/VIP ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：陈佩斯经典舞台喜剧 青春版《阳台》\n \n                      \n                    <p class=\"text2\">时间：2014-3-15 19:30:00<p></p>\n \n                      地点：新清华学堂<br/>\n</p>\n<p class=\"text2\">演出：大道喜剧院</p>\n<p class=\"text2\">票价：20/40/60/100/150/200元/VIP <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\">编剧／导演：陈佩斯<br/>\r\n	　　著名喜剧表演艺术家，大道喜剧院艺术总监。主要舞台剧作品：《托儿》、《亲戚朋友好算账》、《阳台》、《阿斗》、《老宅》、《雷人晚餐》、《日出》（音乐剧）、《蝙蝠》（歌剧）<br/>\r\n	　 历时八年，风靡全国四十多个省市，演出两百余场，吸引二十余万观众的《阳台》，再次火爆来袭！新生代接棒陈佩斯经典喜剧，继续激情四射，再掀新高潮！2012年8月《阳台》青春版第一次在北京世纪剧院驻场演出，首轮34场演出平均上座率高达93.3%，其中10月八场演出全部售罄。</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\"><strong>故事梗概</strong></span></p>\n<p>\n<span style=\"line-height:180%;\">  包工头老穆为众民工讨要拖欠工钱无奈之下上演的\"跳楼秀\"。但是由于过火的\"表演\"老穆不慎失足掉到了侯处长家的阳台。</span></p>\n<p>\n<span style=\"line-height:180%;\"> 此时，侯处长的情人李丽正在导演一出侯处长和他老婆张秀芝\"猫捉老鼠的游戏\"，还没演完\"跳楼秀\"的老穆又被迫加入到了他们的\"游戏\"之中。</span></p>\n<p>\n<span style=\"line-height:180%;\"> 于是，这个\"猫捉老鼠的游戏\"越来越无法收场……</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\"><strong>演员</strong></span></p>\n<p>\n<span style=\"line-height:180%;\"> 王 峰 饰 侯建设</span></p>\n<p>\n<span style=\"line-height:180%;\"> 杨 晨 饰 张秀芝</span></p>\n<p>\n<span style=\"line-height:180%;\"> 许 虎 饰 老 穆</span></p>\n<p>\n<span style=\"line-height:180%;\"> 王宋裔 饰 李丽</span></p>\n<p>\n<span style=\"line-height:180%;\"> 陈天田 饰 顺顺</span></p>\n<p>\n<span style=\"line-height:180%;\"> 颜玮良 饰 大壮</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\"><strong>主创</strong></span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">出品人 王燕玲</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">编剧 陈佩斯/甘草</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">导演 陈佩斯</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">制作人 刘葆彤</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">舞台总监 陈志刚</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">灯光 袁明</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">装置 常文辉</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">音响 冯士奎</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">音效 潘达</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">化妆 郑伟玲</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">服装 刘佳</span></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(916,'陈佩斯经典舞台喜剧 青春版《阳台》','http://www.hall.tsinghua.edu.cn/upload/20140122111808.jpg','1993-01-01','2014-03-14 19:30:00','新清华学堂','演出：大道喜剧院','票价：20/40/60/100/150/200元/VIP ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：陈佩斯经典舞台喜剧 青春版《阳台》\n \n                      \n                    <p class=\"text2\">时间：2014-3-14 19:30:00<p></p>\n \n                      地点：新清华学堂<br/>\n</p>\n<p class=\"text2\">演出：大道喜剧院</p>\n<p class=\"text2\">票价：20/40/60/100/150/200元/VIP <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\">编剧／导演：陈佩斯<br/>\r\n	　　著名喜剧表演艺术家，大道喜剧院艺术总监。主要舞台剧作品：《托儿》、《亲戚朋友好算账》、《阳台》、《阿斗》、《老宅》、《雷人晚餐》、《日出》（音乐剧）、《蝙蝠》（歌剧）<br/>\r\n	　 历时八年，风靡全国四十多个省市，演出两百余场，吸引二十余万观众的《阳台》，再次火爆来袭！新生代接棒陈佩斯经典喜剧，继续激情四射，再掀新高潮！2012年8月《阳台》青春版第一次在北京世纪剧院驻场演出，首轮34场演出平均上座率高达93.3%，其中10月八场演出全部售罄。</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\"><strong>故事梗概</strong></span></p>\n<p>\n<span style=\"line-height:180%;\">   包工头老穆为众民工讨要拖欠工钱无奈之下上演的\"跳楼秀\"。但是由于过火的\"表演\"老穆不慎失足掉到了侯处长家的阳台。</span></p>\n<p>\n<span style=\"line-height:180%;\"> 此时，侯处长的情人李丽正在导演一出侯处长和他老婆张秀芝\"猫捉老鼠的游戏\"，还没演完\"跳楼秀\"的老穆又被迫加入到了他们的\"游戏\"之中。</span></p>\n<p>\n<span style=\"line-height:180%;\"> 于是，这个\"猫捉老鼠的游戏\"越来越无法收场……</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\"><strong>演员</strong></span></p>\n<p>\n<span style=\"line-height:180%;\"> 王 峰 饰 侯建设</span></p>\n<p>\n<span style=\"line-height:180%;\"> 杨 晨 饰 张秀芝</span></p>\n<p>\n<span style=\"line-height:180%;\"> 许 虎 饰 老 穆</span></p>\n<p>\n<span style=\"line-height:180%;\"> 王宋裔 饰 李丽</span></p>\n<p>\n<span style=\"line-height:180%;\"> 陈天田 饰 顺顺</span></p>\n<p>\n<span style=\"line-height:180%;\"> 颜玮良 饰 大壮</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\"><strong>主创</strong></span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">出品人 王燕玲</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">编剧 陈佩斯/甘草</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">导演 陈佩斯</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">制作人 刘葆彤</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">舞台总监 陈志刚</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">灯光 袁明</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">装置 常文辉</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">音响 冯士奎</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">音效 潘达</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">化妆 郑伟玲</span></p>\n<p style=\"margin-left:36.0pt;\">\n<span style=\"line-height:180%;\">服装 刘佳</span></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(922,'中央歌剧院 比才歌剧《卡门》','http://www.hall.tsinghua.edu.cn/upload/20140122044826.jpg','1993-01-01','2014-04-12 19:30:00','新清华学堂','演出：中央歌剧院','票价：待定 ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：中央歌剧院 比才歌剧《卡门》\n \n                      \n                    <p class=\"text2\">时间：2014-4-12 19:30:00<p></p>\n \n                      地点：新清华学堂<br/>\n</p>\n<p class=\"text2\">演出：中央歌剧院</p>\n<p class=\"text2\">票价：待定 <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>剧目介绍：</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　歌剧《卡门》取材于梅里美的同名小说，完成于1874年秋。这是比才一生中最后一部作品，也是当今世界上演率最高的一部歌剧。比才用音乐为大家讲述了一个欢快背景下的悲剧故事，描绘着吉普赛女郎卡门快乐、坦率又充满野性的复杂性格。它向我们展示着赤裸裸的激情，展示着男人和女人间永恒的对立，展示着生活的残酷和美好，展示着爱情和死亡的永恒追随。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　比才为作品创作出具有强烈戏剧性和西班牙风格的灿烂音乐，其中的《哈巴涅拉》、《斗牛士之歌》以及《卡门》序曲等选段选曲，都是被众多艺术家所传唱的挚爱经典，百年来久演不衰。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>　　</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>剧情介绍：</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>　　第一幕</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　故事发生在塞维利亚的街头广场，堂-何塞的未婚妻米凯拉来到警卫队探望堂-何塞，却未能如愿。这时卷烟厂午休了，女工纷纷走到广场，吉普赛女郎卡门也在其中。面对众多追求者，卡门不屑一顾，却看上了在角落里收拾武器的堂-何塞，还把花扔到了他的脸上，并在众女工的掩护下逃脱了。午休结束后，堂-何塞偷偷捡起那朵花。之后米凯拉与堂-何塞互诉衷肠并将家书交给了他。突然，烟厂一阵骚乱，原来是卡门与另一名烟厂女工用刀子刺伤了对方。卡门毫无悔过，被投进了监狱，卡门使出浑身解数诱惑负责看管她的堂-何塞，终于堂-何塞帮她逃脱，并因此而降职、关禁闭。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>　　第二幕</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　在塞维利亚老城墙旁边利拉斯-帕斯蒂亚的小酒馆里，卡门和女友与很多军官和吉普赛人在一起饮酒狂欢。后来，斗牛士埃斯卡米罗来到了小酒馆，并向卡门大胆求爱，而卡门没给他任何承诺。埃斯卡米罗走后，两个走私犯拉拢卡门她们参与一宗走私交易，卡门因为要等堂-何塞，所以断然拒绝了。此时，远处传来堂-何塞的歌声，卡门欣喜若狂地跳起了响板舞。堂-何塞终于表达了对她深深的爱意。因堂-何塞失去了骑兵的身份，只得与卡门去山里干走私的勾当。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>　　第三幕</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　在深山里，堂-何塞跟随卡门和走私犯在这里埋伏很多天了，常常在想起母亲和未婚妻米凯拉时，就为当初自己冲动地加入走私行列而后悔不已，因此与卡门大吵无果，面露凶光的堂-何塞令卡门预感到自己将要死在这个男人手中。后来，深爱着堂-何塞的米凯拉冒着危险，前来找寻他并欲告知他母亲生病的消息。与此同时，斗牛士埃斯卡米罗也来找卡门，却碰到了放哨的堂-何塞。当堂-何塞得知他来意之后，妒火中烧，欲置他于死地，却被赶来的卡门制止。怀着对卡门的大失所望和对母亲的担忧，堂-何塞被迫随米凯拉回家去。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>　　第四幕</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　在塞维利亚的斗牛竞技场前面的广场上，等待斗牛的观众和小商贩们熙熙攘攘。埃斯卡米罗在人们的簇拥中进入斗牛竞技场，卡门留在了场外。这时，衣衫褴褛、神情恍惚的堂-何塞痛哭流涕地恳求卡门原谅，对此，卡门却无动于衷。后来，场内传来欢呼声，卡门想到是埃斯卡米罗获得了胜利，于是将堂-何塞曾送的戒指摘下丢在了地上，迫不及待地冲进场去。这使堂-何塞万念俱灰，他从怀中抽出了早已准备的匕首，刺向了卡门。当观众们带着胜利的喜悦走出斗牛竞技场的时候，却看到了倒在血泊中的卡门，听到堂-何塞大叫“她是我杀的！卡门，我亲爱的卡门！”</span></span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">中央歌剧院简介</span></span></p>\n<p>\n<span style=\"font-size: 14px; line-height: 220%; \">   中央歌剧院是隶属于文化部的国家歌剧院，始建于1952年，前身是延安的中央管弦乐团和鲁艺文工团。1943年在延安创作演出了秧歌剧《兄妹开荒》，1945年在延安演出歌剧《白毛女》。目前是中国及亚太地区具有规模优势和实力的歌剧院。</span></p>\n<p align=\"left\">\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">    六十多年来，剧院一直保持着新人辈出的繁荣局面，青年艺术家在国际国内比赛中频频获奖，在国际艺术交流中保持着高水准，为国家赢得广泛的声誉，为剧院发展提供支持力。作为新世纪的中国国家歌剧院，将继续保持创造性、开放性、国际性的发展原则，肩负着发展民族文化和国际间合作交流的历史重任。</span></span></p>\n<p align=\"left\">\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">   2012年4月及2013年5月，中央歌剧院派出强大演出阵容在新清华学堂分别上演经典歌剧《茶花女》和《图兰朵》，获得广大师生的热烈好评。</span></span></p>\n<p align=\"left\">\r\n	</p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(923,'中央歌剧院 比才歌剧《卡门》','http://www.hall.tsinghua.edu.cn/upload/20140122044628.jpg','1993-01-01','2014-04-11 19:30:00','新清华学堂','演出：中央歌剧院','票价：待定 ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：中央歌剧院 比才歌剧《卡门》\n \n                      \n                    <p class=\"text2\">时间：2014-4-11 19:30:00<p></p>\n \n                      地点：新清华学堂<br/>\n</p>\n<p class=\"text2\">演出：中央歌剧院</p>\n<p class=\"text2\">票价：待定 <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>剧目介绍：</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　歌剧《卡门》取材于梅里美的同名小说，完成于1874年秋。这是比才一生中最后一部作品，也是当今世界上演率最高的一部歌剧。比才用音乐为大家讲述了一个欢快背景下的悲剧故事，描绘着吉普赛女郎卡门快乐、坦率又充满野性的复杂性格。它向我们展示着赤裸裸的激情，展示着男人和女人间永恒的对立，展示着生活的残酷和美好，展示着爱情和死亡的永恒追随。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　比才为作品创作出具有强烈戏剧性和西班牙风格的灿烂音乐，其中的《哈巴涅拉》、《斗牛士之歌》以及《卡门》序曲等选段选曲，都是被众多艺术家所传唱的挚爱经典，百年来久演不衰。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>　　剧情介绍：</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>　　第一幕</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　故事发生在塞维利亚的街头广场，堂-何塞的未婚妻米凯拉来到警卫队探望堂-何塞，却未能如愿。这时卷烟厂午休了，女工纷纷走到广场，吉普赛女郎卡门也在其中。面对众多追求者，卡门不屑一顾，却看上了在角落里收拾武器的堂-何塞，还把花扔到了他的脸上，并在众女工的掩护下逃脱了。午休结束后，堂-何塞偷偷捡起那朵花。之后米凯拉与堂-何塞互诉衷肠并将家书交给了他。突然，烟厂一阵骚乱，原来是卡门与另一名烟厂女工用刀子刺伤了对方。卡门毫无悔过，被投进了监狱，卡门使出浑身解数诱惑负责看管她的堂-何塞，终于堂-何塞帮她逃脱，并因此而降职、关禁闭。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>　　第二幕</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　在塞维利亚老城墙旁边利拉斯-帕斯蒂亚的小酒馆里，卡门和女友与很多军官和吉普赛人在一起饮酒狂欢。后来，斗牛士埃斯卡米罗来到了小酒馆，并向卡门大胆求爱，而卡门没给他任何承诺。埃斯卡米罗走后，两个走私犯拉拢卡门她们参与一宗走私交易，卡门因为要等堂-何塞，所以断然拒绝了。此时，远处传来堂-何塞的歌声，卡门欣喜若狂地跳起了响板舞。堂-何塞终于表达了对她深深的爱意。因堂-何塞失去了骑兵的身份，只得与卡门去山里干走私的勾当。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>　　第三幕</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　在深山里，堂-何塞跟随卡门和走私犯在这里埋伏很多天了，常常在想起母亲和未婚妻米凯拉时，就为当初自己冲动地加入走私行列而后悔不已，因此与卡门大吵无果，面露凶光的堂-何塞令卡门预感到自己将要死在这个男人手中。后来，深爱着堂-何塞的米凯拉冒着危险，前来找寻他并欲告知他母亲生病的消息。与此同时，斗牛士埃斯卡米罗也来找卡门，却碰到了放哨的堂-何塞。当堂-何塞得知他来意之后，妒火中烧，欲置他于死地，却被赶来的卡门制止。怀着对卡门的大失所望和对母亲的担忧，堂-何塞被迫随米凯拉回家去。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>　　第四幕</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　在塞维利亚的斗牛竞技场前面的广场上，等待斗牛的观众和小商贩们熙熙攘攘。埃斯卡米罗在人们的簇拥中进入斗牛竞技场，卡门留在了场外。这时，衣衫褴褛、神情恍惚的堂-何塞痛哭流涕地恳求卡门原谅，对此，卡门却无动于衷。后来，场内传来欢呼声，卡门想到是埃斯卡米罗获得了胜利，于是将堂-何塞曾送的戒指摘下丢在了地上，迫不及待地冲进场去。这使堂-何塞万念俱灰，他从怀中抽出了早已准备的匕首，刺向了卡门。当观众们带着胜利的喜悦走出斗牛竞技场的时候，却看到了倒在血泊中的卡门，听到堂-何塞大叫“她是我杀的！卡门，我亲爱的卡门！”</span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">中央歌剧院简介</span></span></p>\n<p>\n<span style=\"font-size: 14px; line-height: 220%; \">  中央歌剧院是隶属于文化部的国家歌剧院，始建于1952年，前身是延安的中央管弦乐团和鲁艺文工团。1943年在延安创作演出了秧歌剧《兄妹开荒》，1945年在延安演出歌剧《白毛女》。目前是中国及亚太地区具有规模优势和实力的歌剧院。</span></p>\n<p align=\"left\">\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">   六十多年来，剧院一直保持着新人辈出的繁荣局面，青年艺术家在国际国内比赛中频频获奖，在国际艺术交流中保持着高水准，为国家赢得广泛的声誉，为剧院发展提供支持力。作为新世纪的中国国家歌剧院，将继续保持创造性、开放性、国际性的发展原则，肩负着发展民族文化和国际间合作交流的历史重任。</span></span></p>\n<p align=\"left\">\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">2012年4月及2013年5月，中央歌剧院派出强大演出阵容在新清华学堂分别上演经典歌剧《茶花女》和《图兰朵》，获得广大师生的热烈好评。</span></span></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(924,'孟京辉戏剧演出季――话剧《两只狗的生活意见》','http://www.hall.tsinghua.edu.cn/upload/20140122033901.jpg','1993-01-01','2014-03-29 19:30:00','新清华学堂','演出：孟京辉戏剧工作室','票价：20/40/60/100/150/200/280元  （优惠套票：200*2=360 200*3=500 280*2=500 280*3=700 ） ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：孟京辉戏剧演出季――话剧《两只狗的生活意见》\n \n                      \n                    <p class=\"text2\">时间：2014-3-29 19:30:00<p></p>\n \n                      地点：新清华学堂<br/>\n</p>\n<p class=\"text2\">演出：孟京辉戏剧工作室</p>\n<p class=\"text2\">票价：20/40/60/100/150/200/280元  （优惠套票：200*2=360 200*3=500 280*2=500 280*3=700 ） <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\r\n	</p>\n<p>\n<span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 15px; line-height: 22px; text-align: -webkit-left; \">售票时间：2月23日12:00起</span><br style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-family: tahoma; font-size: 15px; color: rgb(0, 0, 0); text-align: -webkit-left; \"/>\n<span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 15px; line-height: 22px; text-align: -webkit-left; \">售票电话：62781984,13699152575</span><br style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-family: tahoma; font-size: 15px; color: rgb(0, 0, 0); text-align: -webkit-left; \"/>\n<span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 15px; line-height: 22px; text-align: -webkit-left; \">售票地点：新清华学堂票厅</span><br style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-family: tahoma; font-size: 15px; color: rgb(0, 0, 0); text-align: -webkit-left; \"/>\n<span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 15px; line-height: 22px; text-align: -webkit-left; \">温馨提示：1米2以下儿童谢绝入场</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height: 26px; \"><span style=\"font-size: 14px; \">导 演：孟京辉</span></span></p>\n<p>\n<span style=\"line-height: 26px; \"><span style=\"font-size: 14px; \">主 演：刘晓晔、韩鹏翼、吴洲凯、王印</span></span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height: 26px; \"><span style=\"font-size: 14px; \"><strong>剧目简介：</strong></span></span></p>\n<p align=\"left\">\n<span style=\"line-height: 26px; \"><span style=\"font-size: 14px; \">   话剧《两只狗的生活意见》单从创作时间上说，算不上“老”作品，但从其口碑、反响和观众认可度来讲，绝对称得上当代话剧作品的经典之作。该剧2007年首演之际便引起了轰动，创造了“630次笑声，140次掌声，整个剧场笑得人仰马翻”的小剧场奇迹。2011年，“狗兄弟”还漂洋过海前往美国讨生活、追理想，足见其知名度和影响力。经历了一系列生活磨练，来福和旺财登场次数已经超过800次，“两只狗”正斗志昂扬地向千场大关迈近。</span></span></p>\n<p align=\"left\">\r\n	</p>\n<p>\n<span style=\"line-height: 26px; \"><span style=\"font-size: 14px; \"><strong>剧情简介：</strong></span></span></p>\n<p>\r\n	</p>\n<p align=\"left\">\n<span style=\"line-height: 26px; \"><span style=\"font-size: 14px; \">    两只狗离开家乡进入城市，他们寻找幸福的生活，寻找伟大的理想，然而城里的世界并不象他们想象得那么美好……四处碰壁之后，他们对生活产生了各种意见，这些意见是他们简单纯洁的头脑无法理解的生存难题。为了能够吃上一口饱饭，来福和旺财在街头卖艺，参加明星选秀进入娱乐界，去当保安，被富人收养又被抛弃，被打狗队打得遍体鳞伤，最后，他们决定勇敢地面对生活，不管生活有多艰辛，一定要勇敢地走下去！</span></span></p>\n<p align=\"left\">\r\n	</p>\n<p align=\"left\">\n<span style=\"line-height: 26px; \"><span style=\"font-size: 14px; \">导演：孟京辉</span></span></p>\n<p align=\"left\">\n<span style=\"line-height: 26px; \"><span style=\"font-size: 14px; \">　　孟京辉是当前亚洲剧坛最具影响力的著名实验戏剧导演，现为中国国家话剧院导演。他以独具个性的创造力，多元化的艺术风格，不仅开拓了中国当代戏剧的新局面，而且已经成为一种值得瞩目的文化现象。他执导的《思凡》《一个无政府主义者的意外死亡》《百年孤独》《恋爱的犀牛》《臭虫》《关于爱情归宿的最新观念》《琥珀》《镜花水月》《艳遇》《两只狗的生活意见》《爱比死更冷酷》都引起了强烈的反响，使中国实验戏剧在美学高度上日臻完善，为中国戏剧舞台多元化的新局面注入了活力。由他担任导演的电影《像鸡毛一样飞》获香港国际电影节费比西影评人大奖、洛加诺国际电影节青年评委会特别奖。孟京辉导演在国际戏剧领域有着广泛的知名度，他的戏剧作品曾在多个国际艺术节上演出。2008年创建北京青年戏剧节并任艺术总监。</span></span></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(925,'孟京辉戏剧演出季――话剧《两只狗的生活意见》','http://www.hall.tsinghua.edu.cn/upload/20140122033707.jpg','1993-01-01','2014-03-28 19:30:00','新清华学堂','演出：孟京辉戏剧工作室','票价：20/40/60/100/150/200/280元  (优惠套票：200*2=360 200*3=500 280*2=500 280*3=700 ) ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：孟京辉戏剧演出季――话剧《两只狗的生活意见》\n \n                      \n                    <p class=\"text2\">时间：2014-3-28 19:30:00<p></p>\n \n                      地点：新清华学堂<br/>\n</p>\n<p class=\"text2\">演出：孟京辉戏剧工作室</p>\n<p class=\"text2\">票价：20/40/60/100/150/200/280元  (优惠套票：200*2=360 200*3=500 280*2=500 280*3=700 ) <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\r\n	</p>\n<p>\n<span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 15px; line-height: 22px; text-align: -webkit-left; \">售票时间：2月23日12:00起</span><br style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-family: tahoma; font-size: 15px; color: rgb(0, 0, 0); text-align: -webkit-left; \"/>\n<span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 15px; line-height: 22px; text-align: -webkit-left; \">售票电话：62781984,13699152575</span><br style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-family: tahoma; font-size: 15px; color: rgb(0, 0, 0); text-align: -webkit-left; \"/>\n<span style=\"color: rgb(0, 