他执导的《思凡》《一个无政府主义者的意外死亡》《百年孤独》《恋爱的犀牛》《臭虫》《关于爱情归宿的最新观念》《琥珀》《镜花水月》《艳遇》《两只狗的生活意见》《爱比死更冷酷》都引起了强烈的反响，使中国实验戏剧在美学高度上日臻完善，为中国戏剧舞台多元化的新局面注入了活力。由他担任导演的电影《像鸡毛一样飞》获香港国际电影节费比西影评人大奖、洛加诺国际电影节青年评委会特别奖。孟京辉导演在国际戏剧领域有着广泛的知名度，他的戏剧作品曾在多个国际艺术节上演出。2008年创建北京青年戏剧节并任艺术总监。</span></span></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(926,'孟京辉戏剧演出季――话剧《两只狗的生活意见》  ','http://www.hall.tsinghua.edu.cn/upload/20140122033419.jpg','1993-01-01','2014-03-27 19:30:00','新清华学堂','演出：孟京辉戏剧工作室','票价：20/40/60/100/150/200/280元 （ 优惠套票：200*2=360 200*3=500 280*2=500 280*3=700 ） ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：孟京辉戏剧演出季――话剧《两只狗的生活意见》  \n \n                      \n                    <p class=\"text2\">时间：2014-3-27 19:30:00<p></p>\n \n                      地点：新清华学堂<br/>\n</p>\n<p class=\"text2\">演出：孟京辉戏剧工作室</p>\n<p class=\"text2\">票价：20/40/60/100/150/200/280元 （ 优惠套票：200*2=360 200*3=500 280*2=500 280*3=700 ） <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 15px; line-height: 22px; text-align: -webkit-left; \">售票时间：2月23日12:00起</span><br style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-family: tahoma; font-size: 15px; color: rgb(0, 0, 0); text-align: -webkit-left; \"/>\n<span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 15px; line-height: 22px; text-align: -webkit-left; \">售票电话：62781984,13699152575</span><br style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-family: tahoma; font-size: 15px; color: rgb(0, 0, 0); text-align: -webkit-left; \"/>\n<span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 15px; line-height: 22px; text-align: -webkit-left; \">售票地点：新清华学堂票厅</span><br style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-family: tahoma; font-size: 15px; color: rgb(0, 0, 0); text-align: -webkit-left; \"/>\n<span style=\"color: rgb(0, 0, 0); font-family: tahoma; font-size: 15px; line-height: 22px; text-align: -webkit-left; \">温馨提示：1米2以下儿童谢绝入场</span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">导 演：孟京辉</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">主 演：刘晓晔、韩鹏翼、吴洲凯、王印</span></span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>剧目简介：</strong></span></span></p>\n<p align=\"left\">\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">   话剧《两只狗的生活意见》单从创作时间上说，算不上“老”作品，但从其口碑、反响和观众认可度来讲，绝对称得上当代话剧作品的经典之作。该剧2007年首演之际便引起了轰动，创造了“630次笑声，140次掌声，整个剧场笑得人仰马翻”的小剧场奇迹。2011年，“狗兄弟”还漂洋过海前往美国讨生活、追理想，足见其知名度和影响力。经历了一系列生活磨练，来福和旺财登场次数已经超过800次，“两只狗”正斗志昂扬地向千场大关迈近。</span></span></p>\n<p align=\"left\">\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>剧情简介：</strong></span></span></p>\n<p>\r\n	</p>\n<p align=\"left\">\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">    两只狗离开家乡进入城市，他们寻找幸福的生活，寻找伟大的理想，然而城里的世界并不象他们想象得那么美好……四处碰壁之后，他们对生活产生了各种意见，这些意见是他们简单纯洁的头脑无法理解的生存难题。为了能够吃上一口饱饭，来福和旺财在街头卖艺，参加明星选秀进入娱乐界，去当保安，被富人收养又被抛弃，被打狗队打得遍体鳞伤，最后，他们决定勇敢地面对生活，不管生活有多艰辛，一定要勇敢地走下去！</span></span></p>\n<p align=\"left\">\r\n	</p>\n<p align=\"left\">\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">导演：孟京辉</span></span></p>\n<p align=\"left\">\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">　　孟京辉是当前亚洲剧坛最具影响力的著名实验戏剧导演，现为中国国家话剧院导演。他以独具个性的创造力，多元化的艺术风格，不仅开拓了中国当代戏剧的新局面，而且已经成为一种值得瞩目的文化现象。他执导的《思凡》《一个无政府主义者的意外死亡》《百年孤独》《恋爱的犀牛》《臭虫》《关于爱情归宿的最新观念》《琥珀》《镜花水月》《艳遇》《两只狗的生活意见》《爱比死更冷酷》都引起了强烈的反响，使中国实验戏剧在美学高度上日臻完善，为中国戏剧舞台多元化的新局面注入了活力。由他担任导演的电影《像鸡毛一样飞》获香港国际电影节费比西影评人大奖、洛加诺国际电影节青年评委会特别奖。孟京辉导演在国际戏剧领域有着广泛的知名度，他的戏剧作品曾在多个国际艺术节上演出。2008年创建北京青年戏剧节并任艺术总监。</span></span></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(927,'且弹且谈--章红艳弹拨组合音乐会清华大学专场','http://www.hall.tsinghua.edu.cn/upload/20140122033017.jpg','1993-01-01','2014-03-22 19:00:00','蒙民伟音乐厅','演出：章红艳弹拨组合','票价：10/20/40/60/100元 ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：且弹且谈--章红艳弹拨组合音乐会清华大学专场\n \n                      \n                    <p class=\"text2\">时间：2014-3-22 19:00:00<p></p>\n \n                      地点：蒙民伟音乐厅<br/>\n</p>\n<p class=\"text2\">演出：章红艳弹拨组合</p>\n<p class=\"text2\">票价：10/20/40/60/100元 <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>章红艳弹拨组合简介</strong></span></span></p>\n<div>\n<p align=\"left\">\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">   “章红艳弹拨组合”成立于2008年，由著名琵琶演奏家、教育家，中央音乐学院教授章红艳创建，并担任音乐总监及主奏。组合成员选自中央音乐学院弹拨乐团，由本科生、研究生及青年教师组成。创立迄今，章红艳教授秉承“艺术至上，演奏纯粹的音乐，不用任何音乐以外的手段取悦听众”的音乐理念，带领弹拨乐团以“且弹且谈”的方式，在国家大剧院及全国各大音乐剧场、大学校园以及香港、澳门、日本、美国等地举行讲座式音乐会，传播音乐及音乐厅文化，培养了大批喜爱民族音乐的观众和音乐爱好者。获得了音乐界和社会公众的高度赞誉。</span></span></p>\n</div>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>章红艳</strong></span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">  中国当代杰出琵琶演奏家、教育家，中央音乐学院教授、硕士生导师、民乐系副，曾任美国哥伦比亚大学访问学者。</span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">  章红艳毕业于中央音乐学院，获硕士学位，先后师从章时钧、孙维熙、林石城教授。是中国及世界乐坛最活跃和重要的演奏家与教育家之一。她首演了多部作曲家的作品，并多次出演于纽约卡内基音乐厅、纽约林肯中心、柏林爱乐大厅、维也纳金色大厅、华盛顿肯尼迪艺术中心等世界顶级音乐厅。先后应邀于国内、外著名大学讲演。主要著作及出版物包括论文、散文、教材、专辑等。鉴于她为中国传统音乐所做出的杰出贡献，美国国会图书馆和美国国家民俗中心永久收藏她的唱片专辑《十面埋伏》，让全世界共同分享。</span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">  章红艳的成功不仅表现于所教授的学生人数多寡，还体现在多次获得国内外重大音乐比赛奖项，还表现于对社会音乐教育的关注。2003年，章红艳发起创立中央音乐学院弹拨乐团，任音乐总监，主力强化学生的演出实践和乐队意识，开拓弹拨音乐的作品样式及积累弹拨音乐的曲库，探索中国弹拨乐器的组合与表现可能，以及在普及、传播弹拨音乐诸方面均做出具有开创性的贡献。章红艳秉承艺术至上的理念，推行音乐厅文化为目的。尤以“且弹且谈”的方式，在国家大剧院及全国多个城市举行讲座式音乐会，获得音乐界和社会公众的崇高评价。是当代国内外乐坛备受赞誉的演奏家和享有盛名的国际音乐使者。</span></span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(928,'“花样年华”中外名校优秀舞台艺术系列――爱尔兰皇家音乐学院室内乐音乐会','http://www.hall.tsinghua.edu.cn/upload/20140124074812.jpg','1993-01-01','2014-03-13 19:00:00','蒙民伟音乐厅','演出：爱尔兰皇家音乐学院','票价：10/20/40/60/80/100元 ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：“花样年华”中外名校优秀舞台艺术系列――爱尔兰皇家音乐学院室内乐音乐会\n \n                      \n                    <p class=\"text2\">时间：2014-3-13 19:00:00<p></p>\n \n                      地点：蒙民伟音乐厅<br/>\n</p>\n<p class=\"text2\">演出：爱尔兰皇家音乐学院</p>\n<p class=\"text2\">票价：10/20/40/60/80/100元 <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心 爱尔兰驻华使馆</span>\n<p class=\"text2\"><br>\n<p>\n<span style=\"font-size:14px;\"><span style=\"line-height:180%;\">艺术家简介</span></span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>约翰·菲纽肯， 单簧管</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">    约翰·菲纽肯曾就读于都柏林三一学院， 现已成为国内外知名的管弦乐音乐家、室内乐音乐家、单簧管演奏家和指挥家。曾参与国家交响乐团和爱尔兰广播电视台(RTE) 管弦乐团在爱尔兰和英国的巡演， 演奏过所有单簧管协奏曲的重头曲目，并为罗伯特·兰博和詹姆斯·威尔逊等众多作曲家的协奏曲奉献首演。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">   约翰被公认为当今爱尔兰最富天赋、最出类拔萃的音乐家之一。 作为单簧管演奏家和室内乐音乐家，约翰曾在皇家阿尔伯特大厅、圣约翰史密斯广场、 伦敦以及爱尔兰所有重要的音乐节上献技， 并在德国、荷兰、法国、西班牙、意大利、加拿大和中国举办的音乐会上表演。 最近与钢琴家休·提尼合作在都柏林城堡的圣帕特里克厅举办了独奏音乐会；他还 参加了国家交响乐团的全国巡演， 在格哈德·马克森的指挥下演绎了韦伯的第一协奏曲； 并作为国家室内乐团成员来中国巡演。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">   作为指挥家，约翰曾经和RTE交响乐团、RTE管弦乐团、乌斯特管弦乐团、 萨里小交响乐团和歌剧公司合作过。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">    约翰现在爱尔兰皇家音乐学院教授单簧管， 也是爱尔兰人管乐团的音乐指导。自1995年以来就成为RTE国家交响乐团的首席单簧管演奏家。</span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>菲欧诺拉·亨特 小提琴</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">    菲欧诺拉·亨特是爱尔兰最为杰出和知名的独奏表演艺术家、艺术指导和室内乐音乐家之一。 她曾担任爱尔兰室内乐团的艺术指导和音乐总监， 并在1995年至2002年期间担任一年一度的Killaloe音乐节的艺术总监。 与室内乐团合作期间，她既管理乐团在国内的演出， 也负责乐团在欧洲、美国和澳大利亚的巡演， 并录制了爱尔兰经典音乐作品和柴科夫斯基作品。她为许多爱尔兰顶级作曲家受邀特制的音乐作品进行世界首演， 其中许多灌制了唱片。 在与爱尔兰国家交响乐团、爱尔兰广播电视台(RTE)管铉乐团和乌斯特管弦乐团合作时奉献独奏曲目。 参加过维也纳室内乐团的演出， 并在慕尼黑和巴伐利亚国家歌剧管弦乐团合作两年。 做过3年的都柏林RTE交响乐团的联席领导， 也做过伦敦交响乐团、BBC 爱乐乐团、BBC苏格兰交响乐团、哈雷管弦乐团、伯恩茅斯交响乐团、乌斯特管弦乐团和墨尔本交响乐团客座指导。曾特邀指导了瓦列里·杰吉耶夫指挥的莫斯科世界和平管弦乐音乐会。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">   菲欧若拉很小的时候就和姐姐邬娜演奏室内乐， 并以二重奏形式在爱尔兰国内和奥地利、德国、瑞士、意大利、英国和美国等世界各国演出。和她经常合作的艺术家有休·提尼、约翰·菲纽肯、约翰·林奇、约翰·奥康诺、威廉姆·巴特和麦克尔·达西。 还担任过都柏林爱尔兰现代艺术博物馆举办的1997室内乐系列音乐会的艺术指导。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">    菲欧诺拉生于贝尔法斯特， 就读于乌斯特音乐学院和伦敦皇家音乐学院， 师从雅罗斯拉夫·瓦涅切克。 1976年至1984年求学于维也纳音乐艺术学院， 拜师于沃尔夫冈·施奈德汉和Franz Samohyl, 并获得一级荣誉表演证。</span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>琳达·李 女高音</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">    琳达师从维罗妮卡·邓恩（VeronicaDunne）博士学习歌唱艺术， 在此期间， 曾多次获奖， 并代表北爱尔兰参加卡迪夫世界歌手大奖赛。她和歌剧戏剧团合作奉献了职业生涯的首次演唱会， 随后与爱尔兰各大歌剧公司合作，演唱了品种繁多的歌剧和音乐会曲目。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">   她随后供职于格林德本歌剧院、苏格兰歌剧院， 并在柯芬园艺术节、巴克斯顿艺术节、德累斯顿艺术节以及欧洲纪念亨德尔的音乐节上演出。 在莱比锡歌剧院做了三年首席女高音，同一时间与哈雷歌剧院合作频繁。由于其出色的演绎了亨德尔作品中的角色，曾两度被国际歌剧杂志 <strong>歌剧世界</strong>提名最佳新人奖和最佳表演奖。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">    录制的商业唱片有亨德尔的《米萨亚》、《李尔王的孩子》、《玛丽塔纳》和《拉达米斯托》。 在米拉迈克斯影业公司拍摄的、由戴姆�姬· 史密斯和安妮·海色薇主演的电影《成为简·奥斯汀》中饰演角色， 也参加过乔纳斯·米勒改编的巴赫的《圣马太受难曲》演出。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">   2009年，琳达应圣母合唱团邀请，在罗马的梵蒂冈为罗马教皇本尼迪克特表演了亨德尔的《米萨亚》， 也曾为日本天皇演唱。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">   近期，琳达在巴黎爱尔兰文化中心演唱了泰雷津集中营的音乐, 并在肯曼哈姆皇家医院旧址为KBC爱尔兰老房子 音乐节演唱了精彩曲目。</span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>约翰·林奇 中提琴</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">     约翰·林奇出生于澳大利亚墨尔本， 求学于维多利亚艺术学院。1988年在布达佩斯的李斯特音乐学院学习室内乐演奏， 从师于安德拉斯·米哈利；1991年在弗莱堡音乐学院求学时和金·卡谢卡乡是同学， 还同尤里·巴什梅特共同参加过意大利西恩纳高级音乐讲习班的学习，期间， 和钢琴家米哈伊尔合作演奏肖斯坦科维奇的中提琴奏鸣曲， 该曲于1975年由米哈伊尔首演。约翰是Binneas铉乐四重奏的创办人，该乐队曾在意大利的斯波莱托音乐节、北美的班夫和坦格·伍德音乐节上演出， 并在1987年圣彼得堡举办的肖斯塔科维奇铉乐四重奏比赛上获奖。 他还与澳大利亚室内管弦乐团、盖文·布莱尔斯乐团、即兴表演团” deFlocked” 联袂演出，并参加了马泽尔指挥的以色列“红海之滨音乐会”的演出。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">     约翰现是爱尔兰国家广播电视台交响乐团首席中提琴， 也是爱尔兰皇家音乐学院铉乐教师，并在皇家音乐学院和音乐家菲欧诺拉·亨特、 克里斯托弗 ·马伍德、 约翰·菲纽肯、 休·提尼 以及女高音琳达·李联袂表演过。</span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>克里斯托弗 ·马伍德, 大提琴</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">   克里斯托弗1983年毕业于剑桥大学， 后在伦敦皇家音乐学院和马斯特里赫特音乐学院深造。从师于胡顿, 大卫·斯顿吉, 柯希保恩, 浦利思和阿社列<em>斯</em><em>库</em>。���曾是他多年的室内音乐导师。克里斯托弗曾在许多重大的音乐会上表演大提琴独奏，并在英国各地举办过多场独奏音乐会。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">    1985年，克里斯托弗加入凡布鲁铉乐四重奏（Vanbrugh Quartet），并在1986年与同行们在科克奉献了演出。1988年四重奏在伦敦国际铉乐四重奏比赛中一举夺魁， 由此而展开的更大的国际舞台为其带来欧洲、亚洲和美洲地区2千多场音乐会， 发行了25张光盘，其中包括贝多芬四重奏曲全集。 与此同时，RTE 凡布鲁四重奏还致力于在全爱尔兰普及室内乐，并 大力支持国内作曲家和年轻的音乐人。</span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">    克里斯托弗是西部科克室内乐音乐节副总监， 这个音乐节是他和弗朗西斯·汉弗莱斯 于1996年出资举办的； 他还是DIT音乐学院室内乐讲师。 并在科克音乐学校和皇家音乐学院教授大提琴。 </span></span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>休·提尼 钢琴</strong></span></span></p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">     自1983年在意大利波佐利和1984年在西班牙帕洛玛奥谢钢琴比赛中均赢得第一名， 休·提尼在欧洲、美国、南美以及远东等30多个国家进行过演出。世界各地的音乐节的演出邀请使他足迹遍布全球，其演奏实况曾在超过15个国家进行过电台广播。1987年Leeds钢琴比赛中的获奖使他在英国的职业生涯进入了黄金时代，先后与许多著名的管弦乐团合作，其中包括伦敦爱乐乐团、皇家爱乐乐团、皇家利物浦爱乐乐团、皇家苏格兰爱乐乐团，BBC威尔士爱乐乐团以及包括赖特尔在内的众多指挥家。近30年中他为爱尔兰的音乐会事业做出了巨大贡献，奉献了一系列独奏音乐会（如1990年的“肖邦等”，“舒伯特和贝多芬”，以及2011年的“欧洲钢琴大师作品”音乐会），并与爱尔兰著名的管乐团定期演出协奏曲。他还与鲍罗廷室内乐团、东京室内乐团、爱尔兰广播电视台范步勒室内乐团、沃格勒四重奏小组、 维也纳室内乐团、史蒂芬·以瑟里斯，凯瑟琳·罗纳尔多、菲欧诺拉·亨特、约翰·菲纽肯、酋长乐队和已故的贝尔纳·奈特均有过合作。他为德卡、纳克索斯、爱尔兰广播抒情调频道和几张其他激光唱片录制过独奏、室内乐和协奏曲曲目。从2000年至2006年，休·提尼曾担任爱尔兰老房子音乐节的音乐艺术总监。自1995年以来他一直在爱尔兰皇家音乐学院任教，并为几个国际钢琴赛事担任评委。2007年，他被爱尔兰国立大学授予荣誉音乐博士学位。</span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\">演出曲目：</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\">1、Beethoven: Clarinet Trio in B Flat major, op 11</span></p>\n<p>\n<span style=\"line-height:180%;\">贝多芬：降B大调单簧管三重奏，作品11</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\">2、Handel/Halvorsen: Passacaglia for Violin and Cello</span></p>\n<p>\n<span style=\"line-height:180%;\">亨德尔/ 哈尔沃森：小提琴大提琴二重奏«帕萨卡利亚»</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\">3、Messager: Solo de Concours</span></p>\n<p>\n<span style=\"line-height:180%;\">梅沙杰：«竟合之独白»</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\">4、Poulenc: Banalites</span></p>\n<p>\n<span style=\"line-height:180%;\">浦朗克：凡人之歌</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\">5、Wallace: Three Songs</span></p>\n<p>\n<span style=\"line-height:180%;\">华莱士：三首歌曲</span></p>\n<p>\n<span style=\"line-height:180%;\">《Sweet Spirit Hear My Prayer》</span></p>\n<p>\n<span style=\"line-height:180%;\">《Say My Heart Can This Be Love》</span></p>\n<p>\n<span style=\"line-height:180%;\">《Scenes That Are Brightest》</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:180%;\">6、Piazzolla: Verano Porteno</span></p>\n<p>\n<span style=\"line-height:180%;\">皮亚佐拉：四季之夏</span></p>\n<p>\r\n	</p>\n<p>\r\n	（演出曲目以实际为准）</p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(1059,'孟京辉戏剧演出季――话剧《两只狗的生活意见》  ','http://www.hall.tsinghua.edu.cn/upload/20140218022424.JPG','1993-01-01','2014-03-30 19:30:00','新清华学堂','演出：孟京辉戏剧工作室','票价：20/40/60/100/150/200/280元 （ 优惠套票：200*2=360 200*3=500 280*2=500 280*3=700 ） ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：孟京辉戏剧演出季――话剧《两只狗的生活意见》  \n \n                      \n                    <p class=\"text2\">时间：2014-3-30 19:30:00<p></p>\n \n                      地点：新清华学堂<br/>\n</p>\n<p class=\"text2\">演出：孟京辉戏剧工作室</p>\n<p class=\"text2\">票价：20/40/60/100/150/200/280元 （ 优惠套票：200*2=360 200*3=500 280*2=500 280*3=700 ） <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height: 22px; font-family: tahoma; color: rgb(0,0,0); font-size: 15px\">售票时间：2月23日12:00起</span><br style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; font-family: tahoma; color: rgb(0,0,0); font-size: 15px; padding-top: 0px\"/>\n<span style=\"line-height: 22px; font-family: tahoma; color: rgb(0,0,0); font-size: 15px\">售票电话：62781984,13699152575</span><br style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; font-family: tahoma; color: rgb(0,0,0); font-size: 15px; padding-top: 0px\"/>\n<span style=\"line-height: 22px; font-family: tahoma; color: rgb(0,0,0); font-size: 15px\">售票地点：新清华学堂票厅</span><br style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; font-family: tahoma; color: rgb(0,0,0); font-size: 15px; padding-top: 0px\"/>\n<span style=\"line-height: 22px; font-family: tahoma; color: rgb(0,0,0); font-size: 15px\">温馨提示：1米2以下儿童谢绝入场</span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height: 220%\"><span style=\"font-size: 14px\">导 演：孟京辉</span></span></p>\n<p>\n<span style=\"line-height: 220%\"><span style=\"font-size: 14px\">主 演：刘晓晔、韩鹏翼、吴洲凯、王印</span></span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height: 220%\"><span style=\"font-size: 14px\"><strong>剧目简介：</strong></span></span></p>\n<p align=\"left\">\n<span style=\"line-height: 220%\"><span style=\"font-size: 14px\">   话剧《两只狗的生活意见》单从创作时间上说，算不上“老”作品，但从其口碑、反响和观众认可度来讲，绝对称得上当代话剧作品的经典之作。该剧2007年首演之际便引起了轰动，创造了“630次笑声，140次掌声，整个剧场笑得人仰马翻”的小剧场奇迹。2011年，“狗兄弟”还漂洋过海前往美国讨生活、追理想，足见其知名度和影响力。经历了一系列生活磨练，来福和旺财登场次数已经超过800次，“两只狗”正斗志昂扬地向千场大关迈近。</span></span></p>\n<p align=\"left\">\r\n	</p>\n<p>\n<span style=\"line-height: 220%\"><span style=\"font-size: 14px\"><strong>剧情简介：</strong></span></span></p>\n<p>\r\n	</p>\n<p align=\"left\">\n<span style=\"line-height: 220%\"><span style=\"font-size: 14px\">    两只狗离开家乡进入城市，他们寻找幸福的生活，寻找伟大的理想，然而城里的世界并不象他们想象得那么美好……四处碰壁之后，他们对生活产生了各种意见，这些意见是他们简单纯洁的头脑无法理解的生存难题。为了能够吃上一口饱饭，来福和旺财在街头卖艺，参加明星选秀进入娱乐界，去当保安，被富人收养又被抛弃，被打狗队打得遍体鳞伤，最后，他们决定勇敢地面对生活，不管生活有多艰辛，一定要勇敢地走下去！</span></span></p>\n<p align=\"left\">\r\n	</p>\n<p align=\"left\">\n<span style=\"line-height: 220%\"><span style=\"font-size: 14px\">导演：孟京辉</span></span></p>\n<p align=\"left\">\n<span style=\"line-height: 220%\"><span style=\"font-size: 14px\">　　孟京辉是当前亚洲剧坛最具影响力的著名实验戏剧导演，现为中国国家话剧院导演。他以独具个性的创造力，多元化的艺术风格，不仅开拓了中国当代戏剧的新局面，而且已经成为一种值得瞩目的文化现象。他执导的《思凡》《一个无政府主义者的意外死亡》《百年孤独》《恋爱的犀牛》《臭虫》《关于爱情归宿的最新观念》《琥珀》《镜花水月》《艳遇》《两只狗的生活意见》《爱比死更冷酷》都引起了强烈的反响，使中国实验戏剧在美学高度上日臻完善，为中国戏剧舞台多元化的新局面注入了活力。由他担任导演的电影《像鸡毛一样飞》获香港国际电影节费比西影评人大奖、洛加诺国际电影节青年评委会特别奖。孟京辉导演在国际戏剧领域有着广泛的知名度，他的戏剧作品曾在多个国际艺术节上演出。2008年创建北京青年戏剧节并任艺术总监。</span></span></p>\n<p align=\"left\">\r\n	</p>\n<p align=\"left\">\n<span style=\"font-size:14px;\">                        （演出时长约90分钟，无中场休息）</span></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(1095,'\"音乐赏听系列“且弹且谈--章红艳弹拨组合音乐会清华大学专场','http://www.hall.tsinghua.edu.cn/upload/20140122033017.jpg','1993-01-01','2014-03-22 19:00:00','蒙民伟音乐厅','演出：章红艳弹拨组合','票价：10/20/40/60/100元 ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：\"音乐赏听系列“且弹且谈--章红艳弹拨组合音乐会清华大学专场\n \n                      \n                    <p class=\"text2\">时间：2014-3-22 19:00:00<p></p>\n \n                      地点：蒙民伟音乐厅<br/>\n</p>\n<p class=\"text2\">演出：章红艳弹拨组合</p>\n<p class=\"text2\">票价：10/20/40/60/100元 <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<em><span style=\"font-size:14px;\">   琵琶被称为“民乐之王”、“弹拨乐器之王”，是我国重要的民族乐器。《琵琶行》所描绘的“大弦嘈嘈如急雨，小弦切切如私语，嘈嘈切切错杂弹，大珠小珠落玉盘” 已不再是诗人的艺术夸张，而是当代琵琶名副其实的演奏效果。且听章老师为您现场讲解琵琶艺术的精髓。</span></em></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>章红艳弹拨组合简介</strong></span></span></p>\n<div>\n<p align=\"left\">\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">   “章红艳弹拨组合”成立于2008年，由著名琵琶演奏家、教育家，中央音乐学院教授章红艳创建，并担任音乐总监及主奏。组合成员选自中央音乐学院弹拨乐团，由本科生、研究生及青年教师组成。创立迄今，章红艳教授秉承“艺术至上，演奏纯粹的音乐，不用任何音乐以外的手段取悦听众”的音乐理念，带领弹拨乐团以“且弹且谈”的方式，在国家大剧院及全国各大音乐剧场、大学校园以及香港、澳门、日本、美国等地举行讲座式音乐会，传播音乐及音乐厅文化，培养了大批喜爱民族音乐的观众和音乐爱好者。获得了音乐界和社会公众的高度赞誉。</span></span></p>\n</div>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\"><strong>章红艳</strong></span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">  中国当代杰出琵琶演奏家、教育家，中央音乐学院教授、硕士生导师、民乐系副主任，曾任美国哥伦比亚大学访问学者。</span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">  章红艳毕业于中央音乐学院，获硕士学位，先后师从章时钧、孙维熙、林石城教授。是中国及世界乐坛最活跃和重要的演奏家与教育家之一。她首演了多部作曲家的作品，并多次出演于纽约卡内基音乐厅、纽约林肯中心、柏林爱乐大厅、维也纳金色大厅、华盛顿肯尼迪艺术中心等世界顶级音乐厅。先后应邀于国内、外著名大学讲演。主要著作及出版物包括论文、散文、教材、专辑等。鉴于她为中国传统音乐所做出的杰出贡献，美国国会图书馆和美国国家民俗中心永久收藏她的唱片专辑《十面埋伏》，让全世界共同分享。</span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height:220%;\"><span style=\"font-size:14px;\">  章红艳的成功不仅表现于所教授的学生人数多寡，还体现在多次获得国内外重大音乐比赛奖项，还表现于对社会音乐教育的关注。2003年，章红艳发起创立中央音乐学院弹拨乐团，任音乐总监，主力强化学生的演出实践和乐队意识，开拓弹拨音乐的作品样式及积累弹拨音乐的曲库，探索中国弹拨乐器的组合与表现可能，以及在普及、传播弹拨音乐诸方面均做出具有开创性的贡献。章红艳秉承艺术至上的理念，推行音乐厅文化为目的。尤以“且弹且谈”的方式，在国家大剧院及全国多个城市举行讲座式音乐会，获得音乐界和社会公众的崇高评价。是当代国内外乐坛备受赞誉的演奏家和享有盛名的国际音乐使者。</span></span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"font-size:14px;\">演出曲目：</span></p>\n<p>\r\n	</p>\n<p style=\"margin-left:18.0pt;\">\n<span style=\"font-size:14px;\">1.《<strong>金蛇狂舞》</strong>               唐建平改编    白浩钰移植</span></p>\n<p>\n<span style=\"font-size:14px;\">演奏：隋琼莹 李跞 卢雨薇 陶亮亮 崔颖 李彤 王谌思 叶烨</span></p>\n<p style=\"margin-left:18.0pt;\">\n<span style=\"font-size:14px;\">2.《<strong>大浪淘沙》</strong>                   华彦钧曲</span></p>\n<p>\n<span style=\"font-size:14px;\">演奏：章红艳</span></p>\n<p style=\"margin-left:18.0pt;\">\n<span style=\"font-size:14px;\">3.《<strong>江南春》</strong>         韦红雨  姜水林  根据王惠然的《江南三月》 改编</span></p>\n<p>\n<span style=\"font-size:14px;\">演奏：隋琼莹 李跞</span></p>\n<p style=\"margin-left:18.0pt;\">\n<span style=\"font-size:14px;\">4.《<strong>春江花月夜》</strong> 古曲 顾冠仁改编</span></p>\n<p>\n<span style=\"font-size:14px;\">演奏：章红艳 卢雨薇 崔颖 陶亮亮 王谌思</span></p>\n<p style=\"margin-left:18.0pt;\">\n<span style=\"font-size:14px;\"><strong>5.</strong><strong>中外弹拨乐作品三首 </strong></span></p>\n<p style=\"margin-left:18.0pt;\">\n<span style=\"font-size:14px;\">《走西口》               山西民歌 鲍元恺改编</span></p>\n<p style=\"margin-left:18.0pt;\">\n<span style=\"font-size:14px;\">《莫斯科郊外的晚上》    索洛维约夫·谢多伊曲 王丹红编配</span></p>\n<p style=\"margin-left:18.0pt;\">\n<span style=\"font-size:14px;\">《土耳其进行曲》            莫扎特曲 顾冠仁改编</span></p>\n<p>\n<span style=\"font-size:14px;\">小琵琶：隋琼莹 陶亮亮 中阮：李彤 王谌思 刘骅毅</span></p>\n<p>\n<span style=\"font-size:14px;\">琵 琶：崔颖 卢雨薇 大阮：李跞 叶烨</span></p>\n<p style=\"margin-left:18.0pt;\">\n<span style=\"font-size:14px;\">6.《<strong>十面埋伏》</strong>         古曲  章红艳改编</span></p>\n<p>\n<span style=\"font-size:14px;\">演奏：章红艳</span></p>\n<p>\n<span style=\"font-size:14px;\">协奏：隋琼莹 李跞 陶亮亮 崔颖 卢雨薇 李彤 王谌思 刘骅毅 叶烨</span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\r\n	                             （演出时长约90分钟，无中场休息）</p>\n<p>\r\n	</p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(1176,'电影《冰雪奇缘》','http://www.hall.tsinghua.edu.cn/upload/20140224100729.jpg','1993-01-01','2014-03-01 18:00:00','大礼堂','演出：21世纪校园数字电影院线','票价：25元（校内师生凭二代IC卡） 45元（校外观众） ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：电影《冰雪奇缘》\n \n                      \n                    <p class=\"text2\">时间：2014-3-1 18:00:00<p></p>\n \n                      地点：大礼堂<br/>\n</p>\n<p class=\"text2\">演出：21世纪校园数字电影院线</p>\n<p class=\"text2\">票价：25元（校内师生凭二代IC卡） 45元（校外观众） <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\n<span style=\"line-height: 150%\">开票时间：2014年2月26日 12:00 </span></p>\n<p>\n<span style=\"line-height: 150%\"><span style=\"line-height: 150%\">售票地点：新清华学堂票厅</span></span></p>\n<p>\n<span style=\"line-height: 150%\"><span style=\"line-height: 150%\">售票电话：62781984 </span><span style=\"line-height: 150%\">13699152575</span></span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height: 150%\"> 影片故事基于安徒生童话中的《白雪皇后》改编而成。在四面环海、风景如画的阿伦戴尔王国，生活着两位可爱美丽的小公主，艾莎和安娜。艾莎天生具有制造冰雪的神奇能力，随着年龄的增长，她的能力越来越强，甚至险些夺走妹妹的生命。为此国王紧闭宫门，也中断了两姐妹的联系。阿伦戴尔的国王和王后在一次海难中丧生。悲哀的海难过后，艾莎终于到了加冕的年龄，各国王公齐来祝贺。艾莎战战兢兢，唯恐被人识破隐藏了多年的秘密。然而当听说安娜将要和初次见面的南方小岛王子汉斯结婚时，依然情绪失控露出了马脚。在此之后她逃到山中，构建了属于自己的冰雪宫殿，而阿伦戴尔也陷入可怕的寒冷之中。<br/>\r\n	 安娜为了拯救姐姐和阿伦戴尔王国，独自来到山中，在山民克里斯托弗的帮助下总算来到姐姐的宫殿，她能否让国家重新找回失落的绿意？</span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(1181,'电影《冰雪奇缘》3D','http://www.hall.tsinghua.edu.cn/upload/20140224100729.jpg','1993-01-01','2014-03-01 18:00:00','大礼堂','演出：21世纪校园数字电影院线','票价：25元（校内师生凭二代IC卡） 45元（校外观众） ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：电影《冰雪奇缘》3D\n \n                      \n                    <p class=\"text2\">时间：2014-3-1 18:00:00<p></p>\n \n                      地点：大礼堂<br/>\n</p>\n<p class=\"text2\">演出：21世纪校园数字电影院线</p>\n<p class=\"text2\">票价：25元（校内师生凭二代IC卡） 45元（校外观众） <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\n<span style=\"line-height: 150%\">开票时间：2014年2月26日 12:00 </span></p>\n<p>\n<span style=\"line-height: 150%\"><span style=\"line-height: 150%\">售票地点：新清华学堂票厅</span></span></p>\n<p>\n<span style=\"line-height: 150%\"><span style=\"line-height: 150%\">售票电话：62781984 </span><span style=\"line-height: 150%\">13699152575</span></span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"line-height: 150%\"> 影片故事基于安徒生童话中的《白雪皇后》改编而成。在四面环海、风景如画的阿伦戴尔王国，生活着两位可爱美丽的小公主，艾莎和安娜。艾莎天生具有制造冰雪的神奇能力，随着年龄的增长，她的能力越来越强，甚至险些夺走妹妹的生命。为此国王紧闭宫门，也中断了两姐妹的联系。阿伦戴尔的国王和王后在一次海难中丧生。悲哀的海难过后，艾莎终于到了加冕的年龄，各国王公齐来祝贺。艾莎战战兢兢，唯恐被人识破隐藏了多年的秘密。然而当听说安娜将要和初次见面的南方小岛王子汉斯结婚时，依然情绪失控露出了马脚。在此之后她逃到山中，构建了属于自己的冰雪宫殿，而阿伦戴尔也陷入可怕的寒冷之中。<br/>\r\n	 安娜为了拯救姐姐和阿伦戴尔王国，独自来到山中，在山民克里斯托弗的帮助下总算来到姐姐的宫殿，她能否让国家重新找回失落的绿意？</span></p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(1198,'俄罗斯国家明星芭蕾舞剧院《天鹅湖》','http://www.hall.tsinghua.edu.cn/upload/20140225024544.jpg','1993-01-01','2014-04-16 19:30:00','新清华学堂','演出：俄罗斯国家明星芭蕾舞剧院','票价：40/60/100/150/200/280元/VIP 优惠套票：280*2=500元，280*3=700元 ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：俄罗斯国家明星芭蕾舞剧院《天鹅湖》\n \n                      \n                    <p class=\"text2\">时间：2014-4-16 19:30:00<p></p>\n \n                      地点：新清华学堂<br/>\n</p>\n<p class=\"text2\">演出：俄罗斯国家明星芭蕾舞剧院</p>\n<p class=\"text2\">票价：40/60/100/150/200/280元/VIP 优惠套票：280*2=500元，280*3=700元 <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：北京纵贯线文化有限公司</span>\n<p class=\"text2\"><br>\n<p style=\"text-align: center\">\r\n	俄罗斯国家明星芭蕾舞剧院</p>\n<p align=\"left\">\r\n	 俄罗斯国家明星芭蕾舞剧院的成立，想法来自于20世纪80年代伟大的独舞演员——瓦列里·科克勒夫。在很多俄罗斯国家级的芭蕾舞剧院里，有很多不为外国人所熟悉的舞蹈明星。最终，明星芭蕾舞剧院发现了闪耀在莫斯科和圣彼得堡剧院里的世界级舞蹈明星。另一方面，随着苏联的解体，很多原苏联的舞蹈明星发现他们已经成为了“外国”明星，而同时又还是“俄罗斯明星”。俄罗斯国家明星芭蕾舞剧院的成立，汇聚了来自世界各地的俄罗斯舞蹈明星，他们与俄罗斯著名的编舞家和艺术家们在一起创作真正的俄罗斯芭蕾舞作品，并且对世界闻名的俄罗斯芭蕾进行改革创新。</p>\n<p align=\"left\">\r\n	俄罗斯国家明星芭蕾舞剧院真正的历史始于20世纪末，由当时的西伯利亚国立芭蕾舞团发展而来，之后该团一直与很多俄罗斯省会城市合作。因此现如今，俄罗斯国家明星芭蕾舞剧院跟很多剧院有着紧密的关系，包括：西伯利亚芭蕾舞剧院（艺术总监谢尔盖·波波洛夫）、诺夫哥罗德歌剧芭蕾舞剧院、萨马拉歌剧芭蕾舞剧院、以“萨茨”命名的莫斯科音乐剧院、车里雅宾斯克歌剧芭蕾舞剧院、切博克萨雷歌剧芭蕾舞剧院等等。俄罗斯国家明星芭蕾舞剧院跟莫斯科剧院博物馆也有着特殊的合作关系，不但为博物馆提供艺术作品，还经常在博物馆举办专题展览。舞剧院还长期跟俄罗斯著名设计家如德米特里·切赫巴德奇以及著名作曲家如乔治·乔兰尼亚等人合作。</p>\n<p align=\"left\">\r\n	2011年5月6日剧院完成改革。如今，除了与很多俄罗斯国家级剧院的合作作品外，明星芭蕾舞剧院独立拥有三部全本芭蕾舞剧作品：《天鹅湖》、《睡美人》和《胡桃夹子》。另外，剧院还在计划将由里姆斯基·科萨科夫和乔兰尼亚作曲的《辛巴达》、以及柴可夫斯基的《雪姑娘》改编搬上舞台。</p>\n<p align=\"left\">\r\n	俄罗斯国家明星芭蕾舞剧院拥有来自莫斯科和圣彼得堡，以及前俄罗斯共和国的芭蕾舞学院的芭蕾明星，这些明星拥有长期与世界级导演合作的经历，他们都是年轻并且前途无量的芭蕾舞蹈演员，很多人都获得过国际及俄罗斯国内芭蕾舞大赛的冠军，表演和编舞水平都高超过人。明星芭蕾舞剧院仍然一直不断在寻找更多的世界各地以及俄罗斯国内的芭蕾舞明星们，很多芭蕾舞演员非常愿意加入剧院。因此，剧院正计划为每部剧目设置两套阵容，包括两套布景和服装。</p>\n<p align=\"left\">\r\n	如今，俄罗斯国家明星芭蕾舞剧院正在迅速地成长。</p>\n<p>\r\n	</p>\n<p style=\"text-align: center\">\r\n	俄罗斯国家明星芭蕾舞团《天鹅湖》</p>\n<p style=\"text-align: center\">\r\n	——2014中国巡演主演简介</p>\n<p>\r\n	</p>\n<p>\n</p>\n<p>\r\n	瓦西里·科佐罗夫——王子</p>\n<p>\n<em>俄罗斯国家明星芭蕾舞团领舞演员</em></p>\n<p>\r\n	</p>\n<p>\n<em>俄罗斯联邦功勋艺术家，“诺夫哥罗德市明珠”奖获得者</em></p>\n<p>\r\n	</p>\n<p>\r\n	 2001年毕业于诺夫哥罗德芭蕾舞剧院附属学校，师从俄罗斯著名艺术家库拉金娜。2000年起，瓦西里便开始在诺夫哥罗德国家模范歌剧芭蕾舞剧院工作，担任独舞演员。在他职业生涯第一个演出季便获得了第一个领舞角色——著名古典作品《仙女》。他担任领舞的大剧目包括：柴可夫斯基的《天鹅湖》和《睡美人》中的王子，以及《梅菲斯特》、《罗密欧与朱丽叶》、《吉赛尔》、《一千零一夜》、《艾斯米拉达》、《胡桃夹子》、《唐吉可德》等等作品中的男主角。</p>\n<p>\r\n	瓦西里曾随诺夫哥罗德国家模范歌剧芭蕾舞剧院到意大利、中国、美国、西班牙等国家出访巡演。作为客座明星，还跟随俄罗斯国家芭蕾舞团、新古典芭蕾舞团及其他一些舞蹈团在俄罗斯国内以及世界各国访问演出。</p>\n<p>\r\n	2010年起，他成为俄罗斯国家明星芭蕾舞团的领舞演员。</p>\n<p>\r\n	</p>\n<p>\n</p>\n<p>\r\n	伊琳娜·艾迪洛娃——白天鹅</p>\n<p>\n<em>俄罗斯国家明星芭蕾舞团首席女演员</em></p>\n<p>\r\n	</p>\n<p>\r\n	 伊琳娜出生于乌拉尔彼尔姆地区的别列兹尼基市。6岁起开始学习跳舞，她曾经通过了俄罗斯最著名的芭蕾舞蹈学校之一的考试，但是父母不希望她离家太远去求学。2002年，通过表演《吉赛尔》和《唐吉可德》中的两段独舞片段，展现其高超的舞台表演技巧，伊琳娜获得了全俄罗斯古典芭蕾舞大赛的一等奖。通过比赛，著名俄罗斯芭蕾舞蹈教授卢德米拉·萨克洛娃选中了伊莲娜，从此她进入了彼尔姆芭蕾舞蹈学校，直接从第5级开始学起。之后，她继续师从涅丽·丹尼洛维奇-席尔瓦诺维奇女士，于2006年从彼尔姆芭蕾舞蹈学校毕业。同年，她进入由戈蒂夫·维亚切斯拉夫先生领导的俄罗斯芭蕾舞团。</p>\n<p>\r\n	她的第一个职业舞蹈角色是芭蕾舞剧《洋葱头和他的朋友们》中的雷迪斯索卡，该角色要求非常高的技巧。而后她在很多芭蕾舞剧中出演，包括《天鹅湖》、《睡美人》、《胡桃夹子》、《吉赛尔》等。三年中她随团到过很多国家巡演，例如德国、墨西哥、乌克兰以及中国。之后，她被世界最著名的俄罗斯马林斯基剧院招入麾下，在那里她出演的作品除了古典剧目，又增加了由著名编舞家谢尔盖·拉特曼斯基创作的新编版《舞姬》、《火鸟》、《安娜·卡列尼娜》等现代剧目。</p>\n<p>\r\n	自2012年起，伊琳娜成为圣彼得堡芭蕾舞学院以及俄罗斯国家明星芭蕾舞团的首席女演员，并领衔主演了很多古典芭蕾剧目，例如《天鹅湖》、《睡美人》、《吉赛尔》等等。</p>\n<p>\r\n	</p>\n<p>\n</p>\n<p>\r\n	埃琳娜·科特苏比拉——黑天鹅</p>\n<p>\n<em>圣彼得堡米凯伊洛夫斯基剧院独舞演员</em></p>\n<p>\n<em>俄罗斯莫斯科国家芭蕾舞团、莱奥尼达·雅克布索娜剧院、俄罗斯国家芭蕾舞团、莫斯科芭蕾舞团的客座独舞演员</em></p>\n<p>\r\n	</p>\n<p>\r\n	 埃琳娜于1992年进入彼尔姆国家舞蹈学校学习，师从L.萨哈洛娃，并于2000年毕业。2000年她加入圣彼得堡以米凯伊洛夫斯基命名的国家歌剧芭蕾舞剧院。其参演过的剧目和角色包括：《吉赛尔》中的吉赛尔，《天鹅湖》中的白天鹅、黑天鹅公主，《艾斯米拉达》中的艾斯米拉达，《胡桃夹子》中的玛莎，《罗密欧与朱丽叶》中的朱丽叶，《睡美人》中的公主，以及《仙女》和《舞姬》中的女主角。</p>\n<p>\r\n	埃琳娜曾多次参加芭蕾舞蹈大赛，并获得2006彼尔姆国际芭蕾舞大赛的第二名的成绩，以及大赛的“银蔓藤奖”。</p>\n<p>\r\n	</p>\n<p>\n</p>\n<p>\r\n	阿里法诺夫·阿尔乔姆——魔王</p>\n<p>\r\n	俄罗斯国家明星芭蕾舞剧院首席独舞演员</p>\n<p>\r\n	</p>\n<p>\r\n	 阿里法诺夫·阿尔乔姆出生于1984年的乌克兰，于1996年进入第聂伯罗彼得罗夫斯克城市芭蕾舞学校学习。作为极富天赋的学生，阿里法诺夫被莫斯科国家模范舞蹈学院接收并师从著名的尤科萨斯尼科夫教授，并于2004年毕业。他曾参加过多项国际芭蕾舞赛事并获得奖项。</p>\n<p>\r\n	 2004年至2006年，阿里法诺夫担任了室内古典芭蕾舞剧《莫斯科》的原版演员。2007年他回到乌克兰，并在乌克兰国内最重要的芭蕾舞团——顿涅茨克歌剧芭蕾舞剧院担任领舞。自2011年起，他开始担任俄罗斯国家明星芭蕾舞团的特邀嘉宾明星演员。</p>\n<p>\r\n	阿里法诺夫不单是一名优秀的独舞演员，也是每一位芭蕾舞演员梦想与之合作的好搭档。他的舞蹈专业性与独特的舞蹈技巧能力使其在一系列重要作品中担任领舞角色，这些作品中的代表作包括：</p>\n<p>\r\n	《天鹅湖》——王子，魔王</p>\n<p>\r\n	《斯巴达克斯》——斯巴达克斯</p>\n<p>\r\n	《舞姬》——索罗</p>\n<p>\r\n	《堂吉诃德》——埃斯帕达</p>\n<p>\r\n	《睡美人》——王子，蓝鸟</p>\n<p>\r\n	《巴黎圣母院》——卡西莫多</p>\n<p>\r\n	《吉赛尔》——阿尔伯特</p>\n<p>\r\n	《雷蒙达》——布林纳</p>\n<p>\r\n	《一千零一夜》——国王山努亚</p>\n<p>\r\n	《罗密欧与朱丽叶》——罗密欧</p>\n<p>\r\n	阿里法诺夫曾经跟随芭蕾舞剧《莫斯科》、顿涅茨克剧院以及其他芭蕾舞团走访过世界很多国家，作为俄罗斯国家明星芭蕾舞剧院的特邀独舞演员，也参与很多世界巡回演出。</p>\n<p>\r\n	</p>\n<p>\n<span style=\"display: none\"><span id=\"cke_bm_72E\" style=\"display: none\"></span></span></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(1199,'俄罗斯国家明星芭蕾舞团《天鹅湖》','http://www.hall.tsinghua.edu.cn/upload/20140225024237.jpg','1993-01-01','2014-04-15 19:30:00','新清华学堂','演出：俄罗斯国家明星芭蕾舞剧院','票价：40/60/100/150/200/280元/VIP 优惠套票：280*2=500元，280*3=700元 ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：俄罗斯国家明星芭蕾舞团《天鹅湖》\n \n                      \n                    <p class=\"text2\">时间：2014-4-15 19:30:00<p></p>\n \n                      地点：新清华学堂<br/>\n</p>\n<p class=\"text2\">演出：俄罗斯国家明星芭蕾舞剧院</p>\n<p class=\"text2\">票价：40/60/100/150/200/280元/VIP 优惠套票：280*2=500元，280*3=700元 <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：北京纵贯线文化有限公司</span>\n<p class=\"text2\"><br>\n<p align=\"center\">\r\n	</p>\n<p style=\"text-align: center\">\r\n	俄罗斯国家明星芭蕾舞剧院</p>\n<p align=\"left\">\r\n	 俄罗斯国家明星芭蕾舞剧院的成立，想法来自于20世纪80年代伟大的独舞演员——瓦列里·科克勒夫。在很多俄罗斯国家级的芭蕾舞剧院里，有很多不为外国人所熟悉的舞蹈明星。最终，明星芭蕾舞剧院发现了闪耀在莫斯科和圣彼得堡剧院里的世界级舞蹈明星。另一方面，随着苏联的解体，很多原苏联的舞蹈明星发现他们已经成为了“外国”明星，而同时又还是“俄罗斯明星”。俄罗斯国家明星芭蕾舞剧院的成立，汇聚了来自世界各地的俄罗斯舞蹈明星，他们与俄罗斯著名的编舞家和艺术家们在一起创作真正的俄罗斯芭蕾舞作品，并且对世界闻名的俄罗斯芭蕾进行改革创新。</p>\n<p align=\"left\">\r\n	俄罗斯国家明星芭蕾舞剧院真正的历史始于20世纪末，由当时的西伯利亚国立芭蕾舞团发展而来，之后该团一直与很多俄罗斯省会城市合作。因此现如今，俄罗斯国家明星芭蕾舞剧院跟很多剧院有着紧密的关系，包括：西伯利亚芭蕾舞剧院（艺术总监谢尔盖·波波洛夫）、诺夫哥罗德歌剧芭蕾舞剧院、萨马拉歌剧芭蕾舞剧院、以“萨茨”命名的莫斯科音乐剧院、车里雅宾斯克歌剧芭蕾舞剧院、切博克萨雷歌剧芭蕾舞剧院等等。俄罗斯国家明星芭蕾舞剧院跟莫斯科剧院博物馆也有着特殊的合作关系，不但为博物馆提供艺术作品，还经常在博物馆举办专题展览。舞剧院还长期跟俄罗斯著名设计家如德米特里·切赫巴德奇以及著名作曲家如乔治·乔兰尼亚等人合作。</p>\n<p align=\"left\">\r\n	2011年5月6日剧院完成改革。如今，除了与很多俄罗斯国家级剧院的合作作品外，明星芭蕾舞剧院独立拥有三部全本芭蕾舞剧作品：《天鹅湖》、《睡美人》和《胡桃夹子》。另外，剧院还在计划将由里姆斯基·科萨科夫和乔兰尼亚作曲的《辛巴达》、以及柴可夫斯基的《雪姑娘》改编搬上舞台。</p>\n<p align=\"left\">\r\n	俄罗斯国家明星芭蕾舞剧院拥有来自莫斯科和圣彼得堡，以及前俄罗斯共和国的芭蕾舞学院的芭蕾明星，这些明星拥有长期与世界级导演合作的经历，他们都是年轻并且前途无量的芭蕾舞蹈演员，很多人都获得过国际及俄罗斯国内芭蕾舞大赛的冠军，表演和编舞水平都高超过人。明星芭蕾舞剧院仍然一直不断在寻找更多的世界各地以及俄罗斯国内的芭蕾舞明星们，很多芭蕾舞演员非常愿意加入剧院。因此，剧院正计划为每部剧目设置两套阵容，包括两套布景和服装。</p>\n<p align=\"left\">\r\n	如今，俄罗斯国家明星芭蕾舞剧院正在迅速地成长。</p>\n<p>\r\n	</p>\n<p style=\"text-align: center\">\r\n	俄罗斯国家明星芭蕾舞团《天鹅湖》</p>\n<p style=\"text-align: center\">\r\n	——2014中国巡演主演简介</p>\n<p>\r\n	</p>\n<p>\n</p>\n<p>\r\n	</p>\n<p>\r\n	瓦西里·科佐罗夫——王子</p>\n<p>\n<em>俄罗斯国家明星芭蕾舞团领舞演员</em></p>\n<p>\r\n	</p>\n<p>\n<em>俄罗斯联邦功勋艺术家，“诺夫哥罗德市明珠”奖获得者</em></p>\n<p>\r\n	</p>\n<p>\r\n	 2001年毕业于诺夫哥罗德芭蕾舞剧院附属学校，师从俄罗斯著名艺术家库拉金娜。2000年起，瓦西里便开始在诺夫哥罗德国家模范歌剧芭蕾舞剧院工作，担任独舞演员。在他职业生涯第一个演出季便获得了第一个领舞角色——著名古典作品《仙女》。他担任领舞的大剧目包括：柴可夫斯基的《天鹅湖》和《睡美人》中的王子，以及《梅菲斯特》、《罗密欧与朱丽叶》、《吉赛尔》、《一千零一夜》、《艾斯米拉达》、《胡桃夹子》、《唐吉可德》等等作品中的男主角。</p>\n<p>\r\n	瓦西里曾随诺夫哥罗德国家模范歌剧芭蕾舞剧院到意大利、中国、美国、西班牙等国家出访巡演。作为客座明星，还跟随俄罗斯国家芭蕾舞团、新古典芭蕾舞团及其他一些舞蹈团在俄罗斯国内以及世界各国访问演出。</p>\n<p>\r\n	2010年起，他成为俄罗斯国家明星芭蕾舞团的领舞演员。</p>\n<p>\r\n	</p>\n<p>\n</p>\n<p>\r\n	伊琳娜·艾迪洛娃——白天鹅</p>\n<p>\n<em>俄罗斯国家明星芭蕾舞团首席女演员</em></p>\n<p>\r\n	</p>\n<p>\r\n	 伊琳娜出生于乌拉尔彼尔姆地区的别列兹尼基市。6岁起开始学习跳舞，她曾经通过了俄罗斯最著名的芭蕾舞蹈学校之一的考试，但是父母不希望她离家太远去求学。2002年，通过表演《吉赛尔》和《唐吉可德》中的两段独舞片段，展现其高超的舞台表演技巧，伊琳娜获得了全俄罗斯古典芭蕾舞大赛的一等奖。通过比赛，著名俄罗斯芭蕾舞蹈教授卢德米拉·萨克洛娃选中了伊莲娜，从此她进入了彼尔姆芭蕾舞蹈学校，直接从第5级开始学起。之后，她继续师从涅丽·丹尼洛维奇-席尔瓦诺维奇女士，于2006年从彼尔姆芭蕾舞蹈学校毕业。同年，她进入由戈蒂夫·维亚切斯拉夫先生领导的俄罗斯芭蕾舞团。</p>\n<p>\r\n	她的第一个职业舞蹈角色是芭蕾舞剧《洋葱头和他的朋友们》中的雷迪斯索卡，该角色要求非常高的技巧。而后她在很多芭蕾舞剧中出演，包括《天鹅湖》、《睡美人》、《胡桃夹子》、《吉赛尔》等。三年中她随团到过很多国家巡演，例如德国、墨西哥、乌克兰以及中国。之后，她被世界最著名的俄罗斯马林斯基剧院招入麾下，在那里她出演的作品除了古典剧目，又增加了由著名编舞家谢尔盖·拉特曼斯基创作的新编版《舞姬》、《火鸟》、《安娜·卡列尼娜》等现代剧目。</p>\n<p>\r\n	自2012年起，伊琳娜成为圣彼得堡芭蕾舞学院以及俄罗斯国家明星芭蕾舞团的首席女演员，并领衔主演了很多古典芭蕾剧目，例如《天鹅湖》、《睡美人》、《吉赛尔》等等。</p>\n<p>\r\n	</p>\n<p>\n</p>\n<p>\r\n	埃琳娜·科特苏比拉——黑天鹅</p>\n<p>\n<em>圣彼得堡米凯伊洛夫斯基剧院独舞演员</em></p>\n<p>\n<em>俄罗斯莫斯科国家芭蕾舞团、莱奥尼达·雅克布索娜剧院、俄罗斯国家芭蕾舞团、莫斯科芭蕾舞团的客座独舞演员</em></p>\n<p>\r\n	</p>\n<p>\r\n	 埃琳娜于1992年进入彼尔姆国家舞蹈学校学习，师从L.萨哈洛娃，并于2000年毕业。2000年她加入圣彼得堡以米凯伊洛夫斯基命名的国家歌剧芭蕾舞剧院。其参演过的剧目和角色包括：《吉赛尔》中的吉赛尔，《天鹅湖》中的白天鹅、黑天鹅公主，《艾斯米拉达》中的艾斯米拉达，《胡桃夹子》中的玛莎，《罗密欧与朱丽叶》中的朱丽叶，《睡美人》中的公主，以及《仙女》和《舞姬》中的女主角。</p>\n<p>\r\n	埃琳娜曾多次参加芭蕾舞蹈大赛，并获得2006彼尔姆国际芭蕾舞大赛的第二名的成绩，以及大赛的“银蔓藤奖”。</p>\n<p>\r\n	</p>\n<p>\n</p>\n<p>\r\n	阿里法诺夫·阿尔乔姆——魔王</p>\n<p>\r\n	俄罗斯国家明星芭蕾舞剧院首席独舞演员</p>\n<p>\r\n	</p>\n<p>\r\n	 阿里法诺夫·阿尔乔姆出生于1984年的乌克兰，于1996年进入第聂伯罗彼得罗夫斯克城市芭蕾舞学校学习。作为极富天赋的学生，阿里法诺夫被莫斯科国家模范舞蹈学院接收并师从著名的尤科萨斯尼科夫教授，并于2004年毕业。他曾参加过多项国际芭蕾舞赛事并获得奖项。</p>\n<p>\r\n	 2004年至2006年，阿里法诺夫担任了室内古典芭蕾舞剧《莫斯科》的原版演员。2007年他回到乌克兰，并在乌克兰国内最重要的芭蕾舞团——顿涅茨克歌剧芭蕾舞剧院担任领舞。自2011年起，他开始担任俄罗斯国家明星芭蕾舞团的特邀嘉宾明星演员。</p>\n<p>\r\n	阿里法诺夫不单是一名优秀的独舞演员，也是每一位芭蕾舞演员梦想与之合作的好搭档。他的舞蹈专业性与独特的舞蹈技巧能力使其在一系列重要作品中担任领舞角色，这些作品中的代表作包括：</p>\n<p>\r\n	《天鹅湖》——王子，魔王</p>\n<p>\r\n	《斯巴达克斯》——斯巴达克斯</p>\n<p>\r\n	《舞姬》——索罗</p>\n<p>\r\n	《堂吉诃德》——埃斯帕达</p>\n<p>\r\n	《睡美人》——王子，蓝鸟</p>\n<p>\r\n	《巴黎圣母院》——卡西莫多</p>\n<p>\r\n	《吉赛尔》——阿尔伯特</p>\n<p>\r\n	《雷蒙达》——布林纳</p>\n<p>\r\n	《一千零一夜》——国王山努亚</p>\n<p>\r\n	《罗密欧与朱丽叶》——罗密欧</p>\n<p>\r\n	阿里法诺夫曾经跟随芭蕾舞剧《莫斯科》、顿涅茨克剧院以及其他芭蕾舞团走访过世界很多国家，作为俄罗斯国家明星芭蕾舞剧院的特邀独舞演员，也参与很多世界巡回演出</p>\n<p>\r\n	</p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(1208,'“艺术名家讲堂”《“情未了”――中外艺术歌曲鉴赏》','http://www.hall.tsinghua.edu.cn/upload/20140226022058.jpg','1993-01-01','2014-02-27 19:20:00','清华大学大礼堂','演出：程志、胡宝善、夏燕生、王立民等','票价：请携带学生IC卡刷卡入场 ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：“艺术名家讲堂”《“情未了”――中外艺术歌曲鉴赏》\n \n                      \n                    <p class=\"text2\">时间：2014-2-27 19:20:00<p></p>\n \n                      地点：清华大学大礼堂<br/>\n</p>\n<p class=\"text2\">演出：程志、胡宝善、夏燕生、王立民等</p>\n<p class=\"text2\">票价：请携带学生IC卡刷卡入场 <br/>\n<p class=\"text2\">售票状态：结束</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p class=\"p0\" style=\"margin-bottom: 0pt; text-align: left; margin-top: 0pt\">\r\n	</p>\n<p class=\"p0\" style=\"margin-bottom: 0pt; text-align: left; margin-top: 0pt\">\r\n	</p>\n<p class=\"p0\" style=\"margin-bottom: 0pt; text-align: left; margin-top: 0pt\">\n<span style=\"font-size: 12px\"><span style=\'font-family: \"宋体\"; background: rgb(255,255,255); color: rgb(0,0,0); mso-spacerun: \"yes\"; mso-shading: rgb(255, 255, 255)\'>王立民</span></span></p>\n<p class=\"p0\" style=\"margin-bottom: 0pt; text-align: left; margin-top: 0pt\">\n<span style=\"font-size: 12px\"></span></p>\n<p class=\"p0\" style=\"margin-bottom: 0pt; text-align: left; margin-top: 0pt\">\n<span style=\"font-size: 12px\"><span style=\'font-family: \"宋体\"; background: rgb(255,255,255); color: rgb(0,0,0); mso-spacerun: \"yes\"; mso-shading: rgb(255, 255, 255)\'> 男中音歌唱家，中央歌剧院国家一级演员，中国音乐家协会会员，中国戏剧家协会会员，享受国务院政府特殊津贴专家。毕业于中央音乐学院，师从王秉锐教授、温可铮教授、音乐指导赵碧璇教授。王立民曾在《茶花女》、《蝴蝶夫人》、《驯悍记》、《弄臣》、《马可波罗》、《布兰诗歌》等多部歌剧中担任主要角色。曾任中央歌剧院歌剧团副团长。</span><br/>\n<span style=\'font-family: \"宋体\"; background: rgb(255,255,255); color: rgb(0,0,0); mso-spacerun: \"yes\"; mso-shading: rgb(255, 255, 255)\'> 王立民近年来曾多次赴东南亚、澳门、香港等地区参加国际音乐节及演出活动，演出了歌剧《假面舞会》、《飘泊的荷兰人》、《阿依达》、《安魂曲》等，在《蝴蝶夫人》中饰演领事，多次参加国家级的大型文艺演出。</span><br/>\r\n	</span></p>\n<p class=\"p0\" style=\"margin-bottom: 0pt; text-align: left; margin-top: 0pt\">\n<span style=\"font-size: 12px\"></span></p>\n<p class=\"p0\" style=\"margin-bottom: 0pt; text-align: left; margin-top: 0pt\">\n<br/>\n<span style=\"font-size: 12px\"><span style=\'font-family: \"宋体\"; background: rgb(255,255,255); color: rgb(0,0,0); mso-spacerun: \"yes\"; mso-shading: rgb(255, 255, 255)\'>课程内容概要：</span></span></p>\n<p class=\"p0\" style=\"margin-bottom: 0pt; text-align: left; margin-top: 0pt\">\n<br/>\n<span style=\"font-size: 12px\"><span style=\'font-family: \"宋体\"; background: rgb(255,255,255); color: rgb(0,0,0); mso-spacerun: \"yes\"; mso-shading: rgb(255, 255, 255)\'> 艺术歌曲，在歌曲音乐种类中最具艺术表现性。它最初源于十八世纪末十九世纪初的欧洲，基本上是在抒情歌曲的基础上产生、发展起来的。一首优秀的艺术歌曲作品，应该是高境界的文学诗词与完全按照诗词内容恰当运用音乐创作技法配于曲调的、一种诗词与音乐的完美结合。艺术歌曲以其高品位、高情趣、优雅、含蓄成为艺术领域中的一朵芬芳美丽的鲜花。</span><br/>\n<span style=\'font-family: \"宋体\"; background: rgb(255,255,255); color: rgb(0,0,0); mso-spacerun: \"yes\"; mso-shading: rgb(255, 255, 255)\'> 此次艺术名家讲堂邀请的著名歌唱家有：男高音歌唱家程志、男中音歌唱家胡宝善、男低音歌唱家夏燕生等；演出作品有：《松花江上》、《阿拉木汗》、《可爱的一朵玫瑰花》、《满江红》、《在那遥远的地方》、《草原上升起不落的太阳》，以及六首歌剧选段（如：歌剧《茶花女》之《普罗旺斯的海洋》、歌剧《弄臣》之《女人善变》等）。希望这些生动隽永的音乐作品及艺术家们的精致演绎，能带给同学们艺术之享受、精神之升华。</span><br/>\n<span style=\'font-family: \"宋体\"; background: rgb(255,255,255); color: rgb(0,0,0); mso-spacerun: \"yes\"; mso-shading: rgb(255, 255, 255)\'> 本次讲座主要是互动式的现场音乐会赏析，希望听课同学积极参与。</span><br/>\r\n	</span></p>\n<p class=\"p0\" style=\"margin-bottom: 0pt; text-align: left; margin-top: 0pt\">\n<span style=\"font-size: 12px\"></span></p>\n<p class=\"p0\" style=\"margin-bottom: 0pt; text-align: left; margin-top: 0pt\">\n<br/>\n<span style=\"font-size: 12px\"><span style=\'font-family: \"宋体\"; background: rgb(255,255,255); color: rgb(0,0,0); mso-spacerun: \"yes\"; mso-shading: rgb(255, 255, 255)\'>特别提示：从2013年3月7日起，由清华大学艺术教育中心开设的“艺术名家讲堂”（《艺术欣赏导论》课程系列讲座入《文化素质教育讲座》课程，没有选修《艺术欣赏导论》的本科生可以按《文化素质教育讲座》课程选听讲座，请携带学生IC卡刷卡入场。除选修《艺术欣赏导论》的同学外，“艺术名家讲堂”有350个座位对全校本科生开放。</span></span><span style=\'font-size: 10pt; font-family: \"times\"; mso-spacerun: \"yes\"\'><o:p></o:p></span></p>\n<p>\n<!--EndFragment--></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(1216,'英国TNT剧院《罗密欧与朱丽叶》 ','http://www.hall.tsinghua.edu.cn/upload/20140228110318.jpg','1993-01-01','2014-04-20 19:00:00','蒙民伟音乐厅','演出：英国TNT剧院','票价：40/60/80/150/200/280元  ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：英国TNT剧院《罗密欧与朱丽叶》 \n \n                      \n                    <p class=\"text2\">时间：2014-4-20 19:00:00<p></p>\n \n                      地点：蒙民伟音乐厅<br/>\n</p>\n<p class=\"text2\">演出：英国TNT剧院</p>\n<p class=\"text2\">票价：40/60/80/150/200/280元  <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：北京云汉文化交流有限公司 </span>\n<p class=\"text2\"><br>\n<p style=\"text-align: center\">\n<strong>走进“原汁原味”的莎士比亚世界</strong></p>\n<p style=\"text-align: center\">\n<strong>2014</strong><strong>年全球 纪念莎士比亚诞辰450周年</strong></p>\n<p style=\"text-align: center\">\n<strong>四百年盛演不衰的爱情传奇/秉承英国维多利亚时期莎剧传统/带来最纯正的英伦之声</strong><br/>\n<strong>年均演出1000场的英国传奇剧团—TNT剧院2014年度经典巨献/莎士比亚名篇</strong></p>\n<p style=\"text-align: center\">\r\n	</p>\n<p style=\"text-align: center\">\n<strong> 《罗密欧与朱丽叶》</strong><br/>\n<strong> （英语现场演出，中文投影字幕）</strong><br/>\n<br/>\r\n	</p>\n<p align=\"left\">\r\n	悲剧就是把人们美好的梦在现实中打破,正如辛苦制作的花瓶，却在上色的最后一环上有意摔破了……</p>\n<p align=\"left\">\r\n	</p>\n<p align=\"left\">\n<strong>剧情梗概</strong><br/>\r\n	《罗密欧与朱丽叶》是莎士比亚早期的著名悲剧。它描写了两个热恋的男女被拆散后，双双殉情的故事。<br/>\r\n	</p>\n<p align=\"left\">\r\n	故事发生在意大利维洛那城。凯普莱特和蒙太古两大家族有不共载天的世仇。在一次盛大华丽的宴会上，凯普莱特大人美丽多情的女儿朱丽叶与蒙太古大人英俊、潇洒的儿子罗密欧一见钟情，罗密欧无法抑制自己对朱丽叶的爱，向她求爱，两人迅速坠入爱河并私订终身，并在好心的神父劳伦斯的主持下举行了婚礼，朱丽叶望着身边英俊而多情的罗密欧，心中充满了对未来的憧憬。谁知，罗密欧在街上与凯普莱特的侄子提伯尔特相遇，提伯尔特故意挑衅，两人发生了格斗，罗密欧杀死了对方，被逐出维洛那城。</p>\n<p align=\"left\">\r\n	朱丽叶含泪送别了罗密欧，她的心和情已随着罗密欧去了，她丧魂失魄地思念着罗密欧。然而，父亲却逼她忘了这个家族的仇人，嫁给帕里斯伯爵。朱丽叶不敢背叛家族，又不愿意背叛心上人的爱情，她的心被痛苦和矛盾撕咬着，左右为难。好心的劳伦斯神父再次帮助朱丽叶，让她吞服安眠药，以假死来搪塞帕里斯的求婚，拖延时间。<br/>\r\n	</p>\n<p>\r\n	不明真相的凯普莱特一家人信以为真，伤心地为朱丽叶送葬。这时罗密欧悄悄地潜回了维洛那城，他以为朱丽叶真的死了，急急忙忙地赶到墓地，望着安详、苍白、停止了呼吸的朱丽叶，他千呼万唤，悲痛欲绝，他无法离开他心爱的朱丽叶，他无法孤独地、没有爱情地活着，他喝下毒药倒在朱丽叶的身边。可不一会儿，朱丽叶的药性过了，她苏醒过来，惊喜地发现心上人就在身旁，但罗密欧告诉他，他快要死了，朱丽叶抱着他，不相信这一切，然而他一点点衰弱下去，朱丽叶不能离开罗密欧，哪怕赴黄泉，他们也不再分离，朱丽叶毅然用短剑结束自己年轻生命。他们拥抱着爱情升入了天国。一对情人殉情而死。他们的鲜血终于唤醒了两个互相敌视的家族言归于好。</p>\n<p>\r\n	</p>\n<p>\n<strong>媒体评论</strong></p>\n<p>\r\n	</p>\n<p>\r\n	“至纯至真的爱情却在死亡中达到高潮，朱丽叶尤其让人心碎……美丽的作品让人难以忘怀，直击莎翁作品核心。”- 德国《法兰克福评论报》</p>\n<p>\r\n	“TNT剧院《罗密欧与朱丽叶》堪称当代英国莎翁剧中最令人满意和最具表现力的作品。”- 英国《戏剧世界》杂志</p>\n<p>\r\n	“纯粹的戏剧力量……道白、表演和戏剧完美得无以复加，高超的演技成就了如此精炼、动人的《罗密欧与朱丽叶》。”- 斯洛伐克《真理报》</p>\n<p>\r\n	“TNT剧院《罗密欧与朱丽叶》在悲剧与喜剧间切换自如，优雅浪漫却不乏生动风流，一如莎士比亚原作。戏剧魔术般的表演使得角色甚至风格可在瞬间自由转换，演员的卓越演技成为最大看点，自然流畅到全无表演痕迹。导演保罗·斯特宾让我们相信，至少在戏剧中还存在真爱。”- 德国《明斯特日报》</p>\n<p>\r\n	“折服中国观众的是简洁却绝不简单的设计中蕴含的巧妙想象力以及整个演出纯正的英伦风格和强烈的戏剧震撼力。”— 《北京晚报》</p>\n<p>\r\n	“表演行云流水，潇洒自如中却深藏功力。舞台简洁至极，朴实之中却凸现庞大寓意，对比英国人驾驭戏剧的能力，我们深受启发，却又自认不如。” —《新京报》</p>\n<p>\r\n	“一个卓越的例子：如何将莎士比亚戏剧演绎给现代的观众。”-日本《时代周刊》</p>\n<p>\r\n	“快节奏的惊悚剧却有现实的哲学深度，所以TNT剧院能在全世界如此成功。”–希腊《雅典新闻》</p>\n<p>\r\n	“莎士比亚经典的完美演绎，展现了作品所有的情感和哲学深度。”- 捷克布拉格《PRAVO》</p>\n<p>\r\n	“最好的巡演剧团。”- 香港《南华早报》</p>\n<p>\r\n	“充满生机，美丽超凡的剧院。”- 美国纽约《乡村之声》</p>\n<p>\r\n	“尽管用英语演出，但圣彼得堡国立喜剧院每夜爆满，我们从未看过这样的话剧。”-俄罗斯《戏剧》杂志</p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<strong>关于TNT版《罗密欧与朱丽叶》</strong></p>\n<p>\r\n	 《罗密欧与朱丽叶》中大量的抒情意象和抒情形式是莎士比亚其他悲剧中所没有的，男女主人公弹奏了一曲情意缠绵青春的颂歌、爱的颂歌。尽管这纯粹、美好的爱情与理性、法度和社会责任等尘世的价值观念相对立，但男女主人公在死亡中实现了尘世所不容的恋情，显示了青春和爱情的巨大力量，从而化解了两个家族的仇恨。莎士比亚用诗情化的笔触，使悲怆的死闪耀着人性的灵光，回响着浪漫的旋律……英国TNT剧院长久以来以重现莎翁精神为己任，其《罗密欧与朱丽叶》被德新社誉为“直击观众心灵，美丽得让人过目不忘。”秉承莎士比亚生活的维多利亚时期话剧采用现场音乐的传统，与剧情水乳交融的现场音乐和无伴奏合唱为TNT版《罗密欧与朱丽叶》平添了许多魅力。</p>\n<p>\r\n	2009年，画家<a href=\"http://weibo.com/n/%E8%96%9B%E7%BB%A7%E4%B8%9A\"><font color=\"#990000\">薛继业</font></a>观看英国TNT剧院《罗密欧与朱丽叶》后，创作了同名油画系列，被舞蹈家沈培艺购得收藏（右图为沈与画作合影）。沈培艺称，画作布满难以抑制的哀伤：当圣光透过屋顶撒下，轻抚榻上已“睡去”的佳人，一切都结束，连同曾经昏天黑地的爱恨情仇，惟有他们撼天动地的爱情挽歌，流传至今。这也是对TNT版《罗密欧与朱丽叶》的诠释。</p>\n<p>\r\n	</p>\n<p>\n<strong>关于英国TNT剧院</strong></p>\n<p>\r\n	 英国TNT剧院创立于1980年，是世界级国际巡演剧团，曾获慕尼黑双年艺术节、爱丁堡戏剧节、德黑兰艺术节大奖和新加坡政府奖等多项大奖。TNT剧院不仅在英国本土声名显赫，而且是全球巡演国家和场次最多的英语剧团——几乎占据了德国全部英语话剧市场，也是在法国、日本和俄罗斯演出最多的英语剧团。TNT剧院倡导戏剧激发观众的想象力，让观众成为戏剧的参与者而非旁观者，致力于在戏剧中融入多种艺术形式，每个剧目都邀请顶级作曲家为其量身创作音乐，因此作品中有很重的音乐和舞蹈元素。TNT剧院从2000年开始创作莎士比亚的系列作品，包括《哈姆雷特》、《麦克白》、《仲夏夜之梦》、《罗密欧与朱丽叶》和《驯悍记》等，迄今已在全球30多个国家演出1000余场。<span style=\"display: none\"></span></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(1217,'英国TNT剧院《罗密欧与朱丽叶》','http://www.hall.tsinghua.edu.cn/upload/20140228110101.jpg','1993-01-01','2014-04-19 19:00:00','蒙民伟音乐厅','演出：英国TNT剧院','票价：40/60/80/150/200/280元  ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：英国TNT剧院《罗密欧与朱丽叶》\n \n                      \n                    <p class=\"text2\">时间：2014-4-19 19:00:00<p></p>\n \n                      地点：蒙民伟音乐厅<br/>\n</p>\n<p class=\"text2\">演出：英国TNT剧院</p>\n<p class=\"text2\">票价：40/60/80/150/200/280元  <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：北京云汉文化交流有限公司 </span>\n<p class=\"text2\"><br>\n<p style=\"text-align: center\">\n<strong>走进“原汁原味”的莎士比亚世界</strong></p>\n<p style=\"text-align: center\">\n<strong>2014</strong><strong>年全球 纪念莎士比亚诞辰450周年</strong></p>\n<p style=\"text-align: center\">\n<strong>四百年盛演不衰的爱情传奇/秉承英国维多利亚时期莎剧传统/带来最纯正的英伦之声</strong><br/>\n<strong>年均演出1000场的英国传奇剧团—TNT剧院2014年度经典巨献/莎士比亚名篇</strong></p>\n<p style=\"text-align: center\">\r\n	</p>\n<p style=\"text-align: center\">\n<strong> 《罗密欧与朱丽叶》</strong><br/>\n<strong> （英语现场演出，中文投影字幕）</strong><br/>\n<br/>\r\n	</p>\n<p align=\"left\">\r\n	悲剧就是把人们美好的梦在现实中打破,正如辛苦制作的花瓶，却在上色的最后一环上有意摔破了……</p>\n<p align=\"left\">\r\n	</p>\n<p align=\"left\">\n<strong>剧情梗概</strong><br/>\r\n	《罗密欧与朱丽叶》是莎士比亚早期的著名悲剧。它描写了两个热恋的男女被拆散后，双双殉情的故事。<br/>\r\n	</p>\n<p align=\"left\">\r\n	故事发生在意大利维洛那城。凯普莱特和蒙太古两大家族有不共载天的世仇。在一次盛大华丽的宴会上，凯普莱特大人美丽多情的女儿朱丽叶与蒙太古大人英俊、潇洒的儿子罗密欧一见钟情，罗密欧无法抑制自己对朱丽叶的爱，向她求爱，两人迅速坠入爱河并私订终身，并在好心的神父劳伦斯的主持下举行了婚礼，朱丽叶望着身边英俊而多情的罗密欧，心中充满了对未来的憧憬。谁知，罗密欧在街上与凯普莱特的侄子提伯尔特相遇，提伯尔特故意挑衅，两人发生了格斗，罗密欧杀死了对方，被逐出维洛那城。</p>\n<p align=\"left\">\r\n	朱丽叶含泪送别了罗密欧，她的心和情已随着罗密欧去了，她丧魂失魄地思念着罗密欧。然而，父亲却逼她忘了这个家族的仇人，嫁给帕里斯伯爵。朱丽叶不敢背叛家族，又不愿意背叛心上人的爱情，她的心被痛苦和矛盾撕咬着，左右为难。好心的劳伦斯神父再次帮助朱丽叶，让她吞服安眠药，以假死来搪塞帕里斯的求婚，拖延时间。<br/>\r\n	</p>\n<p>\r\n	不明真相的凯普莱特一家人信以为真，伤心地为朱丽叶送葬。这时罗密欧悄悄地潜回了维洛那城，他以为朱丽叶真的死了，急急忙忙地赶到墓地，望着安详、苍白、停止了呼吸的朱丽叶，他千呼万唤，悲痛欲绝，他无法离开他心爱的朱丽叶，他无法孤独地、没有爱情地活着，他喝下毒药倒在朱丽叶的身边。可不一会儿，朱丽叶的药性过了，她苏醒过来，惊喜地发现心上人就在身旁，但罗密欧告诉他，他快要死了，朱丽叶抱着他，不相信这一切，然而他一点点衰弱下去，朱丽叶不能离开罗密欧，哪怕赴黄泉，他们也不再分离，朱丽叶毅然用短剑结束自己年轻生命。他们拥抱着爱情升入了天国。一对情人殉情而死。他们的鲜血终于唤醒了两个互相敌视的家族言归于好。</p>\n<p>\r\n	</p>\n<p>\n<strong>媒体评论</strong></p>\n<p>\r\n	</p>\n<p>\r\n	“至纯至真的爱情却在死亡中达到高潮，朱丽叶尤其让人心碎……美丽的作品让人难以忘怀，直击莎翁作品核心。”- 德国《法兰克福评论报》</p>\n<p>\r\n	“TNT剧院《罗密欧与朱丽叶》堪称当代英国莎翁剧中最令人满意和最具表现力的作品。”- 英国《戏剧世界》杂志</p>\n<p>\r\n	“纯粹的戏剧力量……道白、表演和戏剧完美得无以复加，高超的演技成就了如此精炼、动人的《罗密欧与朱丽叶》。”- 斯洛伐克《真理报》</p>\n<p>\r\n	“TNT剧院《罗密欧与朱丽叶》在悲剧与喜剧间切换自如，优雅浪漫却不乏生动风流，一如莎士比亚原作。戏剧魔术般的表演使得角色甚至风格可在瞬间自由转换，演员的卓越演技成为最大看点，自然流畅到全无表演痕迹。导演保罗·斯特宾让我们相信，至少在戏剧中还存在真爱。”- 德国《明斯特日报》</p>\n<p>\r\n	“折服中国观众的是简洁却绝不简单的设计中蕴含的巧妙想象力以及整个演出纯正的英伦风格和强烈的戏剧震撼力。”— 《北京晚报》</p>\n<p>\r\n	“表演行云流水，潇洒自如中却深藏功力。舞台简洁至极，朴实之中却凸现庞大寓意，对比英国人驾驭戏剧的能力，我们深受启发，却又自认不如。” —《新京报》</p>\n<p>\r\n	“一个卓越的例子：如何将莎士比亚戏剧演绎给现代的观众。”-日本《时代周刊》</p>\n<p>\r\n	“快节奏的惊悚剧却有现实的哲学深度，所以TNT剧院能在全世界如此成功。”–希腊《雅典新闻》</p>\n<p>\r\n	“莎士比亚经典的完美演绎，展现了作品所有的情感和哲学深度。”- 捷克布拉格《PRAVO》</p>\n<p>\r\n	“最好的巡演剧团。”- 香港《南华早报》</p>\n<p>\r\n	“充满生机，美丽超凡的剧院。”- 美国纽约《乡村之声》</p>\n<p>\r\n	“尽管用英语演出，但圣彼得堡国立喜剧院每夜爆满，我们从未看过这样的话剧。”-俄罗斯《戏剧》杂志</p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<strong>关于TNT版《罗密欧与朱丽叶》</strong></p>\n<p>\r\n	 《罗密欧与朱丽叶》中大量的抒情意象和抒情形式是莎士比亚其他悲剧中所没有的，男女主人公弹奏了一曲情意缠绵青春的颂歌、爱的颂歌。尽管这纯粹、美好的爱情与理性、法度和社会责任等尘世的价值观念相对立，但男女主人公在死亡中实现了尘世所不容的恋情，显示了青春和爱情的巨大力量，从而化解了两个家族的仇恨。莎士比亚用诗情化的笔触，使悲怆的死闪耀着人性的灵光，回响着浪漫的旋律……英国TNT剧院长久以来以重现莎翁精神为己任，其《罗密欧与朱丽叶》被德新社誉为“直击观众心灵，美丽得让人过目不忘。”秉承莎士比亚生活的维多利亚时期话剧采用现场音乐的传统，与剧情水乳交融的现场音乐和无伴奏合唱为TNT版《罗密欧与朱丽叶》平添了许多魅力。</p>\n<p>\r\n	2009年，画家<a href=\"http://weibo.com/n/%E8%96%9B%E7%BB%A7%E4%B8%9A\">薛继业</a>观看英国TNT剧院《罗密欧与朱丽叶》后，创作了同名油画系列，被舞蹈家沈培艺购得收藏（右图为沈与画作合影）。沈培艺称，画作布满难以抑制的哀伤：当圣光透过屋顶撒下，轻抚榻上已“睡去”的佳人，一切都结束，连同曾经昏天黑地的爱恨情仇，惟有他们撼天动地的爱情挽歌，流传至今。这也是对TNT版《罗密欧与朱丽叶》的诠释。</p>\n<p>\r\n	</p>\n<p>\n<strong>关于英国TNT剧院</strong></p>\n<p>\r\n	 英国TNT剧院创立于1980年，是世界级国际巡演剧团，曾获慕尼黑双年艺术节、爱丁堡戏剧节、德黑兰艺术节大奖和新加坡政府奖等多项大奖。TNT剧院不仅在英国本土声名显赫，而且是全球巡演国家和场次最多的英语剧团——几乎占据了德国全部英语话剧市场，也是在法国、日本和俄罗斯演出最多的英语剧团。TNT剧院倡导戏剧激发观众的想象力，让观众成为戏剧的参与者而非旁观者，致力于在戏剧中融入多种艺术形式，每个剧目都邀请顶级作曲家为其量身创作音乐，因此作品中有很重的音乐和舞蹈元素。TNT剧院从2000年开始创作莎士比亚的系列作品，包括《哈姆雷特》、《麦克白》、《仲夏夜之梦》、《罗密欧与朱丽叶》和《驯悍记》等，迄今已在全球30多个国家演出1000余场。<span style=\"display: none\"></span></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(1218,'英国TNT剧院《罗密欧与朱丽叶》','http://www.hall.tsinghua.edu.cn/upload/20140228105517.jpg','1993-01-01','2014-04-18 19:00:00','蒙民伟音乐厅','演出：英国TNT剧院','票价：40/60/80/150/200/280元  ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：英国TNT剧院《罗密欧与朱丽叶》\n \n                      \n                    <p class=\"text2\">时间：2014-4-18 19:00:00<p></p>\n \n                      地点：蒙民伟音乐厅<br/>\n</p>\n<p class=\"text2\">演出：英国TNT剧院</p>\n<p class=\"text2\">票价：40/60/80/150/200/280元  <br/>\n<p class=\"text2\">售票状态：待售票</p>\n<span class=\"text2\"> 主办：北京云汉文化交流有限公司</span>\n<p class=\"text2\"><br>\n<p style=\"text-align: center\">\n<strong>走进“原汁原味”的莎士比亚世界</strong></p>\n<p style=\"text-align: center\">\n<strong>2014</strong><strong>年全球 纪念莎士比亚诞辰450周年</strong></p>\n<p style=\"text-align: center\">\n<strong>四百年盛演不衰的爱情传奇/秉承英国维多利亚时期莎剧传统/带来最纯正的英伦之声</strong><br/>\n<strong>年均演出1000场的英国传奇剧团—TNT剧院2014年度经典巨献/莎士比亚名篇</strong></p>\n<p style=\"text-align: center\">\r\n	</p>\n<p style=\"text-align: center\">\n<strong> 《罗密欧与朱丽叶》</strong><br/>\n<strong> （英语现场演出，中文投影字幕）</strong><br/>\n<br/>\r\n	</p>\n<p align=\"left\">\r\n	悲剧就是把人们美好的梦在现实中打破,正如辛苦制作的花瓶，却在上色的最后一环上有意摔破了……</p>\n<p align=\"left\">\r\n	</p>\n<p align=\"left\">\n<strong>剧情梗概</strong><br/>\r\n	《罗密欧与朱丽叶》是莎士比亚早期的著名悲剧。它描写了两个热恋的男女被拆散后，双双殉情的故事。<br/>\r\n	</p>\n<p align=\"left\">\r\n	故事发生在意大利维洛那城。凯普莱特和蒙太古两大家族有不共载天的世仇。在一次盛大华丽的宴会上，凯普莱特大人美丽多情的女儿朱丽叶与蒙太古大人英俊、潇洒的儿子罗密欧一见钟情，罗密欧无法抑制自己对朱丽叶的爱，向她求爱，两人迅速坠入爱河并私订终身，并在好心的神父劳伦斯的主持下举行了婚礼，朱丽叶望着身边英俊而多情的罗密欧，心中充满了对未来的憧憬。谁知，罗密欧在街上与凯普莱特的侄子提伯尔特相遇，提伯尔特故意挑衅，两人发生了格斗，罗密欧杀死了对方，被逐出维洛那城。</p>\n<p align=\"left\">\r\n	朱丽叶含泪送别了罗密欧，她的心和情已随着罗密欧去了，她丧魂失魄地思念着罗密欧。然而，父亲却逼她忘了这个家族的仇人，嫁给帕里斯伯爵。朱丽叶不敢背叛家族，又不愿意背叛心上人的爱情，她的心被痛苦和矛盾撕咬着，左右为难。好心的劳伦斯神父再次帮助朱丽叶，让她吞服安眠药，以假死来搪塞帕里斯的求婚，拖延时间。<br/>\r\n	</p>\n<p>\r\n	不明真相的凯普莱特一家人信以为真，伤心地为朱丽叶送葬。这时罗密欧悄悄地潜回了维洛那城，他以为朱丽叶真的死了，急急忙忙地赶到墓地，望着安详、苍白、停止了呼吸的朱丽叶，他千呼万唤，悲痛欲绝，他无法离开他心爱的朱丽叶，他无法孤独地、没有爱情地活着，他喝下毒药倒在朱丽叶的身边。可不一会儿，朱丽叶的药性过了，她苏醒过来，惊喜地发现心上人就在身旁，但罗密欧告诉他，他快要死了，朱丽叶抱着他，不相信这一切，然而他一点点衰弱下去，朱丽叶不能离开罗密欧，哪怕赴黄泉，他们也不再分离，朱丽叶毅然用短剑结束自己年轻生命。他们拥抱着爱情升入了天国。一对情人殉情而死。他们的鲜血终于唤醒了两个互相敌视的家族言归于好。</p>\n<p>\r\n	</p>\n<p>\n<strong>媒体评论</strong></p>\n<p>\r\n	</p>\n<p>\r\n	“至纯至真的爱情却在死亡中达到高潮，朱丽叶尤其让人心碎……美丽的作品让人难以忘怀，直击莎翁作品核心。”- 德国《法兰克福评论报》</p>\n<p>\r\n	“TNT剧院《罗密欧与朱丽叶》堪称当代英国莎翁剧中最令人满意和最具表现力的作品。”- 英国《戏剧世界》杂志</p>\n<p>\r\n	“纯粹的戏剧力量……道白、表演和戏剧完美得无以复加，高超的演技成就了如此精炼、动人的《罗密欧与朱丽叶》。”- 斯洛伐克《真理报》</p>\n<p>\r\n	“TNT剧院《罗密欧与朱丽叶》在悲剧与喜剧间切换自如，优雅浪漫却不乏生动风流，一如莎士比亚原作。戏剧魔术般的表演使得角色甚至风格可在瞬间自由转换，演员的卓越演技成为最大看点，自然流畅到全无表演痕迹。导演保罗·斯特宾让我们相信，至少在戏剧中还存在真爱。”- 德国《明斯特日报》</p>\n<p>\r\n	“折服中国观众的是简洁却绝不简单的设计中蕴含的巧妙想象力以及整个演出纯正的英伦风格和强烈的戏剧震撼力。”— 《北京晚报》</p>\n<p>\r\n	“表演行云流水，潇洒自如中却深藏功力。舞台简洁至极，朴实之中却凸现庞大寓意，对比英国人驾驭戏剧的能力，我们深受启发，却又自认不如。” —《新京报》</p>\n<p>\r\n	“一个卓越的例子：如何将莎士比亚戏剧演绎给现代的观众。”-日本《时代周刊》</p>\n<p>\r\n	“快节奏的惊悚剧却有现实的哲学深度，所以TNT剧院能在全世界如此成功。”–希腊《雅典新闻》</p>\n<p>\r\n	“莎士比亚经典的完美演绎，展现了作品所有的情感和哲学深度。”- 捷克布拉格《PRAVO》</p>\n<p>\r\n	“最好的巡演剧团。”- 香港《南华早报》</p>\n<p>\r\n	“充满生机，美丽超凡的剧院。”- 美国纽约《乡村之声》</p>\n<p>\r\n	“尽管用英语演出，但圣彼得堡国立喜剧院每夜爆满，我们从未看过这样的话剧。”-俄罗斯《戏剧》杂志</p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<strong>关于TNT版《罗密欧与朱丽叶》</strong></p>\n<p>\r\n	 《罗密欧与朱丽叶》中大量的抒情意象和抒情形式是莎士比亚其他悲剧中所没有的，男女主人公弹奏了一曲情意缠绵青春的颂歌、爱的颂歌。尽管这纯粹、美好的爱情与理性、法度和社会责任等尘世的价值观念相对立，但男女主人公在死亡中实现了尘世所不容的恋情，显示了青春和爱情的巨大力量，从而化解了两个家族的仇恨。莎士比亚用诗情化的笔触，使悲怆的死闪耀着人性的灵光，回响着浪漫的旋律……英国TNT剧院长久以来以重现莎翁精神为己任，其《罗密欧与朱丽叶》被德新社誉为“直击观众心灵，美丽得让人过目不忘。”秉承莎士比亚生活的维多利亚时期话剧采用现场音乐的传统，与剧情水乳交融的现场音乐和无伴奏合唱为TNT版《罗密欧与朱丽叶》平添了许多魅力。</p>\n<p>\r\n	2009年，画家<a href=\"http://weibo.com/n/%E8%96%9B%E7%BB%A7%E4%B8%9A\">薛继业</a>观看英国TNT剧院《罗密欧与朱丽叶》后，创作了同名油画系列，被舞蹈家沈培艺购得收藏（右图为沈与画作合影）。沈培艺称，画作布满难以抑制的哀伤：当圣光透过屋顶撒下，轻抚榻上已“睡去”的佳人，一切都结束，连同曾经昏天黑地的爱恨情仇，惟有他们撼天动地的爱情挽歌，流传至今。这也是对TNT版《罗密欧与朱丽叶》的诠释。</p>\n<p>\r\n	</p>\n<p>\n<strong>关于英国TNT剧院</strong></p>\n<p>\r\n	 英国TNT剧院创立于1980年，是世界级国际巡演剧团，曾获慕尼黑双年艺术节、爱丁堡戏剧节、德黑兰艺术节大奖和新加坡政府奖等多项大奖。TNT剧院不仅在英国本土声名显赫，而且是全球巡演国家和场次最多的英语剧团——几乎占据了德国全部英语话剧市场，也是在法国、日本和俄罗斯演出最多的英语剧团。TNT剧院倡导戏剧激发观众的想象力，让观众成为戏剧的参与者而非旁观者，致力于在戏剧中融入多种艺术形式，每个剧目都邀请顶级作曲家为其量身创作音乐，因此作品中有很重的音乐和舞蹈元素。TNT剧院从2000年开始创作莎士比亚的系列作品，包括《哈姆雷特》、《麦克白》、《仲夏夜之梦》、《罗密欧与朱丽叶》和《驯悍记》等，迄今已在全球30多个国家演出1000余场。</p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(1219,'幽兰雅韵――江苏省演艺集团昆剧院经典折子戏专场','http://www.hall.tsinghua.edu.cn/upload/20140303113303.jpg','1993-01-01','2014-04-17 19:00:00','蒙民伟音乐厅','演出：江苏省演艺集团昆剧院','票价：10/20/40/60/100/200/VIP280元（套票优惠：280*2=500 280*3=700） ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：幽兰雅韵――江苏省演艺集团昆剧院经典折子戏专场\n \n                      \n                    <p class=\"text2\">时间：2014-4-17 19:00:00<p></p>\n \n                      地点：蒙民伟音乐厅<br/>\n</p>\n<p class=\"text2\">演出：江苏省演艺集团昆剧院</p>\n<p class=\"text2\">票价：10/20/40/60/100/200/VIP280元（套票优惠：280*2=500 280*3=700） <br/>\n<p class=\"text2\">售票状态：售票中</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p align=\"center\">\n<strong>剧目简介</strong></p>\n<p>\r\n	</p>\n<p>\n<strong>                        《九莲灯·火判》 </strong></p>\n<p>\r\n	   忠臣之子闵远因全家遭奸臣陷害，独自逃至火神庙躲避。火德星君现灵，问明情由。嘱闵至莲花圣母处借取九莲灯以解其危。此剧唱做繁重，为昆剧净行架子花脸代表剧目之一。</p>\n<p>\r\n	火德星君…………孙 晶 饰（优秀青年演员、全国昆曲青年演员“十佳新秀奖”获得者）</p>\n<p>\r\n	闵 远……………张争耀 饰（优秀青年演员、江苏省“红梅杯”戏曲大赛金奖获得者）</p>\n<p align=\"left\">\r\n	</p>\n<p align=\"left\">\n<strong>                       《绣襦记·教歌》</strong></p>\n<p align=\"left\">\r\n	   常州刺史郑儋之子郑元和上京应试，途中结识名妓李亚仙，整日沉溺烟花不能自拔。钱财花尽沦落街头，后被乞丐收留并教以讨饭之技能。</p>\n<p>\r\n	苏州老大………李鸿良 饰（国家一级演员、中国戏剧“梅花奖”获得者）</p>\n<p align=\"left\">\r\n	扬州老二………计韶清 饰（国家一级演员、江苏省“红梅杯”戏曲大赛银奖获得者）</p>\n<p>\r\n	郑 元 和………王 斌 饰（国家一级演员、“文华导演奖”获得者）</p>\n<p style=\"margin-left: 149.65pt\">\r\n	</p>\n<p>\n<strong>                      《白罗衫·诘父》</strong></p>\n<p>\r\n	   徐继祖在寻访白罗衫的过程中，终于弄清了自己的身世。原来他的所谓父亲徐能，是个既对他有十八年养育之恩，又与他有十八年杀父之仇的江洋大盗。面对着严酷的现实，徐继祖的灵魂颤栗了，他为前来探望他的徐能摆下了丰盛的酒宴，这究竟是一桌洗尘酒，还是一席“饯行宴”呢？………………</p>\n<p>\r\n	徐继祖……………施夏明 饰（优秀青年演员、全国昆曲青年演员“十佳新秀奖”获得者）</p>\n<p>\r\n	徐 能……………赵于涛饰（优秀青年演员、全国昆曲青年演员“展演表演奖”获得者）</p>\n<p>\r\n	奶 公……………计 灵饰（优秀青年演员）</p>\n<p>\r\n	</p>\n<p>\n<strong>                    《玉簪记·偷诗》 </strong></p>\n<p>\r\n	   陈妙常在房中幽怀孤闷，恍惚入梦。潘必正突至，于桌上翻得妙常情诗，诗中流露爱潘心意。妙常醒来虽百般掩饰，但潘以诗为凭，两人遂结情缘。</p>\n<p>\r\n	陈妙常……………龚隐雷 饰（国家一级演员、第四届中国昆剧艺术节“优秀表演奖”获得者）</p>\n<p>\r\n	潘必正……………钱振荣 饰（国家一级演员、江苏省“红梅杯”戏曲大赛金奖获得者）</p>\n<p align=\"center\">\r\n	</p>\n<p align=\"center\">\n<strong>江苏省演艺集团昆剧院介绍</strong></p>\n<p>\r\n	</p>\n<p>\r\n	 江苏省演艺集团昆剧院位于六朝古都南京，具有鲜明的南昆风格和吴文化底蕴。剧院拥有一大批保留的精品剧目和大量经典昆曲折子戏，坚持对昆曲传统的挖掘、保护和传承，致力于古典名著的整理改编系列工程，将继承传统、保护国粹作为剧院的首要任务。昆曲申遗成功十周年来，江苏省演艺集团昆剧院体制、机制的大胆创新，给昆曲本身的传承、保护、发展注入了蓬勃的生机和活力，大大解放了艺术生产力，让古老的昆曲焕发出了崭新活力。不间断的演出让年轻演员有了更多舞台展现的机会，艺术水准不断提高，以著名昆剧表演艺术家张继青为代表的“继”字辈及张寄蝶、石小梅、胡锦芳、林继凡、黄小午等为代表的第二代艺术家之后，第三代昆剧演员包括柯军、孔爱萍、徐云秀、李鸿良、钱振荣、龚隐雷等已走向成熟，第四代青年演员单雯、施夏明、张争耀、徐思佳、孙晶、赵于涛等也开始崭露头角，江苏省演艺集团昆剧院的昆剧人才形成了良好的梯队。剧院代表剧目有《牡丹亭》、《1699·桃花扇》、《朱买臣休妻》、《窦娥冤》、《小孙屠》、《白罗衫》、《红楼梦》、《南柯梦》等等。</p>\n<p>\r\n	   除扎实地传承昆曲剧目之外，江苏省演艺集团昆剧院还进行了诸多其它方面的尝试。例如与有着香港文化教父之称的荣念曾合作实验剧《临川四梦汤显祖》、《夜奔》等等。在2011年9月27日，江苏省演艺集团昆剧院还将昆曲历史性地第一次送进了地铁，传递了安全、安静、安心的感受和昆曲雅致从容的生活态度，古老的中华民族传统文化与现代文明交汇出亮丽的色彩，此次活动影响十分广泛，不仅吸引了更多新的观众走进了昆曲的剧场，还引起了关于经典文化在现代发展的深入讨论，对传播昆曲艺术具有十分积极的意义。</p>\n<p>\r\n	 剧院曾先后四十余次赴意大利、美国、德国、日本、法国、西班牙、韩国、印度、芬兰、瑞典等国及我国香港、台湾地区访问、演出、讲学，受到国际文化界和海内外人士的普遍赞誉。                         </p>\n<p>\r\n	</p>\n<p>\n<span style=\"text-align: center\">                    (本场演出时长约120分钟，无中场休息）</span></p>\n<p>\r\n	</p>\n<p>\n<span style=\"display: none\"></span></p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL),(1220,'幽兰雅韵――江苏省演艺集团昆剧院经典折子戏专场','http://www.hall.tsinghua.edu.cn/upload/20140303111409.jpg','1993-01-01','2014-04-16 19:00:00','蒙民伟音乐厅','演出：江苏省演艺集团昆剧院','票价：10/20/40/60/100/200/VIP280元（套票优惠：280*2=500 280*3=700） ','<table border=\"0\" height=\"\" width=\"97%\">\n<tr>\n\n<td align=\"left\" width=\"100%\"><p>\n\n\n<p class=\"text2\">剧目：幽兰雅韵――江苏省演艺集团昆剧院经典折子戏专场\n \n                      \n                    <p class=\"text2\">时间：2014-4-16 19:00:00<p></p>\n \n                      地点：蒙民伟音乐厅<br/>\n</p>\n<p class=\"text2\">演出：江苏省演艺集团昆剧院</p>\n<p class=\"text2\">票价：10/20/40/60/100/200/VIP280元（套票优惠：280*2=500 280*3=700） <br/>\n<p class=\"text2\">售票状态：售票中</p>\n<span class=\"text2\"> 主办：清华大学艺术教育中心</span>\n<p class=\"text2\"><br>\n<p>\r\n	</p>\n<p align=\"center\">\n<strong>剧目简介</strong></p>\n<p>\r\n	</p>\n<p>\n<strong>                 《虎囊弹·山门》</strong></p>\n<p>\r\n	   鲁智深打死镇关西后，在五台山做了和尚，终因受不了清规戒律，于是溜出山门。巧遇有人卖酒，但不卖给和尚吃，鲁智深气恼之下，强将两桶酒都吃了，遂在醉醺醺的回寺途中，乘着酒兴耍起了十八罗汉拳，打坏山门，山亭倒坍。</p>\n<p>\r\n	鲁智深…………曹志威 饰（优秀青年演员、全国昆曲青年演员“十佳新秀奖”获得者）</p>\n<p>\r\n	酒 保…………钱 伟饰（优秀青年演员、全国昆曲青年演员“展演表演奖”获得者）</p>\n<p>\r\n	</p>\n<p>\n<strong>                 《幽闺记·踏伞》</strong></p>\n<p>\r\n	   秀才蒋世隆与妹子瑞莲，小姐王瑞兰偕母亲，都因战乱，逃难异乡。是日，雨若倾盆，风如箭急，战马奔窜。不幸亲人同被冲散。世隆寻喊妹子瑞莲名字，瑞兰误听作母亲相呼，见面一番惊疑之后，只好“事急且本随”，假称夫妻，结伴同行。</p>\n<p>\r\n	王瑞兰……………单 雯 饰（优秀青年演员、全国昆曲青年演员“十佳新秀奖”获得者）</p>\n<p align=\"left\">\r\n	蒋世隆……………张争耀 饰（优秀青年演员、江苏省“红梅杯”戏曲大赛金奖获得者）</p>\n<p align=\"left\">\r\n	</p>\n<p align=\"left\">\n<strong>                 《烂柯山·痴梦》</strong></p>\n<p>\r\n	   崔氏抛弃贫寒丈夫朱买臣，改嫁木匠张西乔。后得知朱买臣当了本郡太守，心中百感交集，万般无奈，不觉入梦，梦见朱买臣派人来接她当夫人。正在得意非凡，如痴似狂之际，突然惊醒过来，只见残月孤灯。</p>\n<p>\r\n	崔 氏……………徐云秀 饰（国家一级演员、联合国教科文组织和国家文化部颁发的“促进昆曲</p>\n<p>\r\n	艺术奖”获得者）</p>\n<p>\r\n	张西乔……………计韶清 饰（国家一级演员、江苏省“红梅杯”戏曲大赛银奖获得者）</p>\n<p>\r\n	院 子……………刘 效 饰（优秀演员、首届中国昆剧青年演员交流演出“兰花表演奖”获得者）</p>\n<p>\r\n	衙 婆……………裘彩萍饰（国家二级演员、首届中国昆剧青年演员交流演出“兰花表演奖”获得者）</p>\n<p>\r\n	</p>\n<p>\n<strong>                 《西厢记·游殿》</strong><br/>\r\n	   唐代，书生张珙上京应试，途经普救寺。和尚法聪陪他畅游僧院佛殿，不想遇上寄居在西厢房的相国千金莺莺和丫环红娘。张珙对莺莺一见钟情，由此无心应试羁留寺中。</p>\n<p>\r\n	法 聪…………李鸿良 饰（国家一级演员、中国戏剧 “梅花奖”获得者）</p>\n<p>\r\n	张 珙…………钱振荣 饰（国家一级演员、江苏省“红梅杯”戏曲大赛金奖获得者）</p>\n<p>\r\n	莺 莺…………周向红 饰（国家二级演员）</p>\n<p>\r\n	红 娘…………丛海燕 饰（国家二级演员、江苏省首届“加佳杯”表演奖获得者）</p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p align=\"center\">\n<strong>江苏省演艺集团昆剧院介绍</strong></p>\n<p>\r\n	</p>\n<p>\r\n	 江苏省演艺集团昆剧院位于六朝古都南京，具有鲜明的南昆风格和吴文化底蕴。剧院拥有一大批保留的精品剧目和大量经典昆曲折子戏，坚持对昆曲传统的挖掘、保护和传承，致力于古典名著的整理改编系列工程，将继承传统、保护国粹作为剧院的首要任务。昆曲申遗成功十周年来，江苏省演艺集团昆剧院体制、机制的大胆创新，给昆曲本身的传承、保护、发展注入了蓬勃的生机和活力，大大解放了艺术生产力，让古老的昆曲焕发出了崭新活力。不间断的演出让年轻演员有了更多舞台展现的机会，艺术水准不断提高，以著名昆剧表演艺术家张继青为代表的“继”字辈及张寄蝶、石小梅、胡锦芳、林继凡、黄小午等为代表的第二代艺术家之后，第三代昆剧演员包括柯军、孔爱萍、徐云秀、李鸿良、钱振荣、龚隐雷等已走向成熟，第四代青年演员单雯、施夏明、张争耀、徐思佳、孙晶、赵于涛等也开始崭露头角，江苏省演艺集团昆剧院的昆剧人才形成了良好的梯队。剧院代表剧目有《牡丹亭》、《1699·桃花扇》、《朱买臣休妻》、《窦娥冤》、《小孙屠》、《白罗衫》、《红楼梦》、《南柯梦》等等。</p>\n<p>\r\n	 除扎实地传承昆曲剧目之外，江苏省演艺集团昆剧院还进行了诸多其它方面的尝试。例如与有着香港文化教父之称的荣念曾合作实验剧《临川四梦汤显祖》、《夜奔》等等。在2011年9月27日，江苏省演艺集团昆剧院还将昆曲历史性地第一次送进了地铁，传递了安全、安静、安心的感受和昆曲雅致从容的生活态度，古老的中华民族传统文化与现代文明交汇出亮丽的色彩，此次活动影响十分广泛，不仅吸引了更多新的观众走进了昆曲的剧场，还引起了关于经典文化在现代发展的深入讨论，对传播昆曲艺术具有十分积极的意义。</p>\n<p>\r\n	 剧院曾先后四十余次赴意大利、美国、德国、日本、法国、西班牙、韩国、印度、芬兰、瑞典等国及我国香港、台湾地区访问、演出、讲学，受到国际文化界和海内外人士的普遍赞誉。</p>\n<p>\r\n	</p>\n<p>\r\n	</p>\n<p>\n<span style=\"display: none\"></span></p>\n<p>\r\n	                         （本场演出时长约120分钟，无中场休息）</p>\n<p>\r\n	</p>\n<p align=\"center\">\r\n	</p>\n<p align=\"center\">\r\n	</p>\n</br></p></p></p></p></td>\n</tr>\n</table>',NULL);
