INSERT INTO `TuanTuanApp_club` VALUES (1,'三农学会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6CJ2xYicbQO68XmpTd7n63F146RKYWvOVpCL98epxfgspg/0','清华大学学生三农学会是以关注、学习研究“三农”问题为主的学生社团，这里有一群善良可爱而富有责任心的同学。','<div class=\"text\"><p></p><p>清华大学学生三农学会是以关注、学习研究“三农”问题为主的学生社团，这里有一群善良可爱而富有责任心的同学。学会主要活动有：“三农”问题讨论学习，由理论基础扎实的会员负责，针对学会内部成员，由浅入深学习研究三农相关主题的内容（如农村土地流转）；三农沙龙活动（已举办3期），骨干成员负责组织，面向全校师生，每期一个主题（如“大学生村官”），共同讨论交流；打工子弟小学“爱心陪伴”活动，每周四下午到小学陪伴放学后还留在学校的孩子，给他们辅导功课、做游戏；暑假实践调研，针对热点问题组建支队进行调研，如2011年赴山东寿光蔬菜生产流通调研、2012年赴河北保定梁漱溟乡村建设中心合作社调研；协助清华大学中国农村研究院举办相关活动，如“三农讲坛”。</p><p><br></p></div>'),(2,'舞蹈爱好者协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6CrmrNv8KQibcEmu5q9VtLJH53Nll4E6JZzeNdKE962VJA/0','清华大学学生舞蹈爱好者协会是由清华爱舞学子于2004年民间自发组建的公益性学生社团，旨在发展校园舞蹈文化，丰富同学的课余生活，为广大舞蹈爱好者搭建交流学习的平台。','<div class=\"text\"><p><strong>协会介绍</strong> &nbsp;</p><p><span style=\"font-size:16px;font-family:楷体_gb2312\">清华大学学生舞蹈爱好者协会是由清华爱舞学子于</span><span style=\" font-size:16px ; ; ; ; \">2004</span><span style=\"font-size:16px;font-family:楷体_gb2312\">年民间自发组建的公益性学生社团，旨在发展校园舞蹈文化，丰富同学的课余生活，为广大舞蹈爱好者搭建交流学习的平台。协会同时接受清华大学社团部和清华大学学生艺术团的指导；以普及舞蹈艺术为己任，不对任何人、任何舞种设置进入门槛；协会核心价值观：温馨和谐，包容进取，以舞蹈为媒介积极输出正能量。</span></p><p> </p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">协会的六支舞队（古典舞队、肚皮舞队、摩登舞队、交谊舞队、弗拉明戈舞队、欧美热舞队），每周都会在万人地下社团活动室进行日常训练，日常训练面向全体会员开放，将主要由老队员进行指导，进行基本功或者成品舞、套路的学习。</span></p><p style=\"text-align:left\"><span> </span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">另外，协会每学期都会邀请老师，在清华开展各种流行舞蹈的培训学习。协会长期为协会学员开设零基础的古典舞、芭蕾舞、现代舞、肚皮舞、弗拉明戈舞、国标华尔兹、国标探戈、阿根廷探戈、</span><span>SALSA</span><span style=\"font-family:楷体_gb2312\">、交谊舞、欧美热舞、拉丁舞等的课程，旨在努力提升校园的文艺气氛，增进同学们的个人气质。对于部分有基础的同学，协会也开设了相应的提高课程，满足同学们的相关需求。</span></p><p style=\"text-align:left\"><span> </span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">协会除了日常的舞蹈学习与训练，还会定期或者不定期地举办舞会，以及其他大型演出活动等。如在</span><span>2012</span><span style=\"font-family:楷体_gb2312\">年秋冬季节，协会举办了“热爱生活·舞出真我”系列活动，即包含了百变真我秀、寻梦缘舞会、“舞韵流觞”文化晚会等三个子活动。该系列活动引起了校内外广泛关注，中国青年网、中华舞蹈网都做了相关报道。百变真我秀网络点击量超过</span><span>150000</span><span style=\"font-family:楷体_gb2312\">次，寻梦缘舞会参与人数近千人，“舞韵流觞”文化晚会还获得新浪直播，累计观看人次超过</span><span>20000</span><span style=\"font-family:楷体_gb2312\">人次。</span></p><p style=\"text-align:left\"><span> </span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">清华大学学生舞蹈爱好者协会</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">官方微信号：</span><span>TsinghuaDance</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">官方邮箱：</span><span>dance.thu@gmail.com</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">新浪微博：（清华舞协）</span><span>http://www.weibo.com/thuda</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">人人主页：（清华舞协）</span><span>http://page.renren.com/601538374</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">人人小站：</span><span>http://zhan.renren.com/thudance</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">新浪博客：</span><span>http://blog.sina.com.cn/u/3035234043</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">新浪轻博客：</span><span>http://qing.weibo.com/thuda</span></p><p style=\"text-align:left\"><span>1</span><span style=\"font-family:楷体_gb2312\">号</span><span>QQ</span><span style=\"font-family:楷体_gb2312\">群：</span><span>179316911</span></p><p><span style=\"font-size:14px ;\">2</span><span style=\"font-size:14px;font-family:楷体_gb2312\">号</span><span style=\"font-size:14px ;\">QQ</span><span style=\"font-size:14px;font-family:楷体_gb2312\">群：</span><span style=\"font-size:14px ;\">101661398</span> </p><p><br></p><p><br></p></div>'),(3,'轮滑协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6C6ibGiavVJfAYL1OovPg1GHZWHggiauRrDFqIGT7hLV0KLA/0','清华大学学生轮滑协会（简称“轮滑协会”）成立于1999年3月，是我校轮滑爱好者的精英组织，代表着我校轮滑运动的最高水平。协会的宗旨是在我校进一步普及轮滑运动，为广大同学提供娱乐、学习、交流、提高的机会，使我校的轮滑运动进一步系统化、正规化，在全国高校中占据领先位置。','<div class=\"text\"><p><strong>协会简介：</strong><br></p><p> &nbsp; &nbsp;清华大学学生轮滑协会（简称“轮滑协会”）成立于1999年3月，是我校轮滑爱好者的精英组织，代表着我校轮滑运动的最高水平。协会的宗旨是在我校进一步普及轮滑运动，为广大同学提供娱乐、学习、交流、提高的机会，使我校的轮滑运动进一步系统化、正规化，在全国高校中占据领先位置。</p><p>协会现有注册会员上千人，协会的各项活动得到了校内外轮滑爱好者的广泛关注。协会机构设置有办公室、内联部、外联部、宣传部、装备部和培训组等部门，在轮滑技术层次上，成立有平花队、速滑队，正在筹备的轮舞队和刹车队也已经有了一定的发展成果。</p><p>协会成立以来始终坚持校园轮滑的普及活动。同时，协会在每学期的招新中补充了大量新鲜的血液，进一步扩大影响力。</p><p><br></p><p><strong>品牌活动：</strong></p><ul style=\"list-style-type:disc;\"><li><p><strong>“马约翰杯”轮滑比赛</strong>协会负责承办了清华大学“马约翰杯”轮滑项目的比赛，每届都有十几个院系近百名选手报名参赛。比赛分为速滑和花样的6个单项的个人、团体项目。</p><p><br></p></li><li><p><strong>“北京高校轮滑邀请赛”</strong>2007年5月26日首届“北京高校轮滑邀请赛”在清华轮滑场举行，14所高校踊跃参加。北京轮滑界名人FOX，曹南等人到场作裁判，并有ROLLERBLADE公司、可口可乐公司的热情赞助。此次活动是近三年内北京唯一一次学生组织的大型轮滑活动，在北京轮滑界取得了较大的反响。</p><p><br></p></li><li><p><strong>“滑young年华”</strong>2008年5月18日，“滑young年华”轮滑节在清华轮滑场进行。在这次活动中，清华北大两校的同学携手共进，响应学校加强体育锻炼的号召，让更多学生提高体育活动的热情。</p><p><br></p></li></ul><p>联系方式：</p><ul style=\"list-style-type:disc;\"><li><p>协会邮箱： thu_skate@163.com</p></li><li><p>人人网清华轮滑社主页：www.renren.com/thuskat</p></li><li><p>corsair社区：清华大学轮滑协会</p></li></ul><p><span style=\"text-decoration:underline;\"></span><br></p></div>'),(9,'古典爱乐社','http://mmbiz.qpic.cn/mmbiz/OOMV4tnjF6A6PYYgDxzV4Xdcbd4IpL9DC9NgT4vCK0sPhegKhreheu4jrDQqYia9c4lljLv0xfhynR6pA1XGsXA/0','清华大学古典爱乐社成立于二零零九年底，是由清华大学校内古典音乐爱好者自发组织的群体共享交流型公益团体，它面向全校同学而不仅仅是有艺术特长的同学，以公益活动的形式介绍西方古典音乐，让更多的同学有机会近距离地接触古典音乐，并在一起沟通和交流对音乐的感受，增强艺术修养和审美鉴赏力。','<div class=\"text\"><p style=\"margin-bottom: 10px; white-space: normal;\"><strong><span style=\"font-family: 宋体;\">协会概要：</span></strong></p><p style=\"margin-bottom: 10px; white-space: normal; text-indent: 32px;\"><span style=\"font-family: 宋体;\">清华大学古典爱乐社成立于二零零九年底，是由清华大学校内古典音乐爱好者自发组织的群体共享交流型公益团体，它面向全校同学而不仅仅是有艺术特长的同学，以公益活动的形式介绍西方古典音乐，让更多的同学有机会近距离地接触古典音乐，并在一起沟通和交流对音乐的感受，增强艺术修养和审美鉴赏力。社团内部成员会定期举行交流会，目的在于沟通感情，交流音乐体验，会员会被建议或被邀请对某一问题进行或长或短的阐释，我们力求在一种平等的语境下进行对话，并通过这种对话，实现音乐人格的完善与升华。清华大学古典爱乐社定期发布优质的北京市场大型古典乐演出的信息，相关票务优惠，以及演出场所的彩排观众邀请，因此，积极参加内部交流，极其有利于会员迅速成长为专业型音乐爱好者。经过数年发展，我们已与北京大学提琴社、北京外国语大学古典音乐协会、中央音乐学院、中山音乐厅、国家大剧院建立了交流合作关系，在校内校外的影响力也逐渐扩大。</span></p><p style=\"margin-bottom: 10px; white-space: normal;\"><strong><span style=\"font-family: 宋体;\">经典活动：</span></strong></p><p style=\"margin-bottom: 10px; white-space: normal; text-indent: 32px;\"><span style=\"font-family: 宋体;\">古典爱乐协会致力于在校园内引进高端学术普及型讲座，并组织属于爱乐学生自己的沙龙、音乐会活动。曾举办过“旧金山四重奏音乐会”、“音乐的纽带——清华大学夏季草坪音乐会”；“歌剧解码——为什么我听不懂歌剧”、“梦回瓦尔哈拉——瓦格纳和他的音乐世界”、“解密莫尔斯——贝多芬在敲门“等讲座；“活跃在中国舞台上的音乐家”、“假面舞会”、“贝多芬的那些慢板乐章”沙龙等一系列活动。</span></p><p style=\"margin-bottom: 10px; white-space: normal; text-indent: 32px;\"><span style=\"font-family: 宋体;\"><img src=\"http://mmsns.qpic.cn/mmsns/OOMV4tnjF6B5ZOGQnt2U9j1icpzX0nrqVia7EnHUslQbIiaLszdR9qIrQ/0\"><strong>“音乐的纽带——清华大学草坪音乐会”现场</strong></span></p><p style=\"margin-bottom: 10px; white-space: normal; text-indent: 32px;\"><span style=\"font-family: 宋体;\"><strong><img src=\"http://mmsns.qpic.cn/mmsns/OOMV4tnjF6B5ZOGQnt2U9j1icpzX0nrqVD3HichSlnszYF6q6iceukVQQ/0\">社内交流沙龙现场</strong></span></p><p style=\"margin-bottom: 10px; white-space: normal;\"><strong><span style=\"font-family: 宋体;\">所获荣誉：</span></strong></p><p style=\"white-space: normal;\"><span style=\"font-family: 宋体;\">·&nbsp;&nbsp;</span><span style=\"font-family: 宋体;\">2010</span><span style=\"font-family: 宋体;\">年度清华大学学生优秀新协会</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 宋体;\">·&nbsp;</span><span style=\"font-family: 宋体;\">2010-2011</span><span style=\"font-family: 宋体;\">学年度秋季学期学生素质拓展计划项目评优中我社的“清华大学百年校庆古典音乐会系列”项目荣获“招标项目及校系类项目”银奖</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 宋体;\">·&nbsp;&nbsp;</span><span style=\"font-family: 宋体;\">2011-2012</span><span style=\"font-family: 宋体;\">学年度</span><span style=\"font-family: 宋体;\">秋季学期学生素质拓展计划项目评优中我社的“遇见奥菲欧”项目荣获“招标项目及校系类项目”金奖</span></p><h1 id=\"activity-name\" style=\"white-space: normal;\">如果你喜欢我们的内容，不要忘记分享给朋友们哟~【校团委社团部】</h1><p style=\"white-space: normal;\"><span style=\"font-size: 17px; font-family: 宋体;\"><img src=\"http://mmsns.qpic.cn/mmsns/OOMV4tnjF6BbOVQN60f1YT7PCgPWjufOiaibPdYwtTMuTiaUpdicqicPRvw/0\"></span></p><p style=\"white-space: normal;\"><span style=\"font-size: 17px; font-family: 宋体;\">独乐乐不如众乐乐，如果你喜欢我们的内容，那就推荐身边的同学一起关注吧</span>~</p><p style=\"white-space: normal;\"><br>&nbsp; &nbsp;<span style=\"font-size: 17px; font-family: 宋体;\">如果你觉得我们的内容有趣实用，请动一动食指，点击右上角</span>“<span style=\"font-size: 17px; font-family: 宋体;\">分享至朋友圈</span>”<span style=\"font-size: 17px; font-family: 宋体;\">分享给朋友们吧</span>~~</p><p style=\"white-space: normal;\"><br><span style=\"font-size: 17px; font-family: 宋体;\">【清华大学社团协会】</span></p><p style=\"white-space: normal;\"><span style=\"font-size: 17px; font-family: 宋体;\">官方邮箱：</span>shetuan@mail.tsinghua.edu.cn</p><p style=\"white-space: normal;\"><span style=\"font-size: 17px; font-family: 宋体;\">新浪微博：</span>http://e.weibo.com/u/2602764487?</p><p style=\"white-space: normal;\"><span style=\"font-size: 17px; font-family: 宋体;\">人人主页：</span>http://page.renren.com/600435535?ref=history</p><p><br></p></div>'),(10,'街舞社','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6C6ibGiavVJfAYL1OovPg1GHZicNrzXIyQZMIkf2RickVXwFw/0','清华大学学生街舞社起源于2005年由清华校园内一群热爱街舞的同学组成的清华街舞队。秉承街舞文化积极拼搏、乐观自由的精神，街舞社为清华学子提供了一个展现青春、释放活力的平台。','<div class=\"text\"><p><span style=\"font-family:宋体;\">协会简介：</span></p><p style=\"background:white;text-align:left;line-height:23px;\"><span style=\"font-family:宋体;\">清华大学学生街舞社起源于</span><span style=\"\">2005</span><span style=\"font-family:宋体;\">年由清华校园内一群热爱街舞的同学组成的清华街舞队。经过不断积累与发展，清华大学学生街舞社（以下简称</span><span style=\"\">“</span><span style=\"font-family:宋体;\">街舞社</span><span style=\"\">”</span><span style=\"font-family:宋体;\">）于</span><span style=\"\">2009</span><span style=\"font-family:宋体;\">年正式成立。秉承街舞文化积极拼搏、乐观自由的精神，街舞社为清华学子提供了一个展现青春、释放活力的平台。</span><span style=\"color:black;font-family:宋体;\">目前社团有社员两百余人，核心骨干三十余人，有四支队伍（</span><span style=\" color:black  \">hiphop</span><span style=\"color:black;font-family:宋体;\">，</span><span style=\" color:black  \">jazz</span><span style=\"color:black;font-family:宋体;\">，</span><span style=\" color:black  \">poppin</span><span style=\"color:black;font-family:宋体;\">，</span><span style=\" color:black  \">breakin</span><span style=\"color:black;font-family:宋体;\">）。</span></p><p><span style=\"font-family:宋体;\">经过多年发展，街舞社已经成为清华校内最具知名度的艺术类社团之一，街舞社的成员活跃在校内外各大舞台上，展现清华学子不为人所知的独特一面。同时，清华街舞社又保持了清华人自强不息、厚德载物的传承，清华街舞人用刻苦和专一经历汗水和伤痛，用自己灵动而又稳重的脚步舞动人生的篇章。</span></p><p><span style=\"\"> </span></p><p><span style=\"font-family:宋体;\">协会活动：</span></p><p style=\"background:white;text-align:left;line-height:23px;\"><span style=\"color:black;font-family:宋体;\">日常训练：每周二至周五的晚上</span><span style=\" color:black  \">9:00</span><span style=\"color:black;font-family:宋体;\">之后在万人地下舞房由队长带领进行分舞种的基础训练，每个舞种每周训练一次，社员可根据兴趣自由选择参加。</span></p><p style=\"background:white;text-align:left;line-height:23px;\"><span style=\"color:black;font-family:宋体;\">导师上课：周六和周日请国内顶尖的街舞文化传播公司（如舞佳舞，嘉禾舞社等）的老师为社员提供提高训练，带来接触了解街舞顶尖水平的绝佳机会。</span></p><p style=\"background:white;text-align:left;line-height:23px;\"><span style=\"color:black;font-family:宋体;\">比赛和演出：组织社员参与校内各大活动演出和北京高校高水平街舞赛事，从参加比赛开始每次高校街舞赛事都取得了良好的成绩。</span></p><p style=\"background:white;text-align:left;line-height:23px;\"><span style=\" color:black  \"> </span></p><p style=\"background:white;text-align:left;line-height:23px;\"><span style=\"color:black;font-family:宋体;\">协会荣誉：</span></p><p><span style=\"\">2012</span><span style=\"font-family:宋体;\">年全国啦啦操联赛（北京站）</span><span style=\"font-family:宋体;\">大学组街舞</span><span style=\"\">2</span><span style=\"font-family:宋体;\">级（混合）</span><span style=\"font-family:宋体;\">第一名</span></p><p><span style=\"\">2012</span><span style=\"font-family:宋体;\">年全国啦啦操联赛（北京站）</span><span style=\"font-family:宋体;\">大学组爵士无级别（全女）</span><span style=\"font-family:宋体;\">第一名</span></p><p><span style=\"\">2012</span><span style=\"font-family:宋体;\">年</span><span style=\"\">“UR</span><span style=\"font-family:宋体;\">杯</span><span style=\"\">”</span><span style=\"font-family:宋体;\">北京市高校街舞挑战赛</span><span style=\"font-family:宋体;\">吉利大学站分站赛冠军</span><span style=\"font-family:宋体;\">总决赛最佳人气奖</span></p><p><span style=\"\"> </span></p><p><span style=\"font-family:宋体;\">联系方式：</span></p><p style=\"background:white;text-align:left;line-height:23px;\"><span style=\"color:black;font-family:宋体;\">邮箱：</span><span style=\" color:black  \"> </span><span style=\" color:#634A3B  \">tsinghua5dk@163.com</span></p><p style=\"background:white;text-align:left;line-height:23px;\"><span style=\"color:black;font-family:宋体;\">人人主页：清华街舞</span><span style=\" color:black  \">DK5</span></p><p style=\"background:white;text-align:left;line-height:23px;\"><span style=\" color:black  \"> </span></p><p style=\"background:white;text-align:left;line-height:23px;\"><span style=\"color:black;font-family:宋体;\">街舞是一项热情，自由，健康的运动，也是一门表达自身情感和深刻含义的艺术，在舞蹈中相互认识交流，培养默契，锻炼身体，我们期待你的加入！</span></p><p></p></div>'),(11,'吉他爱好者协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6DIZL7PxGw73P4Ribs64yCrfOQ5YiaCicZNvExvgicibesou6g/0','清华大学学生吉他协会（简称“吉协”）成立于1995年，协会始终坚持以兴趣为主导，努力服务广大吉他和现代音乐爱好者，不仅帮助校内吉他爱好者学习吉他演奏技巧，而且介绍现代音乐，普及吉他弹奏，欣赏和选购等相关知识，提高同学对音乐的欣赏水平。','<div class=\"text\"><p><span style=\"line-height:127%;font-family:宋体\">成立于1995年，历史悠久，人数众多，男女比例平衡，是清华所有音乐爱好者、思维奔逸者、精力旺盛者和情感受挫者的乐园。</span><strong style=\"line-height:127%\"><span style=\"line-height:127%;font-family:宋体\"><br></span></strong></p><p><strong style=\"line-height:127%\"><span style=\"line-height:127%;font-family:宋体\"><br></span></strong></p><p><strong style=\"line-height:127%\"><span style=\"line-height:127%;font-family:宋体\">协会简介：</span></strong><br></p><p style=\"line-height:27px;margin-top:8px;\"><strong><span style=\"font-family:宋体;font-size:16px\">清华大学学生吉他协会</span></strong><span style=\"font-family:宋体;font-size:16px\">（简称“吉协”）成立于1995年，协会始终坚持以兴趣为主导，努力服务广大吉他和现代音乐爱好者，不仅帮助校内吉他爱好者学习吉他演奏技巧，而且介绍现代音乐，普及吉他弹奏，欣赏和选购等相关知识，提高同学对音乐的欣赏水平。协会开展大量教学演出等活动，为各种水平的会员提供发展自身兴趣爱好的方便条件。协会的代表性活动之一露天音乐节于每年5月份在紫荆操场举办，每次音乐节的规模在10至15支乐队，持续时间5小时左右，观众人数达500人以上。</span></p><p><br></p><p style=\"line-height:127%\"><strong><span style=\"line-height:127%;font-family:宋体;font-size:16px\">品牌活动：</span></strong></p><ul style=\"list-style-type:disc\"><li><p><strong><span style=\"font-size:16px\">弦舞</span></strong><strong><span style=\"line-height:127%;font-family:宋体;font-size:16px\">露天音乐节——</span></strong><span style=\"line-height:127%;font-family:宋体;font-size:16px\">露天音乐节于每年5月份在紫荆操场举办。每次音乐节规模在10至15支乐队，持续时间5小时左右，观众人数达500人以上。我们每年都会邀请<strong>校内、校外、地下、民间、各大唱片公司</strong>的<strong>大牌小牌以及潜力乐队</strong>参与。曾经登台演出的乐队包括：<strong>刺猬、水木年华、南无、梁晓雪、坡上村、发射器、八方、平衡木</strong>等等。</span></p><p><br></p></li><li><p><strong style=\"line-height:127%\"><span style=\"line-height:127%;font-family:宋体\">弦舞序章——</span></strong><span style=\"line-height:127%;font-family:宋体\">每年秋季学期我们都会举办一个小型室内摇滚音乐节，为校内乐队提供演出机会，并为来年的弦舞露天摇滚音乐节选拔演出乐队。</span></p><p><br></p></li><li><p><span style=\"font-size:13px\"><span style=\"line-height:20px;font-size:16px\"><span style=\"font-family:宋体\"><strong>沐音音乐会——</strong>吉协每月都会在清华科技园演绎吧举行小型不插电音乐会。汇聚清华校内和周边所有<strong>奇特却有趣</strong>的音乐同学参与演出。</span></span></span></p><p><br></p></li><li><p><span style=\"font-size:13px\"><span style=\"line-height:20px;font-size:16px\"><span style=\"font-family:宋体\"><strong>每周一鉴&amp;<strong style=\"line-height:20px;font-family:宋体\">推荐演出</strong><strong style=\"line-height:20px;font-family:宋体\">——</strong></strong>每周，我们的音乐Geek都会给你带来不一样的音乐推荐，帮助每一位同学都能成为品味出众的音乐爱好者。同时我们会一起看<span style=\"line-height:20px;font-family:宋体\">Rock、Jazz、Folk等各种各样的Live。</span></span></span></span></p><p><br></p></li><li><p><span style=\"font-size:13px\"><span style=\"line-height:20px;font-size:16px\"><span style=\"font-family:宋体\"><strong><span style=\"line-height:20px\"><span style=\"line-height:20px\">乐队专访<strong style=\"line-height:20px;font-family:宋体\">——</strong></span></span></strong><span style=\"line-height:20px\"><span style=\"line-height:20px\">我们采访校内知名乐队、音乐人。我们采访周边知名乐队、音乐人。我们采访圈内知名乐队、音乐人。我们采访你所感兴趣的所有知名乐队、音乐人。</span></span></span></span></span></p><p><span style=\"font-size:13px\"><span style=\"line-height:20px;font-size:16px\"><span style=\"font-family:宋体\"><strong><span style=\"line-height:20px\"><span style=\"line-height:20px\"></span><br></span></strong></span></span></span></p></li><li><p><span style=\"font-size:13px\"><span style=\"line-height:20px;font-size:16px\"><span style=\"font-family:宋体\"><strong><span style=\"line-height:20px\"><span style=\"line-height:20px\"><span style=\"line-height:20px\">大牌合演<strong style=\"line-height:20px;font-family:宋体\">——</strong></span></span></span></strong></span></span></span><span style=\"font-family:宋体\">2010</span><span style=\"font-family:宋体\">年5月吉他协会40人参加“五月天”北京工人体育场演唱会，担任《人生海海》集体吉他伴奏。2012年五月吉协30人参与“五月天”工体演唱会，一共演出两首曲目。</span></p></li></ul><p><span style=\"color:#222222\"><br></span>欢迎关注清华吉协</p><p>微信帐号：清华大学吉他协会</p><p>人人主页：清华吉他协会<br></p><p>微博帐号：清华吉他协会</p></div>'),(12,'口琴协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6BlcPtTWTLMVSwECvXiaB1icsfSM7icRAsTgqcvic6b7YABpg/0','清华大学口琴协会成立于2010年。“口袋里的钢琴，旅途中的旋律”自2010年清华大学学生口琴协会成立以来，每年都吸引了大批校内外同学加入口琴爱好者的队伍。','<div class=\"text\"><p><br></p><p>清华大学口琴协会成立于2010年。“口袋里的钢琴，旅途中的旋律”自2010年清华大学学生口琴协会成立以来，每年都吸引了大批校内外同学加入口琴爱好者的队伍。来自北京大学的口琴推广家，曾师从于口琴大师杨敬民的田野女士和零字班的徐培迪同学免费为同学们授琴，目前有半音阶和复音两种课程。口琴协会还有两支高水平乐队，“sunny”和“windy”。他们多次在社团文化节或各大高校的晚会中演出。口琴零基础？没关系！老会员将毫无保留的帮助新会员，让新会员尽快体验到口琴演奏的快感。 协会目前设有：组织部、常务部、宣传部、技术部四大部门，为口琴社的良好运转提供了保障。此外还有很多精彩活动等你来参加！</p></div>'),(13,'电影协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6CrmrNv8KQibcEmu5q9VtLJH4JyWRD789Z42xD84iaFgMUA/0','清华大学影视欣赏与评论协会成立于1992年，以推广优秀影片，提高同学影视鉴赏力，提升同学人文素养为宗旨，现在会员510多人，骨干成员40余人。','<div class=\"text\"><p><strong>协会简介</strong></p><p> &nbsp; &nbsp; <span style=\"font-size:14px;font-family:宋体;color:black\">清华大学影视欣赏与评论协会成立于</span><span style=\"font-size:14px ;color:black \">1992</span><span style=\"font-size:14px;font-family:宋体;color:black\">年，以推广优秀影片，提高同学影视鉴赏力，提升同学人文素养为宗旨，现在会员</span><span style=\"font-size:14px ;color:black \">510</span><span style=\"font-size:14px;font-family:宋体;color:black\">多人，骨干成员</span><span style=\"font-size:14px ;color:black \">40</span><span style=\"font-size:14px;font-family:宋体;color:black\">余人。协会成立以来曾获</span><span style=\"font-size:14px ;color:black \">“</span><span style=\"font-size:14px;font-family:宋体;color:black\">清华大学十佳协会</span><span style=\"font-size:14px ;color:black \">”</span><span style=\"font-size:14px;font-family:宋体;color:black\">，</span><span style=\"font-size:14px ;color:black \">“</span><span style=\"font-size:14px;font-family:宋体;color:black\">清华大学最快进步协会</span><span style=\"font-size:14px ;color:black \">”</span><span style=\"font-size:14px;font-family:宋体;color:black\">，</span><span style=\"font-size:14px ;color:black \">“</span><span style=\"font-size:14px;font-family:宋体;color:black\">清华大学十佳协会活动</span><span style=\"font-size:14px ;color:black \">”</span><span style=\"font-size:14px;font-family:宋体;color:black\">等多个奖项。在校内拥有很高人气。我们的活动有每周一次的常规放映及讨论，各种主题电影月，电影周等，还有不定期的影视鉴赏，影视制作讲座，以及独立拍摄活动。</span> </p><p><br></p><p><strong>品牌活动</strong></p><ul style=\"list-style-type:disc;\"><li><p>猎梦观影 协会在每周六晚6点半都会放映精心挑选的影片。这些影片往往思想性、观赏性俱佳。在放映后，协会会组织学生进行深入的讨论。会员们往往会携带一些DVD前来，在映后互相交换，形成良好的交流氛围。</p><p><br></p></li><li><p>猎梦影刊 猎梦影刊创立于2004年，是一本主要刊载协会会员影评以及影视活动信息的刊物，以一个季度为发行周期。</p><p><br></p></li><li><p>猎梦学生短片大赛 活动于今年新创立，征片起于4月，闭幕于11月。活动旨在通过各种丰富的讲座活动，提升学生的影视制作水平，帮助他们创作出自己的短片。</p></li></ul><p><br></p><p><strong>联系方式：</strong></p><ul style=\"list-style-type:disc;\"><li><p>邮箱：<span style=\"color:#000000;\">thamovie@tsinghua.org.cn</span>，可发送申请入会的邮件。</p></li><li><p>人人网账号：“清华影视协会”，可留言申请入会。</p></li></ul><p>注：只有清华在读学生才具有官方认可的正式会员资格。</p><p><br></p><p><br></p></div>'),(14,'摄影协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6C6ibGiavVJfAYL1OovPg1GHZXWN7RLeaCRo20sNiaBXFQ1g/0','“我们用一只眼睛观察外面的世界，用另一只眼睛观察自己的心灵。”摄影不仅是一个简单地按下快门的动作，而是两个世界的交流。在光影中，让我们一起走过。','<div class=\"text\"><p><strong>协会简介</strong>：</p><p style=\"text-align:left;text-indent:14px;\"><span style=\"font-family:楷体_gb2312;font-size:16px;\"> &nbsp;“我们用一只眼睛观察外面的世界，用另一只眼睛观察自己的心灵。”摄影不仅是一个简单地按下快门的动作，而是两个世界的交流。在光影中，让我们一起走过。</span></p><p style=\"text-align:left;text-indent:14px;\"><span style=\"font-family:楷体_gb2312;font-size:16px;\"> &nbsp; 摄影协会长期为同学们提供各类摄影相关活动。摄影基础讲座旨在向更多的同学介绍摄影基本审美和技术；外拍实践活动由协会和艺术团摄影部一起组织，为同学们提供大量拍摄实践的机会；各种主题观片会为同学们搭建了一个交流摄影技术与思想的平台；各种摄影展览、摄影比赛则为同学们提供了更多展示自己的机会，不光是摄影，我们还为清华同学提供展示自我的舞台，通过摄影师的镜头，我们为各个组织做宣传，可以说清华大学摄影协会是人们了解清华学生的窗口。同时，我们每学期还邀请知名摄影大师为同学们开阔眼界。</span></p><p><span style=\"font-family:楷体_gb2312;font-size:16px;\"> &nbsp; &nbsp;摄影协会的同学们活跃在校园的各个角落，每一天学校里拍摄的同学绝大多数都是我们的会员，与学校各部门和组织都有着良好的合作关系，通过帮助学通社、社团部等拍摄纪实照片。不光是纪实，协会成员在生活的基础上进行着创作，已经举办过难以计数的摄影展。</span><span style=\"font-size:16px;\"> </span></p><p> &nbsp; &nbsp; &nbsp;<br></p><p><strong>品牌活动：</strong> &nbsp; </p><ul style=\"list-style-type:disc;\"><li><p style=\"text-align:left;\"><span style=\"font-family:楷体_gb2312;\">影像讲堂 &nbsp;</span><span style=\"font-family:楷体_gb2312;\">协会每学期都会邀请知名摄影大师为同学们举办讲座，开阔眼界，领略当代大师风采。</span></p></li><li><p style=\"text-align:left;\"><span style=\"font-family:楷体_gb2312;\">人像外拍</span><span style=\"font-family:楷体_gb2312;\"> &nbsp;协会每学期举行一次面向全校的人像外拍活动，征集模特与摄影师，提高同学的人像摄影水平。</span></p></li><li><p style=\"text-align:left;\"><span style=\"font-family:楷体_gb2312;\">春</span><span>/</span><span style=\"font-family:楷体_gb2312;\">秋季外拍</span><span style=\"font-family:楷体_gb2312;\"> &nbsp;协会在清明</span><span>/</span><span style=\"font-family:楷体_gb2312;\">五一</span><span>/</span><span style=\"font-family:楷体_gb2312;\">十一会组团去近京地区进行风光摄影，如坝上，青龙峡等。</span></p></li><li><p style=\"text-align:left;\"><span style=\"font-family:楷体_gb2312;font-size:14px;\">摄影比赛</span><span style=\"font-family:楷体_gb2312;font-size:14px;\"> &nbsp;面向全校举行高水平的摄影大赛，</span><span style=\"font-size:14px;\">2013</span><span style=\"font-family:楷体_gb2312;font-size:14px;\">年春季学期比赛暂定名“看不见的</span><span style=\"font-size:14px;\">____</span><span style=\"font-family:楷体_gb2312;font-size:14px;\">”预计四月下旬启动。</span> </p></li></ul><p> </p><p><strong>联系方式：</strong></p><ul style=\"list-style-type:disc;\"><li><p style=\"text-align:left;\"><span style=\"font-family:楷体_gb2312;font-size:16px;\">人人网公共主页：清华大学学生摄影协会</span></p></li><li><p><span style=\"font-size:16px;\"> &nbsp;</span><span style=\"font-family:楷体_gb2312;font-size:16px;\">人人网小站：清华大学学生摄影协会</span></p></li></ul></div>'),(15,'艺术与设计协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6CJ2xYicbQO68XmpTd7n63F1TrWwf2kszIXwDzicdQ3CqZA/0','清华大学学生艺术与设计协会，英文全称 Art and Design Association ，简称AADA。','<div class=\"text\"><p>清华大学学生艺术与设计协会，英文全称 Art and Design Association ，简称AADA。于2003年4月在清华大学注册成立，挂靠单位为清华大学美术学院工业设计系，指导教师为蒋红斌。清华大学学生艺术与设计协会是一支致力于在学生与院系之间、学生与社会之间进行以艺术与设计为核心的交流与研讨活动的社团组织。<br></p></div>'),(16,'越剧协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6BMH0KA19ReRhFgbhWfLvJuWpCM4icJNwOzV40ricib9LRnA/0','我们是一群越剧的爱好者，是优美的越剧让我们走到了一起。我们的宗旨在于弘扬越剧文化，普及越剧知识，让更多的人了解越剧、欣赏越剧，让所有爱好、关心越剧的年轻人拥有一个温馨的家园。','<div class=\"text\"><p style=\"white-space: normal; line-height: 24px; \"><strong><span style=\"font-family: 宋体; \"></span></strong></p><p style=\"white-space: normal; line-height: 24px; \"><strong><span style=\"font-family: 宋体; \">协会概要</span></strong><span style=\"font-size: 21px; line-height: 31px; font-family: 宋体; \">:</span></p><p style=\"white-space: normal; line-height: 24px; \"><span style=\"font-size: 21px; line-height: 31px; font-family: 宋体; \">&nbsp;&nbsp;</span><span style=\"font-family: 宋体; \">&nbsp;&nbsp;</span><span style=\"font-family: 宋体; \">我们是一群越剧的爱好者，是优美的越剧让我们走到了一起。2001年我们成立了自己的越剧协会，2002年，协会正式成为清华大学注册的协会社团。我们的宗旨在于弘扬越剧文化，普及越剧知识，让更多的人了解越剧、欣赏越剧，让所有爱好、关心越剧的年轻人拥有一个温馨的家园。真诚欢迎大家加入我们这个集体，一起分享快乐、一起感悟艺术。</span></p><p style=\"white-space: normal; text-indent: 32px; line-height: 24px; \"><span style=\"font-family: 宋体; \">加入协会不限性别、籍贯，不限年龄、学校，不需任何演唱或表演基础，不论你的目的在于纯粹地欣赏越剧之美、与同好互相交流，或是粉墨登台自我展现，越剧协会都将为你提供一片广阔的天地。</span></p><p style=\"white-space: normal; line-height: 24px; \"><span style=\"font-family: 宋体; \">&nbsp;&nbsp;&nbsp;</span></p><p style=\"white-space: normal; line-height: 24px; \"><strong><span style=\"font-family: 宋体; \">经典活动</span></strong><span style=\"font-size: 21px; line-height: 31px; font-family: 宋体; \">:</span></p><p style=\"white-space: normal; line-height: 24px; \"><span style=\"font-family: 宋体; \">2008</span><span style=\"font-family: 宋体; \">年5月，蒙楼多功能厅——越剧协会第三届专场演出！</span></p><p style=\"white-space: normal; line-height: 24px; \"><span style=\"font-family: 宋体; \">2009</span><span style=\"font-family: 宋体; \">年5月，越剧协会第四届专场演出，清华大学十佳活动！</span></p><p style=\"white-space: normal; line-height: 24px; \"><span style=\"font-family: 宋体; \">2011</span><span style=\"font-family: 宋体; \">年5月，越剧协会成立十周年专场！</span></p><p style=\"white-space: normal; line-height: 24px; \"><span style=\"font-family: 宋体; \">2012</span><span style=\"font-family: 宋体; \">年10月，越剧协会第六届专场演出！</span></p><p style=\"white-space: normal; line-height: 24px; \"><span style=\"font-family: 宋体; \">2012</span><span style=\"font-family: 宋体; \">、2013两届清华大学新年晚会都有我们演出的身影！</span></p><p style=\"white-space: normal; line-height: 24px; \"><span style=\"font-family: 宋体; \">协会每周进行基本功训练、排戏、欣赏等活动，每一到两年据办一次专场，与北京、上海、浙江各大票友团体、戏曲协会保持紧密联系，参与学校社团文化节开闭幕式、新年晚会的演出，不定期组织戏曲欣赏、暑期实践等活动。邀请或走访了傅全香、徐玉兰、吕瑞英、钱惠丽、赵志刚、方亚芬、张咏梅等越剧名家，与优秀青年演员郭茜云、齐春雷等进行交流，现场观摩了《家》、《蝴蝶梦》、《陆游与唐婉》、《赵氏孤儿》、《西厢记》等一系列名剧，与茅威涛、王君安等众多越剧名家面对面交流，还曾多次参加中央电视台的戏曲节目。</span></p><p style=\"white-space: normal; line-height: 24px; \"><strong><span style=\"font-family: 宋体; \">&nbsp;</span></strong></p><p style=\"white-space: normal; line-height: 24px; \"><strong><span style=\"font-family: 宋体; \">所获荣誉</span></strong><span style=\"font-size: 21px; line-height: 31px; font-family: 宋体; \">:</span></p><p style=\"white-space: normal; line-height: 24px; \"><span style=\"font-size: 21px; line-height: 31px; font-family: 宋体; \">&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: 宋体; \">清华越协于2003、2004、2005、2006连续四年蝉联清华大学十佳协会，2008年再次获得十佳协会称号，多次获得素拓金奖，优秀文艺类社团称号。暑期实践中的纪录片作品《&lt;家&gt;里的青春故事》在清华大学社会实践评比中获得十佳优秀纪录片的称号。</span></p><p style=\"white-space: normal; line-height: 24px; \"><span style=\"font-family: 宋体; \">&nbsp;</span></p><p style=\"white-space: normal; line-height: 24px; \"><strong><span style=\"font-family: 宋体; \">协会参与</span>2013<span style=\"font-family: 宋体; \">清华大学新年晚会的演出照片</span></strong><br></p><p style=\"white-space: normal; line-height: 24px; \">&nbsp;<strong>2012<span style=\"font-family: 宋体; \">年第六届专场演出大合影</span></strong><br></p><p style=\"white-space: normal; line-height: 24px; \"></p><p style=\"white-space: normal; line-height: 24px; \"><strong>2012<span style=\"font-family: 宋体; \">年暑期赴上海越剧院考察，与著名越剧艺术家吕瑞英老师合影留念</span></strong><br></p><p style=\"white-space: normal; \"><br></p><h1 id=\"activity-name\" style=\"white-space: normal; \">如果你喜欢我们的内容，不要忘记分享给朋友们哟~【校团委社团部】</h1><p style=\"white-space: normal; \"><span style=\"font-size: 17px; font-family: 宋体; \"></span></p><p style=\"white-space: normal; \"><span style=\"font-size: 17px; font-family: 宋体; \">独乐乐不如众乐乐，如果你喜欢我们的内容，那就推荐身边的同学一起关注吧</span>~</p><p style=\"white-space: normal; \"><br>&nbsp; &nbsp;<span style=\"font-size: 17px; font-family: 宋体; \">如果你觉得我们的内容有趣实用，请动一动食指，点击右上角</span>“<span style=\"font-size: 17px; font-family: 宋体; \">分享至朋友圈</span>”<span style=\"font-size: 17px; font-family: 宋体; \">分享给朋友们吧</span>~~</p><p style=\"white-space: normal; \"><br><span style=\"font-size: 17px; font-family: 宋体; \">【清华大学社团协会】</span></p><p style=\"white-space: normal; \"><span style=\"font-size: 17px; font-family: 宋体; \">官方邮箱：</span>shetuan@mail.tsinghua.edu.cn</p><p style=\"white-space: normal; \"><span style=\"font-size: 17px; font-family: 宋体; \">新浪微博：</span>http://e.weibo.com/u/2602764487?</p><p style=\"white-space: normal; \"><span style=\"font-size: 17px; font-family: 宋体; \">人人主页：</span>http://page.renren.com/600435535?ref=history</p><p><br></p></div>'),(17,'京剧昆曲爱好者协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6Dd9yPH6RpH5dicjwqchhKJBhy7J1SmiaIUM1Ldh0sta71A/0','清华大学学生京剧昆曲爱好者协会成立于1994年，以在清华园内传播京剧、昆曲艺术为目的。协会现有会员五十余人，通过举办讲座、演出、沙龙、赏析、外出看戏等形式让同学们接触京剧昆曲，体验传统艺术的魅力。','<div class=\"text\"><p><strong>协会简介：</strong></p><p> &nbsp; &nbsp; &nbsp; &nbsp;清华大学学生京剧昆曲爱好者协会成立于1994年，以在清华园内传播京剧、昆曲艺术为目的。协会现有会员五十余人，通过举办讲座、演出、沙龙、赏析、外出看戏等形式让同学们接触京剧昆曲，体验传统艺术的魅力。</p><p> &nbsp; &nbsp; &nbsp; &nbsp;戏曲艺术源远流长，有近千年的悠久历史，经历了长时间的发展和众多著名艺术家的共同努力，取得了举世瞩目的艺术成就。京剧、昆曲作为戏曲艺术的集大成者，涌现出了众多的表演大师和优秀剧目。由于种种特殊原因，近二十年来这两门伟大的艺术陷入了低谷，但同时，京昆艺术在清华园内有着良好的传统，京剧泰斗刘曾复先生、京剧表演艺术家胡芝风等诸多戏曲大师都曾在清华学习生活过，在这样的背景下，清华京昆协会有责任在清华园里延续传统。</p><p> &nbsp; &nbsp; &nbsp; &nbsp;京昆协会自成立以来，全体会员通力合作，取得了许多荣誉。在北京市举办的第二届中青年京剧演唱大赛上，京昆协会的同学代表清华获得两个三等奖，并获得组织奖。全国大学生京剧大奖赛上，京昆协会的同学多次荣获一等奖、二等奖。在第二届北京市大学生艺术展演活动戏剧专场和第三届全国戏迷票友大赛中，京昆协会的同学都荣获了二等奖。2006年6月，协会获得“清华大学学生优秀协会”称号。2008年，协会获得“首都高校优秀学生社团”称号</p><p> </p><p><strong> </strong></p><p><strong>主要活动</strong>：</p><p> &nbsp; &nbsp; &nbsp; &nbsp;京昆协会的主要活动包括日常的票房、赏析、沙龙、教学，面向全校组织的知识普及与赏析讲座报告、联系专业剧团演出，邀请专业老师进行演出指导，近距离的观摩交流等活动。同时，“京昆文化节”是京昆协会的一项代表活动，每年举行，并且在校园内引起了良好的反响。</p><p><br></p><p><strong>协会近年来大型活动</strong></p><ul style=\"list-style-type:disc;\"><li><p>2006年，京昆文化节之“文缘艺粹”——上海昆剧院《伤逝》清华专场</p></li><li><p>2007年，京昆文化节之王振义昆曲讲座</p></li><li><p>2007年，京昆文化节之北京京剧院专场</p></li><li><p>2007年，京昆文化节之《牡丹亭》清华专场</p></li><li><p>2008年，京昆文化节之梅派乾旦胡文阁谈梅兰芳表演艺术</p></li><li><p>2009年，“走进昆山”之昆曲演出</p></li></ul><p><br></p></div>'),(18,'古琴社','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6Dd9yPH6RpH5dicjwqchhKJBKAvLU3kPiafhbc7v9hDWxQw/0','清华大学学生古琴社，于2007年2月成立。成立三年来，在“以琴会友，以友辅仁”的宗旨指导下，在“学习和弘扬古琴文化，在提高个人修养，支持校园文化建设”的发展目标推动下，古琴社从成立之初只有十余人的小团体，发展成清华校内，甚至在北京高校琴界极具影响力的社团。','<div class=\"text\"><p><strong>协会简介</strong></p><p> &nbsp; &nbsp; &nbsp; &nbsp;清华大学学生古琴社，于2007年2月成立。成立三年来，在“以琴会友，以友辅仁”的宗旨指导下，在“学习和弘扬古琴文化，在提高个人修养，支持校园文化建设”的发展目标推动下，古琴社从成立之初只有十余人的小团体，发展成清华校内，甚至在北京高校琴界极具影响力的社团。古琴社先后邀请李祥霆、张子盛、吴钊、林友人等著名古琴演奏家来校举办音乐会；围绕着古琴的历史，传承，审美，音律等各方面主题，前后近20位著名研究者来校开展文化讲座；同时，琴社更注重对社员的培养，雅集、琴课、练琴会、读书会的开展，使社员从琴技与琴文化两方面都得到了提升，加强了在校琴友间的学习与交流。琴社曾先后荣获“最佳新协会”与“十佳协会”的称号。</p><p><br></p><p><strong>主要活动</strong></p><ul style=\"list-style-type:disc;\"><li><p>古琴文化系列讲座</p></li></ul><p> &nbsp; &nbsp; &nbsp; &nbsp;第一期 &nbsp; 吴钊：古琴与中国文化</p><p> &nbsp; &nbsp; &nbsp; &nbsp;第二期 &nbsp; 茅毅：古琴与传统文化在当代的表达</p><p> &nbsp; &nbsp; &nbsp; &nbsp;第三期 &nbsp; 吴文光：古琴艺术与吴派琴曲</p><p> &nbsp; &nbsp; &nbsp; &nbsp;第四期 &nbsp; 李祥霆：怎样认识古琴艺术</p><ul style=\"list-style-type:disc;\"><li><p>音乐科学与美学系列讲座</p></li></ul><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;“音乐科学与美学系列讲座”是清华大学学生古琴社立足于清华学术特色而开展的一系列讲座活动。活动以磅礴大气、悠远深邃的古琴传统音乐为视觉窗口，将广泛的音乐艺术背后所蕴含的深刻科学思想与美学原理传达给清华学子，以使听众达到以理性的思维审视音乐之律，用人文的情怀感悟节奏之美，以全新的视角窥视音乐中逻辑与灵性的契合。</p><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;第一场（2009.4.10）姜夔：探秘音律中的奇妙数理</p><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;第二场（2009.5.15）王鹏：探讨古琴结构理性与审美思辨</p><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;第三场（2009.11.4）周海宏：音乐心理学</p><ul style=\"list-style-type:disc;\"><li><p>古琴演奏音乐会</p></li></ul><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2008.12.6“七弦心语”——李祥霆琴与箫即兴演奏音乐会</p><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2009.12.5“薪传太古”——张子盛师生古琴音乐会</p><p><br></p><p><strong>联系方式</strong></p><ul style=\"list-style-type:disc;\"><li><p>公共邮箱：qinghuaguqin@gmial.com</p></li><li><p>人人主页：http://www.renren.com/woaiguqin</p></li><li><p>琴社网站：http://topics.cic.tsinghua.edu.cn/09201/column2109201.jsp</p></li><li><p>QQ 群：126926969</p></li></ul><p><br></p></div>'),(20,'紫荆志愿者服务总队','http://www.tsinghua.edu.cn/publish/xtw/4810/4810/zijingzongdui2.jpg','清华大学紫荆志愿者服务总队，以“自我实践、服务他人、自我教育、推动社会”为宗旨，坚持立足校园、辐射社区、面向社会的原则，深入开展具有清华特色的丰富多彩的大学生志愿活动。','<p style=\"text-align: center\">欢迎关注“紫荆志愿”</p>\r\n            <div style=\"font-weight: bold\">\r\n\r\n                <p>【微信平台】：@清华大学紫荆志愿者服务总队</p>\r\n                <p>【人人主页】：@紫荆志愿</p>\r\n                <p>【邮箱】：zhiyuanzhe@mail.tsinghua.edu.cn</p>\r\n                <p>【飞信】：18810356976</p>\r\n            </div>\r\n\r\n            \r\n            <p>清华大学将鼓励学生参加志愿活动作为促进学生全面发展的工作重点之一，学校面向全体学生，在全校大力推进青年学生的志愿工作，全面提升清华学生的志愿公益意识。在这样的理念指引下，清华大学紫荆志愿者服务总队，\r\n                以“自我实践、服务他人、自我教育、推动社会”为宗旨，坚持立足校园、辐射社区、面向社会的原则，深入开展具有清华特色的丰富多彩的大学生志愿活动。经过多年的实践，紫荆志愿者服务总队已经构建起了适应社会不同需要的多层次志愿服务岗位，全面促进学生良好道德品质和健全人格的形成，取得了显著的效果。</p>\r\n <p>清华大学在上世纪七十年代就通过开设义务劳动课，将志愿服务引入第一课堂。1991年，以八十周年校庆为契机，清华大学团委筹建“学生紫荆义务服务总队”，此为清华大学紫荆志愿者服务总队的前身。</p>\r\n <p>经过了五年的发展，1996年10月31日，“清华大学紫荆志愿者服务总队”誓师大会暨《清华大学学生文明公约》签约仪式在大礼堂前广场隆重举行，标志着“清华大学紫荆志愿者服务总队”（以下简称“紫荆总队”）正式成立。依托于基层院系的各个紫荆志愿者支队也相继建立。2002年12月，全国第一支完全由研究生组成的志愿者队伍——清华大学紫荆志愿者总队研究生服务团成立。</p>\r\n <p>2006年8月，紫荆总队自主开发了紫荆志愿者注册认证系统，依托先进的信息技术对志愿者资料和志愿活动进行全面系统的记录和管理。截止到2010年12月，紫荆志愿者注册总人数达到18344人。此外，学校每年拨出专项经费支持志愿公益类素质拓展项目，鼓励班级、团支部、紫荆志愿者支队开展志愿服务活动；设立志愿公益单项奖学金，奖励在当年志愿服务工作中表现突出的志愿者个人；开展院系紫荆志愿者支队年度评优，促进基层志愿者组织积极、健康、有序发展，带动全校志愿工作不断迈上新的台阶。</p>\r\n <p>目前，紫荆总队本着立足校园、辐射社区、面向社会的原则，通过树立校园、社区、社会三个层面多样化、长期化的品牌项目，不断扩大自身影响力，为广大清华同学参与志愿服务搭建坚实而广阔的平台。立足校内，充分发挥清华学生们的才能和创造性，鼓励学生之间相互支持，相互扶助，关心身边的朋友和校园环境，形成和谐人际关系，建设和谐校园；辐射社区，要引导学生从身边做起，从小事做起，走进学校周边社区，服务于社区居民；面向社会，引导学生利用双休日、寒暑假走进社会进行志愿服务，引领良好社会风气的形成。在时间安排上，注意日常服务与节假日大型实践相结合。</p>\r\n <p>紫荆总队不断完善志愿工作的组织体系，整合校内资源，搭建志愿服务长效机制。将基层组织细胞延伸到班级、团支部，建立“校-院（系）-班”三级管理体系。在志愿者招募、培训、资源共享、经验交流等多方面继续加强对学生志愿服务活动的指导、支持和推进。</p>\r\n <p>为响应学校“建议清华同学在校期间至少参加20个小时的志愿公益活动”的号召，总队坚持以爱国为主线，紧跟时代脉搏，坚持与时俱进，不断开拓创新，把志愿公益教育与学校对学生全面素质培养的方针紧密结合，在学校的倡导下面向全体学生，贯穿育人全程。让同学们在志愿服务“利他”的同时也能够“利己”，在建立良好人际关系的同时将个人成长与社会发展紧密联系在一起，将实现自我价值与服务祖国人民统一起来，让志愿与微笑成为清华学生习惯，让越来越多的同学亲身参与志愿服务，成为永远的志愿者，成为良好社会风尚的倡导者，成为社会主义精神文明的传播者和实践者！\r\n</p>'),(21,'时事大讲堂','http://wp3.sina.cn/woriginal/93095982jw1e2yqp9df80j.jpg','时事大讲堂帮助同学了解时事政策、理论前沿和社会热点，能够“处身校园，紧跟时代；胸怀祖国，放眼世界”。','<p style=\"text-align: center; font-size: 20px\">欢迎关注“时事大讲堂”</p>\r\n            <div style=\"font-weight: bold\">\r\n\r\n                <p>【微信平台】：@清华时事大讲堂</p>\r\n                <p>【人人主页】：@时事大讲堂</p>\r\n                <p>【新浪微博】：@清华大学时事大讲堂</p>\r\n            </div>\r\n\r\n\r\n            <p>“时事大讲堂”是由清华大学校团委宣传部主办的时事政策类报告会。它帮助同学了解时事政策、理论前沿和社会热点，为同学们搭建“处身校园，紧跟时代；胸怀祖国，放眼世界”的广阔学习交流平台。“时事大讲堂”以其“时效性”、“高端性”和“权威性”在清华校内独树一帜，受到同学们的热烈欢迎。\r\n                </p><p>\r\n“时事大讲堂”的开办得到了学校领导、老师和社会各界人士的大力支持。自2004年创办以来，“时事大讲堂”已举办讲座90余场，邀请到社会各界的杰出人士与清华师生进行交流，包括政府官员、军队将领、各领域专家学者和社会知名人士。时事大讲堂时刻紧跟时政要闻，对国内外热点话题进行分析的同时也邀请了一些在自身岗位上默默奉献的人，与同学分享他们的经验\r\n</p><p>“时事大讲堂”始终坚持服务同学的宗旨，不断创新，不断完善，已经成为清华学生关心国家民族，树立远大理想的重要平台。</p>'),(22,'学生天空工场','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6CrmrNv8KQibcEmu5q9VtLJHGM0YPeOtaBQ6FuibWC09GlQ/0','天空工场成立于2009年12月，致力成为清华校内第一科技平台，目前是校内由学生自发组织和运营的规模最大、技术最强的学生科技社团。','<div class=\"text\">                                <p> &nbsp; </p><p style=\"text-align:center;line-height:115%\"><strong><span style=\"font-size:21px;line-height:115%;font-family:宋体\">天空工场简介</span></strong></p><p style=\"text-indent:28px;line-height:115%\"><span style=\"font-family:宋体\">天空工场（</span><span style=\"font-family:宋体\">skyworks</span><span style=\"font-family:宋体\">）成立于</span><span style=\"font-family:宋体\">2009</span><span style=\"font-family:宋体\">年</span><span style=\"font-family:宋体\">12</span><span style=\"font-family:宋体\">月，致力成为清华校内第一科技平台，目前是校内由学生自发组织和运营的规模最大、技术最强的学生科技社团。天空工场下设嵌入式、未来航空、云计算三个团队（其中未来航空团队由波音公司提供赞助），共有</span><span style=\"font-family:宋体\">60</span><span style=\"font-family:宋体\">余名同学，他们分别来自自动化、精密仪器、航院、计算机、电子、材料、化工、机械、美院、经管等十多个院系。</span></p><p style=\"text-indent:28px;line-height:115%\"><span style=\"line-height:115%;font-family:宋体\">清华有这样一个科技爱好者的世外桃源，它就是C楼410。在这里，往来着各个院系的同学，做着形形色色的科技项目；在这里，每个人都是天空工场的主人；在这里，只要有想法，就可以号召一群人，马上动手去实现；在这里，每个人做的都是自己最喜欢做的事情，与成绩无关、与文章无关、与荣誉无关。</span></p><p style=\"text-indent:28px;line-height:115%\"><span style=\"line-height:115%;font-family:宋体\">天空工场招新不限院系，因为我们相信，相比起技术大牛，我们更需要有热情的人。工场更像是一个平台，在这里，清华所有爱好科技创新的同学一起努力一起成长。这里，你可以看到材料系的女生凭着对机械和编程的热爱一点点掌握了CAD软件、单片机的使用，最终做出优秀的项目。也正是这样的热爱点燃激情，晚上十二点后，在漆黑的清华里，从紫荆操场看C楼，天空工场的房间永远亮着振奋人心的灯。</span></p><p style=\"text-indent:28px;line-height:115%\"><span style=\"line-height:115%;font-family:宋体\">天工工场的每个队员都能提出新项目，并且被鼓励去实现。这里的项目进度没有强制要求，但是团队的队长会一直跟进，不断提供帮助。未来航空的飞行球项目，只是源于一个非常简单的想法，想做就做，直到现在，队员们收获的，不只是十几个版本的设计，更是丰厚的技术积累，和越来越成形的想法、越来越完善的项目。</span></p><p style=\"text-indent:29px;line-height:115%\"><span style=\"line-height:115%;font-family:宋体\">天空工场的管理制度简单，日常管理人员只有四名：辅导员，两位队长和</span><span style=\"font-family:宋体\">一名财务负责人</span><span style=\"line-height:115%;font-family:宋体\">。没有宣传部，没有外联，没有内联，没有人力，每个人都有充分的时间专注于项目。对于会议，我们坚持有事开会，无事不开，少开大会，多开小会的原则。每个月有一次大的理事会，由上述四名同学和各团队的骨干成员一起花一个小时对本月的工作进行总结以及对下个月的工作进行规划，力图解决存在的问题。对于会议的形式，我们可以坐在情人坡的大树下</span><span style=\"font-family:宋体\">回顾工场的历程</span><span style=\"line-height:115%;font-family:宋体\">，也可以在食堂边吃饭边</span><span style=\"font-family:宋体\">热烈的讨论</span><span style=\"line-height:115%;font-family:宋体\">项目的进度，还可以躺在会议室的沙发上一边喝着饮料一边畅想着天空工场的未来。</span></p><p style=\"text-indent:29px;line-height:115%\"><span style=\"line-height:115%;font-family:宋体\">天空工场还处于创业阶段，有很多不完善的地方。在天空工场的建设过程中，每一个意见都能够得到充分的尊重，建成大家的天空工场。纵然今天有各种不完善，也许会很多争论，有意见不一，甚至偶尔迷茫，失去信心，但我们相信只要执着努力，一起付出，一定可以建成一个卓越一流、创造历史的的学生科技组织。</span></p><p style=\"text-indent:29px;line-height:115%\"><span style=\"line-height:115%;font-family:宋体\">总之，这里是梦想的聚集地，无梦想，不工场。</span></p><p> &nbsp; </p><p><br></p>            </div>'),(23,'健美操协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6DvZ0iaYzhI7LKKgEJ5R7ljrJIrWGVdhGvcsnu9r95Q0EQ/0','清华大学健美操协会是面向清华师生的有氧健身啦啦操社团，常年欢迎所有热爱健身、追求健康活力的年轻人加入我们！','<div class=\"text\">                                <p><span style=\"font-size:16px;font-family:楷体_gb2312\">清华大学健美操协会是面向清华师生的有氧健身啦啦操社团，常年欢迎所有热爱健身、追求健康活力的年轻人加入我们！</span></p><span style=\"font-size:14px;font-family:楷体_gb2312\">在这里有专业的健美操运动员为大家详细指导，在这里有宽敞的健身场地供大家学习使用，在这里有更多志同道合的年轻人彼此交流。放松心情，减轻压力，让身体自由地有氧呼吸，就在这里，清华大学健美操协会。</span><p><br></p>            </div>'),(24,'滑雪协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6C6ibGiavVJfAYL1OovPg1GHZvps3HSdib2ZibibZDHSQYMOtw/0','清华雪协在近两年已组织滑雪活动125次，参与人数超过9100人次，是清华在校人数最多、组织校外活动最多的协会。','<div class=\"text\">                                <p><strong><span style=\"color:#000000;text-decoration:none;\">协会简介：</span></strong> </p><p><span style=\"font-size:15px;font-family:楷体_gb2312\"> &nbsp; &nbsp;清华雪协在近两年已组织滑雪活动</span><span style=\" font-size:15px ; ; ; ; \">125</span><span style=\"font-size:15px;font-family:楷体_gb2312\">次，参与人数超过</span><span style=\" font-size:15px ; ; ; ; \">9100</span><span style=\"font-size:15px;font-family:楷体_gb2312\">人次，会员数超过</span><span style=\" font-size:15px ; ; ; ; \">2500</span><span style=\"font-size:15px;font-family:楷体_gb2312\">人，是清华在校人数最多、组织校外活动最多的协会。</span> </p><p><span style=\"color:#000000;text-decoration:none;\"><br></span></p><p><strong><span style=\"color:#000000;text-decoration:none;\">品牌活动：</span></strong></p><p> &nbsp; </p><p><strong><span style=\"font-size:15px;font-family:楷体_gb2312\"> &nbsp; &nbsp;一年四季组织滑雪，四季如</span></strong><strong><span style=\" font-size:15px ; ; ; ; \">“</span></strong><strong><span style=\"font-size:15px;font-family:楷体_gb2312\">冬</span></strong><strong><span style=\" font-size:15px ; ; ; ; \">”</span></strong><strong><span style=\"font-size:15px;font-family:楷体_gb2312\">。</span></strong><span style=\"font-size:15px;font-family:楷体_gb2312\">冬天，会组织赴北京各大室外滑雪场滑雪（如南山、渔阳、石京龙等），而夏天还会组织去室内雪场滑雪的哟，室外</span><span style=\" font-size:15px ; ; ; ; \">30</span><span style=\"font-size:15px;font-family:楷体_gb2312\">℃室内</span><span style=\"font-size:15px;font-family:宋体\">-</span><span style=\" font-size:15px ; ; ; ; \">2℃</span><span style=\"font-size:15px;font-family:楷体_gb2312\">，消暑圣地呀</span><span style=\" font-size:15px ; ; ; ; \">~~~~ </span></p><p><strong><span style=\"font-size:15px;font-family:楷体_gb2312\"> &nbsp; &nbsp;每周末组织滑雪。</span></strong><span style=\"font-size:15px;font-family:楷体_gb2312\">大家可以在自己有空的周末参加，<strong><span style=\"text-decoration:underline;\">自由选择没有限制</span></strong>。</span></p><p><span style=\"font-size:15px;font-family:楷体_gb2312\"> &nbsp; &nbsp;</span><span style=\"font-size:15px;font-family:楷体_gb2312\">为同学们提供<strong>最低廉的滑雪价格</strong>。雪场会提供各种雪具以及雪服和衣柜，同学们<strong><span style=\"text-decoration:underline;\">不必准备任何装备</span></strong>就可以随协会滑雪。雪协为同学们争取的滑雪价格将是普通门市价格的三分之一甚至更低。同时接受非会员同学报名活动，但价格会略高。</span></p><p><span style=\"font-size:15px;font-family:楷体_gb2312\"> &nbsp; &nbsp;入会费</span><span style=\" font-size:15px ; ; ; ; \">15rmb</span><span style=\"font-size:15px;font-family:楷体_gb2312\">，会员资格直至离校。如果你留校读研，会员资格自动延续到研究生毕业哦</span><span style=\" font-size:15px ; ; ; ; \">~~~</span></p><p><span style=\"font-size:15px;font-family:楷体_gb2312\"> &nbsp; &nbsp;清华滑雪队将<strong>为初学者进行零基础教学</strong>。所以加入协会</span><strong><span style=\"text-decoration:underline;\"><span style=\"font-size:21px;font-family:楷体_gb2312\">无需任何基础</span></span></strong><span style=\"font-size:15px;font-family:楷体_gb2312\">哦。</span></p><p><span style=\"font-size:15px;font-family:楷体_gb2312\"> &nbsp; &nbsp;如果你随协会滑雪多次已经练就娴熟的滑雪技艺，协会将推荐你<strong><span style=\"text-decoration:underline;\">加入清华滑雪队</span></strong>代表清华出征。为清华增光添彩，</span><span style=\" font-size:15px ; ; ; ; \">O(∩_∩)O~~~</span></p><p><span style=\"font-size:15px;font-family:楷体_gb2312\"> &nbsp; &nbsp; </span><span style=\"font-size:15px;font-family:楷体_gb2312\">清华滑雪队在北京市大学生高山滑雪联赛中，与</span><span style=\" font-size:15px ; ; ; ; \">20</span><span style=\"font-size:15px;font-family:楷体_gb2312\">余支高校滑雪队同台竞技，已经连续</span><span style=\" font-size:15px ; ; ; ; \">4</span><span style=\"font-size:15px;font-family:楷体_gb2312\">年包揽男子组个人冠军、团体冠军，</span><span style=\" font-size:15px ; ; ; ; \">2013</span><span style=\"font-size:15px;font-family:楷体_gb2312\">年更是包揽<strong><span style=\"text-decoration:underline;\">男子个人、男子团体、女子个人、女子团体、总团体</span></strong>全部<strong><span style=\"text-decoration:underline;\">冠军</span></strong>。清华滑雪队未来的辉煌就由你来续写了！</span> </p><p><strong><span style=\"color:#000000;text-decoration:none;\"><br></span></strong><br></p><p><strong><span style=\"color:#000000;text-decoration:none;\">联系方式：</span></strong> &nbsp; </p><p><span style=\" font-size:16px ; ; ; ; \"> &nbsp; &nbsp;http://www.renren.com/skithu </span></p><p><span style=\" font-size:16px ; ; ; ; \"> &nbsp; &nbsp;http://www.SkiUnion.org</span></p><p><span style=\" font-size:16px ; ; ; ; \"> &nbsp; &nbsp;Email: &nbsp;ski.thu2010@gmail.com</span></p> &nbsp; <p><br></p>            </div>'),(25,'飞盘协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6C6ibGiavVJfAYL1OovPg1GHZPBTFVCx2hB9OJ5IE2qRLtQ/0','我们是极限飞盘运动的忠实粉丝，我们热爱极限飞盘运动，我们坚持极限飞盘精神，在这里我们收获友情，突破自我，彼此激励，成长灵性，平衡发展，追求卓越，彼此尊重！','<div class=\"text\">                                <p> &nbsp; </p><p style=\"text-align:left\"><span style=\"  ; ; ; \">我们是极限飞盘运动的忠实粉丝，我们热爱极限飞盘运动，我们坚持极限飞盘精神，在这里我们收获友情，突破自我，彼此激励，成长灵性，平衡发展，追求卓越，彼此尊重！</span><em><span style=\"  ; ; ; \">iFrisbee</span></em><em><span style=\"font-family:华文细黑\">，</span></em><em><span style=\"  ; ; ; \">more than Frisbee</span></em><em><span style=\"font-family:华文细黑\">！</span></em><span style=\"  ; ; ; \">我们期待你的加入！</span></p><p style=\"text-align:left\"><span style=\"  ; ; ; \"> </span></p><p style=\"text-align:left\"><span style=\"  ; ; ; \">日常活动：每周六上午九点到十一点，紫荆操场！</span></p><p style=\"text-align:left\"><span style=\"  ; ; ; \">校际交流：北京交通大学，北京航空航天大学，对外经贸大学</span></p><span style=\" font-size:14px ; ; ; ; \">多样比赛：秋季学期“新生杯”，春季学期“清超杯”</span> <p><br></p>            </div>'),(26,'排球协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6Dd9yPH6RpH5dicjwqchhKJBHibgV04djzicKF0t4yuTPLlA/0','清华大学学生排球协会于1988年成立，现有会员120余名，是一个由学生自发组建，接受共青团清华大学委员会社团协会部管理的公益性质的学生社团。协会以普及清华排球运动，提高广大同学的排球技战术水平为宗旨。为普及清华排球运动，协会坚持办好传统赛事，并不断推陈出新。','<div class=\"text\">                                <p><strong>协会简介</strong></p><p> &nbsp; &nbsp;清华大学学生排球协会于1988年成立，现有会员120余名，是一个由学生自发组建，接受共青团清华大学委员会社团协会部管理的公益性质的学生社团。协会以普及清华排球运动，提高广大同学的排球技战术水平为宗旨。为普及清华排球运动，协会坚持办好传统赛事，并不断推陈出新。清华大学在读学生均可以在自愿的前提下加入协会，会员入会不收会费，会员有选举及参加协会为会员组织的所有活动的权利。</p><p> </p><p><strong>协会活动</strong></p><ul style=\"list-style-type:disc;\"><li><p>马约翰杯硬地排球比赛 马约翰杯硬地排球比赛是全校最权威，最有影响力，水平最高的排球比赛。一直以来都是清华大学排球协会承办的重要比赛。在清华大学体育部、校团委的相关老师与辅导员的指导与支持下，马约翰杯排球比赛已经成为充分展示各院系排球风采的舞台。</p><p><br></p></li><li><p>马约翰杯沙滩排球比赛 为了进一步普及清华排球运动，提高排球运动的趣味性，促进沙滩排球项目在我校的开展，从2002年开始于每年的10月份举办沙滩排球赛。该活动旨在在普通同学中推广沙滩排球项目。</p><p><br></p></li><li><p>排协常规活动 由于排球具有较高的趣味性以及很强的团队协作性，所以排球始终吸引着众多师生来投入其中，每周四活动于东操排球场，都能见到排球爱好者运动的身影。</p></li></ul><p> </p><p><strong>协会荣誉</strong></p><p> &nbsp; &nbsp;2009-2010学年度清华大学马约翰杯学生运动会优秀承办单位一等奖</p><p><br></p><p><strong>联系方式</strong></p><ul style=\"list-style-type:disc;\"><li><p><span style=\"color:#000000;\">公共邮箱tsinghuavu@gmail.com</span></p></li><li><p><span style=\"text-decoration:none;\">人人主页“清华排协”http://www.renren.com/profile.do?portal=&amp;id=323815224</span></p></li></ul><p><br></p>            </div>'),(27,'网球协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6C6ibGiavVJfAYL1OovPg1GHZkv24czx73XqoElcLKM4Erg/0','每周两次日常网球培训活动是清华大学学生网球协会的日常主题活动，旨在于让大家进一步认识网球，并在提高球技的同时，认识更多志同道合的球友。','<div class=\"text\">                                <p><span style=\"font-family:宋体;\"><strong><span style=\"font-family:楷体_gb2312;font-size:16px;\">精品活动</span></strong></span></p><p style=\"margin:0px 0px 0px 28px;\"><span style=\"font-family:wingdings;font-size:16px;\">l</span><span style=\"font-family:楷体;\">每周两次日常网球培训活动</span></p><p style=\"text-indent:28px;\"><span style=\"font-family:楷体;\">每周两次日常网球培训活动是清华大学学生网球协会的日常主题活动，旨在于让大家进一步认识网球，并在提高球技的同时，认识更多志同道合的球友。</span></p><p style=\"text-indent:28px;\"><span style=\"font-family:楷体;\">活动分为初级、中级、高级三个级别，初级是以网球基本技术介绍为主，中级着重于巩固基础技术，同时了解更高层次的技术，高级由于技术较全面，所以主要是享受网球这样活动。</span></p><p style=\"margin:0px 0px 0px 28px;\"><span style=\"font-family:wingdings;font-size:16px;\">l</span><span style=\"font-family:楷体;\">清华大学马约翰杯网球赛</span></p><p style=\"text-indent:28px;margin-top:auto;margin-bottom:auto;\"><span style=\"font-family:楷体;\">清华大学马约翰杯网球赛是由清华大学学生网球协会主办的校内网球比赛，每年一次。比赛分为混合团体比赛、以及男女单打比赛，并且各个比赛分甲乙组，分别进行角逐。团体比赛以院系为单位，总参与院系在20所左右。男女单打比赛，分别参与人数在128人以及24人左右，甲乙组冠军会决出总冠军。</span></p><p style=\"text-indent:28px;margin-top:auto;margin-bottom:auto;\"><span style=\"font-family:楷体;\">清华大学马约翰杯网球赛发扬了清华大学优良的体育传统，普及推广了网球运动，塑造新时期清华学生的体魄。使学生参与运动，增进友谊，加强情感交流；提高了清华学生的凝聚力和自信心，培养砥砺意志、勇对挫折、不惧竞争、积极进取的精神，为“争取至少为祖国健康地工作五十年”打下坚实的基础。</span></p><p style=\"margin:0px 0px 0px 28px;\"><span style=\"font-family:wingdings;font-size:16px;\">l</span><span style=\"font-family:楷体;\">ATSM</span><span style=\"font-family:楷体;\">网球邀请赛</span></p><p style=\"text-indent:28px;\"><span style=\"font-family:楷体;\">ATSM</span><span style=\"font-family:楷体;\">网球邀请赛是由清华大学学生网球协会主办的北京高校网球年度系列大师赛，该项比赛起源于2003年，每年两次，迄今为止已在清华校内举办了13届，在清华校内以及首都高校网球爱好者中具有广泛的影响力。网球协会希望通过ATSM网球邀请赛的举办，使其成为网球爱好者们展现技术、增进友谊、挥洒激情的舞台。</span></p><p style=\"text-indent:28px;\"><span style=\"font-family:楷体;\">比赛项目分为男子单打和女子单打，一般参赛规模80人-112人，进行为期两天的小组及淘汰赛，总场次160场左右。</span></p><span style=\"font-family:楷体;font-size:14px;\">现在，ATSM网球邀请赛已经发展成为一项成熟的赛事，吸引着越来越多同学的参于和关注，其中有不少选手甚至从不缺席，把ATSM养成了习惯。另外，通过此项赛事，网球协会得到了中网、Tennis123俱乐部、新浪网、网球天地杂志、爱立信中国、论拍坛等多个单位的宣传与支持，国手李思、文俪原、著名穿线师吴洪耀也都曾亲临现场。</span><p> </p><p><br></p>            </div>'),(28,'领导力发展协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6Dd9yPH6RpH5dicjwqchhKJBEd0CXRoaPicOtL4EE8h3Ricg/0','清华大学学生领导力发展协会（THUSLDA）是以培养和发展同学领导才能为宗旨的综合性协会。协会致力于同社会各界精英建立友好关系，加强清华学生同这些人才的联系与交流，培养同学们的管理才能和领导力。','<div class=\"text\">                                <p><span style=\"font-size:16px\"></span></p><p style=\"text-align:left\"><span style=\"font-family:宋体;font-size:16px\"> &nbsp; &nbsp;清华大学学生领导力发展协会（THUSLDA）是以培养和发展同学领导才能为宗旨的综合性协会。协会致力于同社会各界精英建立友好关系，加强清华学生同这些人才的联系与交流，培养同学们的管理才能和领导力。协会通过举办大型讲座、交流座谈以及开展丰富多彩的社会实践，为同学们提供一个很好的培养平台，使参与者能够近距离的接触企业界资深专家和领导者，培养同学的竞争意识与创业能力。</span></p><p style=\"text-align:left\"><span style=\"font-family:宋体;font-size:16px\"> &nbsp; &nbsp;</span><span style=\"font-family:宋体;font-size:16px\">协会每年都会带领部分会员参观中海油等著名央企；协会与欧美同学会关系密切，常与各类海外归国人才交流学习；协会与斯坦福大学的学生组织ASES有合作关系，每年部分优秀会员会被选派去参加在硅谷举办的ASES峰会，参观谷歌等优秀企业总部，参加一系列全球性质的商业竞赛。</span></p><p style=\"text-align:left\"><span style=\"font-family:宋体;font-size:16px\"> </span></p><p style=\"text-align:left\"><strong><span style=\"font-family:宋体;font-size:16px\">品牌活动：</span></strong></p><p style=\"text-align:left;margin:0px 0px 0px 26px\"><span style=\"font-family:wingdings;font-size:13px\"><span style=\"font-family:wingdings;font-size:16px\">l</span><span style=\"  ; \"> &nbsp;</span></span><strong><span style=\"font-family:宋体;font-size:16px\">清华大学学生领导力发展论坛</span></strong><span style=\"font-family:宋体;font-size:16px\">：专注于领导力培养与发展的高规格、高水平、高层次系列讲座。</span></p><p style=\"text-align:left;margin:0px 0px 0px 26px\"><span style=\"font-family:wingdings;font-size:13px\"><span style=\"font-family:wingdings;font-size:16px\">l</span><span style=\"  ; \"> &nbsp;</span></span><strong><span style=\"font-family:宋体;font-size:16px\">走进名企，与名企高管座谈</span></strong><span style=\"font-family:宋体;font-size:16px\">：致力于建立同各行业精英的联系，为培养清华学生的领导力提供强有力的支持。</span></p><p> </p>            </div>'),(29,'汽车爱好者协会','http://mmbiz.qpic.cn/mmbiz/OOMV4tnjF6Bib9qWrqu1wSvkVIibJqzaCyEoGicpvV90HgQYd5Jk9NnUENibKiaLiaoWgXIRicNsVF75iaHG6UzhLJh9Mg/0','清华大学汽车爱好者协会（简称“车协”）成立于1994年，是由清华大学在国家大力发展汽车工业的背景下，为响应清华大学关于全面提高大学生素质的号召，增进大学生对汽车文化的了解及提供与汽车相关服务而自发组织的综合性协会。','<div class=\"text\">                                <p><span style=\"font-size:16px\"></span></p><p style=\"text-align:left;text-indent:27px\"><span style=\"font-family: 宋体; \"><strong style=\"white-space: normal; \"><span style=\"font-family: 宋体; \">协会概要</span></strong><span style=\"font-size: 21px; font-family: 宋体;\">:</span></span></p><p style=\"text-align:left;text-indent:27px\"><span style=\"font-family: 宋体; \">清华大学汽车爱好者协会（简称“车协”）成立于</span><span style=\"font-family: calibri; \">1994</span><span style=\"font-family: 宋体; \">年，是由清华大学在国家大力发展汽车工业的背景下，为响应清华大学关于全面提高大学生素质的号召，增进大学生对汽车文化的了解及提供与汽车相关服务而自发组织的综合性协会。</span></p><p style=\"text-align:left;text-indent:27px\"><span style=\"font-family:calibri;font-size:16px\"> </span><span style=\"font-family:宋体;font-size:16px\">车协的宗旨是“普及汽车知识，弘扬汽车文化，树立振兴中国汽车工业的志向”。车协与戴姆勒中国部、北汽奔驰、厦门金龙、华晨宝马、潍柴等汽车企业、及搜狐汽车频道、网易汽车频道、《汽车杂志》、《汽车族》、《车世界》等媒体开展互动与合作；与北京十多所兄弟院校的车迷组织均保持密切联系。</span></p><p style=\"text-align:left;text-indent:27px\"><span style=\"font-family:宋体;font-size:16px\">车协热切希望能够与更多关心中国汽车工业，致力于汽车工业汽车文化发展的社会各界同仁加强合作，以期共同发展，实现更多的梦想！</span></p><p style=\"text-align:left;text-indent:27px\"><span style=\"font-family:宋体;font-size:16px\">车协永远相信：中国的汽车工业因有热爱汽车的我们而更加精彩！</span></p><p style=\"text-align:left;text-indent:27px\"><span style=\"font-family:宋体;font-size:16px\"><br></span></p><p style=\"text-align:left;text-indent:27px\"><span style=\"font-family:calibri;font-size:16px\"> </span></p><p><strong><span style=\"font-family:宋体;font-size:16px\">协会荣誉</span></strong></p><p style=\"text-align:left\"><span style=\"font-family:calibri;font-size:16px\">1995</span><span style=\"font-family:宋体;font-size:16px\">年、</span><span style=\"font-family:calibri;font-size:16px\">1996</span><span style=\"font-family:宋体;font-size:16px\">年、</span><span style=\"font-family:calibri;font-size:16px\"> 1997</span><span style=\"font-family:宋体;font-size:16px\">年、</span><span style=\"font-family:calibri;font-size:16px\"> 1998</span><span style=\"font-family:宋体;font-size:16px\">年、</span><span style=\"font-family:calibri;font-size:16px\"> 1999</span><span style=\"font-family:宋体;font-size:16px\">年、</span></p><p style=\"text-align:left\"><span style=\"font-family:calibri;font-size:16px\">2000</span><span style=\"font-family:宋体;font-size:16px\">年、</span><span style=\"font-family:calibri;font-size:16px\"> 2003</span><span style=\"font-family:宋体;font-size:16px\">年、</span><span style=\"font-family:calibri;font-size:16px\"> 2004</span><span style=\"font-family:宋体;font-size:16px\">年、</span><span style=\"font-family:calibri;font-size:16px\">2005</span><span style=\"font-family:宋体;font-size:16px\">年、</span><span style=\"font-family:calibri;font-size:16px\"> 2007</span><span style=\"font-family:宋体;font-size:16px\">年</span></p><p style=\"text-align:left\"><span style=\"font-family:宋体;font-size:16px\">清华大学年度十佳协会</span></p><p style=\"text-align:left\"><span style=\"font-family:宋体;font-size:16px\"><br></span></p><p><span style=\"font-family:calibri;font-size:16px\"> </span></p><p><strong><span style=\"font-family:宋体;font-size:16px\">品牌活动</span></strong></p><p><strong><span style=\"font-family:宋体;font-size:16px\"><span style=\"font-family: 宋体;\">“新生汽车知识竞赛”</span></span></strong></p><p><span style=\"font-family:宋体;font-size:16px\"><span style=\"font-family: 宋体;\">&nbsp; &nbsp; 面向新生，意在引导新生关注汽车文化，为喜爱汽车的同学提供展示自我的平台。</span></span></p><p><span style=\"font-family:宋体;font-size:16px\"><span style=\"font-family: 宋体;\"><br></span></span></p><p><strong><span style=\"font-family:宋体;font-size:16px\">中国大学生方程式大赛</span></strong><strong><span style=\"font-family:calibri;font-size:16px\">(</span></strong><strong><span style=\"color:black;font-size:16px \">Formula SAE – China)</span></strong><strong><span style=\"font-size:13px\"></span></strong></p><p style=\"text-indent:27px\"><span style=\"font-family:宋体;color:black;font-size:16px\">由中国汽车工程协会及其合作会员单位，在学习和总结美、日、德等国家相关经验的基础上，结合中国国情，精心打造的一项全新赛事。目的是培养学生的设计制造能力、成本控制能力和团队沟通协作能力，使学生能够尽快适应企业需求，为企业挑选优秀适用人才提供平台；同时通过活动创造</span><span style=\"font-family:宋体;font-size:16px\">学术竞争氛围，为院校间的交流提供一个平台，进而推动学科建设的提升。</span></p><p style=\"text-indent:27px\"><span style=\"font-family:宋体;font-size:16px\"><br></span></p><p><strong><span style=\"font-family:宋体;font-size:16px\">清华大学学生汽车知识竞赛</span></strong></p><p style=\"text-indent:27px\"><span style=\"font-family:宋体;font-size:16px\">一年一度的汽车爱好者盛会，选手们通过知识竞赛切磋对汽车的了解的同时，协会也通过这一平台与大家分享对汽车的理解。中国正由汽车大国向汽车强国发展，汽车知识竞赛秉承“普及汽车知识，弘扬汽车文化”的宗旨，为中国汽车工业的振兴提供成长的土壤。</span></p><p style=\"white-space: normal; \"><strong><span style=\"font-family: 宋体; \"><img data-src=\"http://mmsns.qpic.cn/mmsns/OOMV4tnjF6DSkuf7NYNGFvQR9X3yaq1egMF74s6PfQGiaEWxdexhoNA/0\"></span></strong></p><p style=\"white-space: normal; \"><strong><span style=\"font-family: 宋体; \">2013清华大学汽车知识竞赛</span></strong></p><p><br></p><p style=\"white-space: normal; \"><span style=\"font-family: 宋体; \">“北京高校卡丁车大赛”，此项活动是联合北京各大高校举办的一场全北京的赛车迷盛宴，届时全北京高校的卡丁车高手汇聚一堂，是大家交流赛车技术，相互认识沟通的良好平台；</span></p><p style=\"white-space: normal; \"><span style=\"font-family: 宋体; \">&nbsp; &nbsp; 同时，我们依靠在汽车媒体等方面的外联资源，有时能够为喜爱驾驶的同学提供试乘试驾的机会。</span></p><p style=\"white-space: normal; \"><strong><span style=\"font-family: 宋体; \"><img data-src=\"http://mmsns.qpic.cn/mmsns/OOMV4tnjF6DSkuf7NYNGFvQR9X3yaq1eibSVlkFZaiaFdjTD6JZgAXLg/0\"></span></strong><strong><span style=\"font-family: 宋体; \">Focus试驾</span></strong></p><p><br></p>            </div>'),(30,'科幻协会','http://mmsns.qpic.cn/mmsns/OOMV4tnjF6BkJy3zH0zv8xh0ULUCrVej3mMbDeKjZJ259JOBonicLibA/0','科幻协会，成立于2003年，一直秉承欢乐有趣天马行空的指导思想，为众多爱幻想的人们带去了许多美好的经历和回忆。','<div class=\"text\">                                <p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">科幻协会，成立于</span><span style=\"\">2003</span><span style=\"font-family:楷体_gb2312\">年</span><span style=\"\">3</span><span style=\"font-family:楷体_gb2312\">月</span><span style=\"\">30</span><span style=\"font-family:楷体_gb2312\">日，名誉会长为著名科幻作家星河。</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">科幻协会成立</span><span style=\"\">10</span><span style=\"font-family:楷体_gb2312\">年以来，一直秉承欢乐有趣天马行空的指导思想，为众多爱幻想的人们带去了许多美好的经历和回忆。</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">目前协会主要有以下活动：</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">【观影交流会】周末在</span><span style=\"\">C</span><span style=\"font-family:楷体_gb2312\">楼放映经典科幻影片并进行交流讨论。</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">【读书沙龙】和北大科幻协会的朋友一同就经典的科幻作品进行交流和探讨，并对一些有争议的问题进行深入思考。</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">【主题出游】定期组织会员到科技馆，观象台等地进行主题出游。</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">【科幻创作】号召会员进行科幻作品的创作并参与组织</span><span style=\"\">“</span><span style=\"font-family:楷体_gb2312\">科联奖</span><span style=\"\">”</span><span style=\"font-family:楷体_gb2312\">等全国性的大型科幻征文比赛，出版原创作品集锦。</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">【作家交流】与国内著名的科幻作家进行科幻文学及科幻创作等内容的交流。</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">【《科幻世界》进校园】与《科幻世界》杂志社合办，与作家和编辑进行交流。</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">欢迎持续关注科幻协会！</span></p><p style=\"text-align:left\"><span style=\"\"> </span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">人人：清华</span><span style=\"\">SFA</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">微博：清华科幻协会</span></p><p style=\"text-align:left\"><span style=\"\">QQ</span><span style=\"font-family:楷体_gb2312\">群：</span><span style=\"\">142656727</span></p><p style=\"text-align:left\"><span style=\"font-family:楷体_gb2312\">邮箱：</span><span style=\"\">thu_sf@163.com</span></p><p style=\"text-align:left\"><span style=\"\"> </span></p><span style=\"font-size:14px;font-family:楷体_gb2312\">【广告：科幻协会十周年纪念会刊原创作品集锦《真子集》正在火热发售中，详情请见人人主页日志！】</span><p><br></p>            </div>');
