INSERT INTO `TuanTuanApp_department` VALUES (1,'组织部','http://www.tsinghua.edu.cn/publish/th/campus/trees/view17.jpg','组织部负责校团委的基层组织建设和干部队伍建设。','组织部负责校团委的基层组织建设和干部队伍建设，是校团委指导和服务基层的枢纽。校团委组织部始终坚持加强团的思想教育功能，始终坚持加强团的基层组织建设，在主题教育、基层团建、社工岗位锻炼、干部管理与培养等方面发挥着重要作用。'),(2,'宣传部','http://www.tsinghua.edu.cn/publish/th/campus/trees/view17.jpg','宣传部是校团委下设的职能部门，主要负责学生系统的新闻宣传、信息沟通和团员青年思想教育工作。','宣传部是校团委下设的职能部门，主要负责学生系统的新闻宣传、信息沟通和团员青年思想教育工作。校团委宣传部下设基层组、综合组，指导学生通讯社、《紫荆》报社、学生网络电视台、学生广播台、讲座中心、视觉中心等学生组织开展工作，联合校团委成才信息中心共同维护学生清华网站。'),(3,'学习实践部','http://www.tsinghua.edu.cn/publish/th/campus/trees/view17.jpg','学习实践部以全校学生社会实践活动为工作重点，负责组织包括暑期实践、寒假实践、双休日实践等多种形式的学生实践活动','学习实践部是校团委指导学生实践活动的职能部门，以全校学生社会实践活动为工作重点，负责组织包括暑期实践、寒假实践、双休日实践等多种形式的学生实践活动。同时实践部负责开展针对民族生、国防及军工定向生、研究生支教团等群体的专项工作。'),(4,'文体部','http://www.tsinghua.edu.cn/publish/th/campus/trees/view17.jpg','文体部是校团委引导和建设校园文艺、体育工作的职能部门，始终坚持引领校园主流文化和鼓励同学参与体育锻炼。','文体部是校团委引导和建设校园文艺、体育工作的职能部门。文体活动是青年课余生活的重要组成部分，组织丰富多彩的文体活动，对提高同学们的文化修养和身体素质有着重要的意义。文体部通过形式多样的文化和体育活动，始终坚持引领校园主流文化和鼓励同学参与体育锻炼。'),(5,'社团部','http://www.tsinghua.edu.cn/publish/th/campus/trees/view17.jpg','社团协会部是以引导学生社团科学发展，服务青年学生成长成才为工作目标，履行对学生社团协会管理和服务职能的部门。','社团协会部（以下简称：社团部）是校团委履行对学生社团协会管理和服务职能的部门。社团部始终坚持以引导学生社团科学发展，服务青年学生成长成才为工作目标，重点负责协会活动管理、协会评奖评优、协会干部培养、协会素拓项目和基金项目管理、协会对外交流和为协会争取社会资源等工作。'),(6,'学生素质拓展中心','http://www.tsinghua.edu.cn/publish/th/campus/trees/view17.jpg','学生素质拓展中心引导和帮助广大学生完善素质结构，全面成长成才。','<h3></h3><p style = \"width:95%; margin:0 auto; line-height:22px;\">学生素质拓展中心（以下简称：素拓中心）是校团委下属的职能机构，是校团委为适应中国社会高速发展对青年人力资源开发的迫切需要，服务高校素质教育的全面实施，进一步引导和帮助广大学生完善素质结构，全面成长成才而建立的重要职能部门。<p>'),(7,'学生科技创新中心','http://www.tsinghua.edu.cn/publish/th/campus/trees/view17.jpg','学生科技创新中心负责组织学生课外学术科技与创新创业赛事、支持各类课外学术科技与创新创业项目。','学生科技创新中心（以下简称：科创中心）是团委组织和管理学生课外学术科技与创新创业活动的职能部门。通过营造校园创新创业氛围、组织学生课外学术科技与创新创业赛事、支持各类课外学术科技与创新创业项目以及选派优秀团队参加国际国内课外学术科技与创新创业赛事与交流，不断培养学术科技与创业类拔尖创新人才。'),(8,'成才信息中心','http://www.tsinghua.edu.cn/publish/th/campus/trees/view17.jpg','成才信息中心负责校团委的网络思想教育、学生清华网站建设及信息化建设工作。','成才信息中心负责校团委的网络思想教育、学生清华网站建设及信息化建设工作，积极地为校内各学生组织提供完备的网络服务，同时通过网络辅导员队伍进行网络舆情引导和思想教育，培养我校学生形成正确健康的网络使用习惯。');
