INSERT INTO `TuanTuanApp_modernfigure` VALUES (81,'【人物】张夫也：教书育人 师之天职','http://news.tsinghua.edu.cn/publish/news/4205/20131202095028616937331/1.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】张夫也：教书育人 师之天职</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">教书育人&nbsp; 师之天职</span></strong></p> <p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">&mdash;&mdash;记2013年&ldquo;清华大学教书育人先进个人&rdquo;获得者、清华美院教授张夫也</span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学生记者</span><strong><span style=\"font-family: 楷体,楷体_GB2312\"> 穆瑞凤</span></strong></p> <p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><span style=\"font-family: 楷体,楷体_GB2312\">张夫也，1955年生于青海省西宁市。1978年3月考入中央工艺美术学院（1999年并入清华并更名&ldquo;清华大学美术学院&rdquo;），1982年1月毕业并留校任教。1990年受国家教育委员会派遣赴日本东京艺术大学任客座研究员。1992年回国并任中央工艺美术学院工艺美术学系副主任，1993年起任中央工艺美术学院副教授。1999年获文学（艺术学）博士学位并任中央工艺美术学院硕士导师。2000年起任清华大学美术学院副教授兼《装饰》杂志主编，2001年起任清华大学美术学院教授。现任清华大学美术学院艺术史论系主任、博士生导师，学术委员会委员、学位评定委员会委员，中国美术家协会理论委员会委员、中国工艺美术学会常务理事、中国工艺美术研究院专家指导委员会委员、中国艺术研究院特聘教授。</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131202095028616937331/1.jpg\" /></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为张夫也。</span></p> <p style=\"text-align: center\"><strong>行胜于言&nbsp; 课比天大</strong></p> <p>　　&ldquo;学生是学校的产品，要打造优质产品，教师起到决定性作用，老师要严格要求自己，身体力行，做到行胜于言&rdquo;。张夫也在谈到作为一名教师对自己的要求时如是说。</p> <p>　　张夫也出身书香门第，家教很严，父亲是文化干部，母亲善良本分，从小父亲对他的要求就很高。父母从来与人为善，不涉是非，坚强地面对困难，他们坚毅的性格和包容的心态，对他产生了很深刻的影响，良好的家庭教育也净化了他的性情，形成了他&ldquo;言必行、行必果&rdquo;的性格。他立志高远，认为不能做一个碌碌无为的人，一定要在文化事业上做出一些成绩，这是他始终的追求。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131202095028616937331/2.jpg\" />　　</p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">张夫也与学生讨论。</span></p> <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 张夫也很庆幸自己做了一名教师。在最初做教师的日子里，条件很艰苦，他和其他同事一起合住，他的房间不足20平米，没有独立的厨房和卫生间。为了不影响别人休息，他通常在厨房备课。尽管如此，张夫也从来没有因为条件差而马虎备课。他始终信守&ldquo;课比天大&rdquo;。在没有电脑、PPT等现代化教学设备的情况下，他自己拍幻灯、做图注、编号。为了严谨教学，他在幻灯片上画箭头，指示方向，再把幻灯片上的图注重新抄写下来，以备讲课使用。每次讲课前，自己先要在家里放两遍，以利于有效控制时间和调整播放顺序。这看似简单的工作，只有认真去做才能给学生带来最完美的展示。正如张老师所说：&ldquo;每次上课，就像登台演出，虽然时间不长但是一定要给学生展示最完美的一面。&rdquo;</p> <p>　　张夫也不仅在教学的准备过程中极其认真负责，而且恪守上课时间。之前，他住在北京大兴区的亦庄经济开发区，距离清华大学有近40公里的车程。考虑到北京拥堵的交通状况，为了保障早晨8点准时授课，他经常前一天晚上住在清华园附近的小旅馆里。这不仅是守时、严谨的表现，更充分体现了&ldquo;上课&rdquo;在他心中的至高地位。</p> <p style=\"text-align: center\"><strong>开拓钻研&nbsp; 完善学科</strong></p> <p>　　对于一名教师来说，课程至关重要。2006年，清华大学将&ldquo;外国工艺美术史&rdquo;定为全校人文素质核心课程。同年，张夫也教授的&ldquo;外国工艺美术史&rdquo;荣获北京市精品课程。2007年，&ldquo;外国工艺美术史&rdquo;荣获全国精品课程。这门课程的开设和发展与张夫也的努力和付出密不可分。1982年，张夫也从中央工艺美术学院毕业留校任教，当时的系主任奚静之教授将开设&ldquo;外国工艺美术史&rdquo;的想法与张夫也进行沟通之后，他欣然接受了这个艰巨的任务，并开始了积极的筹备工作。</p> <p>　　张夫也谈到：&ldquo;研究初期，搜集资料是主要任务。当时还不具备出国考察的条件，只有到各大图书馆来搜集相关文献和图片资料，把资料搜集整理好再花时间反复进行分析研究、归纳、总结，最后编写出教案。&rdquo;刚开始教书时，张夫也边教课，边翻译外文资料、拍摄图片、编辑卡片、标明图注、整理教案，将世界各地的工艺美术和装饰艺术作品及相关文史资料，按时期进行分析，他采取按照专题研究的方式、逐个突破地向前拓进。最终于1986 年，在中央工艺美术学院史论系开设了第一堂&ldquo;外国工艺美术史&rdquo;课，成为开设我国艺术院校&ldquo;外国工艺美术史&rdquo;课程的先驱。</p> <p>　　1990年，张夫也受国家教育委员会（现教育部）派遣赴日本东京艺术大学任客座研究员。他在日本学习期间，观赏并拍摄了大量工艺美术和装饰艺术作品实物，对古代埃及艺术博物馆藏品展、卢浮宫藏品展，以及埃特鲁里亚、玛雅、安第斯等专题性的古代艺术展进行认真研究，充实了他在外国工艺美术史方面的知识，为教学打下了良好的基础。归国后，张夫也充分利用从国外学习的知识和大量的资料，将&ldquo;外国工艺美术史&rdquo;的学科体系建立起来。</p> <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 目前，张夫也编著的《外国工艺美术史》一书，已成为全国艺术设计院校和专业的必读教材。清华大学美术学院将此课程设定为专业必修课，同时作为攻读硕士学位和博士学位的研究课程。全国各大艺术院校也逐步开设外国工艺美术史课程。张夫也开创了我国外国工艺美术史的教学体系，推进了工艺美术史学科的发展。</p> <p style=\"text-align: center\"><strong>以情感人&nbsp; 行为师范</strong></p> <p>　　每年对于新入校的博士生和硕士生来说，入校上的第一堂课意义重大。课上，张夫也主题为&ldquo;如何做人&rdquo;的授课内容看似与学术完全无关，但确是做好学问的重要基础。他认为，要做好学问，首先要做好人。张夫也常以生动的例子为同学们讲道理，要求他们珍惜时间和机会，学会感恩。他经常对学生讲：&ldquo;你们考到清华很不容易，不要忘记你为实现这个梦想付出的努力，不要忘记父母、家人、朋友、老师的支持&hellip;&hellip;&rdquo;</p> <p>　　张夫也另一个育人法宝就是用行动引导学生，要求他们做正直的人，勤勉的人，善于思考的人。张夫也提到，当系里老先生生病时，他都会及时看望，而不是打个电话或是发个短信问候。年近九十岁高龄的叶喆民先生是张夫也的老师，叶先生患病期间，张夫也带领院系老师多次看望他，令老先生非常感动。每当接到老师的电话时，他都是耐心地听他们讲话，张夫也说，耐心聆听老先生诉衷肠必定会给老师以安慰。这样的例子看多了，张夫也的学生也以老师为榜样，更多地关注身边的老师和同学。张夫也工作室其乐融融的氛围让人羡慕。</p> <p>　　对于学生而言，张夫也除了教授他们专业知识，更是努力为他们提供力所能及的帮助。张夫也不仅帮助学生们进行日文资料的翻译，在交朋友和找工作两件大事上也非常关心学生。很多情况下，学生们把张老师当作家长，无话不谈，请他把关、提建议。对于找工作，张夫也非常上心，写推荐信、联系单位，忙里忙外。对于外地的同学，张夫也关怀备至。为了让他们感受到家的温暖，他时常邀请他们到自己家中聚餐。一是让大家在轻松愉快的氛围中交流学术，很多做人的道理和学术上的问题在吃饭的时候交流得更充分；二是可以把家里收藏的来自世界各地的艺术品，当作教具，让每一位到他家里的同学触摸和感受实物教具和艺术品的美。</p> <p>　　这就是张夫也，一位以教书育人为天职的先生。</p> <p style=\"text-align: right\">（<strong>清华新闻网12月4日电</strong>）</p> <p style=\"text-align: right\">供稿：美术学院 编辑：范 丽</p></P>     </div>'),(94,'【人物】叶静婷：青春加速度 和羽毛球一起飞翔','http://news.tsinghua.edu.cn/publish/news/4205/20131031113257952496186/1.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】叶静婷：青春加速度 和羽毛球一起飞翔</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">和羽毛球一起飞翔</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&mdash;&mdash;&mdash;访清华大学羽毛球队队员叶静婷</span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">研通社记者</span><strong><span style=\"font-family: 楷体,楷体_GB2312\">&nbsp;尼倩倩 陈俊杰</span></strong></span></p> <p style=\"text-align: center\"><img alt=\"\" width=\"312\" height=\"412\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131031113257952496186/1.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为叶静婷近照。</span></p> <p>　　清华大学羽毛球队里有这样一位女生。她球技过人，堪与男生或专业选手一决高下；她热情开朗，亲切玩笑之间总能将初识变为老友；她被队员们戏称为&ldquo;教主&rdquo;，更是带给所有人快乐与力量的&ldquo;灵魂人物&rdquo;，她就是大家嘴里常念叨的&ldquo;小叶&rdquo;&mdash;&mdash;叶静婷。</p> <p>　　叶静婷现在是清华大学社会科学学院心理学专业的硕士研究生。作为澳门的学生，优秀的她凭借高中竞赛保送到清华大学，在这里，她坦言自己很享受园子里的一切。&ldquo;刚来清华时的确有许多不习惯。&rdquo;小叶谈起清华求学的初印象依然有许多感慨，&ldquo;可是现在真的爱上了这里的纯粹和简单，学校给我们提供了一切便利，我们需要做的就是学习和做自己想要做的事。&rdquo;</p> <p style=\"text-align: center\"><strong>&ldquo;我的世界从此多了一颗球&rdquo;</strong></p> <p>&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 小叶所说的&ldquo;想要做的事&rdquo;里必然少不了羽毛球。</p> <p>　　从上小学开始，小叶就在体育运动上表现出高于他人的天赋，经历过打网球、练跨栏，直至初中二年级时，她才因一次偶然的机会接触羽毛球，并拼进澳门青年队。因为自己起步晚，刚开始练习羽毛球时总是处处不如人，然而爱拼好强的她从不允许未经努力的认输，于是便以更多、更强的训练来要求自己。在一次澳门中学生羽毛球赛中，抱以学习态度的她竟和队友一路过关斩将冲入双打决赛，而这高于期望的好成绩也让小叶深切感受到了付出与收获的关联，对羽毛球的信心由此大增。</p> <p>　　不知道从何时起，这颗小小的羽毛球成为小叶生活的挚爱，哪怕没有比赛，她也从未间歇打球的节奏。小叶十分庆幸自己在进入清华之后依然能够每日与羽毛球相伴，无论是校队还是羽协，白羽飞跃的地方总能看到小叶的飒爽身影。</p> <p>&nbsp;&nbsp;&nbsp; 对于运动带来的小伤小痛，小叶从不会太放在心上，有时即便是前一天受了伤，她也不会缺席次日的比赛，因为她真正做到，只要站在赛场上，所感受到的就只有羽毛球。</p> <p style=\"text-align: center\"><strong>&ldquo;羽毛球对于我意味着生命和朋友&rdquo;</strong></p> <p>　　2011年亿万学生阳光体育运动大学生羽毛球挑战赛女子团体冠军、2012年北京市高校羽毛球比赛女子双打冠军、2013年北京市高校羽毛球比赛女子单打冠军&hellip;&hellip;羽毛球带来了小叶太多的荣誉和光环，她说，&ldquo;羽毛球对我就意味着生命和朋友。&rdquo;</p> <p>　　小叶说羽毛球带给她的是一种很纯粹的东西。无论是日常练习还是参加比赛，无论是露天操场还是正式场馆，只要手握球拍，她的注意力就会全部凝聚到这项运动中。&ldquo;啪！&rdquo;又是一声清脆有力的击球声，这也是小叶和羽毛球的对话。</p> <p>　　校队的训练十分紧张，但是和队友们共同挥汗拼搏的日子却充实而幸福，&ldquo;我们因羽毛球而结缘，也因羽毛球而不断增进感情。&rdquo;提及和教练的关系，小叶笑谈自己是&ldquo;既爱又恨&rdquo;，爱的是教练对自己的悉心指导和照顾，比赛时只要有他坐在一旁，就从不会感到心慌；&ldquo;恨&rdquo;的是高期望下的专业要求太严苛，训练过程难免辛苦和产生矛盾。不过，小叶清楚地知道，没有教练的严格训练，自身的羽毛球水平也不会取得如此迅速的提高，所谓&ldquo;爱恨&rdquo;，正是情深。</p> <p>　　作为羽协的&ldquo;资深会员&rdquo;，小叶在这里投入的时间和精力一点不比校队少。与专业训练不同，在羽协的小叶则希望和更多志同道合的伙伴们一起，一边享受羽毛球，一边推广羽毛球。面对一些热爱但并不擅长羽毛球的同学，小叶主动担起教练员的角色，对他们进行义务培训和指导。&ldquo;教别人打球其实也是个很好的学习过程，一些平时不太注意的动作细节往往会在向别人讲解的过程中有了更清晰的理解。&rdquo;说到自己当&ldquo;教练&rdquo;的体会，小叶颇有心得。</p> <p>　　就这样，在她的认真付出下，羽协的许多会员都学到了专业的羽毛球技能，甚至一位曾经基础为零的同学也在短短2年之后成为和小叶一样在校队参加专业训练的队员。小叶说：&ldquo;看到别人在自己的帮助下迅速成长，我真的感到非常骄傲，这甚至比我自己比赛拿奖还要开心。&rdquo;</p> <p style=\"text-align: center\"><strong>&ldquo;一辈子都要打羽毛球，但羽毛球不是一辈子&rdquo;</strong></p> <p>　　已经步入研究生阶段学习的小叶同样有着紧张忙碌的科研生活，刚刚参加完比赛的她很快调整心态，积极投入到学习中去。只不过再忙再紧，平均一周3次的羽毛球练习依然不会打折扣，因为&ldquo;一辈子都要打羽毛球&rdquo;已成为她的生命常态和人生追求。</p> <p>　　&ldquo;现在还是会把科研放在首位，努力在学术路上走得更远。&rdquo;谈及现在的状态和对未来的规划，小叶表现出来的学术热情丝毫不亚于她对羽毛球的热爱。&ldquo;最近有许多实验要做，也要为学术会议上的文章发表再做准备。&rdquo;善于运动的小叶正是借助于羽毛球所带来的力量和精神，在更广阔、更丰富的平台上勇往直前。</p> <p style=\"text-align: right\">　　供稿：校研究生会&nbsp; 编辑：范 丽</p></P>     </div>'),(96,'【人物】张金松：科研路上的“掘金人”','http://news.tsinghua.edu.cn/publish/news/4205/20131029095322987701152/1(1).jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】张金松：科研路上的“掘金人”</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">科研路上的&ldquo;掘金人&rdquo;　</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\"><strong><span>&mdash;&mdash;&mdash;记第八届中国青少年科技创新奖获得者张金松</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">刘蔚如</span></strong></span></p> <p style=\"text-align: center\">&nbsp;<img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131029095322987701152/1(1).jpg\" /></p> <p>　<span style=\"font-size: 14px\">　<span style=\"font-family: 楷体,楷体_GB2312\">张金松，物理系2008级博士生。所在团队通过四年的不懈努力，在实验上首次实现了量子反常霍尔效应，相关成果以共同第一作者身份发表在《自然》杂志上，被杨振宁先生称为第一次在中国实验室里发表的诺贝尔奖级的物理学论文。曾任物理系研究生会学术副主席，获清华大学&ldquo;学术新秀&rdquo;、博士研究生学术新人奖、博士研究生国家奖学金、清华之友&mdash;TDK一等奖学金、清华大学学生实验室建设贡献奖二等奖。2013年7月被评为清华大学优秀共产党员。2013年8月荣获第八届中国青少年科技创新奖。</span></span></p> <p>　　2013年8月22日，第八届中国青少年科技创新奖颁奖大会在人民大会堂举行。国务院副总理刘延东出席大会，国家副主席李源潮出席大会并讲话。会上，清华大学物理系2008级博士生张金松作为获奖者代表发言。</p> <p>　　就在几个月前的4月10日，清华大学主楼接待厅量子反常霍尔效应新闻发布会现场，张金松坐在台下，聆听诺贝尔物理学奖获得者、清华大学高等研究院名誉院长杨振宁先生掷地有声的评价：&ldquo;这是第一次从中国实验室里发表的诺贝尔奖级的物理学论文。&rdquo;</p> <p>　　杨振宁所说的这篇&ldquo;诺贝尔奖级&rdquo;的论文，正是由清华大学薛其坤院士领衔，清华大学、中科院物理所和斯坦福大学的研究人员联合组成的团队，于美国东部时间2013年3月14日在《科学》杂志在线发表的关于量子反常霍尔效应实验成果的学术论文。张金松是这篇论文的共同第一作者。</p> <p>　　杨振宁的话让在场的听众很受鼓舞，张金松也不例外。他联想到9年前自己还是一名物理系大一新生的时候，坐在六教教室里听杨振宁先生讲《普通物理》课的情形。同样是台上台下，同样怀着仰慕的心情，让张金松感到高兴的是，他已经从一个觉得课程很难的本科新生成长为备受杨振宁赞赏的科研论文第一作者，并因此荣获第八届中国青少年科技创新奖。</p> <p>　　回顾自己的成长道路，张金松喜欢用&ldquo;挖宝藏&rdquo;来比喻。他说：&ldquo;从事科学研究，就像是挖掘潜藏的巨大宝藏，没有人知道它藏在哪里，什么时候能挖到，我们只能凭借自己的判断去挖掘，当然很有可能挖不到，但只要坚持不懈，你总会挖到一些东西，比如精美的小石头。&rdquo;在张金松看来，这些&ldquo;精美的小石头&rdquo;同样是很有价值的收获，就像他作为共同第一作者发表在 《科学》杂志上的另一篇关于拓扑诱导的磁性量子相变的学术论文，就是在挖掘量子反常霍尔效应这块&ldquo;大宝藏&rdquo;时收获的一块&ldquo;精美的小石头&rdquo;。而在科学研究的 &ldquo;掘金&rdquo;之路上，张金松收获的不仅是学术上的成果，更是一份让他感到沉甸甸的荣誉。</p> <p style=\"text-align: center\"><strong>胸怀科学梦 奋斗勇创新</strong></p> <p>　　&ldquo;每个人都有自己的理想，每个人都曾经或一直为自己的理想奋斗着。我是一个热爱生活的人，希望自己的生活是充满理想不断奋斗的历程。从圆梦清华到振兴中华的抱负，这些都是我曾经或正在为之努力和奋斗的理想。&rdquo;这是张金松写在个人自传开头的一段话。那是在2008年初，张金松提交入党申请一年后的5月13日，他正式成为中国共产党预备党员。</p> <p>　　一直以来，张金松都是一位品学兼优的学生。大二被推荐上党课，他第一次系统地了解了党的基本知识和马克思主义的经典理论，那些德高望重的老党员们给了他深深的感动和鼓舞。&ldquo;作为年轻一代的我们，有必要肩负起时代赋予我们的历史使命，在建设有中国特色社会主义的伟大事业中贡献自己的力量。&rdquo;张金松曾这样写道。也正是从那时开始，一颗&ldquo;科学报国梦&rdquo;的种子就在张金松的心里扎根了。</p> <p>　　本科毕业后，顺利保研的张金松对自己的要求更加严格了。他说：&ldquo;作为一名预备党员，我时时都在提醒自己要更加严格地要求自己，要有更强的责任意识，遇到困难也要有更强的决心和毅力。&rdquo;</p> <p>　　研究生一年级，张金松遭遇了&ldquo;最忙最累&rdquo;的一年。他的导师是物理系的年轻教授王亚愚，2008年从美国回清华任教，张金松是他在清华带的第一批学生。因此，实验室从无到有的一切工作，张金松都参与其中。&ldquo;从仪器的购买、搭建到调试，再到实验数据采集程序的编写和优化，一切都是从零开始。&rdquo;张金松说，&ldquo;有时候一个电话打来说设备到了，就要立刻赶过去验收。&rdquo;面对繁杂琐碎的事务，张金松并不清楚未来的科研道路会怎样，但他明白，要实现自己的科学梦，需要一步一个脚印地走。</p> <p>　　2009年秋至2010年秋，张金松在美国纽约州的布鲁克海文国家实验室进行了为期一年的交流学习。当他带着对国外先进实验设备和技术的了解回到清华的时候，薛其坤领衔的研究团队有关量子反常霍尔效应的实验研究正处在稳步推进阶段，张金松加入了这个团队，承担起了对拓扑绝缘体材料的磁电阻和反常霍尔效应进行精密测量的工作。</p> <p>　　开始的两个月是新鲜而有趣的，每一次测量得到不同的结果都让张金松感到兴奋。但很快张金松就发现了问题。那时候，每一块生长好的样品送到张金松的手里，都要先送去做复杂的电极镀膜工作，然后才能进行测量，过程很慢。&ldquo;我觉得这样做太慢了，不能再这样做下去。&rdquo;张金松说。于是，他和导师王亚愚商量，开始尝试自己动手刻划样品，并按压铟电极。张金松的尝试很成功，从最开始的探索时期一天才能准备和安装两个样品，逐渐到两个小时就可以完成，极大地提高了测量效率。张金松把这项技术教给实验室的其他成员，根据他的建议，实验室购入了新的测量仪器，整个实验室的测量效率为之大幅提高，从以前的每周发送一次测量数据变为了每天都能发送一次测量数据。张金松表示：&ldquo;我是一个非常务实的人，觉得用仪器加工的样品再漂亮，不够快也是不好的。如果按照以前的效率，我们肯定不会这么快的做出这项成果。&rdquo;</p> <p>　　对此，同学冯硝评价张金松说：&ldquo;凝聚态物理的输运测量真的太适合他了。&rdquo;张金松的动手能力很强，电子电工实习的课程他从来都是班级第一名。小学的时候，看着别的小朋友们都有自己的冰车，他就凭借平时看爸爸干木匠活儿的记忆，参照着借来的冰车，自己动手做了一辆。在科研的道路上，张金松正是这样，不畏挑战、勇于创新，向着自己的梦想稳步前进。</p> <p style=\"text-align: center\"><strong>不惧挑重担 团结乐分享</strong></p> <p>　　自从进入研究生阶段，除了学习和科研，张金松也在尝试着改变自己。张金松并不是一个外向的人，之前参与集体活动并不积极主动。成为一名预备党员后，他就告诫自己，必须以共产党员的标准要求自己，发挥党员的积极性和带头作用，主动服务广大同学。于是，在研究生新生的第一次大会上，他主动站出来承担了系研究生会学术副主席的工作，主要负责各种学术活动的组织和宣传。</p> <p>　　2008年 10月份开展物理学家叶企孙诞辰110周年纪念活动期间，张金松奔走于北京各高校和研究所，张贴宣传海报，尽可能地保证活动的圆满举行。在清华大学第202期（物理系）博士生学术论坛期间，他作为组委会一员，参与了各种组织协调工作。事情虽都不大，但张金松都很认真地对待，尽管很累，但他也体会到了为大家服务的快乐。</p> <p>　　在实验室里，张金松就像一个&ldquo;大管家&rdquo;。大到仪器购买、经费申请，小到财务报销、补贴发放等各种各样的事情，他都承担过。&ldquo;这些事情虽然和科研不直接相关，但都对实验室的科研工作有影响，在暂时没有专门的工作人员承担的时候，我希望自己能够尽最大的努力把它做好，不要耽误了实验室的科研工作。&rdquo;张金松说，&ldquo;这不是老师的要求，是我自己对自己的要求。&rdquo;</p> <p>　　对待实验室的师弟师妹们，张金松同样毫无保留。他常常主动去找师弟师妹们，利用自己做实验的机会，把掌握的各种技术技巧传授给他们。&ldquo;我很快就要毕业了，但我希望实验室能继续更好地开展工作。&rdquo;张金松说。尽管现在自己要做的实验少了，张金松仍然时常呆在实验室，为其他同学提供尽可能的帮助。</p> <p>　　系里的同学邀请他参加&ldquo;物理系研究生学术沙龙&rdquo;，分享学术经验和感悟，张金松欣然答应，与师弟师妹们真诚地交流各种感受和经验。此外，他还应邀为《科学世界》撰写科普文章《发现量子反常霍尔效应》，让中学生也能一起体验科学世界中的奥秘。他还在中宣部、教育部、共青团中央共同主办、中央电视台承办的《五月的鲜花&mdash;&mdash;&mdash;我们的中国梦》晚会上，与全国人民分享团队的科研成果和自己的学术理想。</p> <p>　　即将博士毕业的张金松将继续做一名科研道路上的&ldquo;掘金人&rdquo;，他说：&ldquo;科研的道路已经在我面前敞开，我会继续走下去，希望自己未来能够领衔做出具有领先性和带动性的出色的科研成果，那时候我才能真正成为一名科学家，更好地实现我的科学梦。&rdquo;</p> <p>　　<span style=\"font-family: 楷体,楷体_GB2312\">来源：新清华 2013-10-18</span></p></P>     </div>'),(104,'【人物】“多面”陈楠','http://news.tsinghua.edu.cn/publish/news/4205/20130923155601088799438/1.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】“多面”陈楠</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">&ldquo;多面&rdquo;陈楠</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\"><strong><span>&mdash;&mdash;</span><strong><span>记清华美院视觉传达设计系副教授陈楠</span></strong></strong></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学生记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">龚元</span></strong></p> <p style=\"text-align: center\"><img style=\"width: 335px; height: 317px\" alt=\"\" width=\"425\" height=\"425\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130923155601088799438/1.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为陈楠近照。</span></p> <p style=\"text-align: left\">　　<span style=\"font-family: 楷体,楷体_GB2312\">陈楠，文学学士、艺术硕士，美术学院视觉传达设计系副教授，硕士生导师；平面设计系统开发研究所所长。中国美术家协会会员；北京工业设计促进会理事会理事；中国包装联合会设计委员会全国委员；IDF国际设计联合会（大中华区分会）常务理事；香港杂志《MILK新潮流》专栏作家。从事视觉传达设计专业的教学、研究与设计实践工作；主讲大学本科与研究生视觉传达设计专业课程。</span></p> <p><span style=\"font-family: 楷体,楷体_GB2312\">　　从业至今，共完成各类设计数百项；著书出版19部；发表论文31篇；发表文章70余篇，其他获得国家级奖励22项，国际奖励5项。2012年，获得&ldquo;清华大学青年教师教学优秀奖&rdquo;；2009年获&ldquo;光华龙腾奖&rdquo;；2008荣获&ldquo;（第四届）中国设计业十大杰出青年&rdquo;荣誉称号；2008年获&ldquo;2008中国创新设计红星奖奥运设计&rdquo;特别奖；2004.3 荣获&ldquo;日本TDC国际设计大赛优异奖&rdquo;；2002年获&ldquo;IDN十年大奖&rdquo;国际设计比赛优异奖等。</span></p> <p>　　走进陈楠的工作室，最先进入眼帘的便是墙上的甲骨文字绘，这些意义非凡的符号被有规律地组织在一起，成为了一幅幅跳跃的风景。于是初来者便很容易对这个屋子的主人充满好感和好奇。</p> <p>　　说起陈楠，很多人的第一印象便是其设计师的身份。比起艺术家的神秘，雾里看花也设计师展现在世人眼中的常态。在很多场合，陈楠的设计作品都让人觉得十分熟悉。但是比起他的设计作品，却极少有人知道，这个严谨踏实的设计师其实还是一个多面手。</p> <p style=\"text-align: center\"><strong>用研究的精神授课</strong></p> <p>　　作为一名教师，课堂是诠释设计思维最好的场所，但如何组织好一堂课，却是需要下一番功夫的。陈楠的课堂充满了&ldquo;研究&rdquo;的味道，他十分重视学生设计方法的培养。他要求的设计，不仅仅是灵感，还要对形态、颜色、元素组合都经过反复研究而生成，这样的设计不仅具有美感，更有文化内涵。在《综合设计基础》课上，他曾要求学生做过自己的脑图，这其实是一种另类的自我剖析，在有趣的形态下，蕴含的其实是一种极为理性的态度，即了解自己。他曾带领学生前往故宫，要求每个学生针对一件事物进行研究，最后找出规律完成设计。有人从&ldquo;斗拱&rdquo;里面发现了&ldquo;节点&rdquo;，进行了折纸的设计，有人从明式家具中摸索出了穿插的原理，从而进行了一系列新家具的设计。在谈到其中一位学生时，陈楠十分欣慰地说：&ldquo;这位同学的研究点是明式家具中特殊的一支&mdash;&mdash;组合推拉式家具，从中提取概念设计了应用于现代书房的兼有楼梯与书柜两种功能合一的特殊装备，我都想定制一套了。&rdquo;</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"320\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130923155601088799438/2.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为学生和自己的脑图合影。</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\"><img border=\"1\" alt=\"\" width=\"425\" height=\"287\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130923155601088799438/3.jpg\" /></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为陈楠的设计手稿。</span></p> <p>　　另一方面，他也随时注意将设计的完整性带入到教学过程中，这不仅意味着思维的完整，还意味着表达、制作的完整，正如他的学生所言：&ldquo;陈楠老师对我的方案提出了建设性的意见和建议，如海报中柳叶的形态、与风雨的构图关系上还需再考究些，文字形态是否能与画面有更进一步的联系，画面是否能有更多的层次，包括激光打印浅灰的颜色效果不好等。这些需要要深入的因素帮助我完成对命题的进一步推敲和视觉表现语言的深度挖掘。&rdquo;陈楠似乎一直将他的课堂作为一件作品来细细雕琢着，他的课程计划具体到每个细节，他的课程常以学生上交的作业册、作品展览和他自己的一本书作为结束。过程的完整常能体现态度的严谨，学生的作业册中包含了作业从开始到结束的每个环节，这种切实的记录总让人觉得踏实。陈楠说：&ldquo;我从来没指望他们上这样一门课后就能养成完整设计的习惯，我只是希望他们能体验一下，在以后的某个阶段能有些益处。当然，如果他们能坚持下去，就更好了。&rdquo;</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130923155601088799438/5.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为陈楠的视觉日记。</span></p> <p style=\"text-align: center\"><img border=\"1\" alt=\"\" width=\"340\" height=\"412\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130923155601088799438/4.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为学生的视觉日记。</span></p> <p>　　陈楠还非常提倡随时记录，不管是自己的灵感还是各种设计元素。在课堂上，陈楠会给学生们展示他在平时积累的设计素材，一般是按照主题来梳理，往往是一些生活中常见的图形和元素，比如各式文字，或是街头的信笔涂鸦，或是小广告，凡是他觉得有趣的，他都会小心地将其记录，而后纳入素材库中。甚而，他将这些素材一一划分，辅之以解说并加以呈现。每次课程结束后，课上的同学都会收到陈楠自制的素描本，他习惯于一刻不停地写写画画，也希望学生们能养成这样的习惯，他的学生常觉得收获颇丰。</p> <p>　　在学院，陈楠的《综合设计基础》和《海报设计》是极受欢迎的课程。近期他获得了&ldquo;清华大学青年教师教学优秀奖&rdquo;。</p> <p style=\"text-align: center\"><strong>用童真的心态生活</strong></p> <p>　　作为设计师和教师的陈楠给人的印象往往是严谨理性，然而很少有人知道他在生活中却是一个充满童趣的人，他将童年的印记带入生命的整个过程，以至于他的身上总是呈现出矛盾的二元对立&mdash;&mdash;成年人的豁达冷静和儿童般的好奇心。拥有成年人的特征并不奇怪，奇怪的是儿童般的好奇心，这一方面或许源自于他逆向思维的习惯，另一方面也许源自于他的怀旧主义情怀。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130923155601088799438/6.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为陈楠搜集的玩具模型。</span></p> <p>　　认识陈楠的人大抵知道他是一位坚定的怀旧主义者，最明显的例证是他的工作室，还未进入，玄关处的老旧供桌、布老虎、泥玩具都会让人产生一种渗入到泥土中的踏实感，这种踏实感来源于那个已经追溯不及的时代。陈楠喜欢搜集老式的玩具、小人书，会精心保存留有旧时印记的点滴，会在忙碌的工作之余，将周末寻访老旧建筑当作生活中唯一的大型娱乐和冒险。对陈楠而言，这种怀旧来源于环境的改变，作为一名典型的70后，陈楠对社会转型的感受极深，成年以后看幼时的世界似乎是水中之花，虚幻而美好，门柱的摩擦声响在耳边，也成了岁月长河那岸遥不可及的歌谣。他的怀旧方式却不止是搜集和感怀，更多的是一种体验。他会将幼时扔掉的小人书一本本地集全，会将得到的玩具拆开把玩，会动手制作小时候玩过的手工枪，会将随手捡来的木头依形雕刻成各种动物。在这个阿多诺口中的&ldquo;一成不变的今天&rdquo;，似乎很少有人能如此认真地去体验一种情感，尤其当这种情感具有十足的形而上学色彩&mdash;&mdash;它并非生活所必需的，陈楠的怀旧体验也因而显得珍贵起来。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130923155601088799438/7.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为陈楠的雕刻作品。</span></p> <p>　　怀旧主义者大抵心思细腻，像诗人一般悲悯和感伤，他们往往更加热衷于那些已逝的过往，那些他们臆想中的片段，而对现实生活，却敬而远之。然而，这种悲悯在陈楠身上却罕有得见，也许是因为他的工作，设计的实用性决定了设计师的入世命运，他们很少能够像艺术家一样沉浸于自己的世界；或许也源自于他的性格，&ldquo;我一直是一个充满表达欲望的人，我喜欢竞争，苏轼、曹操这样的人是我的偶像。&rdquo;可见陈楠骨子里是奋进而现实的。所以至少对观者而言，陈楠的怀旧十分轻松，他会细细讲述他和小人书之间不可不说的故事，会和别人分享他近来走街串巷的所得，甚至会把他新收藏的玩具整理成系列加以呈现，这似乎是一种娱乐，让观者觉得新鲜而愉悦。</p> <p>　　而这样的怀旧中还有了一丝不一样的悠闲，他的怀旧情怀似乎蔓延到了生命的每个角落，以至于他的所行所止都笼上了相同的节奏，他似乎永远是慢悠悠的，生活和工作的压力则被放置到了另一个空间。这种闲适在匆忙的今天十分难得，也许陈楠的怀旧最终寻找的也就是这样一份心态，这是一种对于生活的细细体味，是在每个细节处的驻足，是以发现新的东西为乐趣。佛家常言：&ldquo;止是禅定之胜音，观是智慧之由藉。&rdquo;讲的也就是这种能停下来欣赏风景的心情，无论身处怎样的社会，能够有这样一份&ldquo;闲心&rdquo;，其实是弥足珍贵的。</p> <p>　　远看陈楠，很多人会定格于其设计师的身份。而近看陈楠，他于教学中渗入细致，于细节中品味生命的态度却更让人倾服。本文中的陈楠敏锐、细致、认真、严谨、充满童心又昂扬向上，似乎很难用一个词去概括他的性格，而真实的陈楠又比这短短千余字中多描述的要丰满立体得多，距他的距离越近，就越能从他设计师的身份中感受出一种不一样的宽博来。</p> <p style=\"text-align: right\">　　供稿：美术学院 编辑：范　丽</p></P>     </div>'),(107,'【人物】张如范：志在制备出世界最长的碳纳米管','http://news.tsinghua.edu.cn/publish/news/4205/20130815152333754225397/zhang.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】张如范：志在制备出世界最长的碳纳米管</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">志在制备出世界最长的碳纳米管</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\">&mdash;&mdash;记清华大学化工系2009级博士生张如范</span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">研通社记者</span></span><strong><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\"> 陶一萍 张旭 </span></span></strong><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">新闻中心记者</span></span><strong><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\"> 范丽</span></span></strong></p> <p style=\"text-align: center\"><strong><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"440\" height=\"325\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130815152333754225397/zhang.jpg\" /></span></span></strong></p> <p>　　<span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">张如范，清华大学化学工程系直博四年级学生，师从魏飞教授。在攻读博士期间，在导师的指导和与科研团队其他科研人员的通力协作下张如范成功制备出世界上最长的碳纳米管，实现了单根碳纳米管的光学可视化及宏观尺度下的可控操纵，首次发现了宏观尺度碳纳米管结构超润滑现象。目前以第一作者身份发表SCI论文5篇，其成果相继发表在《自然-通讯》（Nature Communications）, 《先进材料》（Advanced Materials）, 《美国化学会纳米》（ACS Nano）等国际顶级专业期刊上，申请6项专利，参与撰写两部专著。曾获2011年能源与环境新型纳米材料国际会议最佳墙报奖、第13届纳米管科学与应用国际会议最佳墙报奖、巴斯夫亚太地区科技论坛最佳墙报奖、2012年教育部博士研究生学术新人奖、研究生国家奖学金、金涌奖学金、巴斯夫优秀博士生特等奖、清华大学第304期及第330期博士生论坛优秀报告等。其科研成果曾被中央电视台、北京电视台、《人民日报》、《科技日报》、《北京日报》、《大公报》等多家媒体报道。</span></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\"><img style=\"width: 328px; height: 415px\" alt=\"\" width=\"340\" height=\"421\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130815152333754225397/zhang2.jpg\" /></span></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">图为张如范在实验中。</span></span></p> <p>　　张如范从本科毕业设计开始接触纳米研究前沿课题，到为解决这些课题历经重重挑战，再到屡创佳绩取得累累硕果，他是如何破茧成蝶、在科研之路上崭露头角的？</p> <p>　　提到清华工科男，难免不少人会先入为主，觉得张如范是一位整日埋头实验、敏于行而讷于言的工科男生。但在采访过程中，张如范的开朗健谈与诗词才情给笔者留下了深刻印象。他不仅有着工科男的沉稳与踏实，也有着对文艺的追求与情怀。勤奋、巧思、善于总结，以及对科研的乐观和激情都是他取得成功的重要因素。一个多小时的采访，他娓娓道来，生动展示了他的科研与生活。</p> <p style=\"text-align: center\"><strong>天道酬勤，&ldquo;柳暗花明&rdquo;破瓶颈 </strong></p> <p>　　2005年张如范考入中国石油大学（北京）化工学院。在本科期间，他勤奋学习，夯实专业基础，并一直保持乐观的心态，努力培养对新事物的兴趣；曾任班长、化学爱好者协会副主席，学生记者等职务，从社会工作中得到许多收获。</p> <p>　　2009年，张如范以优异的成绩从中国石油大学（北京）保送到清华大学化工系。当年3月份，他提前来到清华做本科毕业设计，跟随魏飞老师做超长碳纳米管制备与性质方面的研究。从本科学石油化工，突然转到完全陌生的纳米领域，面临的困难可想而知。张如范没有退缩，从硬着头皮啃英文文献开始起步。</p> <p>　　接触课题的前两个月，尽管张如范&ldquo;折腾&rdquo;得十分辛苦，但什么成果也没得到。看到别人在实验方面突飞猛进，他一度产生了很强的挫败感。天生乐观的他并没有因此放弃，而是继续在这个课题上努力。由于课题本身难度较高，在日复一日的实验中，张如范依然进展缓慢。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"482\" height=\"321\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130815152333754225397/zhang3.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为张如范在实验中。</span></p> <p>　　天道酬勤。在一次实验中，他偶然发现了一种实现碳纳米管光学可视化的方法。前面连续两个月失败的经历让他敏感地意识到这个发现的意义，他很快利用这种现象设计出一种简单但有效的测量单根碳纳米管力学性质的方法。为了尽快完成这项工作，在清华园的第一个寒假他就放弃了回家过年的机会，大年初一还坚持在实验室处理数据。功夫不负有心人，来到清华的第二年，他的第一篇论文就发表在材料领域国际顶级专业期刊《先进材料》（<em><strong>Advanced&nbsp; Materials</strong></em>）上。</p> <p>　　从此，张如范的科研激情一发不可收拾。清华求学四载，他曾连续两年春节都在实验室度过。</p> <p>　　在与北京大学进行合作的过程中，由于对方实验室电子显微镜使用时间的限制，张如范只能在晚上其他人都下班后才有机会使用。曾经长达两个月的时间里，他经常从晚上八点开始做实验，一直做到早上八点。谈及这段经历，张如范说，条件有限、实验不顺、遇到困难甚至迷惘、困惑等经历都是奋斗路上所必需的，对于年轻人的成长是一件好事。正如导师魏飞老师所言，要想真正做出点成绩，必须要经历一个磨练心智的过程，只有这样你才能真正意识到困难和问题之所在，才能够真正沉得住气，深入进来。</p> <p>　　经历过无数次的挫折之后，他开始明白科研是一个需要静下心来、不断思考、迂回前进的过程。</p> <p style=\"text-align: center\"><strong>匠心独运，&ldquo;山寨方法&rdquo;克难关</strong></p> <p>　　张如范的巧思，用他的话说就是&ldquo;胡思乱想&rdquo;。正是这种天马行空的想象，善于在思考中创造新方法，成为他取胜的&ldquo;法宝&rdquo;之一。面对有限的实验设备和条件，他不拘常规，大胆尝试，敢于创造和运用各种 &ldquo;山寨&rdquo;的方法来解决设备缺乏的困难。</p> <p>　　碳纳米管的研究是一个跨学科的研究领域，需要综合运用多种仪器设备对其性能进行表征。然而张如范所在的实验室很多条件都不具备。面对这些困难，他虽然也会到外单位寻求合作，但更多的是充分发挥自己的主观能动性，利用现有条件，巧妙改造，自制设备进行研究。</p> <p>　　比如，为了摆脱电子显微镜对碳纳米管表征的限制，张如范匠心独运，巧妙构思，提出了一种实现碳纳米管光学可视化的方法，通过常规光学显微镜就可以对单根的碳纳米管进行表征，并解决了研究过程中的一个个难题。他首先制备了一种带有微槽的硅片基底，然后利用超长碳纳米管漂浮生长的特点，使其悬空在凹槽上面，然后在这些悬空的碳纳米管上负载大量二氧化钛纳米颗粒。由于这些颗粒对可见光有很强的散射能力，从而实现了光学显微镜下单根碳纳米管的可视化观察，并可进行后续操纵。该方法不需要任何复杂设备，只需要几秒钟就可完成，简单高效，大大提高了碳纳米管的结构表征、性能测量以及器件构建效率。这项工作的文章发表在《自然通讯》（<strong><em>Nature Communications</em></strong>）上后，其独特的构思和巧妙的设计得到了国际同行的高度评价。</p> <p>　　研究碳纳米管的力学特性，常规的做法是单根碳纳米管固定在专门的力学仪器上进行测量。这种测量一般需要精度达到纳米级的专业设备。可是张如范所在的实验室并没有这方面的设备，怎么办？</p> <p>　　面对这种困难，张如范并没有一筹莫展。在不断思索解决方案的过程中，灵感再次光顾了这个勤奋的研究者。张如范的奇思妙想又来了，他利用一根毛细管从悬空碳纳米管侧面&ldquo;吹气&rdquo;，使其发生弯曲，根据气速大小、颗粒数量和粒径以及碳纳米管的弯曲程度来计算其受力大小，从而测量出它们的力学性质。</p> <p>　　为了能够顺利实现&ldquo;吹气&rdquo;法，首先需要使碳纳米管生长在具有一定沟槽的硅片基底上。而在硅片上刻槽的传统方法是微加工工艺，成本很高。而实现&ldquo;吹气&rdquo;法需要的沟槽宽度和深度都很高，制作这样的一个沟槽成本接近万元。为了能够降低成本，张如范逆向思考：既然微加工方法如此之贵，何不将三块硅片拼接在一起，形成一个沟槽？然而，这种粘接硅片的方法却面临一个关键的难题：缺少一种能够耐受1000<sup>o</sup>C高温并且不影响碳纳米管生长的粘合剂。为了找到合适的粘合剂，张如范进行了大量的尝试，然而无一例外都以失败告终。突然有一天，他灵光一现，心想：为何不用简单的金属箔片去尝试呢？他用实验室常见的铝箔进行试验。将小片铝箔放在两个硅片之间，然后在高温下将铝箔熔化，将两块硅片粘附在一起，冷却后铝箔从液态变为固态，就可以将所粘附的硅片牢牢固定住，从而完美地固定三块硅片从而构成沟槽。这样一来将加工成本几乎降为零。</p> <p>　　这个巧妙的创意在《先进材料》（<em><strong>Advanced Materials</strong></em>）上发表后相继被自然出版集团-亚洲材料（<em><strong>NPG Asia Materials</strong></em>）以及美国纳米科学与技术网站<em><strong>Nanowerk</strong></em>两个著名网站评为亮点文章。张如范说，&ldquo;这是一个看似很&lsquo;山寨&rsquo;的方式，但是背后却蕴含着很多巧妙的构思。有句话叫做&lsquo;有条件要上，没有条件创造条件也要上&rsquo;，做研究就需要有这种闯劲和念头。&lsquo;君子性非异也，善假于物也&rsquo;，也正是这个道理。&rdquo;</p> <p style=\"text-align: center\"><strong>善于积累，&ldquo;垃圾数据&rdquo;废变宝</strong></p> <p>　　善于和热爱总结积累是张如范科研工作的另外一个法宝。每一本厚厚的科研笔记和科研箴言都是值得挖掘的宝藏，这些总结和积累更是他日后很多重大成果的基石。张如范翻出一本本厚厚的《科研工作记录》，扉页上用苍劲挺拔的字体写道&ldquo;敬业者，专心致志以事其业也&rdquo;。密密麻麻，记载着他多来的实验进展和心路历程。纷繁复杂的数据，及时更新的进度，还有自己的苦闷、灵感都包含其中。</p> <p>　　张如范一个重要的研究方向是如何提高碳纳米管的长度，使其达到米级甚至更长，从而为超强纤维等材料的制备提供可供选择的材料。然而，这却是一个世界性的难题。自从2010年魏飞教授带领的研究组在国际上首次制备出20厘米长的碳纳米管后，在此后3年的时间里，国际上再也没有任何新的进展。张如范在从事超长碳纳米管制备的过程中，经常会遇到碳纳米管停止生长的情况。多次失败后，他常常习惯把以往所有的实验数据进行整理和分析，努力从中寻找蛛丝马迹。</p> <p>　　一次次，最终他从那些看似杂乱无章的数据中发现了相互间的必然联系。由此建立了一种能成功描述超长碳纳米管生长的模型。而在此理论模型下，以前所有的数据，哪怕是曾经认为的&ldquo;垃圾数据&rdquo;都能得到合理的解释。也正是靠了这种机理模型的指导，张如范在超长碳纳米管的制备过程中紧紧抓住其核心要素，经过3年的努力，成功制备出单根长度达到半米长的碳纳米管，这是目前世界上最长的碳纳米管，超过现有记录的两倍以上。这项工作发表在《美国化学会纳米》（<em><strong>ACS Nano</strong></em>）上后，引起了广泛关注。美国纳米科学与技术网（<em><strong>Nanowerk</strong></em>）、中央电视台、人民日报等多家主流媒体都做了报道。</p> <p>　　&ldquo;这项工作做出的那一刻，我非常激动。三年多的时间里，我常常为得到大量无用的数据而郁闷，然而通过这一模型的转化，以前所有的数据都&lsquo;化腐朽为神奇&rsquo;、&lsquo;变废为宝&rsquo;，最终都能派上用场。&rdquo;说到那时的兴奋和感慨，张如范仍激动不已。</p> <p>　　张如范对科研有着非同寻常的激情和乐观态度。他的科研过程并非一帆风顺，很多时候是非常枯燥甚至坎坷的。在实验遇到瓶颈的阶段，他往往会赋诗一首，抒发烦闷，寄情于文字之间。</p> <p style=\"text-align: center\"><strong><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">苏幕遮&mdash;科研小生记事</span></span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　　读文献，做实验，夜以继日，双颊洒热汗。暂将此身献科研，学海无涯，长途路漫漫。</span></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　　常失败，淡然看，苦中有乐，悲喜何须念。磨剑尚需待十年，这才几时，继续埋头干！</span></span></p> <p>　　这首词是张如范在一个夜深人静的小树林里作的。那时候他经常通宵达旦地做实验，即使这样，在长达半年的时间里却依然没有任何进展。其内心的苦闷可想而知。但是他并没有气馁，经常会到实验室附近的小树林里去散心，去反思前因后果。有时灵机一动、茅塞顿开，&ldquo;柳暗花明又一村&rdquo;。</p> <p style=\"text-align: center\"><strong><span style=\"font-size: 14px\">衣宽不悔，&ldquo;太空天梯&rdquo;鸿鹄志</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">莫看小管轻如鸿，</span></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">韧性超强胜弩弓。</span></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">来年若长无限度，</span></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">可做天梯上天庭。</span></span></p> <p>　　张如范用自己的这首诗来表达他的梦想，&ldquo;希望能制备出了米级甚至公里级以上的碳纳米管，为超强纤维以及太空天梯的制备开启一线曙光。&rdquo;面对这个高难度的前沿课题，张如范从最初的恐惧，到坦然接受，再到如今渐入佳境、享受探索的过程，是连续两年春节留校攻克实验的付出，也是无数次通宵达旦做实验的积累，更是面对有限的客观条件笃定不放弃的凝聚。</p> <p>　　在采访过程中，张如范对自己的导师魏飞教授表达了深深的敬佩和感谢之情，&ldquo;魏老师是我遇到的对我影响最大的人，其为人为学，都堪为楷模。跟着魏老师，自己的眼界、心胸等各方面都得到极大的开阔。&rdquo;同时，他也对实验室的其他老师和同学表达了感激之情，&ldquo;离开大家的合作，我也很难取得这些成果&rdquo;。</p> <p>　　谈到科研经历，张如范也很乐意将自己的心得与大家分享。他认为勤奋工作和善于思考都很关键。&ldquo;既要埋头拉车，也要抬头看路。勤奋的双脚要踏在正确的方向上。&rdquo;另外，需要有敢于挑战困难的勇气，还需要保持乐观的心态，&ldquo;科研其实挺苦的，需要耐得住寂寞。即使在最失落的时候，也要相信自己经过努力能够看得到希望。&rdquo;</p> <p>　　&ldquo;成功的花，人们只惊羡它现时的明艳！然而它当初的芽儿，浸透了奋斗的泪泉，洒遍了牺牲的血雨。&rdquo;张如范一步步走来，在历练中不断奋进，极佳地诠释了此中深意。</p> <p><strong><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　　导师魏飞教授评语：</span></span></strong></p> <p><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">&nbsp;&nbsp;&nbsp;&nbsp;从张如范同学身上，我感到了作为导师与富有活力和创造性的学生共同研究的快乐与惊喜，这不仅表现在他投入科研的热情、许多个通宵工作的拼命精神及创造性、使宏观尺度上纳米显示这一技术难题很快解决、并使毫米级长度碳纳米管力学测量等前沿课题可以通过简单仪器实现，还表现在他对前沿基础问题持之以恒的努力与奋斗。出身于工科专业，对关键科学问题的专注是出成绩的关键，而实现这些成果的过程则是充满着艰辛与曲折。经历这一过程，并有持续科研的能力才是做好科研的第一步。希望如范同学以此为起点，做高起点与质量的工作，在纳米科技这一前沿领域有清华工科的声音。</span></span></p> <p>&nbsp;</p></P>     </div>'),(125,'【人物】程向君：通向心灵的巴别塔','http://news.tsinghua.edu.cn/publish/news/4205/20130522155337925954507/1.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】程向君：通向心灵的巴别塔</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><span style=\"font-size: 18px\"><strong>通向心灵的巴别塔：程向君的漆画之路</strong></span></p> <p style=\"text-align: center\">　<span style=\"font-family: 楷体,楷体_GB2312\">　学生记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">梁 开</span></strong></p> <p style=\"text-align: center\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"482\" height=\"320\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130522155337925954507/1.jpg\" /></span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为程向君在画室中。</span></p> <p>　　<span style=\"font-family: 楷体,楷体_GB2312\">程向君，清华大学美术学院工艺美术系副教授。1982年考入（原）中央工艺美术学院装饰绘画专业；1986年毕业留校，1988年获得&ldquo;第七届全国美展&rdquo;铜奖；1995年在中国美术馆举办个人展览，作品被中国美术馆收藏；担任第十届、第十一届&ldquo;全国美术展&rdquo;评委和韩国青州国际艺术双年展评委，中国美术家协会漆画艺术委员会副主任；2012年9月至今，先后受邀在浙江省美术馆、河南省美术馆、福建省美术馆、厦门市美术馆举办个人绘画作品巡回展。</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130522155337925954507/2006chenxiangjun.jpg\" /></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为创作中的程向君。</span></p> <p>　　在这看似 &ldquo;坦途&rdquo;之中，程向君在艺术道路上付出的艰辛有几人知！在漆与画之间，他经历了怎样的纠结与波折，走出一条自己的漆画艺术之路，构建了通向心灵的巴别塔？近日，&ldquo;心灵的巴别塔&mdash;&mdash;程向君绘画作品巡回展&rdquo;先后在河南省美术馆、福建省美术馆举行，使笔者有机会面对面采访程老师。敲开程向君工作室的大门，未曾想站在眼前的是一位白面素净、衣着简朴、笑容微敛的老师，工作室也是整洁、简单，除了桌上的画具、材料，堆放的作品，一台电脑，不多一分装饰，在这个安静的环境中，我们茶聊起程向君的漆画那些事儿。</p> <p style=\"text-align: center\"><strong>爱画画 从名师：艺术青年的求学之路</strong></p> <p>　　1961年6月程向君出生于辽宁沈阳的一个军人家庭，1969年由于军队院校的重新部署随父亲从沈阳迁到河南信阳。这一南一北的成长经历在文化上给予了他深刻影响。1980年，经启蒙老师郭渊源的介绍，19岁的程向君只身来北京学画，受教于中央美院教授杜健、高亚光、赵友萍、李天祥、苏高礼、戴士和等教授。程老师感慨自己有幸遇到这么多优秀的老师，&ldquo;我的绘画深受中央美院这几位老师的影响，那时的师生关系很充实，他们为我的艺术道路打下了坚实的基础，一辈子感激他们。&rdquo;</p> <p style=\"text-align: center\"><img alt=\"\" width=\"539\" height=\"211\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130522155337925954507/55.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">程向君江南速写作品。</span></p> <p>　　&ldquo;那是个理想主义的年代，有梦想，画画完全出于个人的爱好。我住在呼家楼，早晨坐第一班车赶到圆明园画风景，到时已经有很多人在那里画画了。每天时间都安排得特别满，上午安排写生，下午到一些培训班里画模特，晚上补习文化课。&rdquo;</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"272\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130522155337925954507/56.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">程向君油画作品：甘南写生。</span></p> <p>　　怀着纯粹的绘画理想，受中央美术学院招生地域的限制，21岁的程向君叩开了中央工艺美术学院装饰艺术系壁画专业的大门。在这里，他得到了范增、袁运甫、权正环、乔十光等名师的教诲，系统学习了中外美术及工艺课程，写实与装饰、绘画与工艺在程向君那里经历了碰撞与融合，对他之后个人艺术风格的形成产生了至深影响。</p> <p style=\"text-align: center\"><strong>由壁画到漆画：就这么执着地，一做就是30年</strong></p> <p>　　程向君最早学习漆画是在1983年唐薇老师的铝版漆画课上，但那时他对漆画并不是特别了解，也没有什么&ldquo;感觉&rdquo;。1985年，装饰艺术系教学改革，成立了工笔重彩壁画、陶瓷镶嵌、漆画3个工作室。当时，壁画专业的15个男同学只有程向君一人报漆画，而他报漆画的原因并不是出于对漆艺术的热爱，而是因为个性中不喜欢壁画项目式的团队作战，他更喜欢独立的、体现个人精神的绘画艺术创作。因此，这次由壁画到漆画的选择，不是理想之举，而是无奈之选。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"482\" height=\"319\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130522155337925954507/3.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">老字号92&times;140cm 2007年作</span></p> <p>　　但更让程向君始料未及的是：他喜欢的大漆（天然漆）却偏偏不喜欢他，他出现了严重的过敏反应。&ldquo;当时去福建学漆的时候，因为接触漆的时间太长了，白天在工厂实习，晚上在宿舍里镶蛋壳，开始很自信，觉得没事儿，经过25天后，爆发式的过敏很厉害，乔十光老师来看我时都看不出我原来的模样，整个脸、人都变了形，特别可怕。&rdquo;那时春节快到了，他寻思自己的模样也坐不了火车，就在福建过了一个春节。至今，程向君仍会因为上课时接触大漆引起过敏、手痒致难以入睡。</p> <p>　　无法用大漆，程向君选择了化学漆，却无奈地陷入了大漆与化学漆的&ldquo;材料之争&rdquo;。对于争议，他认为是因为每个人对漆的理解不一样。大漆有大漆的性能，合成漆有合成漆的性能，但最终要追寻的是漆的视觉语言。所谓漆的视觉语言就是它的褐色的半透明元素，追求作品艺术生命的长久，就是它的绘画美学价值。材料固然重要，但如果驾驭这些材料的精神、艺术的动力不足的话，那只剩下材料而已，因此，核心仍是人对艺术的这种创造性及开拓性。</p> <p>　　当被问及是否想过放弃时，程向君说：&ldquo;我都过敏这么严重了，要不做这漆就太亏了。当时就这么执着地，一做就是30年。&rdquo;</p> <p style=\"text-align: center\"><strong>画在先，艺在后：走出一条运用传统类型的材料表现具有中国精神的绘画之路</strong></p> <p>　　作为中国当代最有代表性和影响力的漆画家之一，程向君有着鲜明的个人艺术风格，那一件件棕褐色调、块面抽象的作品，简洁而不失深沉，现代而饱含古韵，充满民族气派和当代性，呈现出鲜明的个人艺术面貌和独特的漆画艺术表现体系。他的艺术风格是如何形成的，又是如何选择的呢？</p> <p style=\"text-align: center\"><img alt=\"\" width=\"369\" height=\"369\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130522155337925954507/2.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">丹巴之旅100cm&times;100cm 2004年作</span></p> <p>　　程向君认为他个人风格的形成与所工作的院校背景有关系，其中最为重要的一个转折点是在1996年，他接受了《中国现代美术全集?漆画卷》的编辑工作，考察和调研全国的漆画作者、作品和博物馆。他强烈地感到当今中国漆画发展的问题是语言单一，审美样式简单化，缺少内涵，而问题的根源在传统工艺上。虽然大家都以一颗虔诚的心去学习漆工艺，但都没有从传统工艺中走出来，甚至做的不如传统。&ldquo;都用一种声音去说话，我觉得这个不是艺术&rdquo;。于是，程向君决心做一些革命性的变化，期间遭遇了很多不解与劝阻。但西安美院艺术史论系程征教授的一句话却令程向君豁然开朗，程征教授说：&ldquo;你们找到的只是漆工艺装饰语言，漆画作为绘画怎么能适宜于漆的表现，这才是真正的漆画语言。&rdquo;于是，&ldquo;寻找真正的漆画语言&rdquo;就成为程向君近20年来追寻的思路，并努力把它做得更彻底。&ldquo;对我而言，画在先，艺在后。&rdquo;</p> <p>　　&ldquo;我研究漆画艺术这么长时间悟到了一句话：简单的复杂化和复杂的简单化。特别是抽象的表现，有的人在做抽象画的时候，看似复杂，实际上传达的东西很简单，可是要把一个简单的东西让人感觉有意味却很难，需要一个人多方面的素养才能构成一个作品的合理性，才能让人看着信服。&rdquo;</p> <p>　　我们有幸在采访时欣赏了程老师多年来的作品，其中既有漆画也有大量的油画，有上千张油画写生，水墨、素描和黑白画作品，足迹遍及祖国大江南北。他每年暑假都会带着学生下乡写生，去过甘南7、8次，平均每天3张油画写生，&ldquo;比学生还勤奋&rdquo;。程老师笑谈在工作的时候丝毫没有觉得自己是一个艺术家，而是一个普通的劳动者，在作漆画时没有一点潇洒的感觉，脏兮兮的，气味儿又大，并谦逊地感慨&ldquo;我做事儿感觉投入很多、很大，但见效还是比较缓慢的&rdquo;。</p> <p>　　程向君就是这样一个人，执着于漆画艺术，坚持独立创作，个性率真而坦诚，在画与漆之间，走出一条属于自己的路&mdash;&mdash;&ldquo;一条运用传统类型的材料表现具有中国精神的绘画之路&rdquo;。这也许是其将展览定名为&ldquo;程向君绘画作品巡回展&rdquo;，并以之通向&ldquo;心灵的巴别塔&rdquo;的原因吧。</p> <p>　<span style=\"font-family: 楷体,楷体_GB2312\">【尾声】在很多人眼中，程向君是一个不善言谈的人，一旦语出却也蛮&ldquo;犀利&rdquo;的。他因为家住得远，常常早6点多就来到学院，下午4点多也便打道回府了，早来早走，确也很难&ldquo;遇到&rdquo;。即便是中午到食堂吃饭，遇到几个老师聊学校的事儿，也觉得像听故事一样新鲜，俨然一副与世隔绝、世外仙人之态。&ldquo;我愿意保持这种相对封闭的状态，这样可以尽量减少外界对我的干扰。有时侯觉得很难融入一个环境之中，因为每天想的还是自己的创作，好像就是这样的性格。&rdquo;是啊，很多艺术家都想保持这份纯粹，但你若愿意真诚地走进他们的世界，他们也会如遇到知音一般坦诚以待、无话不谈。当我这个&ldquo;小知音&rdquo;走出这&ldquo;深深深几许&rdquo;的漆画家程向君工作室的时候，感觉心里&ldquo;满满的&rdquo;。</span></p> <p style=\"text-align: right\"><span style=\"font-family: 宋体\"><span>供稿：美术学院 编辑：范丽</span></span></p></P>     </div>'),(127,'【人物】熊义志：做学生追梦的助力者','http://news.tsinghua.edu.cn/publish/news/4205/20131202135727729489683/xiong.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】熊义志：做学生追梦的助力者</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">做学生追梦的助力者</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&mdash;&mdash;记2013年清华大学优秀党建与思想政治工作者、就业指导中心主任熊义志</span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">记者 </span></span><strong><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">高 原</span></span></strong></p> <p style=\"text-align: center\"><strong><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"510\" height=\"271\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131202135727729489683/xiong.jpg\" /></span></span></strong></p> <p>　　<strong><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">熊义志</span></span></strong><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">，1975年生，1993年考入清华大学机械系，1997年加入中国共产党。1998年~2004年先后就读于我校21世纪发展研究院和公共管理学院，获管理学硕士和博士学位，毕业后在公共管理学院做博士后研究并留校工作。2008年~2009年赴哈佛大学肯尼迪政府学院做访问学者。曾任公共管理学院院长助理、公共管理学院党委副书记，现任我校就业指导中心主任、公共管理学院公共领导力研究中心执行主任。</span></span></p> <p>　　&nbsp;就业中心工作4年，9次进藏，这一数字在熊义志的工作履历上仍在不断增加。</p> <p>　　从他2010年担任我校就业指导中心主任以来，平均每年两次，一次带学生就业实地考察、一次毕业时送他们上任，每次短短数天来不及领略雪域高原的风情就匆匆离去；但他始终把那片太阳眷顾的地方留在心里，总是牵挂着在祖国边疆奉献青春的清华学子们的成长与发展。他言语朴实，但说起学生们的故事就眼神发亮滔滔不绝，得知要刊登他的人物通讯时忙摇头摆手：&ldquo;胡和平、史宗恺等校领导和老师们因为就业的事情去的次数比我还多。学校始终牵挂着走出去的同学们，我们也被他们的精神鼓舞着，毕竟他们才是到最艰苦的地方工作的人，还是多写写他们吧。&rdquo;</p> <p style=\"text-align: center\"><strong>扶上马、送几程 关心一辈子</strong></p> <p>　&nbsp;&nbsp;&nbsp; 索多，我校2013届社会科学学院硕士毕业生，出生在日喀则拉孜县一个小山村里的他是当地第一个也是唯一一个考上大学、而且是到清华读书的孩子。兄弟姐妹5人，他排行老三，其他人都只完成了小学学业。清华研究生毕业后的他，决心回家乡工作。</p> <p>　　&ldquo;索多很早就决心回西藏基层工作，非常坚定。我和他很熟悉，前后长谈过三次。&rdquo;熊义志说。索多从小天资聪颖，学习成绩优秀，小学毕业后便被推荐到山东一所西藏中学就读，此后在省重点日照第一中学读高中并考取清华。从十二三岁的小索多只身一人来到远离家乡的地方独自生活学习开始，回西藏、回到父母身边的愿望就深深埋藏在他的心底。&ldquo;就像他对我说的，回到家乡是自然的过程。至于是什么原因让他重新回到原点，他说那是一种力量，那种力量来自于责任。从西藏到山东再到清华，走的每一步、得到的每一次机会都来之不易，机会也意味着责任，如果只想着自己的舒适与安逸，就对不起家乡一直关心着他的人们。我理解他&rdquo;。说起学生的成长与蜕变，熊义志既骄傲又心疼。</p> <p>　　索多也曾经历迷茫的时期，并十分感谢熊义志等老师曾对他的帮助。&ldquo;我去年11月时和熊老师取得联系。当时一方面自己对基层工作不了解，一方面也面临很多其他的选择，有些困惑。我通过系里得到了熊老师的邮件地址，把自己的想法写信告诉他。没想到他立即回复了，还打电话叫我去他办公室。他推心置腹的谈话更加坚定了我回西藏的决心，后来我果断放弃了手里所有的面试机会。&rdquo;索多说。</p> <p>　　和索多的成长轨迹截然不同但作出同样选择的，还有机械系2013届本科生王全明。&ldquo;他生在天津，一米八的个子，曾担任学生空手道协会会长，典型的阳光男孩，却有难得的勇气。&rdquo;熊义志几乎对每一位赴基层工作的同学都了如指掌。</p> <p>　　王全明本来已经在北京得到了一份不错的工作，但同班一位去甘肃选调的同学让他深受触动，萌生了去西藏基层工作的愿望。熊义志在得知这一情况后，多次找他谈话，邀请他来参加就业指导中心组织的座谈会。&ldquo;熊老师不是简单地鼓励我去，而是全面介绍在西藏工作生活可能面临的挑战，让我们作好思想准备。这样反而让我们觉得心里踏实，感受到学校的支持与良苦用心。&rdquo;王全明说。</p> <p>　　5月份，王全明随队前往西藏就业实践。第一天到西藏就发生了高原反应，连续输了两天液才好。&ldquo;熊老师像兄长慈父一样照顾着我们，这点小困难不会动摇我的决心，因为挑战才刚刚开始。&rdquo;王全明坚定地表示。</p> <p>　　&ldquo;从2008年开始，我们先后有16名毕业生前往西藏基层工作。西藏的条件很艰苦，但他们做出了很多成绩，这是有目共睹的。学校为他们感到高兴，也希望尽量帮助他们解决现实的困难。例如学校成立励业基金、廖凯原奖励金等，为这些去祖国边疆基层工作的同学们提供帮助。&rdquo;熊义志说：&ldquo;以前我们讲&lsquo;扶上马、送一程&rsquo;，去年陈吉宁校长进一步提出要&lsquo;扶上马、送几程、关心一辈子&rsquo;，我们在实际工作中切实感受到这句话的重要性，也在这样去做。&rdquo;</p> <p style=\"text-align: center\"><strong>大胆创新 开发多样职业辅导工具</strong></p> <p>　&nbsp;&nbsp;&nbsp; 在就业指导中心走廊的尽头，有一间办公室与其他房间构造截然不同，这就是用做职业模拟训练的行为实验室。每次同学们被分成两组，一组模拟组，一组观察组，两个房间隔着单层玻璃。在训练室，模拟组的同学们按照任务要求进行 &ldquo;无领导小组讨论&rdquo;，过程将被视频音频采集设备记录下来。在观察室，指导教师和观察组同学注视着对方的一言一行。讨论结束后，模拟组同学先自我评议，然后回看录像再评议，观察组同学和指导教师再逐一评议，最后作总结提出改进建议。</p> <p>　　&ldquo;经过这番过程，看得出同学们触动很大、印象颇深、收获不小，同时暴露了很多问题。有时我给他们出了两道题，他们却只讨论了一个，这都是很严重的失误。&rdquo;熊义志评价说。</p> <p>　　熊义志在公管学院公共领导力研究中心时就曾想建立领导力实验室，此后他调研了几所学校和企业，终于在2012年成立了我校职业行为实验室，这也是国内高校就业中心第一家职业行为学实验室。&ldquo;在我看来，这只是一个开端。我设想着把学生职业发展能力训练 &lsquo;真刀真枪&rsquo;地做起来。&rdquo;熊义志说。</p> <p>　　近年来，就业指导中心不断开发互动式、个性化、体验型的职业辅导工具，积极扩大一对一的职业咨询覆盖面，拓展工作坊、模拟训练、巡回工作室等就业指导方式。今年举行的第八届生涯教练计划更是达到 102名教练、1100余名学生参加的空前规模，取得了很好的活动效果。</p> <p>　　值得一提的是，今年就业指导中心还不遗余力地推动 &ldquo;一体两翼&rdquo;就业信息平台建设，以新风格、新功能和新媒体的信息服务，适应90后学生的特点。&ldquo;一体两翼&rdquo;指的是以毕业生就业信息网为基础、以移动平台和社交网络为辅助的信息平台。改版后的就业信息网针对学生、教师、雇主、校友四类人群设计了不同入口界面，匹配不同功能，加强实时互动。此外，&ldquo;清华就业&rdquo;微信公共账号定期推送《就业微报》，手机客户端、人人网、QQ等同学们常用的信息平台各有侧重地开展起来，深受同学们的好评。</p> <p>　　&ldquo;现在高校就业信息网主要是为学生&lsquo;提供&rsquo;就业信息，今后应朝着&lsquo;检索&rsquo;的方向不断革新。我们也希望学生进一步转变求职行为，从以前的等待jobfeeding 到今后主动 jobhunting，第一步应该学会 searching&mdash;&mdash;&mdash;根据你的职业兴趣有目标地筛选信息。&rdquo;熊义志说。</p> <p style=\"text-align: center\"><strong>倾心构建清华特色就业引导体系</strong></p> <p>&nbsp;&nbsp;　&nbsp; &ldquo;思想政治工作要产生持续的影响力，关键是更好地服务学生。服务学生，一靠科学健全的工作体系，二靠深入细致的个性化工作。&rdquo;荣获 &ldquo;2013年清华大学优秀党建与思想政治工作者&rdquo;称号的熊义志结合自身工作，对于如何做好思想政治工作有自己的一番理解。</p> <p>　　近年来，就业指导中心为构建具有清华特色的就业引导工作体系，提出了一系列具体的举措。例如，&ldquo;彩虹计划&rdquo;基于学生不同发展特点实施有针对性的就业指导和资源匹配；&ldquo;北斗计划&rdquo;为学生提供切重要害的职业发展辅导；构建雇主联系网络，同一批具有重要影响力的单位建立紧密的合作关系，为毕业生就业开通&ldquo;校园直通车&rdquo;；建立跟踪服务机制，对重点单位工作毕业生&ldquo;扶上马、送几程、关心一辈子&rdquo;。</p> <p>　　为了更好地服务同学、联络企业，对于熊义志等就业中心的老师们来说，牺牲节假日是常有的事。&ldquo;常常下班要出门时，突然觉得还有什么事，想起来该跟某位毕业生打个电话。通完话，才能释然地回家。&rdquo;谈及工作状态时，熊义志轻描淡写地说。但&ldquo;释然&rdquo;二字恰恰折射出他作为一名党员&ldquo;多干实事、少说空话&rdquo;、倾心投入学校工作的宝贵品质。</p> <p>　　近年来，我校就业工作实效进一步显现。毕业生就业的地域结构和行业结构与10年前相比发生了根本性改变，毕业生赴基层公共部门就业取得突破性进展，就业中心曾获得北京市高校思政教育工作实效奖特等奖、全国就业先进工作单位等多项荣誉。</p> <p>　　&ldquo;荣誉固然令人自豪，但真正让人憧憬的是通过我们的工作激发学生心中的梦想，助力学生追梦的脚步。20年后，当他们的梦想汇聚起来，照亮清华梦、中国梦时，我从其中也一定能看到自己的梦想。&rdquo;熊义志坚定地说。</p> <p><font face=\"楷体_GB2312\">　　来源：新清华 2013-11-30</font></p></P>     </div>'),(132,'【人物】李薇:薇·风格','http://news.tsinghua.edu.cn/publish/news/4205/20131114104122535821148/1.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】李薇:薇·风格</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">薇&middot;风格</span></strong></p> <p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">&mdash;&mdash;记清华染织服装艺术设计系教授李薇</span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学生记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">梁 开 邹海萍</span></strong></p> <p style=\"text-align: center\"><img style=\"width: 280px; height: 406px\" alt=\"\" width=\"312\" height=\"442\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131114104122535821148/1.jpg\" /></p> <p>　<span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　<strong>李薇</strong>，1959年12月生于黑龙江省牡丹江市，1982年进入中央工艺美术学院学习，2001年至2003 年前往巴黎装饰艺术学院服装系担任访问学者，并进入巴黎高级时装公会学校学习深造。现担任清华大学美术学院教授、博士生导师、中国服装设计师协会理论委员会理事、中国民族服饰协会理事、北京服装学院民族服饰博物馆艺术委员会顾问、中国传统文化促进会服饰委员会主任委员等职务。</span></span></p> <p><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　　李薇曾在意大利比耶拉（Biella）城市艺术中心举行《视&middot;听&mdash;&mdash;李薇艺术作品展》，在法国巴黎举办过《李薇服装装置艺术展》、《李薇京剧脸谱水墨画展》、《李薇服装艺术展》，在中国华南农业大学设计学院举办《李薇作品展》等个人艺术展，并多次参加过联展。作品《清&middot;远&middot;静》获得2010年&ldquo;从洛桑到北京&rdquo;第六届国际纤维艺术双年展金奖等，服装系列作品《夜与昼》荣获2004年第十届全国美展金奖和2001年第一届艺术与科学国际作品展优秀奖等。主要著作有《服饰结构设计与表现技法》、《人物整体形象设计》、《立体裁剪》、《巴黎霓裳2002春夏流行趋势》等。</span></span></p> <p>　　然而，在这一连串的光环之下，我们感受到的李薇却是一位谦和的长者、要求严格的导师、拥有深厚文化积淀的艺术家。她经历了怎样漫长的求索之路，又是什么特殊的经历，造就了她谦和又大气的&ldquo;艺术范儿&rdquo;呢？</p> <p style=\"text-align: center\"><strong>求学：从牡丹江到北京的漫漫求索路</strong></p> <p>　　李薇，生长在牡丹江畔一个四面环山的小城市，&ldquo;那儿有美丽的镜泊湖，壮观的林海雪原，蓝天下的白桦树&hellip;&hellip;&rdquo;。少年的她特别喜欢爬山，喜欢登高远望的感觉，尤爱秋季的金叶灿灿、冬天的白雪皑皑。一方水土养育一方人，这样一个芊芊女子也许是受东北自然环境的熏陶，形成了她大气的性格。</p> <p>　　少年时李薇就显露出了她的艺术才华。李薇曾在一家群众艺术馆学习。在那里，她遇到了人生中的第一位恩师&mdash;&mdash;李明，老师耐心细致，倾注心力，为李薇打下了良好的基础。1977年，李薇从牡丹江市第十一中学毕业，进入一家服务局工作。当时这样的工作是很不错的，如果能够一直干下去，或许现在的李薇已经是一名国家干部。但是她喜欢艺术，工作之余便会背着画板，跟一群画友出游写生，常常&ldquo;一去十多天，吃的都没有了&rdquo;。她回忆起&ldquo;那时候更吸引我的不是工作，而是画画&rdquo;。电影《草帽歌》让李薇最初有了当服装设计师的理想，当同龄人都谈婚论嫁的时候，李薇却选择放弃稳定的工作,经过三年的不懈努力，终于在1982年如愿以偿考上了中央工艺美院。</p> <p>　　在大学期间，带给李薇最重要的启迪的艺术理想导师是法国时装大师伊夫&middot;圣洛朗（Yves Saint Laurent）。早在1985年圣洛朗带着25年来自己设计的200多件服装到中国美术馆作展览，李薇和班里其他的4位同学受学校委派参加为时半个月的布展工作，使得她可以近距离地接触大师的服装作品，感受大师作品的设计灵魂、品质和内涵。圣洛朗在送给李薇的画册上写到：&ldquo;李薇：把我的灵感全部给你。&rdquo;第一次得到世界时装大师的签名与激励，似乎把李薇带入最高的服装审美境界，指引着她朝最高的服装水准迈进，圣洛朗的名字从此深深地印在李薇的心里，成为她心中的偶像、奋斗的目标。她和同学的工作照也发表在法国的报纸上，成为这段记忆的珍存。同时，大学课堂上的专业训练，其他艺术领域的营养积累，让李薇不仅开拓了艺术视野，而且培养了严谨勤勉的治学态度。</p> <p style=\"text-align: center\"><strong>风格：&ldquo;每个人作品的内核是从早注定的&rdquo;</strong></p> <p>　　李薇的艺术风格独特鲜明，观察她的每一件艺术作品，简约里显露大气，静谧中流淌动感，虚实动静，无不体现深厚的艺术积淀和磅礴的张力。从早期的《甲骨新解》、《大漠孤烟》、《风雅颂》，到《昼与夜》（2004年第十届全国美展设计类作品金奖）、《清&middot;远&middot;静》（2010年&ldquo;从洛桑到北京&rdquo; 第六届国际纤维艺术双年展金奖），她的每一件作品的主题都与传统紧密相连、与自然高度契合。刘巨德教授曾这样评价《昼与夜》：&ldquo;它有楚汉的洒脱和高贵，有一种游离于天地之间的情怀。&rdquo;</p> <p style=\"text-align: center\"><img alt=\"\" width=\"227\" height=\"161\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131114104122535821148/2-1.jpg\" />&nbsp; <img alt=\"\" width=\"227\" height=\"161\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131114104122535821148/2-2.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">《夜与昼》系列作品。</span></p> <p style=\"text-align: left\">　　的确，李薇从小生活在北方，不同与南方自然环境的细腻，北方的大山大水赋予了她表面平静而内心澎湃、低调含蓄而充满张力的&ldquo;粗犷&rdquo;性格。她热爱自然，亲近自然，她的足迹遍布祖国的每一个地方：西北大漠有她跋涉的足迹，云贵高原留下她翩然的身影，唐古拉山有她攀登的记忆。她喜欢冒险，不畏艰难，一次去新疆，临返时因白血球过少，鼻血不止，同学们以为是&ldquo;白血病&rdquo;，纷纷哭着跟她告别；一次去西藏，洗不了澡，打不到车，缺氧和饥饿紧紧相随，让人感觉生命都将终结。然而，李薇没有停下前行的脚步，2008年汶川地震后的一个月，李薇带着研究生作为志愿者赴汶川中学教学生画画，并将孩子们的绘画作品设计成T恤衫，通过义卖捐助灾区，而孩子们的&ldquo;李薇大姐&rdquo;则认为这是一次心灵的洗礼。走万里路，从山野到灾区，因为她认为，只有不断亲近自然，亲近生灵，才能创作出更加优秀和长久的作品。</p> <p>　　路行矣，书亦没有少读。她注重积淀，通过亲身经历和阅读，不断丰富自己的内心世界。同时，她非常关注世界服装潮流，收集、整理、分析流行资讯，做了一本又一本的笔记。正如她所说&ldquo;把艺术作品当作孩子，平时一点一点积累，自会有瓜熟蒂落的时刻。&rdquo;</p> <p style=\"text-align: center\"><img alt=\"\" width=\"454\" height=\"203\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131114104122535821148/3.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">李薇去参观国际服装大师展览的一本本手绘记录。</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"454\" height=\"186\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131114104122535821148/4.jpg\" /></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">李薇参观&ldquo;迪奥与中国艺术家&rdquo;展览的手绘记录。</span></p> <p>　　李薇说&ldquo;一个人的作品一定有连续性，表现形式可能有区别，但是他的内核是从早就注定的&rdquo;。李薇成长在东北广袤的土地上，又走遍了中国的山山水水，她的作品中透出那种浑厚和大气，是一种不可多得的艺术气质。这种气质亦展现在她的作品中，水墨般的，薄纱似的，层层叠叠，虚虚实实，言有尽而意无穷。</p> <p>　　她不断地创作，不断地寻找材料，却有着一贯的风格。她认为&ldquo;每一种材料就像一个孩子一样，有它的特性和可塑性，质地和色彩都饱含感情的因素。&rdquo;她早期使用纸材料创作，希望创作具有水墨感，动静虚实相结合的作品；后来开始寻找中国的丝，但还是觉得材料缺少充足的表现力。在一个偶然的机会下，她接触到了朋友自织的&ldquo;水纱&rdquo;，这种如马王堆蝉衣般柔顺、轻薄的材料让她一下找到了感觉。&ldquo;我喜欢那种看上去很含蓄，但是有一种内张力，能渗入到心里去的材料。&rdquo;于是，她开始了与材料的对话。她把材料当作&ldquo;基因&rdquo;，进行&ldquo;分解&rdquo;再创作。经过无数次的尝试，创作了一组组服装作品、装置作品和纤维作品。这些作品充满了水墨般的情怀和中国式的意蕴，传统与现代结合，简约与大气并重。李薇一直追寻厚重大气、简约动感的创作风格，既根植于中国传统文化的土壤，又在中规中矩里多一份个性和颠覆，正是因为这一贯的审美感和创意感，才使得李薇的作品材料多变而风格鲜明。最近，她的作品材料又变了，颜色也变了，且跨界到了屏风、壁挂，&ldquo;我不能一直沿着过去的走，要不断探讨新材料和新手法&rdquo;。</p> <p style=\"text-align: center\"><img border=\"1\" alt=\"\" width=\"340\" height=\"321\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131114104122535821148/7.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">《清&middot;远&middot;静》系列作品。</span></p> <p style=\"text-align: center\"><img style=\"width: 226px; height: 459px\" alt=\"\" width=\"312\" height=\"585\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131114104122535821148/8.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">《水墨戏》</span></p> <p style=\"text-align: left\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 由于李薇的作品中总是透着对中国传统文化和生命本身的关照，受到国内和国际的关注和认同。她频频受邀到法国、意大利、美国等国家展览。1995年至2005年，她曾4次受邀在法国举办个展，法国媒体曾这样评价道：&ldquo;李薇的思考和感受或许能够帮助我们找到一个途径，使中国时装最终成为世界服装潮流的一个重要组成部分。&rdquo;而在2013年6月意大利比耶拉（Biella）城市艺术中心举行的《视&middot;听&mdash;&mdash;李薇艺术作品展》上，意大利和比耶拉的媒体对展览给予了高度评价：&ldquo;其作品立足于国际，把东方传统美与艺术、纤维相结合&rdquo;（《News Biella》），&ldquo;她的服装作品十分轻盈，微妙的颜色几乎让人感触不到，相当精致&rdquo;(《La Stampa》)。</p> <p style=\"text-align: center\"><strong>教学：学生眼中的&ldquo;魔鬼导师&rdquo;</strong></p> <p>　　作为博士生导师，李薇曾被学生称为&ldquo;魔鬼导师&rdquo;。提起这个称呼，李薇笑道，其实所谓的&ldquo;魔鬼式训练&rdquo;并不是没有人性地逼迫学生，而是对每个学生的每一步都制定有详细且长远的计划。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"282\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131114104122535821148/5.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">《清.远.静》2009年800cmX110cm</span></p> <p>　　李薇观察到，中国学生和外国学生相比，在读大学期间主观意识不足，缺少对艺术的投入和激情。因此她在招收研究生的时候，首先问学生喜不喜欢这个专业，能不能刻苦地创作。入学第一天，她就让学生作计划，明确自己来是为了什么和将来要做什么，让学生一开始便有大概的方向。虽是三年，她会让学生规划五年，&ldquo;这样才不至于对自己的未来一头雾水&rdquo;。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131114104122535821148/6.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">《李薇作品展》在中国华南农业大学设计学院的开幕式。</span></p> <p>　　在对整体的学习有了规划之后，李薇还会让学生在做每件小事之前都有一个详细的计划。比如一次比赛，她会要求学生将做草稿，出小样，拿成品的时间都一一计划详细，然后对学生进行检查，并对完成的不好的学生严厉批评。李薇认为学生们在作品获奖后，会理解她的良苦用心，&ldquo;特别是毕业后，他们对此记忆深刻，老师是严格了一点，苛刻了一点，要求高了一点，但会出东西，就逼着他们这样做，最后有好的成绩&rdquo;。</p> <p>　　在教学上，李薇非常重视学习氛围的营造，经常和学生进行互动和交流。她深感于学生缺少设计思维和设计能力的训练，为此她制定了三步走的&ldquo;魔鬼训练&rdquo;教学方案：第一个阶段是打基础，第二个阶段是实验过程，第三个阶段是寻找自我风格和方向。在打基础的阶段，李薇要求学生们要有扎实的专业知识和专业资讯；在实验阶段，要设计不同类别的作品，比如设计一件衣服，一定要落实到是晚装还是休闲装，设计阶段从灵感来源、主题确定、素材分类等一一实践；在足够的理论与实践的积累后，进入第三个阶段，发现自己的审美取向和兴趣的关注点，然后加以发展，最后让学生朝着这个方向走下去，形成自己的风格。李薇这种严谨为学的态度，和对学生认真负责的指导，真正培养了大批有才华实干的学生，&ldquo;魔鬼导师&rdquo;却是名副其实的&ldquo;良师益友&rdquo;。</p> <p>　　&ldquo;大师不是想当就当的，有时培养是培养不出来的，像是那些德艺双馨的大师，面貌与神态都有相似的感觉，都是谦卑平和的人，对学生也好，都很自然的。李薇也是这样，不辍学习，追求艺术理想；遍览河山，丰富艺术积淀；敢当&ldquo;魔鬼导师&rdquo;，对学生充满爱心。她，正向她的导师一样成为学生心中手执教鞭的艺术家&hellip;&hellip;</p> <p style=\"text-align: right\">（<strong>清华新闻网11月15日电</strong>）</p> <p style=\"text-align: right\">供稿：美术学院 编辑：范 丽</p></P>     </div>'),(137,'【人物】清华工艺美术系副教授周剑石：漆缘人生','http://news.tsinghua.edu.cn/publish/news/4205/20131029095322987701152/1.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】清华工艺美术系副教授周剑石：漆缘人生</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">漆缘人生</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\"><strong><span>&mdash;&mdash;清华大学工艺美术系副教授周剑石专访</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学生记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">劳丽娜</span></strong></p> <p style=\"text-align: center\"><img alt=\"\" width=\"283\" height=\"378\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131029095322987701152/1.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">周剑石近照。 <strong>杨佩璋</strong> 摄</span></p> <p>　　2013年9月6日，&ldquo;1895中国当代工艺美术系列大展暨学术论坛&mdash;&mdash;中国当代漆艺展&rdquo;在南通1895创意产业园举行，记者采访了本次漆艺展主要策展人之一、清华大学美术学院工艺美术系副教授周剑石。</p> <p>　　在他摆满精彩漆艺作品和图片的工作室里，周老师亲切热情、内敛谦和的风格让人如沐春风。</p> <p style=\"text-align: center\"><strong>钟爱漆&nbsp; 研究漆</strong></p> <p>　　&ldquo;童年时候我就十分喜欢欣赏红药水在太阳下金光闪亮的感觉，常用它来画红旗和太阳的红色光芒。我还清晰地记得，小学时看到裱画案子上所髹涂的朱漆，令我兴奋不已。&rdquo;也许就是这份对红色的钟爱让周剑石走上了学习和创作漆艺的生涯。</p> <p>　　这个被朱红漆所吸引的年轻人在1983年还是中央工艺美术学院一名学生的时候，与4名同学利用暑期远赴四川甘孜、玛尼干戈，亲历了当地藏族同胞骑马射箭、跳藏戏等庆贺藏历新年的激动场面。他画了许多素描写生，回到学校后，别出心裁的用漆艺材料、技法与装饰画的形式，创作表现了藏族新年传统民俗节日上骑马射箭的片段&ldquo;耍靶子&rdquo;。作品画面选用白色蛋壳、朱漆、黑漆、绿漆和金属粉等，藏族服饰色彩，人物和场景表现的简约而富有想像力，获得了第六届全国美展优秀奖。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131029095322987701152/2.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">漆艺作品</span><span style=\"font-family: 楷体,楷体_GB2312\">《十二生肖》</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">材料：麻布、生漆、朱砂、石黄、石绿、金箔、</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">工艺：撒碳粉、彩绘、贴铂、研磨</span></p> <p>　　兴趣是最好的老师。周剑石除此之外，还得到了中国漆艺大师乔十光先生和日本漆艺大家大西长利先生的指导和传授。在乔十光先生的举荐下，周剑石获得了到日本学习漆艺的机会。周剑石深知恩师对他的期望&mdash;&mdash;为国内漆艺研究作出更大的贡献，在日本期间，他刻苦钻研，收获颇丰。经过一年的非正式预科后，获得了美术学、艺术学两个硕士学位，并将各种漆艺创作思路和技法融会贯通，系统学习了漆艺的保存和修复技术。</p> <p>　　对于漆艺的创作，周剑石有自己独特的心得。他告诉记者，《考工记》中关于造物的四个要素：&ldquo;天有时，地有气，材有美，工有巧&rdquo;，对于漆艺的创作，尤为重要。漆的干固结膜与天时运转、地域气候密切相关。调入银珠的朱漆和掺入铁粉的黑漆，一旦经过研磨抛光，漆材质就会产生出一种如玉般温润的美感。通过镶嵌、金箔、银箔、款彩、剔犀、剔红、戗金和等制作工艺的多种技巧，又会产生更加丰富多样、各美其美的效果。作为漆艺创作者一定要自觉的遵循天时、地利，发挥漆艺材质的自然美，工艺的技巧美。基于这样的认识，回国后，他将传统漆艺创作由平面扩展到了三维空间，赋予了漆艺新的生命力，充分体现了漆艺这一古老传统的材质美、工艺美等特点的同时，使这一传统艺术在环境艺术设计、产品开发、日常生活领域等呈现出新的面貌。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"340\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131029095322987701152/3.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">漆艺作品</span><span style=\"font-family: 楷体,楷体_GB2312\">《欧洲印象》</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">材料：生漆、朱砂、铁粉、木</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">工艺：雕漆工艺</span></p> <p>　　此外，他还与自己的研究生一起承接了重庆大足石刻千手观音等漆艺修复实验室国家项目。&ldquo;对于那些经历了历史沧桑岁月的出土、传世漆文物来说，加强保护修复，深入研究的意义很多。作为一种纯粹的审美形式，它们本身具有一种超越时代的顽强的生命力，它们既能感动今天的我们，同样也能感动明天的子孙。鉴于此，我们对于今天的文物保护，同样也是为了明天子孙们的一份责任。&rdquo;周剑石如是说。</p> <p style=\"text-align: center\"><strong>承传统&nbsp; 发展漆</strong></p> <p>　　前不久日本专家组成的调查小组与浙江省文物考古研究所，共同对杭州市萧山区跨湖桥最新出土的&ldquo;漆弓&rdquo;进行了测定，确定&ldquo;漆弓&rdquo;为8000年前的文物。周剑石不无感慨的说，&ldquo;这使得中国的漆艺史又向前推进了1000多年，中国的漆艺可谓历史悠久，中外驰名。《考工记》、《髹饰录》等古典著作也受到各国学者的推崇。&rdquo;同时，周剑石表示，广袤的中国大地上有世界上最多最好的生漆原料。漆树的种植可以绿化环境、当地的村民也可以就地取材，发展漆艺产业，增加就业岗位。漆具有耐高温、抗酸抗腐等特点，可以用于造船等行业，漆也可以做粘合剂、成型剂、涂料、颜料和染料等使用。此外，据汉代《神农本草经》、明代《本草纲目》等记载漆可以入药，日本医学界已经确认漆可以抑制大肠杆菌，韩国甚至研制了漆肥皂，这些都是天然健康的。这些都推动了与漆相关的各个行业的可持续发展。这样得天独厚的条件，如果不加以充分利用，着实让人扼腕叹息。</p> <p>　　那么如何利用这些条件？周剑石主张在生活、生产等领域注重漆艺的发展。在日本留学期间他感受到日本民族对漆艺十分重视，漆艺文化氛围浓厚，相比之下，中国拥有良好的漆艺历史和资源却不能深度的挖掘和充分利用，因而他认为应加大中国传统漆艺在当代的传承和发展。</p> <p>　　为此，周剑石在21世纪的地标性建筑&mdash;&mdash;中华世纪坛、漆艺人才第一阵地的清华大学和&ldquo;漆艺之乡&rdquo;的福建都策划了&ldquo;从河姆渡走来漆艺展&rdquo;。目的就是致力于中国传统漆艺的复兴和推广，致力于&ldquo;做中华民族精神最强的漆艺展览&rdquo;。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131029095322987701152/4.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\"><span style=\"font-family: 楷体,楷体_GB2312\">漆艺作品</span>《兼怀万物系列一》</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">材料：生漆、麻布、瓦灰、陶泥、银朱</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">工艺：夹纻、素髹</span></p> <p>　　当谈到漆艺产业，周剑石认为漆艺创作乃至整个工艺美术的创作在当代有很好的发展市场和前景，整个行业应该结合时代特点做更多的思考和拓展。从事漆艺创作的艺术家不应墨守成规，而应思考如何将传统元素、工艺美感与现代时尚和市场相结合，与高科技手段相结合；从事经营的企业不应仅仅迎合市场需求，以&ldquo;好卖&rdquo;为目标，而应该积极主动的引领市场需求。</p> <p style=\"text-align: center\"><strong>重身教&nbsp; 育优才</strong></p> <p>　　周剑石不仅是一位优秀的艺术家，更是一位优秀的教师。他对中国漆艺教育发展有很多的期待。&ldquo;艺术是培养80后90后个性的很好的手段，读万卷书，行万里路的心灵收获都可以用艺术表达出来，选择工艺美术领域，某种意义上是超功利的，但对人的美育有很大的好处。&rdquo;</p> <p>　　关于漆艺的教学，他认为第一要更重视漆艺创作的学科建设和教育，开设更多的科研教学机构，才能与我国悠久的漆艺历史相适宜。第二，工艺美术各行业更加要重视对于历史和理论的研究，这不但对于创作有很多的借鉴作用，同样对于出土、传世漆器的保存和修复也有着密切关系，对于提高本学科在整个中华民族文化价值体系和历史价值地位上都着极为重要的意义。</p> <p>　　具体到对学生的培养上，周老师希望与学生们能成为交流伙伴，教学相长，他提起在东京艺术大学学习期间，聆听到当时任美术学部长澄川先生的一句箴言&ldquo;学生是看着老师的背影成长的。&rdquo; 周剑石认为老师不应是训话式的教育，更应该注重对学生言传身教，强调老师一定要多动手，同时也不应泯灭了学生的个性，&ldquo;我们这一代人有自己对与艺术的感悟，会在作品中有所表现。但我更希望艺术教育中一代人有与一代人不同的气象格局，你们可以向师长学习，但更要发挥自己的个性和特长，这个行业才能有更好的发展气象。&rdquo;</p> <p>　　他的学生感触最深的也是周剑石在深入的分析古今中外艺术家作品的材料，技术和审美表现的同时，手把手教学生各种工艺技法。</p> <p>　　如今，周剑石桃李满天下，他培养的学生已经在全国各地继承着漆艺的事业&hellip;&hellip;</p> <p style=\"text-align: right\">供稿：美术学院　编辑：范丽</p></P>     </div>'),(146,'【人物】令狐昌洋：且将新火趁年华','http://news.tsinghua.edu.cn/publish/news/4205/20130816093858352942832/QD1.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】令狐昌洋：且将新火趁年华</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">且将新火趁年华</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\">&mdash;&mdash;记清华大学电子系2009级毕业生令狐昌洋</span></p> <p style=\"text-align: center\"><strong><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">王冰冰</span></span></strong></p> <p style=\"text-align: center\">　　<img height=\"320\" alt=\"\" width=\"425\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130816093858352942832/QD1.jpg\" /></p> <p>　　2013夏初， MIT校长的一封亲笔信寄到清华园，收信人是清华大学电子系2009级本科生令狐昌洋。这一年8月，他即将奔赴大洋彼岸的美国麻省理工学院攻读博士学位，他不仅获得了全额奖学金，而且也获得了麻省理工学院名额很少的校长奖学金。</p> <p>　　宽阔的额头，灵动的双眸，令狐昌洋，这个年仅22岁的男孩因为在学期间的优秀表现，同时申请到了麻省理工学院、斯坦福大学、普林斯顿大学和康奈尔大学等世界顶尖学府的博士全额奖学金，他最终选择了MIT。所有成绩的取得都有赖于昌洋对学术科研炽烈的兴趣与热情，而追溯这熊熊之火的燃烧之源，昌洋的家庭教育以及清华的学校教育正是赋予这团新火的引燃剂和助燃剂。</p> <p style=\"text-align: center\"><strong>家庭教育 引燃新火</strong></p> <p>　　对于自己的复姓，令狐昌洋娓娓道来，他说&ldquo;令狐&rdquo;是周文王时期延续下来的复姓，一般是王族贵胄的象征。昌洋说自己家族有着严格的家谱，&ldquo;昌&rdquo;是字辈，后面的&ldquo;洋&rdquo;才是他自己的名字。</p> <p>　　昌洋生长在书香门第，父母都是大学教授。在昌洋的儿时记忆中，父母十分开明，从不强迫他补习课程或是参加课外兴趣班。从小学到初高中，父母从不对昌洋做分数和名次要求，只希望他能开心快乐地享受学习过程，保持对身边事物的好奇心和对学习的持续兴趣。年幼的昌洋深受父母这种教育的影响，一直遵循着自己内心的兴趣来学习，从没感到丝毫课业负担与名次压力。</p> <p>　　但这种不以功利为指向的家庭教育并不意味着父母对昌洋学习的放任自流。对于昌洋从小就表现出对自然科学的浓烈求知欲，父母总是尽其所能给予积极引导和学业帮助。例如，小昌洋对电学知识很有兴趣，父亲就把小昌洋介绍给学校里一位教电学的老师，小昌洋就经常跟着老师到实验室观察各种实验现象，还动手做一些简单的实验。一段时间后小昌洋对电学知识的了解远远超过自己看书所得，各种有关电学的疑惑也都在实验中找到了答案。</p> <p>　　父母还很重视对昌洋的视野提升和眼界开阔。昌洋小时候，父亲经常出国，每每回国都带回许多美食和小玩意，让小昌洋欣喜不已。年幼的昌洋从此便对外面的世界充满无限憧憬，期待着有朝一日自己也能走出更广阔的世界，见识更多新奇的事物。</p> <p style=\"text-align: center\"><strong>清华教育 助燃热焰</strong></p> <p>　　昌洋的梦想是&ldquo;去世界最顶尖的研究所，跟一群世界上最聪明的人，去研究怎样改变这个世界&rdquo;。梦想照进现实，高中阶段昌洋参加全国高中生冬令营，凭借聪颖才智获得了全国物理竞赛决赛铜牌和化学竞赛决赛银牌，也为他赢得了清华大学的保送资格，使他距离实现梦想更接近了一步。</p> <p>　　在昌洋看来，物理、数学、生物等改变世界的方式是间接的，而电子等高科技方式改变人们生活的方式却更为直接。昌洋认识到电子是未来科技领域的核心，所以在咨询了多位学长选择专业的建议后，他选择就读清华电子系。</p> <p>　　面对随即而来的专业内诸多具体研究方向的选择，昌洋开始了向学长和老师们的新一番咨询。昌洋十分欣赏李开复那句&ldquo;Follow your heart.&rdquo;他觉得学术科研要追随内心志趣，但这还远远不够，要建立在对事物相对全面了解的基础之上，不然所做的选择难免有失偏颇也很危险。昌洋认为，&ldquo;不会做选择的根本原因是不够了解。&rdquo;当时，昌洋找遍微电子下面各领域每个很&ldquo;牛&rdquo;的老师，去他们办公室聊科研和学术，一聊就是个把小时，有些老师在熟悉之后更是经常见面。昌洋觉得这些老师都是其所在科研领域的顶尖人才，他们拥有多年的科研和教学经验，对学术热点和前沿知识的把握准确，可以&ldquo;俯视&rdquo;所在的科研和学科领域，这种&ldquo;站在巨人肩膀上&rdquo;的方式，帮助昌洋摸清了电子学科的所有脉络，在透彻了解之后更容易找到自己真正的兴趣所在，更有利于进行未来学术和科研方向的选择。</p> <p>　　清华优秀的教学名师和丰富的教学资源，成为激发优秀学生潜质潜能的良好催化剂。昌洋勇于探索和执着钻研的科研精神，得益于清华提供的课内外学习环境，从第一课堂的引领，到第二课堂的挑战，再到出国交流的提升等等。</p> <p>　　从大一开始，昌洋便参与科研项目。他作为第一负责人主持的《智能车系统》和作为第二负责人参与的《Matrix3D虚拟现实》两个项目曾获挑战杯校级二等奖，这份成绩对于仅仅大一的本科生来说已经十分出色。</p> <p>　　昌洋在清华微电子所余志平教授的指导下从事芯片研究工作，致力于用新材料制造出超高速的计算机芯片。在此期间，昌洋提出了世界上首个超高速四管双平衡石墨烯混频器芯片结构的理论，并完成了仿真验证，这项科研成果发表在国际器件仿真顶级会议SISPAD上。斯坦福电子工程系的Philip Wong教授在了解了昌洋的相关科研成果后，对此项工作非常赞赏并还提出了宝贵的指导意见。</p> <p>　　因为这项成果，昌洋得到IBM公司研究总部的邀请，他访问纽约向纳米科学家们展示了自己的科研成果和理论工作。IBM公司负责纳米研究的主管费顿主任向他分析和总结了从物理上实现其设计的芯片的细节和难点，并鼓励昌洋从实验上实现这个芯片。</p> <p>　　大三上学期，昌洋被学校选派赴美国威斯康星大学麦迪逊分校交换学习。交流期间，他选修的三门物理和电子工程领域的博士高年级课程都获得了最好成绩A级。在威斯康星大学的五个月中，昌洋加入了领域知名的Robert Blick教授的科研小组，在微电子所实验室展开了对硅基量子自旋器件的实验研究，并提出了一种测量电磁场对器件影响的方法。在大四之前的暑假，昌洋还获得到美国麻省理工学院进行暑期科研的机会。通过在MIT短短一个月的实验学习，回国后的昌洋在清华-富士康纳米中心的设备支持下实现了自己长期以来设想的芯片设计。</p> <p>　　昌洋的科研成果相继发表在RPGR会议和Chinese Physics B杂志上，他还向IEEE Transactions on Electron Device杂志投稿。位于硅谷的惠普实验室副总裁Stanley Williams在来清华访问时，高度赞扬了昌洋的科研探索，并向斯坦福、麻省理工学院的教授们介绍昌洋的科研成果。</p> <p style=\"text-align: center\">　　<strong>结语</strong></p> <p>　　在校期间，昌洋入选清华星火班特殊拔尖学术人才培养计划，并由于突出的科研成果而被评为此届唯一的&ldquo;星火优秀学员&rdquo;，获得学校授予的&ldquo;学术帝&rdquo;称号。在清华大学课外学术科技创新人才培养研讨会上，昌洋作为星火班代表进行汇报，获得充分肯定。</p> <p>　　毕业前夕，昌洋作为优秀毕业生代表，在毕业生座谈会上向校长陈吉宁汇报自己的学习经历。同时，他还受清华招办邀请作为清华优秀学生代表出席新浪直播发布会，通过对自己学术之路和科研经历的介绍，让更多学子了解清华教育对学生的培养与提升。暖炉更助新焰旺，愿昌洋的学术之火在未来燃烧得更加炽烈和持久！</p> <p style=\"text-align: right\">&nbsp;编辑：李 含</p></P>     </div>'),(166,'【人物】飞氘和他的科幻王国','http://news.tsinghua.edu.cn/publish/news/4205/20131216092659342597657/11.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】飞氘和他的科幻王国</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">飞氘和他的科幻王国</span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">记者 <strong>高 原</strong> 学生记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">潘正道 </span></strong></p> <p style=\"text-align: center\"><img alt=\"\" width=\"312\" height=\"449\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131216092659342597657/11.jpg\" /></p> <p>　　<span style=\"font-family: 楷体,楷体_GB2312\">飞氘，本名贾立元，清华大学人文学院在读博士生，科幻作家。本科毕业于北京师范大学环境学院，后跨专业考取文学院儿童文学专业硕士研究生，2010年考入清华大学人文学院中文系攻读博士学位。自2003年起陆续在多家杂志发表科幻作品数十余万字，先后出版短篇小说集《纯真及其所编造的》、《讲故事的机器人》、《中国科幻大片》。其中短篇小说《一个末世的故事》被收录世界科幻奇幻年选《ALIA》，曾入围第十届&ldquo;华语文学传媒大奖年度最具潜力新人&rdquo;。</span></p> <p>　　第二次见到飞氘，与上一次采访他间隔了20个月。</p> <p>　　他清瘦依旧，仿如一道&ldquo;闪电&rdquo;。不同的是，在这20个月里，他集结出版了两本短篇小说集：《讲故事的机器人》和《中国科幻大片》，同时他还在为以晚清科幻小说为主题的博士毕业论文忙碌着。这足见他内心的力量与持之以恒的努力。</p> <p style=\"text-align: center\"><img border=\"1\" width=\"312\" height=\"458\" alt=\"\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131216092659342597657/555.jpg\" /></p> <p>　　&ldquo;飞氘&rdquo;是他的笔名，他的本名是贾立元，我校人文学院文学系在读博士生。在他身上，理工科的背景与浓厚的文学情结交织在一起；在他的故事里，总生活着许多悲壮的、唐&middot;吉诃德式的英雄人物，他们在时空的隧道里穿梭，在历史的分支中走向另一个无极的终点，一遍又一遍拷问着人类的生存困境而不得其解。</p> <p>　　他的作品始终萦绕着悠悠的千古愁绪，以读者的眼光投向他，他像是一位忧郁的诗人，孤独而不屈地在不同维度的时光空间里寻找光明，但在现实生活中，他笑容温暖和煦，与人交往单纯不设防。</p> <p style=\"text-align: center\"><strong>内心住着一个唐&middot;吉诃德</strong></p> <p>　　2013年10月，飞氘出版了自己的第三部短篇小说集《中国科幻大片》。</p> <p>　　在这本书里，飞氘毫不吝啬地挥洒着充满画面感和艺术感染力的词汇，讲述了一个个荒诞不羁的&ldquo;历史故事&rdquo;，于是有了坐着热气球登泰山、与未来世界相遇的孔夫子，有了一不留神把十个太阳全部射落、没办法只能自己再造一颗的后羿，还有要建一座能装下天下百万寒士的超级广厦的杜甫&hellip;&hellip;</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"288\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131216092659342597657/22.jpg\" /></p> <p>　　在飞氘天马行空的世界里，现代科幻元素与中国古老的神话和历史典故巧妙地结合起来。用他的话说，就是&ldquo;架空&rdquo;历史，为他们在另外一个时空发展一次不同的相遇。</p> <p>　　&ldquo;你想表达什么？&rdquo;</p> <p>　　&ldquo;好像也没有什么特别深刻的寓意，就是为了写着好玩。&rdquo;在这个时候他似乎和所有普通的80后一样，更专注于自己眼前热爱的事情上，鲜少考虑它到底有什么意义。</p> <p>　　同是科幻作家、曾任《瞭望东方周刊》杂志执行总编的韩松却没有这样简单地看：&ldquo;读飞氘的小说，或许会有一些调侃的感觉，但最后留在记忆里的却是巨大的悲怆。他所塑造的一系列唐&middot;吉诃德式的英雄，每一个故事都充满伤怀和对生命的无奈，对人的渺小和滑稽发出震颤心灵的嗟叹。&rdquo;</p> <p>　　飞氘坦承在他创作的过程中，受到了许多世界文学大家的启发，比如马尔克斯、卡尔维诺和鲁迅等。2012年秋天，飞氘在清华读博时听了一门讨论《故事新编》的课，使他对这部作品有了新的认识，更感受到鲁迅在写作这些看似荒诞的故事时博大的情怀和严肃的用心。&ldquo;我想把幻想的可能推到貌似无法无天的地步。当然，调用一个族群对古老过去的自我讲述，也隐含着某种企图：想要挖掘或者探索一种可贵的精神，也就是《故事新编》里面的那些人，大写的&lsquo;人&rsquo;的精神！&rdquo;</p> <p>　　尽管这样，当他对这部凝结心血的作品作总结时，仍在反复强调&ldquo;有趣&rdquo;的重要。&ldquo;世上无趣的人太多了，实在受够了。&rdquo;为此，他甚至给这本书想过许多稀奇古怪的名字，比如《孔夫子搭乘热气球指南》或是《飞翔吧，贵妃！》。</p> <p>　　在飞氘的所有作品中，《去死的漫漫旅途》不能不提，这是他迄今为止最长的一部科幻小说，并即将单独成册出版发行。他说，这部小说受到了意大利著名女记者法拉奇《风云人物采访记》序言中一段话的启发：&ldquo;我无法否认我们的生存是由少数人决定的，是由少数人的幻想和反复无常决定的，是由少数人的能动性和意愿决定的。&rdquo;于是，他想写一个少数派决定不了的故事，那就是让一群不死者自我毁灭。&ldquo;不死者&rdquo;在科幻作品里稀松平常，但写一群死不了的人想方设法去死，这在飞氘看来是一个写起来很解渴的故事，而这部作品也洋溢着对生命最本质困境的哲学思辨味道。</p> <p>　　无论是一意孤行的国王将不死者的躯体湮灭在时间长河中，还是《蝴蝶效应》里中国的远古文明与现代西方电影文化的交汇重叠，飞氘的作品总让读者在时光凌乱的交叉中，仿佛手握绝世好剑，驰骋浩渺时空，酣畅淋漓，却意味深长。</p> <p style=\"text-align: center\"><strong>理性与诗意并存</strong></p> <p>　　2002年，飞氘考入北京师范大学环境工程专业。从小酷爱文学的他没有放弃写作。大二时他将一篇科幻习作《皮鞋里的狙击手》寄给了《科幻世界》杂志，从此杳无音讯，半年后突然一张汇款单飘然而至，原来作品发表了！试水成功后，他没有立即把心思转到科幻写作上，而是执着地写着校园青春文学。隔了一段时间，他重新有了灵感，在《科幻世界》上梅开二度才开始琢磨：为什么不把自己平时天马行空、稀奇古怪的想法写下来呢？从此，开始了他科幻创作之路。</p> <p>　　本科毕业后，他选择跨专业考取同校文学院儿童文学专业硕士研究生。2010年硕士毕业后，他来到清华人文学院攻读文学博士学位。</p> <p>　　从理工科学生到文学博士，在飞氘身上，无论是他的笔名还是他的人生经历，都同时体现了二者的错位与美好。</p> <p>　　&ldquo;我在嘈杂的教室中闭上眼，无声地滑入梦的深渊，一直坠落下去，做加速度为零的匀速运动，直到某个来自另一个世界的声音穿过若干光年的旅途到达我的听觉中枢，轻飘飘地呼唤着我&hellip;&hellip;&rdquo;飞氘在自传性质的青春小说《纯真及其所编造的》里对课间休息的的描述，无疑和&ldquo;在清华食堂里选择扇形30度的葱油饼&rdquo;的段子一样，充满了理性的诗意。</p> <p>　　当然，这样的错位不止飞氘一人。有人说，没有诗意的世界是无趣的。反之，没有理性的世界是混乱的。科学与人文相倚，理性与诗意并存，才能构成一个平衡的世界。</p> <p>　　身为科幻作家，出版的第一本书却是青春文学。飞氘常自我调侃：&ldquo;当有人谈理性，我会谈谈文艺；有人谈文艺，我会说我是科幻作家。&rdquo;当然，他还会一本正经地说：&ldquo;尽管我是科幻作家，也无法拥有时光机。如果你能对现在的生活感到满意，那就得感激全部的过去。&rdquo;</p> <p style=\"text-align: center\"><strong>下辈子我想做个机器人</strong></p> <p>　　&ldquo;人在写作时会有种快感。这种快感来自于创造，如果你确认自己的文字被人喜欢，那就是更大的快感。&rdquo;飞氘认为写作对他来说是不得不写的欲望，是一种生存的方式。《纯真及其所编造的》铭刻了青春的期待和迷茫，《去死的漫漫旅途》投射着专业和兴趣之间的纠结，每部作品都是对现实人生的折射与心灵的释放。</p> <p>　　文学科班的培养对他的写作起到了很大的作用。他坦言，很多作品的灵感都与传统文学作品及理解有着密不可分的关系。科幻于他，像是一道妙趣横生的数学题，充满智力的快感，而他更心仪的是文字的叙事艺术。当然，他也喜欢摇滚，他认为科幻和摇滚的气质都是一种不妥协、要反抗的精神，&ldquo;科幻要有反骨&rdquo;。</p> <p>　　来到清华读博之后，他几乎每天都在图书馆老馆二层的阅读室&ldquo;泡&rdquo;上一段时间，在曹禺当年写作《雷雨》的地方阅读、思考。现如今，他不仅是一位作者，也是一位科幻文学的研究者。&ldquo;世界科幻的历史可以追溯到两百年前，而&lsquo;科学小说&rsquo;出现在中国，最早则是在1902年由梁启超先生创办的《新小说》上，所以清华与科幻小说的渊源很深呀。&rdquo;飞氘饶有兴致地说。</p> <p>　　除了读书研究，他将自己留在华美的想象世界里，以一颗纯真和敏感的赤子之心，希望终生与文字为伴。</p> <p>　　他曾经写过一个动人的故事，讲的是从前有一位国王，创造了一个会唱歌的机器人，可以为他唱最好听的歌。有一天，国王听到一个传说，在遥远的地方有个美丽的姑娘，她曾伤心欲绝，后来变成一尊雕像，如果谁的歌声能打动她，她就会复活。机器人历尽了人世沧桑，千年之后，末日临近，只剩下他和雕像时，他终于懂得了爱，唱出了最用情的歌，雕像复活了。</p> <p>　　&ldquo;下辈子，我想做个机器人。&rdquo;他说。</p> <p><span style=\"font-family: 楷体,楷体_GB2312\">　　来源：《新清华》2013-12-13 </span></p></P>     </div>'),(169,'【人物】黄霞：与学生相处使我充满正能量','http://news.tsinghua.edu.cn/publish/news/4205/20131129105738413751186/huang.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】黄霞：与学生相处使我充满正能量</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">与学生相处使我充满正能量</span></strong></p> <p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">&mdash;&mdash;记2013年&ldquo;宝钢优秀教师特等奖&rdquo;获得者、清华大学环境学院教授黄霞</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">研通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">宋一苇</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img style=\"width: 385px; height: 324px\" alt=\"\" width=\"425\" height=\"359\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131129105738413751186/huang.jpg\" /></span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\">图为黄霞老师近照。</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"425\" height=\"304\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131129105738413751186/ketang.jpg\" /></span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\">图为黄霞老师在给学生上课。</span></strong></span></p> <p>　　孜孜不倦，坚守在教学一线传承教书育人；兢兢业业，奋斗在研究前沿带来科技创新。这是清华大学环境学院教授黄霞一贯恪守的工作准则。高校任教24年来，黄霞凭借着对教育事业的热爱和对党的教育方针的深刻理解，把&ldquo;育人&rdquo;的观念切实融入到教学工作中来。她以先进的教学理念、严谨的治学态度、充满正能量的生活观念，为清华大学环境学院的教学和科研工作树立起一面旗帜。</p> <p style=\"text-align: center\"><strong>学而为师，爱这太阳底下最光荣的事业</strong></p> <p>　　黄霞现任清华大学环境学院学术委员会主任、水环境保护研究所所长、国家重点联合实验室主任，在水污染控制理论与技术方面的科研工作中担任着重要的角色。然而比起这些，黄霞最钟爱的头衔还是同学们亲切称呼她的那一声声黄老师。</p> <p>　　&ldquo;教学工作总是使人充满正能量。&rdquo;谈及自己的教师之路，黄霞的脸上不由绽放出笑容。&ldquo;年轻人是充满活力的，长期同他们相处，我也能永葆乐观积极的心态，有动力、有精力去做自己想做的事情。&rdquo;</p> <p>　　黄霞早年毕业于重庆大学（重庆建筑工程学院），1988年在日本取得化学环境工程专业博士学位，回国后进入清华大学，成为环境学院（原环境科学与工程系）的一名教师。黄霞最初选择这条教师之路的理由很简单&mdash;&mdash;在她心中，教师是天底下最崇高的职业。&ldquo;我一直在努力成为一名称职的教师。在大学里任教，把自己知道的东西传授给学生，而学生的很多想法又激励你去获取更多的知识，这对学生和自己的成长都是十分有益的。&rdquo;</p> <p>　　尽管忙于大量的科研和行政工作，黄霞在教学工作上却从未有过半点懈怠。她有一句名言常常挂在嘴边：&ldquo;&lsquo;教&rsquo;授、&lsquo;教&rsquo;授，第一要务是要教学生、培养学生。&rdquo;她认为，对于大学教师而言，教学工作应是本职工作，也是首要工作。&ldquo;大学是培养人才的地方，学生是咱们的未来。大学和大学教授应当把人才的培养放在各种工作的首位，这一点是不能变的。&rdquo;</p> <p>&nbsp;&nbsp;&nbsp; &ldquo;人民教师最光荣。&rdquo;评价起教师这份职业，黄霞还是觉得这句老话最为合适。&ldquo;尽管有时忙于工作，我不得不放弃一些自己的兴趣爱好，但是这丝毫不会减少我的快乐。我十分热爱我的职业，我的工作就是努力成为一名合格的人民教师。&rdquo;</p> <p style=\"text-align: center\"><strong>热力教改，培养学生解决问题的能力</strong></p> <p>　　黄霞长期从事水污染控制理论与技术方面的教学与科研工作，她主讲的清华大学环境学院本科生基础主干课《水处理工程》、《环境工程原理》课程，先后被评为北京市高校精品课程、清华大学精品课程和国家精品课程。教学过程中，黄霞以诲人不倦的和蔼态度、详尽深入的内容讲解和生动丰富的课堂组织形式，得到了学生们的爱戴和赞誉。</p> <p>　　近年来，黄霞倾注心血，从自己主讲的课程出发，热力推动课程理论性与实践性的有机融合，为高校教育改革事业做出了贡献。她认为，清华培养的学生应当具有扎实的基础知识、较强的创新能力与问题解决能力，而教师的职责就是给学生提供这样一种发展的平台和成长的土壤。&ldquo;我们努力进行教学改革，正是为了给学生提供这样一种将课堂上的理论知识与实践环节有机融合的机会，让学生在实践的过程中自主尝试、深入体会授课中没有具体说明的东西，反过来加深对理论知识的理解和接受。&rdquo;</p> <p>　　在黄霞和团队的努力之下，教学体系不断地发展完善，课堂组织形式也不断开放创新，真正实现了她所期望的&ldquo;从灌输知识到培养人才&rdquo;的转变。例如，为巩固理论课教学效果，培养学生的动手实验能力和科研创新能力，开设了与理论教学同步进行的开放型实验教学。学生分成4-5人一组，在教师的指导下自主设计实验，并在与教师的讨论过程中改进实验方案。学生们在实验设计过程中能够大胆尝试自己的想法，提出许多新颖独特的创意。黄霞说，这种开放型实验教学，一方面可以保证所有同学都能达到课程教学的基本要求，另一方面还能给予有想法的同学自由发挥的空间与平台。</p> <p>　　黄霞的团队在课程体系和内容、教学模式和方法、配套教学实践、学生创新能力培养等方面已形成了一整套完善的教学系统。在历届教学评估中均取得了良好的教学效果，在环境学院名列前茅。这种理论课&mdash;实验课&mdash;工程实践教学紧密结合为一体的教学体系受到一致好评，近年来逐渐被国内其他高校同类课程教学所采纳。</p> <p style=\"text-align: center\"><strong>亦师亦母，愿做学生生活中的指路人</strong></p> <p>　　在不辞辛苦为帮助和支持青年环境科研工作者不断成长创造良好的工作环境的同时，黄霞在生活上对学生的关怀也总是细致入微。&ldquo;黄老师对待学生可谓尽心尽力。无论是科研上还是个人生活上，黄老师总是给予学生最亲切的帮助与指导。&rdquo;黄霞的助理张硕洁对记者说。</p> <p>　　硕士生任仕廷总在夜里精神充沛，充满灵感，为了配合他的节奏，黄霞也牺牲自己的休息时间，时常熬夜为任仕廷解答学术疑难。每到期末考试之前，黄霞总是抽出时间为同学们答疑，约定的答疑时间是一点到四点，黄霞却总是一答就答到六点多。&ldquo;很多老师愿意为同学们答疑解惑，但黄老师却总是主动发现同学们的困惑并予以帮助。对于普通的学生来说，这两者之间其实是有着很大差别的。&rdquo;黄霞的博士生，2012年清华大学研究生特等奖学金获得者陈熹这样说。</p> <p>　　2012年6月毕业于清华大学环境学院的孙昊天曾是黄霞课上的一名学生，毕业设计期间，他因实验长久没有进展而灰心丧气，便通过飞信签名诉说苦恼。没想到签名发出后，几分钟内就收到了黄霞的回复，鼓舞他不要轻易言弃。对于学生来说，黄霞是科研与公务繁忙的大教授，而她总能在细微之处关心到每一个普通的学生，由此传递出来的正能量是十分巨大的。孙昊天于是潜心回到实验室，实验最终取得了成功，而他的毕业论文也被评为当年清华大学优秀毕业论文。</p> <p>　　黄霞今日对于师生之道的认识，实际上受到了很多前辈师长的重要影响。每每回忆及此，黄霞便会说起初入职时，是一同共事的著名环境学家钱易院士的&ldquo;为人为学为师&rdquo;使她对于教师职责崇高性的理解更加深刻。&ldquo;钱老师总是很平和地对待每一个学生，她认为学生的需求就是教师的方向。教学工作对学生的培养非常重要，因此作为教师，我们就应当努力地去做好教学相关的每一件事。&rdquo;黄霞回忆道。</p> <p>　　学生对于黄霞而言就像自己的孩子一样。谈及对于孩子们的期望，她像世上一切的师长与母亲一样，希望他们拥有自立与创新的能力，更&ldquo;希望他们真正拥有一种清华精神，拥有一份自己的梦想，并不断朝着自己的梦想去努力。&rdquo;</p> <p style=\"text-align: right\">　　编辑：襄 桦</p></P>     </div>'),(170,'【人物】徐迎庆：当科学遇上艺术','http://news.tsinghua.edu.cn/publish/news/4205/20131122100657330543966/11.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】徐迎庆：当科学遇上艺术</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">当科学遇上艺术</span></strong></p> <p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">&mdash;&mdash;记清华大学信息艺术设计系主任、校&ldquo;教书育人先进个人&rdquo;获得者徐迎庆</span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学生记者&nbsp; </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">陈姿霖</span></strong></p> <p style=\"text-align: center\"><img style=\"width: 295px; height: 443px\" alt=\"\" width=\"312\" height=\"467\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131122100657330543966/11.jpg\" /></p> <p><strong>　<span style=\"font-family: 楷体,楷体_GB2312\">　</span><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">徐迎庆</span></span></strong><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">，2010年10月受聘于清华大学美术学院，现任美术学院信息艺术设计系系主任、教授、博士生导师。之前任职于美国微软公司亚洲研究院近13年，担任主管研究员，并兼任微软&mdash;&mdash;北京电影学院&ldquo;数字化卡通与动漫联合实验室&rdquo;主任。<span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">2012年获&ldquo;清华大学先进工作者&rdquo;称号，2013年获清华&ldquo;教书育人先进个人&rdquo;称号。</span></span></span></span></p> <p style=\"text-align: left\">&nbsp;　　徐迎庆出身于数学系，拥有计算机博士学位，如今任职于美术学院。</p> <p style=\"text-align: left\">　　&ldquo;从信息艺术设计系的未来与方向来讲，科学与艺术的融合是我们所追求的。&rdquo;他说。</p> <p style=\"text-align: center\"><strong>科学与艺术的融合</strong></p> <p>　　徐迎庆老师给记者的第一印象非常亲切。在谈及选择到美院任职的原因时，他笑着说：</p> <p>　　&ldquo;因为喜欢啊！&rdquo;</p> <p>　　原来徐迎庆在微软亚洲研究院工作期间就和清华美院有过一些合作，同时他在微软亚洲研究院期间的研究工作也是专注于计算机图形学、交互设计、文化遗产数字化等科学与艺术密切结合的领域。</p> <p>　　&ldquo;科学与艺术的融合&rdquo;也是徐迎庆来到清华美院后一直努力的方向。</p> <p>　　在徐迎庆与清华美院学院其他老师的共同努力下，学院承担了包括国家973计划项目、国家自然科学基金项目、文化创意产业国家科技支撑计划项目等多项课题。徐迎庆表示，上述自然科学方面的课题是从国家层面推动科学、艺术、设计相融合的典范，所有的研究工作实际上都还是围绕着美术学院的专业和特长展开的。例如：国家973计划项目《文化遗产数字化保护的理论与方法》，主要是研究如何利用先进的科学技术手段来对以敦煌雕塑和壁画为典型代表的文化遗产进行数字化的模拟、仿真、虚拟复原。</p> <p>　　关于文化遗产数字化保护，徐迎庆向记者介绍，自然灾害、环境变化、人为破坏加速文化遗产的消亡，许多文化遗产实物保护的速度远远赶不上损坏的速度，特别是目前城市化发展很快，也使得保护与发展的矛盾越来越尖锐。另一方面，从历史发展的角度来看，众多文化遗产的消亡是不可逆转、难以修复、只能延缓。而在现实中。一些实物保护方法存在不确定性，而且保护性破坏也时有发生。而数字化保护可以做到不触及文物，最大限度地避免对文物的损坏，同时可以可长期存档，便于反复研究，可以虚拟复原和数字增强，并且可为现实修复提供一定的参考。文化遗产的数字化保护理论与方法是一门新兴的多学科交叉研究方向。研究文化遗产数字化保护不仅是保护和弘扬文化遗产等的国家重大需求，也是一门多学科交叉综合集成的前沿研究课题。近年来，文化遗产的数字化保护已经成为全球研究和应用的热点。</p> <p>　　具体谈到他们目前正在从事的课题，徐迎庆说，以敦煌为例，敦煌艺术早期的艺术原貌是怎样的，那些缺损的壁画内容可否完整地数字化复原出来、壁画的绘制当时都使用了什么颜料，这些颜料的原产地在哪&mdash;&mdash;如果这些问题研究清楚了，这对艺术和考古研究都有帮助。当然，虚拟复原也不是万能，徐迎庆笑着说：&ldquo;就像我们不打算给断臂的维纳斯复原一双手臂出来，我们仅是在那些适合于虚拟修复的地方开展工作，譬如根据考古等历史资料，科学地修补残破。&rdquo;同时数字化之后对于壁画残破原因的分析有着重大意义&mdash;&mdash;电脑里可以产生多种可能。经过这些研究，就可以对壁画和雕塑的物理修复提供建议。徐迎庆告诉我们，全世界都在进行文化遗产复原的工作。正如2011年国际顶级学术期刊《科学》杂志的封面文章所说，文化遗产的数字化是属于地学、信息、化学、考古、色彩、艺术等多学科综合交叉领域，不是相对单一和独立的东西。</p> <p>　　交叉学科在国外一些著名大学已经积累了丰富的经验，在国内清华大学率先在这方面做出了努力，在学校的关心和支持下，清华大学信息科学技术学院、新闻与传播学院、美术学院联合开展了信息艺术设计交叉学科研究生项目。该项目每年都会招收交叉学科的人才，文科比如：信息设计、工业设计、视觉传达、哲学、历史、语言等等，理工科包括：数学、物理、计算机技术、软件工程、电子工程、机械、精密仪器等。把不同学科背景的研究生综合交叉在一起训练，发挥所长，这对于以后的学科发展很有意义。&ldquo;虽然（交叉学科出现）时间很短，但是交叉学科还是一个很有潜力、很有希望的一个学科。&rdquo;徐迎庆说。</p> <p>　　现在信息设计系的师生就正在做交叉学科相关的项目，比如和英特尔公司合作下一代相机的研发，和微软合作《韩熙载夜宴图》的数字化，和故宫合作古代绘画的数字化展示等等。笔者真切地感受到徐老师以及信息系的师生们正在积极实践着科学与艺术的融合&hellip;&hellip;</p> <p style=\"text-align: center\"><strong>高徒出名师</strong></p> <p>　　对于获得&ldquo;教书育人先进个人&rdquo;这个称号，徐迎庆非常谦虚，他纠正了记者提出的&ldquo;老师引导学生&rdquo;的&ldquo;引导&rdquo;一词。</p> <p>　　徐迎庆认为，在知识面前，学生和老师是平等的。《高徒出名师》这篇文章写于他在微软亚洲研究院工作期间，集中体现了他的教学思想。他认为&ldquo;名师出高徒&rdquo;这一句话其实也并不完整。因为好的学生是老师成就的体现。</p> <p>　　&ldquo;我对那些勤奋学习的学生其实心存感激。&rdquo;徐迎庆在文章中就曾表示过：&ldquo;实际上，当和这些优秀的实习生一起工作时，我们也从他们那里学到很多。比如：他们无论面对任何困难，都能够咬着牙坚持下去并一定要取得胜利的精神和必胜决心、他们废寝忘食的工作热诚、他们因成功而获得的欣喜、他们的多才多艺等等。&rdquo;徐迎庆所认同的观点是：老师与徒弟相互促进，而不存在谁&ldquo;引导&rdquo;谁的说法。</p> <p>　　曾经在微软亚洲研究院带实习生的时候，徐迎庆就经常和实习生们辩论；如果实习生不敢与他辩论（就激烈程度而言甚至可以说是&ldquo;吵架&rdquo;），那么这个实习生是会被批评的。徐迎庆认为，学生们要想有所成就，就必须敢于质疑。在研究方面，学生们要学会独立思考，要有独立精神，在学术上不能惧怕权威。</p> <p>　　&ldquo;尊重老师，是人格上的；但是学术上，同学们要敢于为了真理和老师争得面红耳赤；老师们也应该有一种清醒的认识，因为如今接触知识的方式广了，每个人的知识面有所区别，学生们在许多方面都值得老师们去学习。&rdquo;</p> <p>　　美院的同学们都很喜欢徐迎庆老师，因为他总在不经意的细节间就能让学生们与之亲近。信息系的一位同学告诉记者，有一次她去系办，但还没有开门，刚好碰上徐老师，徐老师就帮同学开了门，并说&ldquo;要是系秘问你是怎么进来的，就说是一个姓徐的老师帮你开的门就是了。&rdquo;然后就走了，那位同学非常感动，一直没来得及告诉徐老师说她是认识老师的。</p> <p>　　有的美院同学说：&ldquo;徐老师教咱们科学！&rdquo;徐迎庆听后笑了，他说：&ldquo;我不仅是教科学，我还想提醒大家用科学的态度去对待创作，把感性思维和理性思考相结合，做研究要有科学、严谨的态度。&rdquo;</p> <p>　　对于信息系的同学们，徐老师建议，第一，要热爱专业。因为兴趣决定效率。第二，要多阅读相关书籍，多实践。因为&ldquo;读万卷书，行万里路&rdquo;&ldquo;功夫在门外&rdquo;，同学们要有足够的眼界与经验才能成功。第三，要重视汉语。徐迎庆表示大家当然承认英语的重要性，但是作为一个中国人必须要更注重汉语，从祖国文化中选择和继承优秀养分并充分吸收。第四，每天锻炼一小时。对于学习和工作，身体很是重要。同学们多是远离家乡，离开父母，独自在清华求学，所以同学们要学会照顾自己，不要让在家的父母担心。说这些话的时候，徐迎庆的眼中充满着慈祥&hellip;&hellip;</p> <p><strong>　 相关链接：</strong>　　</p> <p>　　徐迎庆的研究领域是科学与艺术相结合，他一直从事计算机图形学、计算机视觉、图形用户界面设计、虚拟现实、数字色彩、数字化卡通与动画的算法研究和技术开发；还曾参与多项计算机动画电影及电视片、数字特技、电脑动画、数字艺术、计算机绘画的策划与创作。曾主持微软亚洲研究院的人脸卡通自动生成技术研究，该项技术综合计算机视觉、人工智能、计算机图形学、认知科学、艺术设计等交叉领域知识，被评为微软亚洲研究院成立十周年中最有影响力的研究成果之一。</p> <p>　　他在国际会议和学术期刊上发表学术论文70余篇，获得美国技术专利20多项；还有多项研究成果被应用于微软公司的重要产品之中。他是中国美术家协会会员、美国电气和电子工程师协会(IEEE)高级会员、美国计算机协会(ACM)会员、中国计算机学会(CCF)高级会员。他曾服务多个国际学术会议，例如：担任计算机图形学与交互技术大会（亚洲）的艺术展示主席、国际计算机动画与社会媒介学术会议联合主席、国际多媒体大会的交互艺术联合主席他近年的研究方向侧重于自然用户界面设计及其应用、计算机图形学与计算机视觉、文化遗产保护的数字化理论与方法、虚实结合的智能玩具与游戏设计。</p> <p style=\"text-align: right\">（<strong>清华新闻网11月25日电</strong>）</p> <p style=\"text-align: right\">供稿：美术学院&nbsp; 编辑：范 丽</p></P>     </div>'),(171,'【人物】黄齐成：当勤奋成为一种习惯','http://news.tsinghua.edu.cn/publish/news/4205/20131121150806216322171/1.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】黄齐成：当勤奋成为一种习惯</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">当勤奋成为一种习惯</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&mdash;&mdash;</span><strong><span style=\"font-size: 18px\">记&ldquo;第34届日本国际泷富士美术奖&rdquo;获得者、清华大学美术学院硕士生黄齐成</span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学生记者&nbsp; </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">汪 悦</span></strong></p> <p style=\"text-align: center\">&nbsp;&nbsp;&nbsp;<img style=\"width: 295px; height: 370px\" alt=\"\" width=\"312\" height=\"389\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131121150806216322171/1.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为黄齐成近照。</span></p> <p>&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"font-size: 14px\">&nbsp;<span style=\"font-family: 楷体,楷体_GB2312\">&nbsp; <strong>黄齐成</strong>，1990年11月生，广东阳江市人。2009年考入清华大学美术学院雕塑系，2013年硕士免试入学。4年中创作了大小23件雕塑作品，其中2012年作品《碎木里的风景》在韩国Hongik University展出；《指舞云韵》荣获&ldquo;2012年首届中国&middot;佛山国际城市雕塑创作大赛&rdquo;优秀奖；2013年本科毕业作品《乐山乐水》被评为&ldquo;清华大学美术学院优秀毕业作品&rdquo;，荣获&ldquo;第七届全国雕塑专业毕业生作品大奖赛&rdquo;一等奖，&ldquo;2013全国高校毕业生优秀雕塑作品展&rdquo;银奖，&ldquo;2013年曾竹韶雕塑艺术奖学金展览&rdquo;提名奖。曾获&ldquo;清华大学自强之星&rdquo;称号、&ldquo;清华大学优良毕业生&rdquo;称号、&ldquo;北京市优秀毕业生&rdquo;称号。</span></span></p> <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 近日，清华大学美术学院雕塑系学生黄齐成凭作品《乐山乐水》和《指舞云韵》获&ldquo;第34届日本国际泷富士美术奖&rdquo;，成为唯一获奖的中国学生。日本国际泷富士奖举办自1980年，由日本交通协会在全球范围内设立，旨在培养令人瞩目的、具备丰富实践经验的青年艺术家。日本国内12所、海外8所大学的学生为选拔对象，今年大赛全球共18人获奖。</p> <p style=\"text-align: center\"><strong>画画有使我内心宁静的&ldquo;魔力&rdquo;</strong></p> <p>　　和黄齐成的访谈约在午饭时间。这一天风很大，他骑着车，从学校东面美术图书馆急匆匆地往北面食堂赶来，没有戴手套，手微微发红；脖子上挂着单反相机，&ldquo;这是在日本领奖时用奖金买的，终于有属于自己的相机可以自由拍照了&rdquo;，相机里存留着许多上午在图书馆自习时拍的照片，&ldquo;拍的不好，还需多学习&rdquo;，黄齐成态度谦虚而诚恳；说罢他抬起头，举起相机，&ldquo;咔嚓&rdquo;一声，记录下北京难得的湛蓝晴天。</p> <p>　　&ldquo;我小时候特调皮，没少让父母操心&rdquo;，谈及自己的童年，黄齐成憨厚一笑，娓娓道来。&ldquo;父母没什么文化，每天又要忙农活，没时间和意识管我；那时候我东跑西遛，不爱学习，就喜欢动手玩玩具，甚至连家里一些坏电器也拆了研究，运气好的话，能修好一两件&rdquo;，黄齐成对&ldquo;拆东西&rdquo;这件事一直难以忘怀，&ldquo;每次拆东西，整个人立马进入一种专注状态，很投入，忘记周围一切，好像有魔力一样&rdquo;。</p> <p>　　而画画同样给了黄齐成&ldquo;安静&rdquo;的魔力。&ldquo;小时候，我三姐经常画画，看她画画我觉得很好玩，她就给了我纸笔，让我自己画。很神奇的是，当我拿着笔接触纸面、勾勒线条时，我立马安静了，也能坐得住，想着在纸上要画些什么、怎么画才好看&rdquo;。</p> <p>　　黄齐成十分感谢他的三姐，她是他画画生涯的启蒙老师，带领他开启绘画的大门。上初中后，黄齐成只要有时间，就拿起画笔练习美术，从最基本的速写、素描、色彩开始。画画让黄齐成变了一个人，不再乱跳乱窜、调皮捣蛋，他不想出去玩，也不爱出去玩，只要一放假就扎在铅笔、颜料堆中，沉浸在他五彩缤纷的绘画世界里。</p> <p>　　从那时候起，他觉得绘画是他生命里最有趣的一件事；从那时候起，他喜爱追寻宁静的世界和内心；从那时候起，他决定以后要走美术这条路，与使内心宁静的美术相伴。</p> <p style=\"text-align: center\"><strong>我相信&ldquo;天道酬勤&rdquo;</strong></p> <p>　　认识黄齐成的人，对他的评价都是&ldquo;勤奋&rdquo;&ldquo;刻苦&rdquo;；这两个词已成为黄齐成的标签，既激励着他自己，也激励着其他人。而他的勤奋、刻苦、认真，用他的话说，便是&ldquo;人生在勤，已成为一种习惯&rdquo;。</p> <p>　　黄齐成所读的高中是一所以美术为特色的学校，大部分美术生具备较高的天赋和扎实的基础；不是专业出身的他，清楚地知道&ldquo;若要脱颖而出，必须加倍努力&rdquo;。因此每到周末，当大部分同学都回家或者出去玩了，他就一个人留在画室，超额完成美术老师布置的作业，对自己的要求毫不放松。他甚至利用晚饭时间到画室练习，直到晚修开始前十几分钟才收拾画具，啃块面包，赶回教室。此外，他自知英语薄弱，夜里十点半宿舍熄灯后，他偷偷溜到宿舍走廊，借着微弱的灯光看英语，宿舍管理员见他如此认真，都不忍心打扰。黄齐成高中美术专业老师阮钟曾评价他&ldquo;是一个刻苦、踏实的学生，各方面都很优秀，每天他是最早来到画室的一个，也是最晚离开的一个&rdquo;。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"312\" height=\"422\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131121150806216322171/2.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为创作中的黄齐成。</span></p> <p>　　在清华园的本科4年，黄齐成依旧&ldquo;惟日孜孜，无敢逸豫&rdquo;。黄齐成在雕塑学习中感到无比快乐，他一直在享受着自己的勤奋，并为&ldquo;快乐&rdquo;而勤奋。平常他待的最多的地方便是雕塑系的工房和美术图书馆，他喜欢在图书馆安静地查找资料，找寻灵感；喜欢在工房随意揉捏泥巴，塑造各式造型；喜欢去老师办公室聊天，和老师交流想法，解开困惑。他脑袋里装了无数素材，吃饭、骑车、走路时都在思考应如何联系线索，化整归一，举一反三；他随身携带着本子，从不错过记录任何一条有意义的想法。他不爱打游戏，也不爱看电影，很少参与娱乐活动，上网也只是看看新闻、查阅资料。他觉得看电影对他来说&ldquo;是件很奢侈的事&rdquo;。大四推研一结束，黄齐成就开始构思毕业作品，不断列举、延伸、否定、完善，大约花了半年时间用来酝酿灵感；在紧张忙碌的实践阶段，他更是有一个月时间直接睡在工房，累了就睡，醒了再工作&hellip;&hellip;直到作品完整地呈现在本科毕业展上时，他坐在工房的椅子上一下子睡着了&hellip;&hellip;</p> <p>　　天才就是无止境刻苦勤奋的能力。如今，这种年轻人身上普遍少有的能力，已潜移默化地渗入到黄齐成的骨子里，成为他生活的一部分。</p> <p style=\"text-align: center\"><strong>雕塑是我心灵的避风港</strong></p> <p>　　经过本科4年的学习，如今的黄齐成对雕塑有了更明确的认识，&ldquo;对我来说，雕塑其实是我内心的避风港。雕塑能让我和这个嘈杂的社会隔离开，给予我安静的空间思考东西，带来内心的平和，所以我特别喜欢这种平静状态。&rdquo;</p> <p>　　黄齐成本科毕业作品《乐山乐水》，就是在抒发对和谐安宁的精神世界的向往、追求之情。中国传统文化中，&ldquo;山水&rdquo;一直与古代文人的精神内涵息息相关，它代表着文人的智慧与情操，也体现着人与自然间的感应交流，正所谓&ldquo;知者乐水，仁者乐山。知者动、仁者静。知者乐，仁者寿&rdquo;。因此黄齐成选择中国传统山水为切入点，意在表现传统要素。但仅此，他觉得还不够，&ldquo;如果为了传统而传统，最终作品老套、单调，我希望能将传统东西有所转化，通过自我思想意识将传统之物转化为传统根源与现代意蕴兼备的作品。&rdquo;</p> <p>　　某一日，创作灵感突然而至。在看完大量传统山水画图片后，黄齐成回宿舍休息，闭眼的瞬间，山川那种高低起伏的影像不断地在他脑中波动，影像好似现代科技中的无线电波，亦或是心电图的图像在闪烁，那时他已分辨不清到底是山还是电波，只觉得&ldquo;这两者实在太像了，就像被当今信息化社会冲昏头脑一样，很难识别事物的真假&rdquo;，这种突发的感受大大启发了他关键性的创作。最终，黄齐成决意用大自然的山峰与现代无线电波的波峰作对比，它们既有相同的形状特征，又有不同的感情联想，自然与人工化、传统与现代、古代慢生活与现代快节奏&hellip;&hellip;黄齐成在借鉴传统宋元山水画的构图形式和审美特征的基础上，通过传统与现代的转化，以此来揭示中国文化在当代社会中的人文意境。</p> <p>　　最终，黄齐成的《乐山乐水》打动了日本国际泷富士美术奖的评委会们，得到大家一致的高度认可，日本东京艺术大学宫田亮平校长更称赞它令人&ldquo;惊讶至极&rdquo;。</p> <p style=\"text-align: center\">&nbsp;<img alt=\"\" width=\"595\" height=\"149\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131121150806216322171/3(1).jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">黄齐成获奖作品《乐山乐水》。</span></p> <p>&nbsp;　　黄齐成现在已进入研究生一年级。黄齐成对未来往往有着相对清晰和明确的目标追求，他独立思考，凝聚所学知识，寻找最恰当的关注点。&ldquo;雕塑让我的生活变得纯粹和充实，知识永远不会是累赘，我想要不断学习，专注投入，成为有社会责任的艺术家。&rdquo;</p> <p>&nbsp;&nbsp;&nbsp;　&nbsp; 采访结束，黄齐成跨上自行车，和笔者微笑挥手告别，迅速消失在铺满秋叶的主干道上。他如夸父追日，在追逐梦想的道路上勤奋前行！</p> <p><strong>　　【访谈感悟】</strong></p> <p>　　清华大学美术学院雕塑系胥建国老师曾称赞黄齐成&ldquo;十分谦虚质朴&rdquo;，这也是笔者访谈时的相同感受，积极向上，很少抱怨。黄齐成戴着眼镜，略显憨厚，普通话带着不标准的广东腔，班里的同学都喊他&ldquo;小广东&rdquo;。他平时休闲去处是清华西面的雕塑园，他喜欢在那儿走走看看、发发呆。我想清华园里，很少有人像他这样生活吧，可他却乐在其中，一点也不觉得枯燥。在他身上，笔者强烈地感受到&ldquo;生活的纯粹与专注，真是一种幸福！&rdquo;</p> <p style=\"text-align: right\">供稿：美术学院 编辑：范 丽</p></P>     </div>'),(172,'【人物】徐琨：融入金融改革 扎根金融基层','http://news.tsinghua.edu.cn/publish/news/4205/20131118093043221397530/xu.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】徐琨：融入金融改革 扎根金融基层</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">融入金融改革 扎根金融基层</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\">&nbsp;&mdash;&mdash;记清华大学五道口金融学院2011级博士研究生、研究生团总支书记徐琨</span></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\"><img border=\"1\" alt=\"\" width=\"438\" height=\"327\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131118093043221397530/xu.jpg\" /></span></p> <p style=\"text-align: left\">&nbsp;　　<strong><span style=\"font-family: 楷体,楷体_GB2312\"><span style=\"font-size: 14px\">徐琨</span></span></strong><span style=\"font-family: 楷体,楷体_GB2312\"><span style=\"font-size: 14px\">，清华大学五道口金融学院2011级研究生，2013年提前攻博，学分绩点位列年级第一。曾获2011-2012年度研究生国家奖学金、五道口金融学院刘鸿儒特等奖学金、校研究生会优秀学生干部；学术文章曾获评《Economist》杂志中国峰会征文十佳，在《投资研究》和《宏观经济研究》等中文核心期刊发表多篇论文；历任五道口金融学院研究生会副主席、校研究生工作部德育工作助理、学院研究生团总支书记。2013年9月作为金融学院第一位挂职锻炼的博士研究生远赴福建海峡银行深入中小城市商业银行进行锻炼。</span></span></p> <p style=\"text-align: center\"><strong>&ldquo;磨硬双肩，传承积累&rdquo;</strong></p> <p>　　<span style=\"font-family: 楷体,楷体_GB2312\"><span style=\"font-size: 14px\">&ldquo;双肩挑是清华骨干培养一贯延续的优秀制度，紧密联系中国的金融改革与政策研究是五道口的光荣传统。作为清华人、五道口人，我非常认同这两点，无论是学术研究还是社会工作都要将理论与实际兼顾联系起来，经济学科尤其如此。磨硬双肩，传承积累，这将成为融入我血液的成长印记。&rdquo;</span></span></p> <p>　　浓眉大眼、皮肤偏黑、一张浑圆的娃娃脸上总是挂着憨厚、谦卑的笑容。这样的五官似乎很难与睿智这样的词汇联系起来，但是我们的主人公徐琨却专注于货币政策与宏观经济改革研究，思维方式里带有深刻的&ldquo;道口人伴随中国金融改革三十年&rdquo;的烙印。他是2011-2012年度五道口金融学院唯一一位特等奖学金与国家奖学金双料获得者，他曾在《投资研究》和《宏观经济研究》等中文核心期刊发表多篇论文，是同学眼中名副其实的&ldquo;学术新秀&rdquo;和金融界的&ldquo;明日之星&rdquo;。无论是发表在核心期刊上的论文，还是荣获《Economist》杂志 2012 年&ldquo;中国峰会&rdquo;全球征文十佳的文章，徐琨的作品无一不是紧跟中国经济热点脉络，扎根中国金融改革实践。对自己的学术研究，徐琨有个形象的理解，他认为经济金融学理论有神也有形，神是方法、是思想、是规律，形是假设、是约束、是现实。现代西方成熟经济金融理论精髓在神，需要尊重、借鉴，但中国经济有很多特殊的&ldquo;形&rdquo;，特殊的现实约束和隐性契约，如何把精髓的&ldquo;神&rdquo;与具体的&ldquo;形&rdquo;结合起来解决中国的实际问题，当代青年学人责无旁贷。</p> <p>　　徐琨爱学习、好学习，学院里人尽皆知。这是在打基础，徐琨并不把它当作自己履历中的闪光点。他认为不论将来的职业规划如何，校园脱产学习中对专业知识的研究与深造都是十分必要和珍贵的，这将为未来走上工作岗位打下坚实的理论基础。因此当许多大学生深陷理想与现实的矛盾漩涡时，徐琨毫不犹豫地选择了&ldquo;理想至上&rdquo;的命题。他认为，无论志在何方，一个没有理想信念和意义感支撑的追求只能是一座空中楼阁，极易倾覆。</p> <p>　　除了在图书馆，校园里的各种课余活动你都很容易找到徐琨的身影。徐琨先后任学院研究生会副主席、校研究生工作部德育工作助理、学院研究生团总支书记，带领学院研究生团总支首次参加学校评优就获得十佳称号。在学习和工作中寻找平衡，徐琨坦言自己做的并不完美，这也督促他从自身寻求突破，不断自我调整，杜绝拖延，提高效率。&ldquo;社会工作是清华&lsquo;双肩挑&rsquo;优良传统的重要要求，更是在学校服务同学、锻炼能力，在未来用硬实的肩头担起清华人建设共和国重任的准备。服务、成长、担当是贯穿我做社会工作始终的关键词，也正是我的快乐所在、收获所在。&rdquo;</p> <p style=\"text-align: center\"><strong>&ldquo;脚踏上基层的土地，心才能贴近真实的中国&rdquo;</strong></p> <p>　<span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　&ldquo;我将为国家民族之振兴贡献力量视作一生的责任，当下践行，一是学习，二是实践。入则学好书本理论、掌握本领技能、搞活研究创新；出则扎入基层，去观察、去思考、去分析、去解决；两者须结合，知行当统一。脚踏上基层的土地，心才能贴近真实的中国。&rdquo;</span></span></p> <p>　　他多地实践，聚焦中国农村信用体系构建。徐琨认为，金融不是富人的代名词，是工具方法，是现代经济的核心，来源和目的都是实体经济的发展。广袤中国农村、九亿中国农民为主体的农村经济更不例外。但一直以来农村金融各项基础设施的落后和融资渠道的缺乏，制约了农村经济的发展。连续两年暑假，历时近百天，他通过学校短期挂职、组建带队课题调研小组、支队社会实践等多种形式，分赴广西百色、贵州贵阳与安顺、浙江丽水等多地，专注&ldquo;中国农村信用体系建设&rdquo;的课题进行实践调研，并形成调研报告切实写入了各地政策制定，指导农村信用实践。</p> <p>　　他创造性地主导设计&ldquo;整院主题、依托支队&rdquo;的研究生实践调研新模式。如果学院一次实践出行数个支队，不统一调研题目，每个支队实践时间有限、人数有限、地理上只在一点，实难形成深度调研；但若统一规定调研题目，则各地文化习俗、经济特色、现实困境均天壤有别，又难定题。针对这一实践调研中的难题，徐琨结合金融学院实际，创新设计了形散而神不散的实践调研新模式。2013年，五道口金融学院暑期社会实践调研以&ldquo;县域金融发展：现状、瓶颈与对策&rdquo;为大课题，要求各支队在此大题目下结合各地特色，自主从农村金融、县域中小企业融资、金融监管主体与金融机构的县域博弈等等各个子课题挑选一二展开调研，不求面面俱到，但求讲实讲透。实践结束后，这一新型模式使得各个支队的同学在总结交流时都不偏主题、有话可讲的同时又侧重不同，最终整合成一篇大课题调研报告时迸发出了很多新收获和新结论，调研成果显著。&ldquo;整院主题、依托支队&rdquo;的模式也助力五道口金融学院暑期实践联合支队再获校优秀实践支队金奖，成为其中重要的&ldquo;粘合剂&rdquo;。</p> <p>　　他挂职海峡银行，深入中小城市商业银行学习锻炼。2013年9月徐琨作为金融学院首位外派挂职锻炼的博士研究生远赴福建海峡银行，开始为期半年的&ldquo;半工半读&rdquo;。他参与银行应对利率市场化冲击、学习互联网金融前沿以及对台离岸金融研究工作，推动该行实体社区银行设立以及新型信贷产品的设计。&ldquo;当今是央行推进利率市场、推出存款保险制度、引进民营银行的关键时点，然而整体银行业存在创新不足、竞争高度同质化的问题。这种局面下，中小型城市商业银行面对着来自大型国有、股份制商业银行和潜在的民营银行、互联网银行的双重挑战，生存定位和发展战略必须及时做出调整。来到海峡银行挂职，走出课本上固有的商业银行经营理论，接触学习真实的基层城商行运行，贡献自身知识理念，很能开阔眼界、认识问题、增长才干。&rdquo;</p> <p style=\"text-align: center\"><strong>&ldquo;健康，是一个大概念&rdquo;</strong></p> <p>　<span style=\"font-family: 楷体,楷体_GB2312\"><span style=\"font-size: 14px\">　&ldquo;课余生活中我越发体会到，健康是一个大的概念。强健的身体自不必说，阳光的生活心态、广泛的兴趣爱好、和谐的集体融入等等都可以纳入到一个大健康的外延里。按照这个定义，我在科研和社工之外的生活可以一言以蔽之：追求并保持健康。&rdquo;</span></span></p> <p>　　虽然忙碌，但在各类文艺、体育的场地舞台上你总是可以看到徐琨的身影。无论是羽毛球、乒乓球、台球还是篮球、足球，各类竞技项目都是这位&ldquo;球类达人&rdquo;一展身手的好机会，研运会比赛、晚会小品演出也从来不在话下，周末得空还会招呼同学朋友登山郊游、野炊泛舟。学院刚刚开展起来的&ldquo;金融普及进社区&rdquo;志愿活动徐琨更是一开始就积极参与其中。他上满发条般的充沛精力，很让人惊讶，阳光包容的积极态度、开朗风趣的性格言谈又十分招人喜欢，就像他在学院学生节晚会中扮演的&ldquo;睿智却不失可爱&rdquo;的葫芦娃，可谓&ldquo;正能量&rdquo;满满。</p> <p>　　交谈之中徐琨还不忘推广他的&ldquo;大健康&rdquo;理念：&ldquo;园子里科研、工作压力都不小，走入社会竞争想必更加激烈，这让很多人忽视身心、人际、兴趣等多方面的健康，而我相信这种大概念的健康正是学业、事业取得长期的、更高层次的成功的动力之源和重要保障。所以特别希望将自己的这一点感悟分享给所有同学，共同健康地学习、工作、生活。&rdquo;</p> <p>　　琨，美玉是也。温润如玉曰君子，君子势必需&ldquo;修身、齐家、治国、平天下&rdquo;为己任。徐琨用自己的点滴积累和不懈奋斗诠释着他的&ldquo;君子之道&rdquo;，正如他所讲，自己愿化身为一朵浪花，融入中国金融改革的浪潮之中。</p> <p>　　鲲鹏击浪从兹始，沧海横流何足虑！</p> <p style=\"text-align: right\">供稿：五道口金融学院 编辑：襄桦　　</p> <p>　　</p> <p>&nbsp;</p></P>     </div>'),(174,'【人物】李晨曦：青春加速度 我跑我人生','http://news.tsinghua.edu.cn/publish/news/4205/20131101104117413329942/li.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】李晨曦：青春加速度 我跑我人生</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">李晨曦：青春加速度 我跑我人生</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">研通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">朱怡</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"312\" height=\"416\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131101104117413329942/li.jpg\" /></span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\">图为在北京国际马拉松上奔跑的李晨曦。</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"482\" height=\"320\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131101104117413329942/li2.jpg\" /></span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\">图为李晨曦在比赛中。</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"482\" height=\"321\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131101104117413329942/li3.jpg\" /></span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\">图为李晨曦在研运会开幕式上代表运动员宣誓。</span></strong></span></p> <p>　　明朗的笑容，有些憨厚的神情，这就是李晨曦留给记者的第一印象。在10月20日举行的2013北京国际马拉松赛中，这位来自清华大学计算机系的博士一年级的学生，以2小时57分53秒的成绩创造了本届赛事中清华选手的最好成绩。作为马拉松赛场上的一匹&ldquo;黑马&rdquo;，他为自己，也为清华夺得了荣誉。青春不息，奋斗不止，李晨曦矫健的身姿背后，是那一颗为体育梦想而跳动的心。</p> <p style=\"text-align: center\"><strong>2小时57分53秒，每一秒都要坚持</strong></p> <p>　　42.195公里，15000名参赛选手，今年的北马全程赛显得异常艰辛。但在李晨曦看来，这并非一次残酷的竞争，而是马拉松爱好者们的&ldquo;一场节日狂欢&rdquo;。以乐观的心态去参赛，以永不放弃的精神去坚持，这或许就是他能出敌致胜的法宝。</p> <p>　　在当天的全程比赛中，李晨曦并非一帆风顺。在前25公里，他保持了4分钟/公里的速度，处于较为领先的位置。但渐渐地，随着体力不支，他迅速调整了策略，先走路30秒，再继续跑1公里。这样的折中战术既不至于使自己精力衰竭，又能保持相对较快的速度。到了最后2公里处，他一直保持较快的冲刺速度，并最终顺利冲线。</p> <p>　　&ldquo;后半程中每跑一步都要咬紧牙关，好在有清华志愿者和啦啦队队员们为我们打气加油。&rdquo;李晨曦笑着说。在马拉松赛道的两旁，分布着不少清华的物资补充点。每当有别着&ldquo;清华&rdquo;袖章的参赛者跑过，总会听到一声声的&ldquo;清华加油！&rdquo;对李晨曦而言，在这场孤独的战役中，来自清华的声音给予了他许多力量与支持。</p> <p>　　从沿途的美丽风景，到赛道边的阵阵呐喊，从汗流浃背的疲累，到抵达终点的喜悦，再次回顾北马，许多鲜明的记忆仍然萦绕在李晨曦的脑海中。每一秒都是磨练，每一步都是收获，整整三小时的坚持，最终成就了这位跑者的傲人成绩。</p> <p style=\"text-align: center\"><strong>八年路，工科男守护体育梦</strong></p> <p>　　&ldquo;看似寻常最奇崛，成如容易却艰辛。&rdquo;从第一次接触田径以来，李晨曦已经在跑步这条路上前行了8年。</p> <p>　　初三时，初生牛犊不怕虎的李晨曦第一次参加正式比赛，就获得了1500米区冠军。到了高中，他在沉重的学习压力之下依然参加了学校田径队。白天，结束课程之后，他利用最后一节课的自习时间去参加十几公里的跑步训练；晚上，赶着上晚自习的同时，他又挤出时间吃迟到的晚饭。而这样紧张繁忙的生活方式，李晨曦足足坚持了3年。</p> <p>　　&ldquo;练体育的经历影响了我的生活，也造就了我的个性。&rdquo;李晨曦如此评价自己过往的训练生活。当被问到为何不放弃学习或体育这任何一方时，他只用了&ldquo;喜欢&rdquo;这两个字来解释。到了本科，他又摇身成为一名课业繁忙的工科男，但同样投身于自己热衷的体育梦想，积极组织学院的跑步训练并多次代表参加跑步比赛。</p> <p>　　在本次马拉松比赛之前，李晨曦提前2个月开始进行准备训练。不爱绕着操场转圈子的他，喜欢在校园中跑步，从而能感受不同的风景。有趣的是，他还特地在清华园内设计了一个跑步路线，一有闲暇时间就出去跑一跑。在这段准备时间中，他的跑步总路程共达到200公里。</p> <p>　　而今年并不是李晨曦第一次参加北京马拉松。在上一届北马赛事中，他没有做好准备便仓促上场，最终获得3小时10分48秒的成绩。从去年到今年，他的成绩提高了13分钟，依靠的不仅是赛前的充足准备，更是运动实力的厚积薄发。</p> <p style=\"text-align: center\"><strong>每一天，都奔跑在路上</strong></p> <p>　　李晨曦说，跑步，早已融入了他的生活之中。</p> <p>　　他以跑步为乐，在运动的过程中享受到了无限的乐趣。当说起跑步的问题，李晨曦总是能侃侃而谈。同时，爱好挑战的他还希望能参加北马之外的其他赛事，比如上海和厦门等地的国际马拉松比赛。透过他身上的诸多光环，我们看到的是一位跑步者激情四射、拼搏向上的体育精神。</p> <p>　　在10月27日举行的校研究生运动会上，李晨曦作为运动员代表进行了宣誓。观察四周，他为校园内浓郁的体育文化氛围与运动热潮而高兴。</p> <p>　　&ldquo;体现在本次比赛中，就是清华的同学们无论速度如何，参赛态度都很好。&rdquo;李晨曦很有感触。在今年的北马中，清华大学共有798名同学参加。黄色衣服，紫色袖标，成为了赛场上的一道靓丽风景线。由于参赛同学众多，连学校超市里的别针都已经脱销。最终，98%的清华学子顺利完成了比赛。</p> <p>　　&ldquo;跑步真的很有趣哦，欢迎大家多跑步多运动！&rdquo;李晨曦笑着说道。</p> <p>　　每一天的奔跑，都是一次无比新鲜的体验；每一天的前行，都是一份弥足珍贵的记忆。祝福李晨曦，在这条跑步之路上，跑出自己的人生精彩！</p> <p style=\"text-align: right\">　　（<strong>清华新闻网11月1日电</strong>）</p> <p style=\"text-align: right\">　　供稿：校研究生会 编辑：襄桦</p> <p>　　</p> <p>　　</p> <p>&nbsp;</p></P>     </div>'),(176,'【人物】清华800米飞人李翔宇：青春加速度 跑出精彩未来','http://news.tsinghua.edu.cn/publish/news/4205/20131030140631323152282/1.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】清华800米飞人李翔宇：青春加速度 跑出精彩未来</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">青春加速度 跑出精彩未来</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 15px\"><strong><span>&nbsp;&mdash;&mdash;访清华大学&ldquo;800米飞人&rdquo;李翔宇</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">研通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">陈俊杰</span></strong></p> <p style=\"text-align: center\"><img alt=\"\" width=\"312\" height=\"413\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131030140631323152282/1.jpg\" /></p> <p><span style=\"font-family: 楷体,楷体_GB2312\">　　</span><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">李翔宇，清华大学经济与管理学院2012级博士生，2002年考入清华大学附属中学开始专业田径训练，师从曹振水。作为国家队运动员，他曾先后在城运会、全国田径冠军赛、全运会、全国田径锦标赛、全美VISA巡回赛尤金站以及&ldquo;好运北京&rdquo;中国田径公开赛上获得男子800米的冠军，并代表我国参加了北京奥运会。</span></span></p> <p>　　一米八的个头儿，走起路来脚步很快，似乎总在忙个不停；见了人总是笑眯眯，聊天时和你敞开心扉，完全没有&ldquo;六冠王&rdquo;高人一等的架子，当你走近他的时候，你很难相信这就是&ldquo;全国800米飞人&rdquo;真实的一面。</p> <p style=\"text-align: center\"><strong>&ldquo;14连冠&rdquo;助力田径健儿</strong></p> <p>　　清华大学田径代表队战绩辉煌，涌现出了无数的明星，李翔宇是其中的一个。他参加了2004年到2009年的多场国际大赛，并斩获诸多金牌，因此也有了&ldquo;六冠王&rdquo;称号，&ldquo;800米飞人&rdquo;当之无愧。直到2009年获得第十一届全运会冠军后，他逐渐从国家队退出。</p> <p>　　清华大学重视体育，有着悠久的体育传统。2008年的首都高校田径运动会&ldquo;14连冠&rdquo;，在全国掀起了一场格外引人注目的&ldquo;清华风暴&rdquo;，也作为清华的美谈在体育代表队中广为流传，激励着一代又一代的清华学子奋勇向前。</p> <p>　　然而，2009年，清华没有延续辉煌顺利卫冕，这给了田径代表队的队员们当头一棒，然而正是这恰到时宜的一棒，打醒了仍然沉浸在&ldquo;不败金身&rdquo;梦幻中的队员。</p> <p>　　&ldquo;清华对体育的重视也在影响着其他高校，大家都重视，竞争自然就会激烈，我们原来的优势被平均化了；但是输了一年，反而提醒我们更要努力，因为原地踏步就会被甩在后面。&rdquo;输掉比赛后，李翔宇客观地表达了看法。</p> <p>　　2009年之后，清华大学田径代表队重新夺回团体总分冠军并成功卫冕。</p> <p style=\"text-align: center\"><strong>&ldquo;清华模式&rdquo;下的&ldquo;清华制造&rdquo;</strong></p> <p>　　来到清华附中读书后，李翔宇的命运就紧紧地与清华结合在一起。他伸出10个手指头，&ldquo;从2002年到现在，我在清华生活超过10个年头了，&rdquo;一句话道出了作为一名&ldquo;清华人&rdquo;的自豪。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"312\" height=\"444\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131030140631323152282/2.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为李翔宇近照。</span></p> <p>　　清华大学将高考招收的体育特长生部分编入经济与管理学院，目的是采取&ldquo;体教结合&rdquo;的方式，让这些体育特长生在体育之余能学到其他知识，这正是清华所提倡的&ldquo;人格与体格并重&rdquo;的&ldquo;清华模式&rdquo;。</p> <p>　　李翔宇就是&ldquo;清华模式&rdquo;&ldquo;制造&rdquo;出来的一个品牌，代表着迄今清华在800米跑项目上的最高成就。</p> <p>　　&ldquo;为了让我们有足够的时间学习，本科的时间从4年延长到了5年，&rdquo;谈起自己在清华的学习成长，李翔宇表示自己是&ldquo;体教结合&rdquo;的受益者，&ldquo;课堂学习有助于运动员对思维模式的理解，体育方面的问题也需要深层次地去分析&rdquo;。去美国接受过科学训练的李翔宇也坦言得到了很多新的收获，这让他更深刻地感受到体育与教育相结合的不可或缺性。</p> <p>　　除了李翔宇，从&ldquo;眼镜飞人&rdquo;胡凯到跳高运动员王宇，&ldquo;清华模式&rdquo;已培育出很多正宗的&ldquo;清华制造&rdquo;。</p> <p style=\"text-align: center\"><strong>蓄势待发，梦想成为体育教练</strong></p> <p>　　李翔宇结缘体育得益于他的母亲。&ldquo;小时候家庭有认识从事体育方面的熟人，妈妈让我学跑步，一接触就喜欢上这项运动，现在体育已经成了我生活的一部分&rdquo;，李翔宇说。</p> <p>　　跑步之外他还喜欢打篮球，谈到自己的偶像NBA球员雷阿伦时说，&ldquo;他不服输的精神和正直、优雅的为人品格感染着我。&rdquo;在美国的时候，李翔宇很荣幸与美国名将拉加特一起训练，他对美国的体育培养方式表现出了浓厚的兴趣，&ldquo;美国的体育培养更注重运动员的成长，更在意运动员是否有破纪录的创造性，而不再是唯金牌论，拉加特虽然是1975年生人，但一直没有退役，你不得不佩服他坚韧的意志。&rdquo;</p> <p>　　退役后，李翔宇积极转变角色，投入到课程的学习之中，但他依然没有放弃自己的体育事业。&ldquo;我还需要不断地充实自己&rdquo;，他认为退役后考虑工作为时太早，下一步规划是出国深造，这样才能让自己对体育这个事业有更深入地了解。&ldquo;如果有机会，我希望以后还能回到清华，从事高校体育方面的工作，用我所学的东西为清华大学或北京高校体育的提升做贡献。&rdquo;</p> <p>　　作为集诸多荣誉于一身的&ldquo;800米飞人&rdquo;，他有着&ldquo;清华人&rdquo;自强不息的秉性，但同时也是众多清华学子中的普通一员。博士二年级的他现在是MBA一门课程的助教，&ldquo;助教的经历很锻炼人，不但能学到老师的教学方式，学习如何调动学生情绪，同时&lsquo;阅读&rsquo;同学们的作业，也是对自己思维的一种创新。&rdquo;</p> <p>　　李翔宇的理想是成为一名体育教练，&ldquo;从运动员到教练是一个过程&rdquo;，他在为自己的将来仔细规划着。　　</p> <p style=\"text-align: right\">供稿：校研究生会&nbsp; 编辑：范 丽</p></P>     </div>'),(179,'【人物】清华“豆腐哥”：在平凡中感受生命的美好','http://news.tsinghua.edu.cn/publish/news/4205/20131014091604490779335/d.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】清华“豆腐哥”：在平凡中感受生命的美好</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">清华&ldquo;豆腐哥&rdquo;：在平凡中感受生命的美好</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">记者</span><strong><span style=\"font-family: 楷体,楷体_GB2312\"> 高原</span></strong></span></p> <p style=\"text-align: center\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131014091604490779335/d.jpg\" /></span></strong></p> <p>　<strong>　</strong><span style=\"font-family: 楷体,楷体_GB2312\"><span style=\"font-family: 楷体,楷体_GB2312\"><strong>梁田 </strong></span>我校饮食服务中心豆制品加工车间负责人，中共党员。2005年8月毕业于扬州大学旅游烹饪学院营养教育学专业，毕业后进入我校饮食服务中心工作。工作期间曾获得清华大学后勤团工委优秀团干部、饮食服务中心团总支优秀团干部、清华大学百年校庆个人三等功、2012年度清华大学后勤技能标兵等荣誉称号。</span></p> <p>　　凌晨两三点的清华园恬静安详，当大家还在熟睡的时候，梁田已经和他的同事们开始了一天的工作。</p> <p>　　他们穿着深蓝色的工作服，帽子、手套、防水靴，全副武装。工作时，他们很少交谈，长时间的默契配合让他们只要听到机器的轰鸣声，就能了解彼此的工作情况。</p> <p>　　几个小时后，一箱箱热气腾腾的豆腐和包装好的一杯杯豆浆被码放整齐，运送到清华园的各个食堂。此时窗外渐渐泛白，清华园再次恢复到平时生机勃勃的景象，对于园子里的师生们来说，新的一天刚刚开始；对于梁田他们来说，已经完成了一天最繁重的工作。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"319\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20131014091604490779335/d2.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为豆腐哥梁田。</span></p> <p>　　梁田和工友们从嘈杂的工作间走出来，清晨爽利的空气和鸟儿清脆的鸣叫让人为之一振，大家有说有笑地交换对刚才工作的看法。而梁田还不能休息，他脱下工服，换上衬衫、西服裤。除了做豆腐，他还是饮食服务中心豆制品加工车间的负责人，白天还需要处理加工订单以及一些事务性的工作。</p> <p>　　晚饭时间是他和妻子以及刚刚3岁的儿子共享天伦之乐的美好时光，阖家围坐在一起，小朋友稚气可爱聪明伶俐，妻子在旁边百般逗弄，偶尔余光瞥向他，是相濡以沫走过风雨后的理解与温柔。&ldquo;家，是避风的港湾。&rdquo;已过而立之年的梁田，对于人生与未来、责任与担当有了新的感悟。对他来说，在清华工作的这些年是他成长最快的阶段，&ldquo;做豆腐&rdquo;这份工作的意义也发生了深刻的变化。</p> <p style=\"text-align: center\"><strong>一滴相融，凝脂如玉，点制舌尖上的清华味道</strong></p> <p>　　在清华园的各个食堂里，豆制品总是备受师生欢迎&mdash;&mdash;鲜美的豆浆、滑嫩的豆腐、丰富的豆制品，营养健康，深受大家的喜爱。物美价廉的酸奶和冰淇淋柜台前也总是排着长队。但是很少有人知道，这些美味健康的食品出自谁之手，又来自校园的哪个角落。</p> <p>　　在丁香园食堂北侧一座不起眼的灰白色平房里，正是&ldquo;豆腐哥&rdquo;梁田工作的地方。推开车间大门，扑面而来的是浓郁的豆香气，夹杂着卤水微微的酸涩，回味悠长，味蕾生津。面积不大的厂房，被分割为几个不同的工作区块。&ldquo;除了做豆腐和豆浆，我们还有&lsquo;丝干皮泡&rsquo;，南豆腐、北豆腐、豆腐丝、豆腐干、豆腐皮、豆腐泡&rdquo;，梁田像说绕口令一样飞快地说起他的工作。</p> <p>　　&ldquo;平时每日加工干黄豆1200斤，生产各类豆制品1万斤&rdquo;，而这些工作是在半机械化的环境下，由梁田和他的10位同事共同完成的。</p> <p>　　&ldquo;由于规模较小，我们还不能实现完全的机械化，除了前期黄豆的浸泡、清洗、过滤，剩下所有的工作都需要人工完成，特别是点豆腐。&rdquo;梁田介绍说，&ldquo;清华的豆腐之所以好吃，是因为我们完全采用最传统的点浆法，我们做出来的北豆腐口感浓郁成形不散，南豆腐爽口滑嫩晶莹剔透。&rdquo;梁田兴致勃勃地描述起卤水点浆的神奇之处。&ldquo;点豆腐非常讲究技巧，一要手法精准，才能掌握好原浆的浓度；二要根据不同批次大豆的特点掌握卤水的添量，没有四五年经验是点不好豆腐的。&rdquo;点制好的原浆还要经过10分钟的&ldquo;醒脑&rdquo;，让卤水与原浆充分地融合、静置，神奇的化学反应催化着大豆与卤水的&ldquo;爱情&rdquo;，再经过充分的压制，流动的香气最终凝固成有着汉白玉肌理似的豆腐，被送上清华师生们的餐桌。</p> <p style=\"text-align: center\"><strong>从营养教育学本科生到清华&ldquo;豆腐哥&rdquo;</strong></p> <p>　　相较于人工参与度高的豆腐制作，豆浆生产线则显得&ldquo;现代化&rdquo;许多。从黄豆的清洗、分离、过滤到磨浆、加热、煮沸、灭菌、降温，从一颗颗滚圆的黄豆到可以直接饮用的豆浆，全部机械化完成。&ldquo;想象一下，从车间一楼到二楼，豆浆在盘旋上升的管道中流动着、飞舞着，然后&lsquo;从天而降&rsquo;，奔涌而出，这是多么壮观！当然，装杯还是需要手工完成。&rdquo;梁田至今还记得初次见到豆浆生产线时的惊叹。</p> <p>　　2005年8月，梁田从扬州大学营养教育学专业毕业。&ldquo;当得知清华后勤招聘时便一心想来，既然不能来清华读书，来这里工作也好。&rdquo;梁田顺利通过招聘环节，成为清华饮食服务中心豆制品加工车间一名普通的操作工人。来清华的第一天下午，他便来到车间报到，第一眼就被锃光瓦亮的机器&ldquo;震慑&rdquo;住了。他激动地给去星级酒店工作的大学同学打电话：&ldquo;你们做菜还得摘洗切烹，我们这儿都是自动化！&rdquo;</p> <p>　　然而，上完第一个夜班他就后悔了。整整一夜，他忙得连口水都没顾上喝。&ldquo;好像是在做杂工，哪儿缺人就去哪儿，边学边干。第二天上午从车间走出来时，感觉人已经虚脱了。&rdquo;梁田内心动摇了。&ldquo;当时觉得心里特别屈得慌，专业不对口，大学毕业就下基层，心里有落差。&rdquo;后勤领导察觉梁田心理的动态后，多次找他单独谈心，鼓励他&ldquo;年轻人要扎根基层去学习锻炼，有积累才能有作为。&rdquo;在部门领导和同事的关怀下，梁田做工作越来越得心应手，也逐渐认识到：哪怕是最平凡的工作，也可以做出漂亮的成绩。</p> <p>　　为了更好地适应全校师生的需求，2008年5月饮食服务中心决定把豆制品加工纳入自管范围。已经在豆制品生产线上&ldquo;摸爬滚打&rdquo;两年的梁田临危受命，肩负起管理豆制品加工的任务。正值北京奥运会前夕，为了保证全校师生的饮食安全，提高豆制品生产质量，梁田认真钻研生产线上的每一个细节，并逐一提出改进方案：一是与各食堂建立良好的沟通与反馈机制；二是制定工作守则，明确责任分工；三是以身作则，模范带头。那段时间，梁田与同事们三天一小会、五天一大会，请来有经验的师傅反复交流，探讨如何改进产品质量。一个月后，产品质量和产量都明显提高了。</p> <p>　　2009年5月，温家宝总理视察清华大学，在桃李园餐厅就餐时点了一份西芹豆干。&ldquo;总理能品尝到我们做的豆制品，我感到非常自豪！&rdquo;在工作中逐渐获得自信心的梁田，越来越深刻地认识到：&ldquo;做豆腐的岗位虽然平凡，但能为清华后勤保障作贡献，意义和责任是重大的。我坚定当初的选择，做好现在，才能更好地赢得未来。&rdquo;</p> <p>　　在饮食服务中心，梁田一步步地成长，他对工作的投入和取得的成绩也得到了领导和同事们的充分肯定。饮食服务中心主任樊春起表示，梁田作为营养教育学专业大学毕业生来到清华，能深入基层从最普通的员工做起，坚持长时间夜班生产，一干就是八年，勤勤恳恳，体现了现代知识型员工的素质和甘于奉献的精神。</p> <p style=\"text-align: center\"><strong>做豆腐就像是过人生</strong></p> <p>　　在2011年3月百年校庆前夕，梁田在体检中被诊断出甲状腺肿瘤，医生建议他马上动手术，家人也极力劝说他不要耽误治疗。但深知百年校庆生产任务艰巨的他，毅然决定向单位隐瞒病情，坚守岗位，和同事们经过一个月通宵达旦的努力，最终圆满完成了校庆任务。</p> <p>　　4月25日，百年校庆结束的第二天，梁田便立即被送到北医三院手术。大夫语气责备地问他：&ldquo;不要命了吗，怎么拖到现在才来？肿瘤已经有小孩儿拳头大了。&rdquo;梁田的妻子在旁边听到这里，唰地掉下眼泪。所幸的是，手术很成功。身体稍一见好，他又立即回到工作岗位上，依然和往常一样下车间，通宵做豆腐。</p> <p>　　这场大病也让梁田对人生有了新的感悟。&ldquo;得知病情后，我的爱人承受了比我还大的压力。手术那天，她吓坏了，孩子还不到一岁，她问我万一你走了，家里怎么办？&rdquo;我安慰她：&ldquo;不会有事，就算走了，生活还要继续，人始终要乐观向前。&rdquo;经历过人生考验的梁田，分外珍惜现在的幸福。&ldquo;我感谢这份工作，它让我实现了人生的价值，体会到人生的无限与丰富。&rdquo;</p> <p>　　有人说，豆腐的诞生，彻底改变了大豆的命运。一滴酸涩的卤水，让平凡的黄豆得到升华；豆腐无限包容的个性，增加了生命的宽度与韧性。清洗、过滤、点浆、醒脑&hellip;&hellip;做豆腐，就像是过人生，清华&ldquo;豆腐哥&rdquo;梁田就是这样在平凡的工作和生活中感受生命的意义与美好。</p> <p>　　<span style=\"font-family: 楷体,楷体_GB2312\">来源：新清华 2013-10-11　</span></p></P>     </div>'),(180,'【人物】王明旨：探索艺术与科学的融合','http://news.tsinghua.edu.cn/publish/news/4205/20130929141824125379690/w.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】王明旨：探索艺术与科学的融合</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">从光华路到清华园，探索艺术与科学的融合</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&mdash;&mdash;记2013年&ldquo;清华大学突出贡献奖&rdquo;获得者王明旨</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">程 曦</span></strong></p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130929141824125379690/w.jpg\" /></p> <p>　　<span style=\"font-family: 楷体,楷体_GB2312\">我们树起一面大旗，就是清华美院无论在艺术创作、理论研究还是未来的探索中都应该坚持艺术与科学交融的大方向。在全国乃至世界上，少有艺术类院校如此明确地立起这么一面旗帜。现在看来，当时确立这个方向是对的。</span></p> <p style=\"text-align: right\"><span style=\"font-family: 楷体,楷体_GB2312\">&mdash;&mdash;</span><strong><span style=\"font-family: 楷体,楷体_GB2312\">王明旨</span></strong></p> <p style=\"text-align: left\">　　&ldquo;中央工艺美院加盟清华，更名为清华大学美术学院，转眼之间已经14年了。&rdquo;从当年的中央工艺美院院长到合并后的清华大学副校长兼美术学院院长，再到校务委员会副主任，14年来，王明旨一直在为清华美院的发展殚精竭虑。</p> <p>　　14年间，清华美院从光华路上精致小巧的校园迁入清华园东隅宽敞明亮的大楼，在学校建设一流大学战略思想指导下，依托综合学科优势，加大教学改革力度，在学科建设、人才培养、科学研究、队伍建设等方面均取得长足发展，学科结构更趋合理，优势进一步加强，特色更加突出，在2010年的学科国际评估中被评价为&ldquo;已经跨入国际最佳设计院校行列&rdquo;，多次入选美国《商业周刊》评选的全球60所最佳设计院系，成为中国最具影响力的艺术与设计类学院之一。美院的加入，也为清华园增添了浓厚的人文氛围和艺术气息，让艺术与其他各学科的交叉成为可能。</p> <p>　　2013年教师节前夕，王明旨荣膺&ldquo;清华大学突出贡献奖&rdquo;。回顾14年来的历程，他说的最多的还是美院的发展，而不是自己的成绩。&ldquo;必须强调这些都是在学校的大力支持下，清华美院全体师生员工和历任学院领导共同努力的结果。&rdquo;王明旨说。</p> <p style=\"text-align: center\"><strong>设计与美术并重　确立学科发展方向</strong></p> <p>　　1956年成立的中央工艺美术学院，是当时全国惟一的设计艺术类院校。半个多世纪后的今天，随着经济社会的发展和公众审美情趣的不断提升，全国已经有上千所大专院校开设了设计艺术学科。和清华一起大步迈向世界一流的清华美院，在学科发展中应该选择怎样的航向？2000年10月，王明旨等美院领导组织全院召开了为期三天的学科建设讨论会，确立了清华美院在今后发展中要&ldquo;保持设计艺术学科优势，加速发展美术学科&rdquo;的方向。2000年和2003年，清华美院先后获得美术学硕士和博士学位授予权。</p> <p>　　在2001年接受《美术观察》杂志社关于艺术教育的访谈时，王明旨表示：&ldquo;工艺美院并入清华之后，由原来的纯艺术设计扩展到美术的范畴。&rdquo;他强调，清华美院的发展应该处理好美术与设计的关系、传统与现代的关系，在保持设计艺术类学科传统优势的同时，大力促进深层次探索心灵的美术类学科发展，因为它们既能为设计艺术提供养料，又具有全面育人的深远意义。王明旨举例说，中央工艺美院的健康发展，实际上也受惠于&ldquo;装饰绘画&rdquo;、&ldquo;装饰雕塑&rdquo;这些教学中长期存在的美术基本形态。</p> <p>　　在这种思路的指引下，清华美院大力加强美术类学科建设，广揽贤才，迅速发展，成为令人瞩目的&ldquo;后起之秀&rdquo;。以雕塑系为例，学院先后引进曾成钢、李象群和王洪亮等国内非常著名的雕塑家，师资队伍建设取得显著成效。近年来，雕塑系先后完成几十项国家级和省部级科研项目，对我国城市雕塑建设产生了积极影响。</p> <p>　　&ldquo;美术领域的评价欣赏往往见仁见智，很难有统一标准。我们清华美院的美术学科能够在短短十几年时间里取得公认的让人刮目相看的成绩，甚至有人说这确实是&lsquo;清华的学科&rsquo;，上升迅速而水准一流，这是非常难得的。&rdquo;王明旨欣慰地说。</p> <p>　　王明旨当年在访谈中所作的判断没有错，与美术学科的&ldquo;异军突起&rdquo;相呼应，清华美院的设计艺术学科在兄弟院校的激烈竞争中一直保持着领先位置。&ldquo;设计艺术学&rdquo;2002年被教育部评为全国高等学校重点学科，近10年来3次全国一级学科整体水平评估中，&ldquo;艺术学&rdquo;、&ldquo;设计学&rdquo;共获得3次全国第一，清华大学艺术与设计实验教学中心被评为国家级实验教学示范建设单位。</p> <p style=\"text-align: center\"><strong>艺术与科学交融　彰显清华特色</strong></p> <p>　　2001年5月，清华90周年校庆刚刚结束，清华美院在中国美术馆隆重举办首届&ldquo;艺术与科学国际作品展暨学术研讨会&rdquo;，江泽民、李鹏、温家宝、李岚清等16位党和国家领导人先后出席展览，展览参观人次刷新了美术馆的历史纪录。这次极富&ldquo;冲击力&rdquo;的展览和研讨会被誉为当代中国美术界具有深远影响的重大事件，&ldquo;艺术与科学&rdquo;也成为令人瞩目的热门话题。</p> <p>　　科学、艺术两大领域的两位大师&mdash;&mdash;诺贝尔物理学奖获得者李政道先生和著名画家吴冠中先生联手倡导了这次活动。吴冠中来自清华美院，而李政道也一直与清华美院保持着密切交往。这些得天独厚的背景固然为活动&ldquo;极一时之盛&rdquo;创造了条件，但对清华美院来说，更重要的是如何将展览和研讨会带来的影响力持续下去，为清华美院的人才培养和学科发展注入新的力量。</p> <p>　　&ldquo;以这次展览为契机，我们树起一面大旗，就是清华美院无论在艺术创作、理论研究还是未来的探索中都应该坚持艺术与科学交融的大方向。在全国乃至世界上，少有艺术类院校如此明确地立起这么一面旗帜。现在看来，当时确立这个方向是对的。&rdquo;王明旨坚定地说。</p> <p>　　展览期间，学校支持美院成立了&ldquo;清华大学艺术与科学研究中心&rdquo;，李政道担任中心名誉主任，王明旨作为中心主任负责具体工作。中心面对国内外相关领域，通过课题、项目的研究与合作方式，开展艺术与科学的基础理论研究、应用实践研究和学术交流活动。艺术与科学国际作品展暨学术研讨会目前已经连续举办了3届。</p> <p>　　清华综合性、研究型、开放式的大学环境，为美院进行艺术与科学交融的探索提供了难得的条件。&ldquo;清华大学艺术与科学研究国家创新基地&rdquo;入选国家&ldquo;985工程&rdquo;哲学社会科学创新基地建设项目，新成立的信息艺术设计系与计算机系、新闻与传播学院共同开展&ldquo;信息艺术设计&rdquo;交叉学科硕士研究生项目，《清华美术》、《艺术与科学》系列书刊的持续出版&hellip;&hellip;所有这些，无不秉持着艺术与科学交融发展的共同宗旨。&ldquo;这使得我们各方面的工作都有了一个长期的大的努力方向，实际上也让美院和清华其他院系的学科交叉和协同研究找到了新的界面。在这样的环境中，美院甚至有了973项目&mdash;&mdash;雕塑、壁画类文化遗产的虚拟复原，这在过去是不敢想象的。&rdquo;王明旨说。</p> <p>　　从2008年起，王明旨开始担任吴冠中艺术与科学创新奖励基金管理委员会主任。他与吴冠中先生长子吴可雨和管委会委员们经过反复商议，决定利用这笔基金，在3年左右一届的艺术与科学国际作品展上颁发&ldquo;吴冠中艺术与科学大奖&rdquo;，同时面向全校学生，每年奖励9位在艺术与科学创新方面表现优秀的清华学子。王明旨相信，让吴冠中、李政道首倡的艺术与科学交融之道在年轻一代身上发扬光大，是对吴先生最好的纪念，也是清华美院可以为学校作出的独特贡献。</p> <p style=\"text-align: center\"><strong>有大楼更应有大师&ldquo;退居二线&rdquo;心系长远</strong></p> <p>　　回顾14年来清华美院的发展历程，王明旨最感激的，是学校对艺术学科特殊发展规律的尊重和支持；最欣慰的，则是美院全体师生员工对学校世界一流大学建设大局、总体规划、管理体系的理解和认同。</p> <p>　　2005年，也就是王明旨卸任清华美院院长的那一年，他欣慰地看到美院新教学楼的完工。&ldquo;在学校的支持下，我们得以把世界上最优秀的美术院校的建设经验应用到美院大楼的建设中。仅用一年半的时间完成建筑面积达63000平方米的大楼建设，这是很难想象的速度。&rdquo;王明旨强调，美院大楼建设的灵魂不是&ldquo;大&rdquo;，也不是&ldquo;新&rdquo;，而是给予师生充分的实践空间和交流空间。美院大楼建成后，使得清华美院生均教学资源在国内同类院校中占有优势，为学院培养创新型杰出人才提供了重要保证。</p> <p>　　14年一晃而过，当年清华美院引进的一批年富力强的优秀艺术家，不知不觉也到了临近退休的年纪。王明旨借用原常务副校长何建坤打过的比方说，艺术家就像&ldquo;甜瓜&rdquo;，越老越甜。他最大的心愿是希望学校能在这批艺术家退休后，用其他形式尽量组织他们继续为国家、为学校作贡献。&ldquo;他们的艺术创作经验和体悟，对人才培养来说是很宝贵的资源。学生的成长需要他们，我们不能把他们简单地&lsquo;放到&rsquo;社会上。&rdquo;王明旨深有感触地说。</p> <p>　　当院长的时候，王明旨总感到肩上担负的重任。任何时候有老师或同学对学院发展提出建议、意见，他总要认真地听取他们的想法，仔细研究、商议，妥善答复和处理。&ldquo;现在担子不在肩上了，有更多的时间可以考虑一些对学院长远发展有好处的事情，我想通过这种方式为学院和学校继续作贡献。&rdquo;王明旨诚恳地说。</p> <p>　　除了担任校务委员会副主任，王明旨目前还主持着清华大学艺术博物馆的筹建工作。对这座即将于2014年校庆期间建成的&ldquo;艺术殿堂&rdquo;，王明旨充满期待和信心。&ldquo;艺术博物馆将有1万多平米的展览场地，这样既能把社会上和美院内部各种优秀的展览都吸引过来，又能让学校图书馆、建筑学院和美院等院系单位的大量&lsquo;藏品&rsquo;充分呈现在广大师生面前。我们还可以按主题、按季节来策划展览，这对丰富清华的校园生活和艺术氛围会很有好处。&rdquo;王明旨说。</p> <p>&nbsp;<span style=\"font-family: 楷体,楷体_GB2312\">&nbsp;&nbsp;&nbsp;来源：<strong>新清华</strong> 2013-09-27</span></p></P>     </div>'),(181,'【特等奖学金】史欣未：梦想在清华启航','http://news.tsinghua.edu.cn/publish/news/4205/20130929083044144376510/2.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【特等奖学金】史欣未：梦想在清华启航</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">梦想在清华启航</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&nbsp;&nbsp; &mdash;&mdash;访2012年清华大学特等奖学金获得者史欣未</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学通社记者&nbsp; </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">王泰华 丁硕</span></strong></p> <p style=\"text-align: center\"><img style=\"width: 286px; height: 409px\" alt=\"\" width=\"340\" height=\"512\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130929083044144376510/2.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为史欣未。</span></p> <p>　　<span style=\"font-family: 楷体,楷体_GB2312\">史欣未，生物医学工程系2009级本科生。2012年本科生特等奖学金得主。三年学分绩专业第一，连续两年素质测评第一。曾任医学院学生科协主席。多篇论文在国际期刊与会议上发表。</span></p> <p style=\"text-align: center\"><strong>与专业说不尽的故事</strong></p> <p>　　2009年，史欣未考入清华大学医学院生物医学工程系。初到清华，史欣未像很多人一样，对自己的专业和未来的方向还比较迷茫。万紫千红的清华园里，史欣未开始了她的专业之旅。</p> <p>　　生医系如同家一般的感觉，让初来乍到的史欣未产生了对专业的认同感。&ldquo;生医系是很小的一个系，整个专业内学生几乎都互相认识，同学间的关系也非常融洽。&rdquo;史欣未通过系内新生导引项目，在与导师和研究生的交流中，感受到了生医系是一个&ldquo;很前沿、很有意思，也很有交叉性的学科&rdquo;。</p> <p>　　史欣未表示，生医专业虽然目前在国内还不是很热门，但结合国外的发展趋势来看，生医专业未来在中国会有很好的发展前景的。</p> <p>　　大一的时候，史欣未通过新生导引项目、&ldquo;走进实验室&rdquo;等活动中与老师和师兄师姐的交流，萌生了去实验室尝试一下科研的想法，并且对医学影像的研究相当感兴趣。大一暑假之后，清华大学生物医学影像研究中心成立之初，她就积极联系实验室的教授加入到刚起步的研究项目&ldquo;基于化学位移的磁共振脂肪含量检测&rdquo;之中。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130929083044144376510/s.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为做试验中的史欣未。</span></p> <p>　　&ldquo;一开始的时候，我不懂磁共振成像的原理，甚至不会基本的MATLAB编程。非常感谢实验室的导师和师兄师姐，不仅从基本的仪器操作、课题进展方面给了我很多指导，也引导我逐步深入了解磁共振成像的原理和研究方向。&rdquo;在一步步的摸索和前进中，她越来越被这个领域的神奇吸引：从临床上不同部位、不同对比度的影像，到科研中探索人的思维、代谢等奥秘，磁共振成像既有广泛的应用范围，更有强大的待挖掘的潜力。</p> <p>　　做科研的经历其实是很辛苦的，史欣未在特奖答辩时提到&ldquo;我经常连夜做实验，凌晨回宿舍时能看到食堂已经在准备早餐&rdquo;的话语，让现场一片感叹。采访时她解释道：&ldquo;因为有的实验有特别的要求，往往要一做七八个小时，而白天机器有些单位要占用，所以我们要在晚上做实验。&rdquo;第二天往往还要早起看数据，听起来是非常辛苦的日子，史欣未却乐呵呵地说：&ldquo;无论数据很好还是不好，对自己都是一个鼓励。对于自己喜欢的事情就不会在意是不是辛苦了。&rdquo;</p> <p>　　大三的暑假，史欣未到美国霍普金斯大学参加暑期科研项目。她参加的项目需要对一头猪进行反复处理和扫描，每次扫描都需要两个小时。老师们都是每天早上6点就到实验室，一直呆到晚上12点，研究生们则是两班倒。谈到这次交换的收获，史欣未说，&ldquo;我在那边学到的是一种坚韧不拔，不怕辛苦的精神，老师说其实这就是对科研的热爱。&rdquo;</p> <p>　　从刚起步的项目到作为文章第一作者的论文在国际期刊发表，在磁共振成像的研究探索中，史欣未认为：&ldquo;最大的收获是发现了自己感兴趣的事情&rdquo;。</p> <p style=\"text-align: center\"><strong>从学习委员到院科协主席</strong></p> <p>　　从大一班级学习委员兼科协干事，到大三的科协主席兼任班级团支书，史欣未的社会工作生活也丰富而精彩。</p> <p>　　在被问到班级工作和系里的工作有什么区别时，史欣未这样说到，&ldquo;当学委的时候，要负责许多比较琐碎的具体任务，服务的对象也都是同班同学，大家的需求相近；到了科协主席职位，就要面向四个年级的同学，每个年级都有不同的重点和需求，这就需要更高的眼光和更强的统筹能力。&rdquo;</p> <p>　　身份和职责上的改变，对一名新上任的科协主席来说的确是不小的挑战，史欣未对此却有着自己的理解。&ldquo;我希望把对学术、对科研的热情扩散到周围更多同学当中，更好地为同学们服务。&rdquo;在她看来，只要以热爱和热情为动力，就没有什么困难不能克服。</p> <p>　　在史欣未的带领下，生医系科协在巩固原有的&ldquo;走进实验室&rdquo;活动的基础上，又增加了面向大二、大三同学的&ldquo;SRT宣讲会&rdquo;，帮助这些想要走进实验室的同学对科研有更深入的了解 。宣讲会在老师和同学中间都取得了很不错的反响，在科协的帮助下，目前大三年级中也已经有超过60%的同学参加了SRT项目。</p> <p>　　在担任科协主席期间，史欣未还负责了第五届医疗仪器创新设计大赛（简称&ldquo;医设大赛&rdquo;）的组织和举办，这也是每年生医科协工作的重头戏。该年医设大赛吸引了全校范围内10个院系的同学的参加。在这样一届十分成功的大赛背后，自然也少不了科协人的努力与汗水，其中由于院系规模较小，科协人手不足着实让史欣未感受到了压力。</p> <p>　　&ldquo;我们一直在想各种办法解决如何在人手不足的情况下，把我们的宣传工作做得更有效率，让全校更多的同学关注并且参与到我们的医设大赛中。&rdquo;在经过了科协的多次讨论之后，科协的同学们齐心协力，在许多大课堂进行课间宣讲，并且张贴几千张宣传海报，最后终于达到了预期的目的。许多参赛的同学笑着对史欣未说，他们觉得医设大赛在整个校园特别有存在感。每当听到这些话，史欣未和她的科协同学们都会感到十分欣慰和满足。</p> <p style=\"text-align: center\"><strong>梦想在清华启航</strong></p> <p>　　最初来到清华时，史欣未的梦想是&ldquo;成为对社会有用的人&rdquo;。四年之后，她对此有了更清晰的理解：&ldquo;对社会有用的人&rdquo;是&ldquo;对社会有责任心，会把自己人生的目标与整个社会结合在一起的人。&rdquo;在周围的老师和同学看来，史欣未是一个很有社会责任感的生医人，史欣未则觉得，自己是深受清华这种氛围的影响：从第一次来清华参加自主招生的时候，就觉得整个清华有一种特别踏实专注的感觉，到清华之后，从周围的清华人，尤其是一些特别优秀的辅导员和师兄师姐的身上更能感受到一中强烈的社会责任感。史欣未认为，这种厚重的社会责任感，是清华精神非常重要的组成部分。</p> <p>　　史欣未本科毕业后将赴美国斯坦福大学深造，专攻医学影像方向的研究。&ldquo;在医学影像方面做出比较突出的成果，将不仅对临床还是科研都会有更多的贡献。&rdquo;史欣未对自己未来规划的道路是&ldquo;成为一个比较独立的研究者之后回国为祖国医学发展做出自己的努力&rdquo;。坚定而充满理想，史欣未阐释着一个生医人的社会责任。</p> <p>　　（<strong><span style=\"font-family: 楷体,楷体_GB2312\">清华新闻网9月29日电</span></strong>）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p> <p style=\"text-align: right\">编辑：范 丽</p></P>     </div>'),(182,'【特等奖学金】唐海达：心系冷暖 执着追梦','http://news.tsinghua.edu.cn/publish/news/4205/20130927095335292957552/t.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【特等奖学金】唐海达：心系冷暖 执着追梦</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">心系冷暖 执着追梦</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&nbsp;&nbsp; &mdash;&mdash;访2012年清华大学本科生特等奖学金得主唐海达</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学通社记者</span><strong><span style=\"font-family: 楷体,楷体_GB2312\"> 鲍涵</span></strong></p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130927095335292957552/t.jpg\" />&nbsp;</p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为唐海达近照。</span></p> <p>　　<span style=\"font-family: 楷体,楷体_GB2312\">唐海达，清华大学建筑学院建环9班本科生，大学三年学分绩专业第一。曾获得第20届人工环境工程学科奖学金一等奖，第四届&ldquo;爱立信&rdquo;杯热创新设计大赛一等奖，第六届中国制冷空调行业大学生科技竞赛一等奖，美国大学生数学建模竞赛（MCM/ICM）二等奖，绿色建筑创意全国邀请赛全国四强。</span></p> <p><span style=\"font-family: 楷体,楷体_GB2312\"><font face=\"Arial\">　　唐海达形容自己：&ldquo;我是一个特别普通的人，比较随性。&rdquo;如果不是近距离跟他交流，完全想不到看似普通的他也有不凡的一面。</font></span></p> <p><span style=\"font-family: 楷体,楷体_GB2312\"><font face=\"Arial\"> <p style=\"text-align: center\"><strong>为故宫文物保护做设计的&ldquo;暖通人&rdquo;</strong></p> <p>　　建环专业所研究的人居环境、建筑节能事业与城乡建设、人民生活等息息相关，因此师生们喜欢自豪的称自己为&ldquo;暖通人&rdquo;。这种环境也为唐海达利用专业知识解决实际问题、积极开展创新提供了广阔舞台。</p> <p>　　大二暑假，唐海达参加了&ldquo;爱立信&rdquo;杯热创新设计大赛，针对高密度数据机房的散热问题，他们设计了&ldquo;倒T型平板热管的低碳散热方案&rdquo; ，因其独创性获得硬件组冠军并顺利入围决赛。作为入围决赛的十支队伍中唯一的本科生队伍，他们不畏强手，最终夺得第四届&ldquo;爱立信&rdquo;杯热创新设计大赛全国总冠军。</p> <p>　　倦勤斋是故宫内重要的文物保护场所，必须要进行严格的温湿度控制才能确保文物的长期保存。但出于安全考虑，故宫夜晚必须断电，这致使原有的室内环境保障系统无法运转，长此下去，文物不能妥善保存，将造成不可挽回的损失。为此，故宫博物院邀请我校建环专业师生帮其设计一套新的空调保障系统。</p> <p>　　建环专业的老师广发&ldquo;英雄帖&rdquo;，不论本科生还是研究生均可提交自己的方案并择优选用。面对这个棘手的问题，参加&ldquo;竞标&rdquo;的各小组各出奇招，提出了许多非常复杂甚至华丽的方案。唐海达所在的小组也先后拿出多套方案进行讨论，却始终不够理想。设计工作仿佛走进了死胡同。唐海达反复思考都不得其解，不得不再次回到设计初衷寻找灵感。这时他突然灵机一动：为什么答案一定是复杂的呢？他开始意识到，问题的关键不在于技术有多先进、方案有多华丽，而在于在确保系统安全和可靠的基础上解决问题，或许简洁的才是最好的。</p> <p>　　于是，唐海达把业内现有已经比较成熟的技术进行了集成，设计出&ldquo;交流电&mdash;蓄电池联合驱动的应急空调系统&rdquo;，这个系统白天制冰来蓄存冷量，夜晚使用蓄电池来供电，实现了对室内温湿度的控制。有了设计思路之后，后续工作就显得非常顺畅。最终这套方案击败了其他各种纷繁复杂的设计，获得故宫博物院和世界建筑文物保护基金会（WMF）专家的一致认可，并将应用于倦勤斋的文物保存中。</p> <p>　　经过这一系列科学研究和科技创新活动的磨砺，他深深感受到了作为&ldquo;暖通人&rdquo;的自豪，同时也深谙重任在肩，坚定了自己要走出一条更广阔科研道路的决心。</p> </font></span></p> <p style=\"text-align: center\"><strong>追求卓越的新生党员</strong></p> <p>　　作为一名新生党员，大学三年，唐海达的社会工作主要集中在党建方面。大一，他担任建环九班党课小组组长，大二、大三一直担任建环九支部党支书。大二那年，为了确保支部对北漂&ldquo;蚁族&rdquo;调研的顺利进行，他先后4次走访海淀区唐家岭、小月河等&ldquo;蚁族&rdquo;聚居地，做了充分的前期准备工作。调研的过程并非一帆风顺，对此他说：&ldquo;困难在于调研的对象和我们是同龄人，这是一个拥有梦想并且渴望成功的群体，不然也不会背井离乡来北京打拼，他们是普通人，他们有尊严。很多时候他们会回避我们的采访，好不容易接受了采访，也不一定向我们袒露内心真实的想法，同时他们也非常敏感。&rdquo;但凭借着热情和尊重，支部调研工作最终得以顺利完成，并取得了良好效果。还以调研成果为基础撰写了报告《唐家岭兴衰记》。</p> <p>　　这次调研让唐海达在思想上深受触动。&ldquo;中国的社会资源集中在几个特大城市，促使了青年们都往&ldquo;北上广&rdquo;跑，带来了残酷的社会竞争，他们有的将在竞争中脱颖而出，有的则是沉沦。但他们都有一颗拼搏进取的心。跟人挤着15平米的小窝，坐着超载的公交车，每天吃着几块钱的盒饭，但就是这样，他们的青春仍在这里绽放。他们是值得尊敬的。&rdquo;唐海达语气坚定地说道。</p> <p>　　同时，唐海达在班级中作为学习委员，积极推动团小组履行学习小组职责，促进组内学习互助，加强班级学风建设；在学院科协作为竞赛部干事，组织挑战杯和SRT的申报评审工作，奉献了自己的汗水，也得到了同学们的肯定。</p> <p style=\"text-align: center\"><strong>积极服务社会的志愿者</strong></p> <p>　　志愿服务和社会实践活动一直是唐海达大学生活中不可分割的重要组成。</p> <p>　　大二上学期，唐海达坚持每周四到清华同方二期工地为驻地务工人员放映电影、讲解时事。那是一年中秋节，因为假期短，工人们仍然在工地干活，唐海达就和同学们一起给工友们组织了中秋联欢活动，还在活动中设置了一些互动的环节，比如猜词、歌曲连连唱等游戏。&ldquo;当时场面比想象中的要火爆很多，工友们比我们预想的积极很多。&rdquo;唐海达微微笑了，又说：&ldquo;流行歌曲、网络词汇，年轻一点的工友知道的很多，他们同时又在社会中打拼，我能感到他们的激情与迷茫。&rdquo;在上海无证电焊工引发安全事故的事件受到广泛关注后，他及时向务工人员介绍职业安全保护知识及维权手段，受到了广大工友的热烈欢迎。</p> <p>　　从大二开始，唐海达负责清华大学超低能耗示范楼的志愿讲解工作，迄今已接待高校师生及社会各界上千人次的参观学习。各种实践和志愿活动不仅使他获得了自我锤炼和提升，更让他深刻地认识到作为一个清华人自己所肩负的重要使命和责任。</p> <p>　　他坚信只有扎根中国这片土地，立足中国解决实际问题，才能实现建环人&ldquo;心系天下冷暖，情牵广厦万千&rdquo;的赤诚梦想。</p> <p style=\"text-align: right\">　　编辑：范 丽</p></P>     </div>'),(183,'【特等奖学金】方展鹏：追求卓越 铭记责任','http://news.tsinghua.edu.cn/publish/news/4205/20130927093856258393350/f.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【特等奖学金】方展鹏：追求卓越 铭记责任</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">追求卓越 铭记责任</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&nbsp;&nbsp; &mdash;&mdash;访2012年清华大学特等奖学金获得者方展鹏</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学通社记者&nbsp;</span><strong><span style=\"font-family: 楷体,楷体_GB2312\">孙大伟 魏阳 杨天 王钧奕 李阳 薛宇飞</span></strong></p> <p style=\"text-align: center\"><img style=\"width: 314px; height: 432px\" alt=\"\" width=\"340\" height=\"468\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130927093856258393350/f.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为方展鹏近照。</span></p> <p>　　<span style=\"font-family: 楷体,楷体_GB2312\">方展鹏，2009年保送进入清华大学计算机系。入学三年来，他的学业成绩和素质测评一直名列前茅，现任计九第二党支部书记，并于2012年被评为清华大学优秀共产党员。方展鹏不仅获得了6块ACM国际大学生程序设计竞赛亚洲赛金牌，还发表了多篇学术论文；运动场上，他不仅夺得了马杯4&times;400米接力冠军，还作为队长带领计93班篮球队在系里的比赛中上夺冠。</span></p> <p>　　作为一名典型的&ldquo;清华工科男&rdquo;，采访过程中的方展鹏总是有一点点腼腆。他并没有传统影响中&ldquo;学霸&rdquo;的孤傲和冷漠，他话语中流露出的是自信、坚定和乐观。</p> <p style=\"text-align: center\"><strong>在竞争和合作中体会快乐</strong></p> <p>　　作为当年全国高中生信息学竞赛的佼佼者，方展鹏获得了保送清华大学的资格。出于对计算机编程的热爱，他毅然决然地选择了清华大学计算机系。然而，进入清华后，高强度的课业压力和高手如云的竞争环境也让从小到大一直游刃有余的方展鹏面临着前所未有的挑战。</p> <p>　　&ldquo;刚进大学的时候，我还沿袭高中时候的题海战术，考几何代数前两个星期开始刷那本书上的题目，刷了一遍又刷一遍，刷到题目看一眼就知道怎么做。&rdquo;就在他对自己的考试充满信心时，考试结果却令他有些失望，&ldquo;最后考出来没有拿到我理想的分数，这让我开始反思自己的学习方法。&rdquo;在那之后，他开始注重看书，减少了刷题，更加强调看书和理解的重要性，&ldquo;多问问为什么，你懂了，考场上就能答好了&rdquo;。</p> <p>　　因为有了身边同学的同甘共苦，通宵学习也成了方展鹏眼中一件快乐的事，&ldquo;计算机系大三的课特别多，总是有一段时间是不能好好睡觉，不过还好我有两个&lsquo;大神&rsquo;经常和我组队做作业，大家一起通宵，有的时候去中厅，有时候是实验室，感觉很开心。&rdquo;凭着这样的努力，他完成了从大一的年级第十到大三的年级第二的提高。</p> <p>　　在日常的课程学习外，方展鹏还积极发挥自己在学科竞赛上的优势，从大一起，方展鹏一直坚持参加ACM国际大学生程序设计竞赛，3年来他共收获了6块不同赛区的金牌。谈到比赛，方展鹏显得兴致勃勃：&ldquo;比赛要求每个小队在5个小时内解决10道题，大屏幕还会有进度的显示，感觉就像是速度与激情嘛，很有趣，也很好玩。&rdquo;除了对竞赛本身的兴趣与热情，促使方展鹏坚持参加ACM的另一个原因则是去国际总决赛的梦想。方展鹏说，今年他仍然会继续加油，去实现&ldquo;Final&rdquo;的梦想。</p> <p>　　从大二上学期开始，方展鹏走进了实验室。&ldquo;每个人都有一个梦想&mdash;&mdash;在历史上留下自己的名字，在某个领域作出自己的贡献&rdquo;，他这样描述自己投身科研的萌动初心。他对自己有严格的要求：&ldquo;做一样事情一定要尽力去做，差一点在别人看起来可能就是没有做。能多做一点就一定要多做一点。&rdquo;为了更好的投入科研工作，方展鹏大二后的每个暑假几乎都自行缩短：&ldquo;学校给我放两个月假，我给自己只放十天假。&rdquo;</p> <p>　　在参加数据挖掘大赛KDD Cup 2012的3个月中，他与团队一起竭尽努力。赛程过半，原本领先的排名却掉到了100多名，他们一起做实验、观察，优化已有的模型，最后在这云集了领域顶尖大学和研究院的比赛中冲刺到了第8位。此后，他的科研生活就与&ldquo;数据挖掘&rdquo;有了越来越多的联系，他也开始渐渐期待着能够在一个更大的平台上去进行自己的科研工作。终于在今年4月他获得了去澳大利亚从事与&ldquo;数据挖掘&rdquo;相关的科研工作的机会：&ldquo;这样可以在更大的平台上做，做出让更多人认可的东西，个人感觉会更好。&rdquo;</p> <p style=\"text-align: center\"><strong>在团队拼搏中收获成功与欢笑</strong></p> <p>　　和很多男生一样，方展鹏非常喜欢篮球。大一时，在系里的&ldquo;酒井杯&rdquo;篮球赛中，他所在的计93班排名小组垫底。然而两年后，他带领计93班夺得了&ldquo;酒井杯&rdquo;篮球赛的冠军，&ldquo;惊艳&rdquo;全系。</p> <p>　　这样的飞跃与方展鹏作为班级篮球队队长的努力是分不开的。担任队长期间，方展鹏每周都会组织同学进行训练。赛前，他带领同学一起根据对手特点进行针对性训练；赛后他组织所有队员一起总结比赛中的不足。作为&ldquo;球队灵魂&rdquo;控球后卫的他，带领着热血的伙伴们，收获了应有的胜利。方展鹏谦虚地把成绩归于集体，他说，他很庆幸在班级里遇到这么多对篮球有兴趣的同学，每周一起练习，闲谈时不忘讨论战术。</p> <p>　　&ldquo;马杯&rdquo;也是方展鹏和同学们合作拼搏的&ldquo;战场&rdquo;。4X400米是计算机系的传统优势项目，2008年还曾获得过该项目的全校冠军。然而大一方展鹏和他的同伴却没有取得很好的成绩，&ldquo;我们这一年队员青黄不接，掉到了第五名。&rdquo;他们通过加紧训练，逐渐提升了比赛成绩，大二时以与冠军相差两秒的成绩夺得亚军。在方展鹏心目中，4X400米是一项兼具速度与意志力的运动，之后一年，他和同伴一起全面加强了在速度和意志力两方面的训练，&ldquo;我挺喜欢和大家一起努力的感觉，参赛前一天我兴奋得睡都睡不着。&rdquo;终于在赛场上，他们比上一年快了3秒，实现了对自己极限的突破，也终于赢回了&ldquo;马杯&rdquo;上该项目冠军。</p> <p style=\"text-align: center\"><strong>在服务集体与回报社会中体味责任</strong></p> <p>　　方展鹏在高中已成为预备党员。进入大学，特别是在经历了新生党员培训之后，方展鹏对党有了更新、更深刻的认识。从那以后方展鹏就一直希望能够成为有担当的人，在自己擅长的领域做好本职工作，尽到党员义务。</p> <p>　　为更好服务同学，方展鹏先后担任计九第二党支部的组织委员和支部书记，谈到这一点，方展鹏郑重地说：&ldquo;在集体里承担责任才能对得起党员的称号。&rdquo;在此期间，他组织的支部活动、寒假读书计划和访谈离退休教工党支部老党员的活动都受到了同学的好评。方展鹏自己也体会到了来自集体的温暖，&ldquo;我一直觉得自己与人交流能力挺差的，逻辑也不是很清晰，美工也不好，但是准备特奖答辩时班里一直有很多同学帮我。答辩那天大家都去了，又是展板又是口号，我真的很感动！&rdquo;</p> <p>　　大学期间，方展鹏还参加了很多学生社会工作和社会实践活动。让他印象最为深刻的是赴甘肃省定西市百页村百页小学支教的活动。当地艰苦的条件和孩子们的勤奋都给他留下了深刻的印象。&ldquo;他们每天都要起很早，要走两三个小时山路上学，他们很有天赋，对很多问题都很有想法，但是以后很难有更好的受教育的环境。&rdquo;对此方展鹏觉得很遗憾，因此希望通过自己和伙伴们的努力将对未来的信念通过支教的形式传递给这些孩子，&ldquo;我想帮助他们了解山外的世界和外面的人，希望他们能到外面的世界去。&rdquo;</p> <p>　　方展鹏选择了留在计算机系跟随软件所唐杰老师读研：&ldquo;我希望留在国内发展，要为国家的信息化事业贡献自己的一份力量。&rdquo;在方展鹏心目中，自己的未来一定要为国家的发展服务，才能不愧于&ldquo;共产党员&rdquo;和&ldquo;清华学子&rdquo;的双重身份，&ldquo;个人的发展能和国家的命脉结合时，才能登上更大的舞台，才能在更大的平台做一些能留下烙印的事情。&rdquo;</p> <p style=\"text-align: right\">　　编辑：范 丽</p></P>     </div>'),(184,'【人物】阿蕾：清源，我的中国情缘','http://news.tsinghua.edu.cn/publish/news/4205/20130924113302226656452/alei11.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】阿蕾：清源，我的中国情缘</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><span style=\"font-size: 18px\"><strong><span>清源，我的中国情缘</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\"><span>&mdash;&mdash;</span><strong><span>访清华环境学院2011级硕士留学生、学生清源协会创办人阿蕾</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学生记者</span><strong><span style=\"font-family: 楷体,楷体_GB2312\"> 张驰 方文</span></strong></p> <p>　　她，一个来自加拿大的女孩，掌握五种语言&mdash;&mdash;英语、法语、西班牙语、汉语和德语，朋友满天下；她，<span style=\"font-size: 14px\"><span>清华大学环境学院<span><span style=\"font-family: 宋体; mso-bidi-font-size: 14.0pt; mso-bidi-font-family: Arial; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA\">饮用水安全教研所<span lang=\"EN-US\">2011</span>级硕士</span></span>留学生，学生</span></span>清源协会创办者，以她的专业和热情，凝聚了一群志同道合的中外学子，利用暑期奔赴中国农村做公益环保。她就是Burchard-Levine Alejandra Francisca，大家口中的&ldquo;阿蕾&rdquo;。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"340\" height=\"490\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130924113302226656452/alei11.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为留学生阿蕾。</span></p> <p style=\"text-align: center\"><strong>&ldquo;我想来中国看看，看看能为中国的环境保护做些什么&rdquo;</strong></p> <p>　　阿蕾本科就读于加拿大麦吉尔大学（McGill University），专业为化学工程。2010年毕业后，她来到了中国。&ldquo;在加拿大的时候，我跟本国、美国以及欧洲的朋友聊天，当谈到中国时，大家都觉得中国发展很快，环境面临诸多挑战。虽然我本科是学习化学工程的，但我对环境问题很感兴趣，所以我想来中国看看，看看能为中国的环境保护做些什么。&rdquo;</p> <p>　　来到中国后，阿蕾先在北京语言大学学习了半年汉语。凭借在世界水务巨头威立雅公司实习的机会，她与清华大学结缘。&ldquo;当得知威立雅公司跟清华大学有合作，留学生可以申请去清华大学环境学院读硕士的时候，我感到非常兴奋。因为实习结束后，我并不想回国，我觉得中国还有很多东西等着我学习。所以我真的非常开心能够申请到在清华读硕士，这个机会让我能够真正地留在这里，了解中国是怎样解决环境问题的，让我认识这里的同学，跟他们聊天，向他们学习在中国做环境保护。&rdquo;</p> <p>　　阿蕾就读于清华大学环境学院饮用水安全教研所（现在已毕业），主要研究方向为饮用水源保护，包括水资源管理、饮用水源保护、系统建模等，研究课题为&ldquo;常州市河流监测和预警系统&rdquo;。在清华大学学习和生活的日子里，阿蕾对中国的环境问题有了切身的体会：&ldquo;中国和加拿大不同，加拿大是一个人口少、土地广的国家，而中国是一个人口大国，在环境保护方面必然会遇到很多挑战。在中国，我们需要寻找到一个可持续的方式，但这里面包含了很多社会问题。&rdquo;</p> <p style=\"text-align: center\"><strong>&ldquo;虽然我们所做的工作对于整个环保事业的贡献很小，但是这样的工作却是很重要的。&rdquo;</strong></p> <p>　　在环境学院进行正常的硕士学习之外，阿蕾还积极参加各种学生活动。2011年11月，在阿蕾和另一名留学生Jason的推动下，清华大学环境学院清源协会成立了。清源协会是一个环保公益组织，目前主要活动为在中国农村推广生物慢滤池（以下简称BSF）。BSF是一种简易的过滤装置，可以去除99%的悬浮颗粒物及90%以上的病原体，降低60%以上的腹泻发生率，对于部分缺水且水质较差的偏远农村，BSF有着很强的适用性和可操作性。对这件事，阿蕾的理解很简单，&ldquo;虽然我们所做的工作对于整个环保事业的贡献很小，但是这样的工作却是很重要的。&rdquo;</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"285\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130924113302226656452/2.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为阿蕾和清源协会成员在农村推广生物慢滤池。</span></p> <p>　　掌握五种语言，让阿蕾在清华结识了很多朋友。越来越多的同学响应她的号召，加入了&ldquo;清源&rdquo;。目前，&ldquo;清源&rdquo;已有来自加拿大、美国、俄罗斯、印度、哥伦比亚、法国、澳大利亚等国的留学生和中国学生20名。现在，&ldquo;清源&rdquo;除了是一个由学生组成的环保组织外，更为留学生与中国学生的交流提供了平台，在这里，你可以认识来自不同国家的同学，在交往的过程中感受文化和思想的碰撞。</p> <p>　　如何把中国学生和留学生组织在一起开展活动？阿蕾说，&ldquo;组织活动不是一个非常难的问题，但是挑战确实是有。因为我们有着不同的文化背景。虽然留学生之间交流比较多，但有时候我更想知道中国同学的想法是什么。由于大家表达的方式不同，有时候我并不能准确了解每个人的想法。不过，沟通和交流的问题随着大家了解的深入，也自然而然解决了。&rdquo;对于语言沟通不畅的问题，阿蕾笑称：&ldquo;很多中国学生会觉得自己英语不好，不好意思说，其实没关系，你看我的汉语也不好，所以没问题。&rdquo;</p> <p>　　2012年和2013年暑假，阿蕾牵头和大家共同组织了&ldquo;清源&rdquo;赴宁夏盐池县麻黄山乡科技服务暑期实践。阿蕾表示：&ldquo;这是我最难忘的活动。那是一个非常缺水的地方，主要水源是雨水，我们去那里推广家庭用的生物慢滤池，并培训他们怎么使用。我们活动小组里面一半是中国学生，一半是留学生，男女各占一半。我们去了11天，男女各一间房，很挤，没有水洗澡、甚至洗脸。但我觉得这些都不是大问题，在这个过程当中，我实地学到了怎么样去跟农村的居民的打交道，有机会看到一个只有雨水作为水源的农村居民，他们会怎样去生活。&rdquo;在参加活动的过程中，阿蕾对于中国文化有了更深入的理解，&ldquo;当地人非常好，对于我们也很欢迎，可能他们没有水，也没有很多的钱，但是他们非常好客，邀请我们到他们家里吃烤肉等等。这让我感受到了中国文化的魅力。&rdquo;</p> <p>　<span style=\"font-size: 14px\">　<span style=\"font-family: 楷体,楷体_GB2312\">记者手记：在采访的过程中，我们被阿蕾对环境问题的关心和热情所感动，她身上散发的对于理想的执着和乐观，感染着身边的人，也带动着大家一起开展环保公益活动。阿蕾说，&ldquo;毕业以后，我最想做的事情是从事跟环境有关的国际项目。&rdquo;我们祝福她，也相信她丰富的实践经历会帮助她在环境保护的道路上越走越远。</span></span></p> <p style=\"text-align: right\">　　供稿：环境学院&nbsp; 编辑：范 丽</p></P>     </div>'),(186,'【人物】金国藩：清华一甲子 桃李天下芳','http://news.tsinghua.edu.cn/publish/news/4205/20130916101202269242427/1.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】金国藩：清华一甲子 桃李天下芳</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">清华一甲子 桃李天下芳</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\"><span>&mdash;&mdash;</span><strong><span>记2013年&ldquo;清华大学突出贡献奖&rdquo;获得者金国藩院士</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\">&nbsp;<span style=\"font-family: 楷体,楷体_GB2312\">记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">刘蔚如</span></strong></span></p> <p style=\"text-align: center\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"340\" height=\"425\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130916101202269242427/1.jpg\" /></span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为金国藩近照。</span></p> <p style=\"text-align: left\">　　早上8点多，金国藩像往常一样来到他位于9003大楼3层的办公室，今天系里有一场学术报告，他要趁报告开始前与报告人做个交流。这是他又一个忙碌一天的开始。</p> <p>　　年逾八十的金国藩，不仅身体硬朗、精神矍铄，更是保持着旺盛的好奇心和求知欲，带领着年轻的教师和学生们始终探索在科学研究的最前沿。在来到清华工作了整整61年之际，他荣获了清华大学&ldquo;突出贡献奖&rdquo;。&ldquo;我很高兴&rdquo;，金国藩说，&ldquo;60多年的工作得到认可，这是一件让我感到骄傲的事情。&rdquo;</p> <p style=\"text-align: center\"><strong>服从需要 结缘光学</strong></p> <p>　　&ldquo;革命战士一块砖，哪里需要哪里搬&rdquo;是金国藩形容自己前十几年的工作时常说的一句话。</p> <p>　　毕业于北京大学机械系的金国藩自幼就对机械非常喜好，经常将自行车拆了又装，装了又拆，还自行装制矿石收音机、收发报系统。1950年毕业时，成绩优异的金国藩留校任教了。1952年随着全国院系调整，金国藩来到清华大学机械系，从此开始了与清华园的不解之缘。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"340\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130916101202269242427/2.jpg\" /></p> <p>　　初到清华园，适逢国家建设急需大量工程建设人才，学校大量招收学生，需要更多的教师承担全校性基础课的教学任务，金国藩被分配教&ldquo;画法几何&rdquo;与&ldquo;工程制图&rdquo;，由于使用苏联教材，讲前面部分的时候竟不知后面部分的内容，金国藩只能边学边教。两年之后，随着学生们技术基础课程学习的需要，金国藩又被分配讲授&ldquo;金属切削原理&rdquo;，他只得前往哈尔滨工业大学进修了半年，回来后便开设了这门课程，一讲就是5年。这期间，金国藩还被任命为金属切削实验室副主任，他尽全力开设了金属切削原理的实验，以及切削力、切削热、刀具磨损等实验，并制出我国第一台三向切削力测力仪。此后，金国藩又被调往新成立的陀螺仪器专业讲授&ldquo;航空仪表与传感器&rdquo;。</p> <p>　　1965年，金国藩再次服从需要，从陀螺仪器教研组调往光学仪器教研组，任国防工办下达的&ldquo;劈锥测量机&rdquo;研制任务的课题负责人。这次调动，让金国藩从此与光学结缘，在这个领域里孜孜不倦地探索了近50年。</p> <p>　　每次转变，金国藩都面临着巨大的压力。至今想起来，他仍会摇着头说：&ldquo;压力大极了。&rdquo;但他并不畏惧，而是团结组里的其他教师们一块儿迎难而上。在我国第一台&ldquo;三坐标光栅劈锥测量机&rdquo;的研制过程中，对光学一窍不通的金国藩从零学起，带领青年教师们查阅资料，向工人和技术人员请教，自己动手改造和研制试验设备，到工厂亲自加工&hellip;&hellip;1969年国庆前夕，他们终于突破了国外的技术封锁，实现试制成功，精度和自动化程度都达到了当时的国际先进水平，研制成本也远远低于从国外购买1台测量机的价格，这项成果于1978年获全国科技大会奖。</p> <p>　　&ldquo;我搞光学是逼着上，憋着气干，干中学，靠集体发展提高。&rdquo;回顾自己走上光学研究的道路，金国藩这样说。</p> <p style=\"text-align: center\"><strong>严格要求 倾心育人</strong></p> <p>　　&ldquo;金老师对学生培养的要求很严格。&rdquo;这大概是金国藩的学生们的一点共识。在金国藩的学生中，有因不努力不能达到要求被劝导退学的，有预答辩不合格被延期的，有书面或口头报告达不到要求开题报告不予通过的。从研究选题到实验设计，从发表论文到学位论文答辩，金国藩都亲自指导，毫不放松要求，数值模拟结果需尽量经实验验证，实验结果必须可靠并能重复，发表论文需冲击高影响因子&hellip;&hellip;</p> <p>　　&ldquo;我不想培养书呆子，我希望培养出来的人能够为社会做出更多贡献。&rdquo;金国藩说。他认为对研究生来说，能力的培养是最重要的，不仅包括自学能力、分析解决问题的能力、创新能力，也包括写作能力、表达能力和社交能力。&ldquo;因为人都是生活在社会中的，任何人都不能离开别人。&rdquo;金国藩说。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"340\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130916101202269242427/3.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为金国藩与学生在一起。</span></p> <p>　　在课题组的讨论会上，金国藩要求学生们都要做PPT，并进行演讲，还鼓励大家用英文交流，锻炼英文听说能力，对每位学生的报告，他则仔细记录，一一点评。&ldquo;这种交互式的讨论会提高了我们的交流表达能力&rdquo;，金国藩的学生王文陆说，&ldquo;金老师对我这方面能力的培养对我的工作有很大的帮助。&rdquo;</p> <p>　　金国藩的学生郑学哲还记得，在读博士的初期，自己想去开发测棉花色度的仪器，又担心导师要求自己专注于博士课题。没想到的是，金国藩却鼓励他去做自己认为有意义的工作，并告诉他博士课题固然重要，但实际的研发工作也是能力培养重要的一环。&ldquo;对这样一位开明宽厚的师长，我想很多学生都是像我一样心存感激的，因为是他给了我们可以高飞的翅膀。&rdquo;郑学哲说。</p> <p>　　60多年来，无论工作有多繁忙，金国藩从未离开过教书育人的第一线，至今仍在带研究生。他培养了我国光学仪器第一名博士生，有多名研究生获得清华大学优秀学位论文的荣誉，先后有两位博士生的论文被评选为&ldquo;全国百篇优秀博士论文&rdquo;。在担任机械学院院长期间，金国藩更是努力为师生创造条件提高教学水平，他凭借自己的威望从国外的公司募集来资金，资助教师学术交流和学生科技活动。</p> <p style=\"text-align: center\"><strong>瞄准前沿 敢为人先</strong></p> <p>　　&ldquo;金先生常常教育我们&lsquo;要有所为，有所不为&rsquo;，但如果&lsquo;有所为，就要为人先&rsquo;。他把研究目标定位在世界先进水平，要&lsquo;敢为人先&rsquo;。&rdquo;曾接替金国藩先后担任过清华大学光电工程研究所所长（教研室主任）的李达成、张书练、李岩回忆道，&ldquo;他凭借敏锐的学术洞察力，扶持新思想、新动态的发展，有些在刚出现时显得很弱的新芽现在已发展成为学科的重要研究方向&rdquo;。</p> <p>　　金国藩是我国光学仪器和光学信息处理、二元光学的奠基人之一，他编写了国内唯一的《计算机制全息图》和《二元光学》专著，发表文章300余篇，专利100多项，获得国家发明二等奖两次以及国家科技进步三等奖、教育部科技进步一等奖，北京市科学技术一等奖，教育部科技进步二等奖、中国工程科技奖，全国优秀科技图书奖二等奖等诸多奖项。</p> <p>　　金国藩总是对新的东西很有兴趣，他经常到美国光学学会网站上下载最新发表的论文阅读，还把一些相关的论文推荐给课题组的师生，每学期大家基本都能收到他推荐的几篇文章。每次参加学术会议归来，金国藩也会把最新的学术动态、应该留意的科研方向等向课题组的师生们转达。有一次，郑学哲从国外回来，向金国藩汇报了自己正在国外从事的研究，他惊讶地发现，金国藩对他从事的研究方向非常了解，&ldquo;我可以像跟同行交流一样跟他轻松地交流&rdquo;，郑学哲说，&ldquo;他还向我介绍了他的团队在纳米光学器件方面的研究和全息存储方面的突破性进展，我看到了一个永远向前探索的学者&rdquo;。</p> <p>　　金国藩自己是这样做的，也是这样要求青年教师和学生的。他鼓励青年教师多参与学术交流，有的教师出国交流期间，所负责的项目和指导的学生都由他亲自代劳，消除了青年教师出国交流的后顾之忧。有的教师遇到项目经费和人员的困难，他不仅提供自己的经费作为支持，还让自己的学生参与研究提供人力支持。对于这种种支持，张书练曾说：&ldquo;金老师的态度鼓励我坚持课题研究，这对在茫茫大海中寻找科研突破口的年轻人多么重要！&rdquo;</p> <p>　　如今，已步入耄耋之年的金国藩仍然没有打算闲下来，除了仍承担着国家863、973和国防预研等项目，活跃在科学前沿，他最关心的莫过于带动和帮助年轻人成长。他一方面积极拓展研究方向，多方寻求合作，建成了数个实验平台，为年轻教师的成长创造了很好的条件，一方面给年轻人压担子、委以重任，让他们担任课题的具体负责人，给他们以充足的平台和空间。他说：&ldquo;趁现在还跑得动，我还想多做几件事，为系里多争取几个项目，为年轻人多创造些条件。&rdquo;</p> <p>　　&ldquo;生命不息，战斗不止！&rdquo;金国藩铿锵的话语彰显着他的壮心不已。</p> <p style=\"text-align: right\">编辑：范丽</p> <p>&nbsp;</p></P>     </div>'),(189,'【人物】徐和平：做一个自觉而执着的人','http://news.tsinghua.edu.cn/publish/news/4205/20130805154457391495919/xu.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】徐和平：做一个自觉而执着的人</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">做一个自觉而执着的人</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 15px\">&mdash;&mdash;访清华大学医学院2010级博士生徐和平</span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">研通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">李丽媛</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img style=\"width: 471px; height: 312px\" alt=\"\" width=\"482\" height=\"321\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130805154457391495919/xu.jpg\" /></span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\">图为徐和平近照。</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"397\" height=\"353\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130805154457391495919/xu2.jpg\" /></span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\">图为徐和平在实验室。</span></strong></span></p> <p>　　<span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">徐和平，清华大学医学院2010级博士生，研究方向为免疫学，师从祁海教授，攻读博士学位期间主要研究人体内高亲和力抗体产生的调控机制。攻读研究生学位以来共发表学术论文6篇，其中第一作者SCI论文3篇，第一作者TOP级别会议论文1篇。曾获浙江省省级优秀毕业生；浙江省杰出志愿者等荣誉。</span></span></p> <p><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　　2013年4月25日，徐和平作为第一作者在国际顶尖学术期刊《自然》上发表了题为<span style=\"font-family: Arial\"><strong><em>Follicular T- helper cell recruitment governed by bystander B cells and ICOS-driven motility</em></strong></span>（协调共刺激信号分子ICOS与幼稚型B细胞共同促进滤泡区招募辅助T细胞）的研究论文，文章首次揭示了ICOS共刺激分子直接控制T淋巴细胞在体内迁移运动的新功能，为理解体液免疫调节提供了新线索。</span></span></p> <p>　　2012年清华大学生命科学学院篮球联赛&mdash;&mdash;&ldquo;微生物杯&rdquo;的赛场上，一支由祁海教授课题组组成的篮球队喜获亚军，然而鲜为人知的是我们文章的主人公徐和平正是这支篮球队中的主力队员之一。生活中的徐和平阳光乐观、朝气蓬勃，给人一种干净利落的感觉，让人想象不到在科研方面他还有如此能量惊人的一面。</p> <p style=\"text-align: center\"><strong>基础坚固&mdash;&mdash;厚积薄发，无悔无憾</strong></p> <p>　　人体内T细胞和B细胞在抵御病原体的过程中扮演着非常重要的角色。而B细胞必须和T细胞的一个亚类&mdash;&mdash;&ldquo;滤泡性辅助T细胞&rdquo;协同工作才能产生抗体，因此滤泡辅助T细胞需要移动到B细胞生活的区域发挥作用。</p> <p>　　祁海教授带领徐和平所在的课题组研究发现，一个名叫ICOS的物质就像是T细胞内的一个发动机，在体内能促进T细胞的持续运动能力，从而决定T细胞在B细胞区组织中的迁移与分布。在研究清楚诸如ICOS分子调节滤泡性辅助T细胞的运动及功能机制后，医学界在研制疫苗时就可以考虑通过提高滤泡性辅助T细胞的产生来改进抗体疫苗的效率。他的研究成果还可能对人类的自身免疫疾病，如红斑狼疮、类风湿性关节炎的治疗提供新思路。</p> <p>　　如此难度极高的课题研究，对于研究者的洞察力、分析能力、实验水平都有很高的要求，徐和平是怎么做到的呢？</p> <p>　　徐和平本科时的专业昆虫学是一个很宏观的学科，课程十分广泛，这为他日后的研究工作奠定了扎实的基础。期间他做了一些关于昆虫的实验，得到了很多锻炼。&ldquo;动物实验方面的训练给我的帮助很大，比如我现在相对没有经过类似的训练的同学手比较巧、眼睛尖；本科的实验练习也锻炼了我的科学思维能力。&rdquo;徐和平说，研究生阶段研究的内容大都是更加具体的，在分子、细胞这些微观层面，这时候多学科背景、&ldquo;杂&rdquo;知识就会显得很重要，能帮助人开辟新的研究途径。</p> <p>　　当记者要求他用一个词来形容自己的优点时，徐和平选择了&ldquo;自觉&rdquo;。&ldquo;我不是一个喜欢抱怨的人。我喜欢我现在所做可科学研究，既然走在这条路上，就要积极主动地去完成老师布置的任务，用心做好这项工作。&rdquo;</p> <p>　　凡事都&ldquo;自觉&rdquo;，几乎不需要别人去督促，这种对待工作的良好态度的养成与他的成长环境分不开，徐和平说从小父母从来不强制性的加给他要求，而是让他考虑清楚后&ldquo;为自己负责&rdquo;；他的导师祁海教授也是一个非常&ldquo;自觉&rdquo;的人，祁教授常常早出晚归，工作时间甚至超过学生。除了实验室每周两次组会外，祁教授还坚持每周和每个学生有一小时的谈话时间，他对科学的热爱也极大地鼓励着徐和平不断进步。</p> <p style=\"text-align: center\"><strong>抉择当前&mdash;&mdash;不畏艰难，迎接挑战</strong></p> <p>　　采访中记者得知，徐和平在本科和硕士生期间均在攻读昆虫学方向，博士期间才转为做免疫方面的研究。2010年，徐和平面临着两种选择：一方面他可以享受很高的奖学金去东京大学继续攻读昆虫专业；另一方面他可以去清华大学医学院从事免疫学相关研究。斟酌再三，徐和平决定给自己一个挑战，决定从事选择后者。</p> <p>&nbsp;　　当问到徐和平对未来有何规划时，他说自己的目标并没有特别宏伟，如果以后做科研的话，他希望能够把基础免疫运用的临床上。硕士研究生期间，徐和平经常向浙江大学附属医院的医生询问问题，谈话中他了解到，如今基础医学和临床专业分别都做的很好，然而基础向临床的转化率却仅有3-5%左右。&ldquo;所以必须要有人专门花精力做转化方面的研究，如果可能的话&rdquo;，徐和平说，&ldquo;我希望自己可以做这样的工作，成为连接基础医学和临床医学的纽带。&rdquo;</p> <p style=\"text-align: center\"><strong>饮水思源&mdash;&mdash;师恩难忘，勇敢向前</strong></p> <p>　　徐和平将科研上的成就归功于祁海教授的悉心指导。有一次祁海教授向他询问研究进展，而那时的徐和平正在因为结果不理想头疼不已，在祁海教授的要求下，他不得已拿出本打算放弃的结果。然而出乎意料的是，祁海教授对这一结果有着另一番评价。在两个人共同讨论的过程中他们发现现有的实验模型中存在不完善的地方，经过不断地查阅文献和实验验证，他们证实了自己的猜想，并进一步完善了实验模型。</p> <p>　　在徐和平的眼中，祁海教授是一个非常有智慧的科学家，他常常会有令人难以想象的想法冒出，并且很愿意让学生去尝试；他对科学问题常常抱有怀疑态度，并敢于说出自己批判性的见解。徐和平说，祁海教授给他印象最深的就是他对科学的热情很高，并且这种热情可以带动身边的学生，让他们充满激情、有信心地继续走下去。例如有一次徐和平兴冲冲地向老师展示了自己的一些新想法，结果却得到祁海教授&ldquo;Not bad&rdquo;的评价，正当他因为老师这个评价而闷闷不乐的时候，祁海教授加了一句：&ldquo;Not bad 是我给人的最高评价。&rdquo;祁海教授积极乐观的做事态度，深深地影响着徐和平，使他在科研的道路上不畏艰难，勇敢尝试。</p> <p>　　对于这个优秀的学生，祁海教授评价道：&ldquo;小徐很有灵性、刻苦而执着；老师带这样的学生，是种福气。相信将来只要有合适的机会，他一定会在科研的道路上有番作为。&rdquo;</p> <p style=\"text-align: right\">　　编辑：襄桦</p> <p>&nbsp;</p></P>     </div>'),(190,'【人物】乐焰辉：执着追逐 梦想就在前方','http://news.tsinghua.edu.cn/publish/news/4205/20130718113937021721304/zhp.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】乐焰辉：执着追逐 梦想就在前方</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">执着追逐 梦想就在前方</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&mdash;&mdash;&mdash;&mdash;记第二炮兵&ldquo;导弹发射先锋连&rdquo;指导员乐焰辉</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">记者 <strong>范 丽</strong> 学生通讯员 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">戎 戈</span></strong></p> <p>　　<span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">献身国防、建设强大国防是我最初的梦想，也是我最终的梦想。在实现这个目标的过程中，不论路径如何调整和变化，都不会改变我的梦想和追求，都不会改变我实现目标、追求梦想的状态。</span></span></p> <p style=\"text-align: right\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　　&mdash;&mdash;</span><strong><span style=\"font-family: 楷体,楷体_GB2312\">乐焰辉</span></strong></span></p> <p style=\"text-align: center\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130718113937021721304/zhp.jpg\" /></span></strong></p> <p>　　乐焰辉，一名普普通通的清华国防毕业生，毕业6年扎根基层作战连队，用自己的自强不息和勇猛坚毅，实现了从一名&ldquo;稚嫩&rdquo;新兵到&ldquo;全军优秀指挥军官&rdquo;的完美蜕变，谱写着一曲热血青年执着追求&ldquo;强军&rdquo;梦想的激昂乐章。</p> <p style=\"text-align: center\"><strong>追梦，为梦想储能</strong></p> <p>　　13岁时立志长大后要到导弹发射部队当兵；高中时，站在讲台上高呼&ldquo;我要去当兵！我要去建设强大的国防，我不能够让敌人这样侵略我们&rdquo;；拿着清华录取分数却不愿报考清华，而是把所有的军校拿过来挨个选的乐焰辉，拥有的最初、也是最坚定的就是从军、强军的信念。</p> <p>　　得知清华国防生毕业后能去部队，成绩优异的他便追着这个梦走进清华，成为一名既圆清华梦、又圆从军梦的清华国防生。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130718113937021721304/biye.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">毕业时的乐焰辉。</span></p> <p>　　在清华园里，乐焰辉的信念日久弥坚，梦想越来越清晰。</p> <p>　　第一节新生党课和毕业前上的最后一节课，老师讲的都是清华精神，&ldquo;自强不息 厚德载物&rdquo;八个字深深烙在乐焰辉的心中。</p> <p>　　乐焰辉清楚地记得导师郑重地在黑板上写下这八个字，告诉即将毕业的他们：自强不息就是任何时候，遇到任何困难都不要放弃梦想和拼搏，要克服困难为梦想奋斗；厚德载物，是要有更高的德行、更宽广的胸怀，能够承载万物、容人容事，终身学习，向所有人学习，把自己的追求与国家民族的事业融在一起，这需要一辈子去追求。</p> <p>　　每一次学习、了解清华的历史，对乐焰辉来说都是一次心灵的洗礼和思想的升华。</p> <p>　　第一节历史课，听老师讲到中国23名&ldquo;两弹一星&rdquo;元勋中有14位是清华校友时，乐焰辉激动不已；无数次学习邓稼先的故事，乐焰辉每一次都充满崇拜，&ldquo;我觉得他们就是我的榜样，不问名利，把自己的一生和所有精力奉献给祖国和民族的事业，这就是清华精神生动的诠释。&rdquo;</p> <p>　　参观机场、观摩飞行，观看导弹实弹发射，到卫星发射基地参观见学，听学长和校友讲他们献身国防的故事&hellip;&hellip;作为一名清华国防生，乐焰辉时刻接受着学校对他思想上的引导，时刻感受着军队对他的召唤。他说：&ldquo;实践与观摩不仅拓展了我们的思维，开阔了眼界，让我们能站在更高的高度思考国家的国防，更坚定了我们携笔从戎，献身国防的理想信念。&rdquo;</p> <p>　　乐焰辉为了梦想有些疯狂。</p> <p>　　在学校，业余时间，最感兴趣的，是军事杂志；选修课选的，是射击训练；时常惦记的，是那支发射导弹的部队。</p> <p>　　大三暑假，当一些同学纷纷选择留北京享受假期、到机关单位实习时，乐焰辉带着勤工俭学攒下的路费，找到了当年执行发射任务的那支导弹劲旅。在驻地门口，或许是因为对这支神往已久的部队太过痴迷，他被当值的哨兵误抓，有了跟这支导弹部队第一次&ldquo;亲密接触&rdquo;的机会。</p> <p>　　&ldquo;我要去当一名真正的军人。&rdquo;回来后，热血沸腾的乐焰辉开始了他的积极&ldquo;备战&rdquo;。</p> <p>　　有人告诉他：&ldquo;二炮部队在深山老林，交通不便，通讯不便，都说去了那儿没有网络，没有手机，你受得了吗？&rdquo;乐焰辉说，&ldquo;啊？这样子啊&hellip;&hellip;那我也要去！&rdquo;</p> <p>　　乐焰辉强迫自己关掉手机，掐断网线2个月；生在鱼米之乡，从小不吃面的他，逼着自己每顿两个馒头，&ldquo;硬塞&rdquo;了2个月&hellip;&hellip;虽然部队的生活完全不同于他的想象，但他的各种疯狂只是为了自己心中的那个梦想。</p> <p style=\"text-align: center\"><strong>助梦，梦想启航</strong></p> <p>　　 &ldquo;很多种子挤在一个花盆里，就很难充分获取土壤的营养，不容易茁壮成长&rdquo;，这是身为班级党支部书记的乐焰辉和全班同学在一次班级党支部学习时，看到《新清华》报上时任清华党委书记陈希的一句话，&ldquo;不要老把自己当做是金子，认为到哪里都可以发光，做一颗平凡的土豆。&rdquo;</p> <p>　　&ldquo;祖国终将选择那些选择了祖国的人&rdquo;，老师在党课时的话仿佛就在耳边响起。</p> <p>　　到更广阔的天空去！</p> <p>　　到祖国最需要的地方去！</p> <p>　　到最艰苦的基层部队去！到火热的军营去！</p> <p>　　北京的一切，对于毕业生的诱惑是无穷的，对一名清华毕业生更是如此，但是，2007年的毕业季，乐焰辉所在国防班的离京人数是全校各班中最多的。</p> <p>　　乐焰辉是第一个申请到二炮作战部队去的清华毕业生，时任校党委书记的陈希看到他填报的志愿后，带队专程奔赴乐焰辉将要扎根的部队去考察调研，并且向部队首长推荐了自己的毕业生。谈起当年听学校定向办老师说起这&ldquo;学生还没到部队报到，领导老师已先到&rdquo;的轶事，乐焰辉眼含热泪，仍感动不已，&ldquo;我只是一名普普通通的学生，但是，陈希老师觉得我这个学生选择的是国家民族需要的事业，所以他愿意这样去做。老师们的行动让我更加理解和认同了在党课上听到的&lsquo;入主流，上大舞台，干大事业&rsquo;的深刻含义。&rdquo;</p> <p style=\"text-align: center\"><strong>为梦想奋斗，梦想就在前方</strong></p> <p>　　带着清华精神的熏陶，带着学校老师们的期盼，乐焰辉走进部队，&ldquo;低调做人，踏实做事，实事求是做好自己，&rdquo;是他给自己定的基本目标。</p> <p>　　乐焰辉在部队期间连续三次放弃了清华的保研资格，回忆起这三次煎熬的选择时他说：&ldquo;当一个人为了自己的梦想追求时，会错过很多，不能读清华的研究生是我一辈子的遗憾，但这是我立足当时的环境情况作出的实事求是、理性的选择，我从不后悔。&rdquo;</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130718113937021721304/shaobao.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">坚强与磨练叫做成长。</span></p> <p>　　六年拼搏，六年成长，乐焰辉成为第一个被中宣部列为先进典型的清华国防毕业生。</p> <p>　　从入伍首次考核的不理想成绩，到一年后，顺利通过发射指挥长考核，所带发射单元获得全旅年度总评成绩第一，从一名的刚入伍与班长因&ldquo;捏被子&rdquo;、&ldquo;扫地&rdquo;等小事争论不已的新兵到被评为二炮优秀&ldquo;四会&rdquo;政治教员&hellip;&hellip;</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130718113937021721304/jiaoli.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">乐焰辉在清华为国防班的学生做讲座。</span></p> <p>　　&ldquo;眉毛上的汗水和眉毛下的泪水，你总得选一样，如果你流过汗也流过泪，你会更坚强。&rdquo; 带着永不服输的信念和韧劲，乐焰辉用朴实的话语描述着自己的梦想与奋斗，&ldquo;我就是踏踏实实做好自己的事情，当兵就当一名合格的兵；训练我就认真刻苦的训练；不会讲课我就学，专心把课讲好；当指导员我就认认真真当一名指导员&hellip;&hellip;&rdquo;</p> <p>　　六年来，乐焰辉跟战士们一起走西北、闯大漠、斗酷暑、战严寒，参加训练、演习，参加阅兵，发射导弹，跟战士们一起摸爬滚打，在他们的身上看到了，也学到了很多宝贵的品质。</p> <p>　　把一个连队带好，每个士兵都能够听指挥，能士气高昂的投入战斗训练，能以良好的身体素质、心理素质和专业素质去操纵武器，完成战斗任务，这是乐焰辉当一个连队指导员时的强军梦。作为指导员的他，深深爱着每一个基层战士，&ldquo;我了解我的战士，了解他们的需要，知道他们需要不断提高自身素质，更需要梦想的激励。&rdquo;</p> <p>　　&ldquo;我还希望有机会能更广泛的了解我们的部队，了解更多的军兵种，更好地掌握带兵和指挥的规律，拓展思维，适应未来的信息化战争和联合作战。&rdquo;乐焰辉满怀憧憬。</p> <p>　　&ldquo;有时候，努力比能力重要；有时候，选择比努力重要；有时候，坚持比选择更重要。&rdquo;</p> <p>　　这是乐焰辉作为校友学长回到清华，在交流活动中为母校国防生讲述自己经历时总结的三句话。</p> <p>　　&ldquo;我们年轻人从来都不缺少梦想，缺少的是追求梦想的执着和实际行动。一条没有目标的航船，往哪个方向都是错的。选择一个正确的方向，选择一个值得自己奋斗一生的目标，尤为重要。每个人在追求梦想的路上都会遇到各种各样的坎坷、困难和挫折，但是我坚信只要一个人始终不放弃梦想，那就什么环境都能适应，什么艰苦都能够忍受，什么诱惑都能够抵挡，什么困难都能够战胜&rdquo;。</p> <p>　　&ldquo;只有不努力的人，没有坚持到底不成功的人。&rdquo;</p> <p>　　 字句铿锵，这些不仅是乐焰辉自身经历的写照和内心呐喊，更是唱响了每一位清华学子为梦想坚定前行的战歌，敲响着每一位有识、有志青年强国、强军梦想的斗志昂扬的战鼓。</p> <p>　　兼具忠诚、勇气和血性的乐焰辉是清华国防生建功军营的优秀代表，他对祖国、对军队充满热爱与激情，他怀揣梦想，在践行强军梦的伟大征途上执着追逐，奋勇前行，激励着更多有知识、有理想的青年人投身部队，献身国防，为实现祖国&ldquo;强军梦&rdquo;助力、奉献。</p> <p>　　<strong>人物链接：</strong></p> <p>　　乐焰辉，男，汉族，湖北通山人，1983年10月出生，2003年6月入党。2003年被录取为清华大学国防生，2007年毕业于清华航天航空学院飞行器设计与工程专业，同年参军入伍，现任中国人民解放军第二炮兵某旅发射三连政治指导员，上尉军衔，所在连曾被中央军委授予&ldquo;导弹发射先锋连&rdquo;荣誉称号。先后参加新中国成立60周年国庆首都阅兵、全军战略战役集训等重大军事任务，亲自指挥发射两发新型导弹，被评为全军优秀指挥军官、第二炮兵用党的创新理论建连育人先进个人、优秀&ldquo;四会&rdquo;政治教员、优秀人才标兵、优秀基层主官、践行当代革命军人核心价值观模范，荣立二等功1次，三等功3次。</p> <p style=\"text-align: right\">　　编辑：襄 桦</p></P>     </div>'),(191,'【人物】朱正腾：志愿服务在身边','http://news.tsinghua.edu.cn/publish/news/4205/20130718104619768155855/zhu.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】朱正腾：志愿服务在身边</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">志愿服务在身边</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\">&mdash;&mdash;记清华大学电子系2013届本科毕业生朱正腾</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\"><span style=\"font-size: 14px\">学通社记者 </span><strong><span style=\"font-size: 14px\">刘畅</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\"><strong><span style=\"font-size: 14px\"><img alt=\"\" width=\"283\" height=\"337\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130718104619768155855/zhu.jpg\" /></span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\"><strong><span style=\"font-size: 14px\">图为朱正腾。</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\"><strong><span style=\"font-size: 14px\"><img alt=\"\" width=\"425\" height=\"319\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130718104619768155855/zhu2.jpg\" /></span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\"><span><span style=\"font-size: 14px\">图为朱正腾2012年5月在中关村中学担任<span style=\"font-family: 微软雅黑\"><font size=\"2\">JA（Junior Achievement）</font></span><font size=\"2\">的授课志愿者</font>。</span></span></span></p> <p>　　他，是清华大学第五届&ldquo;十佳紫荆志愿者&rdquo;，曾在过去三年半多的时间内一直担任与志愿有关的社工职位，他是一位普通的清华紫荆志愿者，更是一位&ldquo;为志愿者做志愿&rdquo;的志愿者，他，就是清华大学电子系2009级本科生朱正腾。</p> <p>　　&ldquo;心怀志愿公益梦，实干志愿二次方&rdquo;，这是他数年来志愿经历的最好概括。</p> <p style=\"text-align: center\"><strong>志愿，在身边</strong></p> <p>　　三年半的志愿经历，朱正腾的足迹几乎遍及整个中国。在北京，他曾担任了中关村中学JA（Junior Achievement）的授课志愿者，&ldquo;天使之家&rdquo;孤儿爱心陪伴志愿者；在河北，他曾参与河北固安一中的短期支教活动；在四川绵阳，他曾志愿参与应急通信系统灾后重建调研项目；在贵州安顺，他曾以&ldquo;情系母校&rdquo;的志愿者身份，为高考的孩子们送去一臂之力；除此之外，他还在香港，台湾参加过为时两周的志愿体验；校内他参加的志愿活动更是数不胜数&hellip;&hellip;</p> <p>　　在被问到志愿服务总时间，朱正腾只是一笑而过。&ldquo;如今清华校内的志愿服务氛围十分浓厚，很多同学从事志愿活动是怀着一种去服务，去奉献的心态。这里更重要的是一种奉献与收获，而认证时间的价值与之相比就不那么大了。说实在的，现在我的志愿认证时间到底多少，我也不是很清楚。&rdquo;</p> <p>　　其实在每一场志愿活动背后，其投入的绝不仅仅是我们所能看到的活动时间，前期准备付出的精力相较而言要多出好几倍。大三在中关村中学的授课志愿活动，就给朱正腾留下了非常深刻的印象。</p> <p>　　该项目持续整个学期，由5人组成团队，每周进行固定授课，但这些并不是这场志愿活动的全部。&ldquo;每周五我们就会开始下一节课的准备，周五确定大体分工，周六确定授课内容，周一做好课件，进行授课彩排，周二对授课内容定稿，周三进行授课现场的工作分工，周四下午是进行正式授课。授课后我们还会做一个总结，我作为负责人，会把总结通过邮箱发给团队中的每一个人。&rdquo;这样的循环，周而复始。除此之外，这堂名叫&ldquo;国际贸易&rdquo;的课程事实上全都由理工科的同学讲授，每一位志愿者都是在自学教材的基础上，大量收集素材，尽可能丰富每堂课的教学内容。&ldquo;孩子们开始可能是出于兴趣，但如果没有充足的准备，效果肯定每况愈下。所以每堂课上，我们都希望呈现一种对知识的生动的，合理的，易于理解的表达。&rdquo;</p> <p>　　这样的付出，最终让这一团队获得了当年JA中国的优秀志愿者团队的称号。但对于朱正腾而言，最重要的不是荣誉，而是其中的收获与感动。&ldquo;最后孩子们给我们带来的感动是无以言喻的。当时全班用彩笔给每位志愿者都写了一封感谢信，每封的内容都不同，在最后都签有每个孩子的名字。这突然让我们感到自己所做的事特别有价值。&rdquo;</p> <p>　　一次次志愿经历，朱正腾将其总结为三个字&ldquo;在身边&rdquo;。&ldquo;在百年校庆期间我有幸作为志愿者帮助薛其坤院士做了一些力所能及的事情。他当时对我们说了这样一句话&lsquo;年轻人要敢于从基础做起&rsquo;。我想不仅仅是学术，志愿也是这样。很多时候，志愿并不需要跋山涉水，它就在我们同学身边，作为一个真正的志愿者，我们也需要从同学们身边的小事做起。&rdquo;</p> <p style=\"text-align: center\"><strong>从志愿者到&ldquo;志愿者的二次方&rdquo;</strong></p> <p>　　除了积极参加各类志愿活动，朱正腾还有一个特殊身份&mdash;&mdash;&ldquo;志愿者的二次方&rdquo;。在采访中他也笑谈：&ldquo;所谓二次方，就是为志愿者服务的志愿者。在很多活动中，志愿者也需要前期培训，指导，乃至后期保障，权益维护等，我希望我在这个角色中也有一些担当。&rdquo;</p> <p>　　自大二加入校团委志愿服务指导中心以来，朱正腾就致力于这样的工作。一年内，他曾为紫荆学生志愿者队伍举办了十余场培训会，培训志愿者一千余人次。同时，他还提倡对志愿者的工作进行权益保障，并改善志愿者的工作环境。他还创立了志愿培训组的人人主页&ldquo;志愿培训&rdquo;，既是良好的信息发布交流平台，也使为志愿者服务培训的方式由一个固定的地点变成了灵活多变的网络平台。&ldquo;我们也希望通过这样的方式，让更多志愿者参与到其中来。&rdquo;</p> <p>　　除此之外，朱正腾还组织了首届清华大学&ldquo;我们的家园&rdquo;志愿创意大赛。这次大赛聚焦同学身边的社区，旨在激发针对同学身边志愿活动的创意，创造一个更良好的社区氛围。&ldquo;我们希望通过这一大赛，寻找到同学身边志愿项目的创意。&rdquo;</p> <p>　　据了解，这次大赛共征集到23个院系40余个优秀志愿创意，在前期评选过程结束后，获奖的部分创意还将给予启动的资金支持并进行试点开展。&ldquo;譬如美院紫荆支队关于校园环境整体改造的创意，就获得了评选的银奖，现在也得到了逐渐的开展，比如区域布置的美化以及宿舍楼标的再设计等。此外还有关于&lsquo;爱心体重计&rsquo;和废纸回收项目等，也都进行了一些试点工作。&rdquo;</p> <p>　　&ldquo;从开始做志愿以来，我最应该感谢的就是每一位紫荆志愿者，因为他们所付出的辛勤与汗水，某些情况下甚至是泪水，才有了一次次活动的脚踏实地，才有了校内志愿氛围的提升。我一直认为志愿就是这样一个人影响人的过程。很多人参加志愿，并不需要什么理由，可能就是因为身边很多人做志愿，自己就跟着做。所以这样一种氛围很重要。&rdquo;</p> <p>　　在问及志愿与学习的平衡时，朱正腾认为自己在电子系是非常幸运的。&ldquo;我们这届正好赶上了系内的课程改革，本科课程整体更注重于学生知识体系框架的建立，也更为强调核心概念和知识联系。这也给我们留出了更多的课余时间，使学生有了更为多元化的选择。很多有志于科研的同学可以有更多时间进行科研，有的还取得了突破性的成果；对我而言，实际上也有了更多投身志愿者工作的机会。&rdquo;</p> <p>　　如今朱正腾已经取得本系保送研究生的资格，他未来的生活，必定也会与&ldquo;志愿&rdquo;两字密不可分。&ldquo;作为一位普通志愿者，我将会尽可能的参加各种志愿工作；而作为志愿者的二次方，我也将为志愿者服务而尽可能付出。&rdquo;他说。</p> <p style=\"text-align: right\">&nbsp;编辑：襄桦&nbsp;&nbsp;</p></P>     </div>'),(192,'【启航人物】索多：在理想的高空中翱翔','http://news.tsinghua.edu.cn/publish/news/4205/20130718095000306759088/suoduo.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【启航人物】索多：在理想的高空中翱翔</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">在理想的高空中翱翔</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&mdash;&mdash;记清华大学社科学院2013届硕士毕业生索多</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">研通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">方文</span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130718095000306759088/suoduo.jpg\" /></span></p> <p>　<span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　索多，藏族，中共预备党员。清华大学社科学院2010级硕士研究生，毕业后赴西藏基层乡镇工作。曾担任班长等职务，获清华大学国际关系学系学习优秀奖学金等奖项和荣誉。</span></span></p> <p>　　西藏，平均海拔4000米以上，有着&ldquo;世界屋脊&rdquo;之称，雅鲁藏布江呼啸而过，珠穆朗玛峰冲天耸立。</p> <p>　　索多在这里长大，看雄鹰飞过，仿佛伸手就能触摸天空，大概正是这片广袤的土地，才能养育出如此坚定的藏族青年。</p> <p style=\"text-align: center\"><strong>西藏，是爱，是家，是情怀</strong></p> <p>　　12岁的时候，索多离开了自己的家乡西藏，来到山东省济南西藏学校，初中四年，他没有回过家。</p> <p>　　&ldquo;当时西藏没有铁路，我只能从拉萨坐飞机到成都，再坐火车到济南，一次路费就要几千元，没有那么多钱。&rdquo;</p> <p>　　在教室背后的黑板报上，贴着西藏孩子的理想，&ldquo;索多&mdash;&mdash;工程师&rdquo;。</p> <p>　　&ldquo;曾经有位西藏教育厅的官员在我们学校演讲，他说西藏最缺乏的是工程师，因此当一名工程师就成了我的理想。考上清华，我也是为了实现这个理想。&rdquo;</p> <p>　　在一个12岁孩子的世界里，索多其实并不明白工程师的真正涵义。12岁时的你和我，或许还在父母的庇护里打闹嬉戏，可12岁的索多已经开始独立生活。索多的心中一直记着这样一句话&mdash;&mdash;&ldquo;为建设新西藏奉献自己的才智&rdquo;，对一个12岁便背井离乡踏上求学之路的孩子来说，这是信念。</p> <p>　　西藏是家，西藏需要工程师，做一名工程师便是他的理想。</p> <p>　　&ldquo;从进入内地西藏班学习开始，我就知道身上担子的沉重，我们必须成为民族的栋梁。每一次思考，我都把西藏的需求放在第一位，然后其次才是个人的喜好得失。&rdquo;大三暑假，索多面临继续求学还是工作的问题，&ldquo;我们家有五个孩子，我姐姐和哥哥都没上过学，只有我一个人上过大学，按理说我应该承担家庭责任，赚点钱，解决家庭的问题。&rdquo;</p> <p>　　如果当时索多回到西藏，选择一份待遇好的工作，他和他家庭的生活可以更好。</p> <p>　　&ldquo;但是这样，我觉得自己很可怜。&rdquo;这是访谈中索多经常说的一句话。</p> <p>　　为何可怜？</p> <p>　　&ldquo;我也想过去银行工作，月薪过万，可以留在拉萨，很舒适，谁不想要？但如果这样，牵着我鼻子走的，不是理想，不是能力，而是金钱和舒适的生活，这样我会觉得自己很可怜，这样我没法改变别人，最多改变自己的家庭，我能做的事情很少，只能忙于生计，不能为别人创造价值。&rdquo;这是索多的肺腑之言。</p> <p style=\"text-align: center\"><strong>西藏需要什么？我能做什么？</strong></p> <p>　　2006年，索多作为清华招收的唯一一名藏族学生，进入精仪系制造自动化测控技术专业。</p> <p>　　那一年，他以为已经触摸到了自己的&ldquo;工程师梦想&rdquo;。</p> <p>　　可是，索多发现，离开西藏6年，在外求学的时间，甚至让他脱离了西藏。西藏可能需要热能、水利的工程师，可是，西藏根本没有对口的行业接收一名自动化人才。</p> <p>　　&ldquo;我觉得自己学的专业在西藏没有用武之地，我很失望和迷茫。&rdquo;</p> <p>　　在现实与理想冲突的挣扎中，索多的思维随着青藏铁路一路延伸。</p> <p>　　&ldquo;青藏铁路于2006年7月1日通车，7月末我便坐火车来清华报道，这次经历对我触动很大。我认为，火车的开通会对西藏社会产生很大的冲击，一方面，青藏铁路会创造很多发展的机会，但在创造机会的过程中，会产生一些文化对话甚至是裂缝，另一方面，经济高速增长的情况下人的精神世界可能会很贫瘠，这些都是西藏将来可能需要解决的问题，因此相比一名自动化工程师，西藏可能更需要社会科学方面的人才。&rdquo;</p> <p>　　考虑到自身优势以及西藏未来建设与发展对人才的新要求，索多选择从精密仪器专业转入社会科学试验班。</p> <p>　　&ldquo;以前只想着西藏需要什么，没有去思考自己的潜力，现在想来，我需要考虑两个因素，一个是西藏需要什么，一个是我能做什么。&rdquo;</p> <p>　　在研究生期间，索多熟知了西藏村官计划，也逐渐产生了自己的认识，&ldquo;如果我去基层，我有很多优势，我会说藏语，会写藏文，汉语和其他语言也可以，另外，我从小在农村长大，我懂老百姓，知道他们的辛苦，这种情结很重要。我曾经看见自己的家人亲戚朋友在农村承受的苦难，这也是影响我选择到西藏基层工作的重要原因。他们为了省一块钱，可能走几十公里路回家，在城里，这些钱可能就只够给小孩买块糖，跟他们比，你觉得自己苦吗？我觉得不苦。把我放在最艰苦的地方，我都觉得不苦。&rdquo;</p> <p>　　关于西藏的农村现状，索多也在不断思考，&ldquo;西藏的城市化程度更低，农民基数更大，作为一个决策制定者或者建议者，你必须了解他们。如果我能去基层，我确实能够为他们做一些事情，西藏基层，知识太匮乏了。如果有知识，你能做很多事情，这是真的。&rdquo;</p> <p style=\"text-align: center\"><strong>尊师如父，严父如山</strong></p> <p>　　索多是幸运的，在大学，遇到了如慈父一般的导师，带领他摸索前进的方法，更幸运的是，他有一个伟大的父亲，是索多离家在外独自求学十余年的精神支柱。</p> <p>　　索多在社会科学学院国际关系学系攻读硕士期间师从阎学通教授，学术上，阎老师对索多倾心指导；生活中，更是言传身教。&ldquo;阎老师曾经上山下乡，在黑龙江建设兵团度过九年劳动岁月，九年的等待时间是煎熬的，缺乏物质，精神贫瘠，可是他坚持下来，并走了出来，这九年的经历塑造了现在的他，他也常常跟我们回忆当时的生活，鼓励我们坚持自己的理想。&rdquo;在索多心中，阎老师像家乡农村的老爷爷，没有那么多讲究。慈祥，简单。</p> <p>　　若说尊师如父，那索多的父亲，就像一座山，高大挺拔。</p> <p>　　索多跟很多孩子一样，亲切的称呼父亲为&ldquo;老爸&rdquo;。</p> <p>　　&ldquo;可能我比较自私，在我眼中，我的老爸很完美。&rdquo;</p> <p>　　索多说，&ldquo;我觉得我的父亲有一种很宽阔的胸襟，想事情从来不考虑自己和家人，如果没有他，我不可能走到现在。他虽然是一个农民，但看得很远。高考结束后，我的家庭遭遇了变故，经济上困难很大。但父亲坚持让我好好学习，告诉我，哪怕需要出国读博士，家里都会支持。&rdquo;</p> <p>　　硕士学位论文答辩结束后，索多很兴奋，第一时间给父亲打了电话，&ldquo;老爸，我马上要工作了，我的第一份工资，你希望我给你买什么礼物？&rdquo;&ldquo;我希望你把自己的第一份工资全部捐出去，当作表明自己的志向，以后，当你遇到了诱惑和动摇，想起自己捐出的第一份工资，或许还能回想起当初的理想。&rdquo;在索多的眼中，父亲有一种&ldquo;无我&rdquo;的境界。</p> <p>　　能让人感动的，常常不是小说里的千回百转，而是发生在普通人身上最真实的故事，就好像读者一般不会被形容词打动，触动心灵的，常常是用动词和名词组成的最简单的句子。这里，索多，是一个会让人感动的名词。</p> <p style=\"text-align: right\">　　编辑：范 丽</p> <p>&nbsp;</p></P>     </div>'),(193,'【人物】冯旭：历练不平凡的青春','http://news.tsinghua.edu.cn/publish/news/4205/20130715092455831570029/fengxu(1).jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】冯旭：历练不平凡的青春</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">做平凡事 历练不平凡的青春</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\">&mdash;&mdash;记清华大学新闻与传播学院2013届本科毕业生冯旭</span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">学通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">鲍涵</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"269\" height=\"404\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130715092455831570029/fengxu(1).jpg\" /></span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">图为冯旭近照。</span></span></p> <p>　　命运带来的贫穷没有打倒冯旭，反而让他的生活更为丰满与富有，社会的关怀激发他饮水思源，致力公益。冯旭总说自己做的都是简单而平凡的小事；但他的青春，铭刻着清华大学&ldquo;自强不息，厚德载物&rdquo;的校训，闪耀着不平凡的光彩。</p> <p style=\"text-align: center\"><strong>男儿当自强</strong></p> <p>　　出生于鄂西山区的一个清贫农家，冯旭很早就担当起了家庭的重担。父亲残疾不便劳动，母亲困于病榻，上有一位体弱多病的兄长，下有一个少不更事的幼弟。为了补贴家用，年幼的冯旭利用放学后的时间上山寻找各种值钱的野物或者水果。上中学时，他在假期靠卖玉米、土豆以赚取微薄的收入。到了大学，做家教、当楼管、摆自行车、发传单、贴广告，参加勤工俭学工作成为家常便饭。16年求学时光里，冯旭曾经交不起学费、用不起参考书、吃不起午餐、买不起校服，甚至因为坐不起回家的班车而不得不走路回家。</p> <p>　　生活的重压之下，儿时的玩伴多半选择了外出逃避或者浑噩度日，而冯旭选择了坚强面对，贫穷没有成为平庸和堕落的理由。&ldquo;这个世界不会抛弃那些很努力掌握自己命运的人&rdquo;，冯旭如是说，&ldquo;我是一个初中和高中两个阶段都得到一定资助的学生，我明白不管条件有多差，只要你肯用心，就会有人帮助你。&rdquo;高中三年，冯旭历次考试稳居年级前三名，他顶着39度高烧走进高考考场，以优异的成绩考入了清华大学2009级新法国防班。进入大学，遇到&ldquo;理&rdquo;转&ldquo;文&rdquo;的情况，冯旭的成绩一度低迷，但他硬是凭着一股不服输的劲头拼命追赶：图书馆学期借书量突破3000，论文修改次数高达28次，每门课平均阅读书目达到7本&hellip;&hellip;最终他实现了年级排名由28到18再到第4名的&ldquo;三连跳&rdquo;，还发表了一篇专业论文和多篇随笔，获得了包括&ldquo;好读书奖学金&rdquo;在内的多项综合优秀奖学金。冯旭用自己的艰苦努力，证明了理科生也可以把文科学好，他也在法学专业学习中找到了学术兴趣，收获了学习的自信和快乐。凭着奖学金和各种兼职工资，大学四年，冯旭不仅没有向家里要一分钱，反而主动负担起了弟弟读高中的生活费用和父母的医药费。贫穷，反而让这个来自大山的孩子变得强大和富有。</p> <p style=\"text-align: center\"><strong>少成若天性 习惯如自然</strong></p> <p>　　求学过程中接受社会帮助的经历鼓励着冯旭将感恩之心投入到志愿公益活动中去。大学期间，冯旭担任校园义务导游累计超过1000小时，无偿献血8次达3200毫升。&ldquo;只要时间允许，我就去献血，也没有想到积累起来已经这么多了。&rdquo;虽然生活拮据，他还是会坚持每个月向班级设立的&ldquo;新法9助学基金&rdquo;捐献一笔善款，有钱的时候捐五十、六十，没钱的时候十块、八块，从未间断。不知不觉中，他已经成为全班捐款最多的学生。&ldquo;除了自身的成长经历，清华的氛围也是激励我做这些事的重要原因。它确实给我们提供了很多很便捷的去做这些事情的机会，像献血、校园义务导游、暑期实践还有支教等等。&rdquo;</p> <p>　　他在昌平慰问孤寡老人，在呼和浩特关心留守儿童，在海淀区提供法律援助。大三暑假时，他参加法学院组织的实践活动，在岳阳监狱帮助服刑人员。&ldquo;我们的目的是让他们知道没有人歧视他们，让他们感到平等，同时力所能及地给予他们在一些法律问题方面的咨询帮助。&rdquo;</p> <p>　　在积极投身这些&ldquo;小公益&rdquo;的同时，冯旭还尝试着做一点&ldquo;大公益&rdquo;：省吃俭用自费前往重庆万州、湖北宜昌、河南信阳等地进行社会实践调研，撰写报告超过80万字，对国情有了最直观和准确的认识；认真钻研国家的养老、保险、三农、扶贫等大政方针，撰写有关新农村建设的报告和建议。</p> <p>　　 &ldquo;说到公益，其实我回想起来，没有刻意追求过。就是可以做公益的机会来了，我就抓住；想法来了，我就去实现，不给自己犹豫的机会，&rdquo;冯旭说，&ldquo;就是习惯成自然。这些事情如果我不做，心里就有些小疙瘩；做了这些事，我会感觉很快乐。&rdquo;</p> <p style=\"text-align: center\"><strong>国防生的责任与担当</strong></p> <p>　　在冯旭看来，&ldquo;国防生&rdquo;不仅仅是一种称谓、一种符号，更是一种责任、一种担当。&ldquo;清华的国防生都很有理想，他们愿意为国防事业去奉献自己。他们对自己的人生也很有规划，&rdquo;冯旭如此评价清华大学国防生集体，&ldquo;在清华大学勤工助学分队里面，最多的是国防生。很多国防生家里其实蛮富有，但是他们还是愿意做这个。不是为了一小时十几块钱，而是为了贡献自己的力量。&rdquo;</p> <p>　　初入大学时，心脏功能偏弱的冯旭甚至都无法适应最基本的体能训练，&ldquo;弄的最差、完成最慢、做的最难看&rdquo;成了他的专属标签。但失败反而成了冯旭前进的动力。在班级、连队的日常训练之外，他常常偷偷给自己&ldquo;搞例外&rdquo;、&ldquo;开小灶&rdquo;，一有空闲时间就到西操的器材场地练个不停，大冬天挥汗如雨他也乐此不疲，手掌、肘部、背部、臀部、脚掌都留下了厚厚的茧子。班级同学帮他做过粗略的统计，三年里，他共完成5000米长跑1500余公里，&ldquo;三个100&rdquo;（100个俯卧撑、100个仰卧起坐、100个深蹲）600余次，练习散打、擒拿、格斗等基本战术800余小时。功夫不负有心人，渐渐地，他能胜任队列的指挥官了，5000米能跑到队伍前面去了，俯卧撑能在全校国防生比武中拿到名次了。</p> <p>　　在大一和大二暑期的国防生军政训练月中，冯旭凭借优异的表现被评为&ldquo;先进个人&rdquo;。但&ldquo;不安分&rdquo;的冯旭没有满足于这些已有的成绩，他清醒地意识到自己距离一名优秀的共和国军官还有很远的距离。大四一开学，他又开国防生实习的先河，主动联系了以训练强度著称的北京军区某部，打好背包、穿上迷彩服，冯旭一头扎到了一线作战部队，和最基层的战士们一起吃、一起住、一起训练、一起挨骂，一起体验那份只属于军人的苦与乐。</p> <p>　　冯旭说：&ldquo;我不是清华最自强的学生，我所做的不过是无数和我一样的清华同学们正在做的。但我愿做自强精神的践行者，在平凡的日子中摔打不平凡的青春。&rdquo;</p> <p style=\"text-align: right\">　　编辑：襄桦</p> <p>&nbsp;</p></P>     </div>'),(194,'【人物】胡凯：清华！我愿把青春献给你','http://news.tsinghua.edu.cn/publish/news/4205/20130715090408346504542/7a.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】胡凯：清华！我愿把青春献给你</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">清华！我愿把青春献给你</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\">&mdash;&mdash;记短跑健将、经管学院博士毕业生胡凯&nbsp;</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">赵姝婧</span></strong></p> <p style=\"text-align: center\">　　<img alt=\"\" width=\"246\" height=\"369\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130715090408346504542/7a.jpg\" /></p> <p><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　　胡凯</span></span></p> <p><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　　1982年生，2001年进入清华大学经管学院体育特招班学习，2006年本科毕业攻读本院硕士学位，2011年开始攻读本院市场营销专业博士，2013年7月博士毕业。先后获得第二十三届世界大学生运动会男子100米冠军、第四届东亚运动会男子100米冠军，日本大阪国际田联大奖赛100米冠军，2008年北京奥运会男子100米进入第二轮、男子4&times;100米接力进入决赛。曾获得CCTV十大体坛风云人物、中国劳伦斯十佳运动员、中国大学生十大年度人物等多项荣誉称号。今年7月毕业后选择留校工作，主要承担清华大学团委体育代表队和文体部相关工作。</span></span></p> <p>　　今年6月的一个夏夜，繁星满天，胡凯跟朋友们坐在大礼堂前，感受着清华园里弥漫的毕业味道。他们随心畅聊，有关青春，有关梦想。胡凯扳着手指，笑着数他在清华度过的一个个年头。</p> <p>　　12年了。这些年，胡凯在清华园里也算是一位&ldquo;风云人物&rdquo;，有&ldquo;眼镜飞人&rdquo;的美誉，有闯进奥运会的辉煌，有拿到博士学位的欣喜，也有追逐梦想的艰辛。</p> <p>　　那晚胡凯跟朋友们聊到了很晚，面对即将开启的未来，每个人都有不同的选择。胡凯思索良久：&ldquo;我决定留校。清华精神已经渗透到我的灵魂里面了，我想把勇于拼搏、敢于争先、爱国奉献的人生体会与更多同学分享，我愿把青春全都献给清华。&rdquo;</p> <p>　　7月16日，胡凯将在毕业典礼上郑重接过博士学位证书。一个新起点由此开始，在未来的日子里，胡凯将成为清华大学团委的一名教师，主要承担体育代表队和文体部工作，继续在清华园里跟同学们一起分享成长的经验和收获。</p> <p style=\"text-align: center\"><strong>那些年挥洒在赛场上的理想</strong></p> <p>　　2001年冬天，元宵节还没过，19岁的胡凯只身一人从青岛来到北京，参加清华大学冬令营选拔大会。这位仅仅接受过3个月体育训练的高三男孩，凭借优异的表现拿到了唯一一个男子短跑特招名额，高考又取得了超出山东省本科线20多分的好成绩，如愿进入清华经管学院体育特招班。</p> <p>　　&ldquo;我觉得，有一个词特别能概括当时我们班同学的状态：理想主义。&rdquo;据胡凯回忆，入学后他们班建立了自己的BBS账号，&ldquo;没想到，当我第一次进入论坛时就被&lsquo;惊&rsquo;到了，大家竟然都是结合自己的目标起名字！比如，有的同学将目标定为北京奥运会，他就会在名字后缀加上&lsquo;2008&rsquo;；有的同学将铅球目标成绩定为17.5米，他就会用&lsquo;1750&rsquo;代表自己。试想一下，能在这样拼搏向上的环境里成长，自己是多么幸运，而且怎么会不拼尽全力去训练、去学习！&rdquo;</p> <p>　　在酷暑难耐的夏天，发烫的跑道与胶鞋的摩擦使胡凯的脚就像在火上烤一样难受，即使脚上磨起血泡、浑身挥汗如雨也毫无怨言；在寒风凛冽的冬天，胡凯迎着刺骨的北风在训练场上一圈圈奔跑，被汗水打湿的头发迅速结成冰凌，他却毫不在意。</p> <p>　　&ldquo;其实我最害怕的是每周二和周五的速度耐力课，每次训练结束都会看到我在跑道上打滚的狼狈景象，乳酸的堆积使我的身体失去了控制，臀部和腿剧烈的酸胀感让我不论选择站着、躺着还是坐着、蹲着都十分痛苦，但这魔鬼训练丝毫磨灭不了我训练的激情！&rdquo;胡凯眼睛里闪着坚毅的光芒。</p> <p>　　要想提高成绩，不仅需要艰苦的训练，还要保证训练的系统性，于是胡凯慢慢忘记了节假日的休息时间。&ldquo;记得刚入学的时候，我问李庆教练什么时候可以回家？教练开玩笑地说：清华就是你的家。&rdquo;可是后来，胡凯把这句玩笑变成了行动，他粗略计算了一下，入学12年来回家的天数加在一起总共不到两个月，更有5个春节留守清华。就是这样艰苦充实的训练，磨砺了他的意志，成为他赢得多项优异成绩的最大原因。</p> <p>　　&ldquo;胡凯对体育的热爱以及他高昂的斗志，远远超过了一般的体育特长生。他不仅勇于吃苦，而且肯动脑子，悟性很高，对训练方法和技术的解读都很深刻，我想这就是他的个性和与众不同之处。&rdquo;胡凯的教练李庆说。</p> <p>　　第二十三届世界大学生运动会男子100米冠军，第四届东亚运动会男子100米冠军，国际田联大奖赛100米冠军，北京奥运会男子100米进入第二轮、男子4&times;100米接力进入决赛&hellip;&hellip;一个个新的记录，一次次新的历史，都是胡凯身上光芒四射的光环。但他很少把这些荣誉挂在嘴边，&ldquo;这些成绩是清华的、是中国的，我只是其中的一分子，做着自己该做的事情。&rdquo;</p> <p style=\"text-align: center\"><strong>严谨求学　攀登学术高峰</strong></p> <p>　　胡凯说，他特别享受自己的双重身份，既是运动员又是学生。&ldquo;作为学生运动员，我们不仅要在高校乃至全国、全世界参加各项比赛，还要履行普通学生的责任，认真完成上课、考试、写论文等学业任务。我觉得清华给予我的人文环境非常宝贵，我能在这里接受全方位的综合教育，更好地提高自身的文化水平和悟性。&rdquo;</p> <p>　　在很多人眼中，胡凯是个&ldquo;牛人&rdquo;，他在练体育的同时，还一口气拿下了经管学院学士、硕士、博士三个学位。&ldquo;我一直觉得，正是体育教给了我一种做事的态度：凡事都不能怕吃苦，凡事都不能偷一丁点儿懒。&rdquo;</p> <p>　　胡凯在读博士一年级时，有一门课叫做《营销管理方法论》，老师要求每位同学都要上台演讲指定的全英文论文。&ldquo;我用了一周的时间，把整篇文章都翻译成了中文，彻底弄明白之后才讲给大家。后来我才知道多数人只是看过论文摘要、实验和结论之后就可以上台讲了。但是我没有这么做，因为我始终怕落掉一些关键内容。这就如同比赛，不练力量和耐力，只练一下速度就去比赛，总觉得不扎实。所以我宁可花费比别人多的精力，也一定要把它做到最好。&rdquo;</p> <p>　　为了更好地完成博士论文，胡凯前后共发放了400多份问卷进行调研，每份问卷都有80多道题。&ldquo;很多人跟我说可以找录入公司统计结果，省时省事，但我就是不放心，坚持自己一份一份地录了一个星期，这样可以保证我的调查结果是绝对真实的，我想这也是对学术的一种态度。&rdquo;</p> <p>　　胡凯的博士论文《顾客企业关系的象征性符号形成机制研究》凭借新颖的选题、扎实的研究方法和严谨科学的研究结果，被评审专家给予A的好成绩，答辩委员会也给予很高评价。胡凯的博士生导师、经管学院教授李飞称赞道：&ldquo;这是一篇难度很大的研究题目，胡凯极为认真努力，他查阅了大量资料，论文写得非常扎实，研究结果非常有意义，优秀程度不亚于其他的博士生，他刻苦努力的精神值得很多人学习。&rdquo;</p> <p>　　多年来，胡凯在努力学习的同时，还要进行高强度的体育训练，为了按时完成学业任务，胡凯经常熬夜。&ldquo;曾经有人问我，学习和训练应该怎样才能相互促进？我觉得可以打个比方，如果说运动是一座山，学习是另一座山，两山之间是有很多共性的。如果说我在攀登运动这座山时用了足够的力气，当我站在高处俯瞰另一座时，会看到两山的一些共有规律。所以我相信只要有毅力，什么事情都可以做好。&rdquo;</p> <p>　　&ldquo;我经常觉得，在清华安静读书的感觉甚至会超过我拿冠军时的感觉。因为无论是在自习室还是图书馆，我会觉得这个位子曹禺先生当年可能曾经坐过，那个窗下邓稼先先生也许曾埋头苦读过。他们的故事激励着我，也许正是爱国奉献、追求卓越的清华精神，一直在无形中促使我更加努力。&rdquo;胡凯感慨地说。</p> <p style=\"text-align: center\"><strong>以未来之名起誓　青春不毕业</strong></p> <p>　　从2010年开始，胡凯担任清华大学体育代表队的辅导员。他把这个活称作&ldquo;良心活&rdquo;，坚信只要尽职尽责、用心去做肯定会有不一样的收获。当时胡凯首先负责的是体育代表队的党建工作，&ldquo;由于代表队很多同学的文字功底不是特别扎实，所以很多材料我都得从头到尾地去修改，常常一改就到半夜。&rdquo;后来胡凯担任了体育代表队工作组副组长，面临的事情更为复杂，但是他一直坚持与代表队的同学们密切交流，尊重每一位同学的个性，完善学生沟通机制。</p> <p>　　毕业后的胡凯还将承担团委文体部的学生工作，&ldquo;清华的校园文化非常有魅力，每位同学的个性凝聚升华成清华的精神和文化，而清华传承下来的精神又能体现、传承到个体当中，这是一个相互促进、相互丰富的过程。所以我觉得学生工作特别重要，我今后将努力做到认真引导每一位同学成长。&rdquo;胡凯说。</p> <p>　　&ldquo;我认为，所有来清华的学生都是有幸的，但是当有一天你能真正体会到清华精神在你脉搏里跳动的时候，你会说：我跟清华是有缘的。&rdquo;胡凯感慨地说，&ldquo;我认为清华人的身上有着一个鲜明的标签，那就是很认真、很努力、永远有梦想、永远不停息，为了理想全力拼搏，每个人的青春都痛快淋漓。我希望这种精神能永远传承下去，这也是我今后最想做的。&rdquo;</p> <p>　　学校体育部主任刘波说：&ldquo;胡凯非常适合留校工作，他有足够的经验和优势，是一位&lsquo;跨时代的人物&rsquo;，在同学中具有很大的影响力和很好的表率作用。这不仅体现在他是中国高校里真正意义的、第一位被广泛认可的优秀学生运动员，而且他在体育、学术、社会工作三方面全面发展，这非常符合清华的传统，是一位典型的清华人。&rdquo;</p> <p>　　胡凯还笑着补充说自己是一个怀旧的人。他能连续说出清华园里很多令他难以忘怀的关键词：东操、训练场、狮子座流星雨、大石桥烧烤、西大狂欢&hellip;&hellip;&ldquo;我的青春全在这里了，我无法割舍。清华园是一片净土，它给予我太多美好的东西和回忆，我想留在这里，尽自己的一份力量，跟同学们在一起，共同分享成长的经验和收获，这样的青春能够永远&lsquo;不毕业&rsquo;！&rdquo;</p> <p>　　那晚与朋友们在大礼堂前畅聊的胡凯还许下了一个愿望，他希望多年以后，还能像现在这样，几个朋友一起骑车穿过校园，心怀美好梦想，在清辉斑斓里一路放歌&hellip;&hellip;&nbsp;</p> <p>&nbsp;&nbsp; 　<span style=\"font-family: 楷体,楷体_GB2312\">来源：新清华2013-7-12</span></p></P>     </div>'),(195,'【启航人物】赵云龙：种树者必培其根 种德者必养其心','http://news.tsinghua.edu.cn/publish/news/4205/20130711094953234757967/zhao.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【启航人物】赵云龙：种树者必培其根 种德者必养其心</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">种树者必培其根 种德者必养其心</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\">&mdash;&mdash;记清华大学化学系博士毕业生赵云龙</span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">研通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">吴春林 通讯员 罗志德</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130711094953234757967/zhao.jpg\" /></span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\">图为赵云龙。</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"312\" height=\"396\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130711094953234757967/zhao2.jpg\" /></span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><strong><span style=\"font-family: 楷体,楷体_GB2312\">图为赵云龙与同学工作中。</span></strong></span></p> <p>　<span style=\"font-family: 楷体,楷体_GB2312\"><span style=\"font-size: 14px\">　赵云龙，男，满族，辽宁沈阳人。2004年考入清华大学化学系，2013年博士毕业。曾任共青团清华大学研究生委员会副书记、清华大学研究生会副主席、清华大学学生职业发展协会会长等职务；曾荣获清华大学特等奖学金、林枫辅导员奖、一二九辅导员奖等荣誉；迄今已发表SCI检索论文五篇，申请国家专利三项。2012年11月签约成都市龙泉驿区，目前分配到区委组织部人才办工作。</span></span></p> <p>　　&ldquo;清华是一个充满了梦想和信念的地方，我喜欢这个园子，也期待大家在这里修成正果。&rdquo;这是此次访谈行将结束时，他给师弟、师妹们的寄语。九年的清华求学岁月，让毕业之际的&ldquo;修成正果&rdquo;的他成为一个具有坚定信念的逐梦者。</p> <p style=\"text-align: center\"><strong>又红又专，清华带领我前行</strong></p> <p>　　五年前从清华本科毕业时，赵云龙对未来自己做什么还没有清晰的概念。&ldquo;当时无法认清自己，连想从事与自然科学相关的工作还是到社会上与人打交道都不清楚。&rdquo;赵云龙坦言，&ldquo;那个时候我感觉知识也没有学到家。我需要读博，需要一个系统的科学训练。&rdquo;</p> <p>　　在读直博生的五年中，赵云龙在科研上取得了良好成绩，也去了很多地方，让自己的人生阅历更加丰富。在赵云龙看来，博士是一个历练的过程，一个把事情做深做透的过程。&ldquo;同一件事情压着做三五年，前两年踏踏实实进行，可能什么成就也没有，必须忍受孤单、寂寞和失落。然后突然间有了突破，一种喜悦涌上心头。最后还需要将成果加工，推广出去。&rdquo;赵云龙讲述到，&ldquo;这样的一个过程不是和人生奋斗经历很相似吗？接受挑战，忍受孤寂，做出成绩，经验推广&hellip;&hellip;&rdquo;笋因落箨方成竹，鱼为奔波始化龙，经受住困难的历练，才能成就自我。清华，就是这样一个历练之所。</p> <p>　　清华给予学生的历练是知识、阅历、思维方式等多方面的。&ldquo;知识分为形而上的和形而下的，我们所学到的形而下的知识占多数，但这些知识在基层公共服务的具体工作中很少直接用到。形而上的知识包括分析问题的方法，对事物规律的认识等等，是随着阅历的增加而不断增强的。&rdquo;赵云龙说，&ldquo;所以不能简单地认为在学校所学知识在工作中无任何用处，很多时候我们辛辛苦苦学到的，即使没有直接用到，也会间接影响我们自身。做科研就是一个例子，也许我发的论文在具体工作中很难实用，但这五年间，我以&lsquo;工作人&rsquo;的态度面对科研，踏踏实实做事情，多了许多的人生阅历，比五年之前成熟了许多，这些都是宝贵的人生财富。&rdquo;</p> <p>　　除去科研，社会工作也是赵云龙5年读博生涯的重要组成部分。从2010年夏天到研究生系统工作始，到2012年夏天离开研究生系统止，他在校研团委和研究生会从事过体育、办公室、志愿者、组织等多种类型的工作，最后担任了研团委副书记一职，是清华大学研究生中&ldquo;双肩挑&rdquo;的典型人物。研团委原书记王磊老师评价他说：&ldquo;云龙同学兼顾了学业和其他能力的发展，属于全面型、综合型的干部。&rdquo;社会工作对赵云龙的成长和人生规划产生了非常重要的影响，让他更加清晰和客观地认识了自己。&ldquo;比起现在的我，来研团、研会前的我过于青涩。那个时候的我只知道自己不想要什么，却不能清楚的知道自己想要什么。随着在研团、研会工作的时间越来越长，我逐渐清楚地了解和认识了自己，从而更加坚定目前的职业选择。&rdquo;他颇有感触地讲到，&ldquo;我在研团、研会最大的收获，就是能够结识许多位能够一起讨论深层次问题的老师和同学，他们对我点点滴滴的评价，让我加深了自我认识，帮助我在关键和重大选择上能够比较果决地得到最适合自己的答案。&rdquo;</p> <p>　　包括校研团和校研会在内的研究生社会工作系统是我校引领青年、培养青年和服务青年的重要平台，是实施思想引导和实践教育的研究生&ldquo;第二课堂&rdquo;，在这一系统中培养起来的工作方法和理念，对学生干部走向社会后的正式工作将起到一定的指导和借鉴作用。赵云龙自今年1月份便开始在他现在的工作岗位实习。&ldquo;机关单位里文字工作比较多，很多新人最不能适应的就是这一点，而我却乐在其中，因为类似的工作我在学校研团、研会工作期间基本都接触过。看似枯燥的文字工作，实际上却是机关工作至关重要的组成部分，是价值极高的工作。文字材料反映的是逻辑、是思想、是智慧，是行动的指导，是政策落实的保障，也是团结人心的利器。在研团、研会起草团代会、学代会报告的经历，让我能够较快地适应目前的文字工作。&rdquo;在赵云龙看来，社工是他除专业科研之外、读博生涯中最宝贵的经历，为他提供了丰富的基层服务工作模拟演练的机会，也是促使其最终决定走向基层的重要因素。</p> <p style=\"text-align: center\"><strong>至诚至真，愿为祖国一块砖</strong></p> <p>　　从事基层公共服务事业是赵云龙很久以前就有的职业想法。几年来丰富的学校社会工作经历带给他许多熏陶和历练，让他对公共服务事业有了深入的理解。他喜欢这种工作状态，沉浸于做成一件事情后的成就感和满足感，并期待用自己的力量去做成更多的事、造福更多的人。&ldquo;人生的意义是&lsquo;过程&rsquo;，人生的价值是在自己的生命过程中做一些有用的事情，对身边的人或可影响的人发挥一些良好的作用。赠人玫瑰，手有余香，有价值的人生是快乐和幸福的基本条件。&rdquo;在采访时，记者从他举止言谈中感受到的是信念、意志和对自己职业选择的义无反顾。</p> <p>　　大学期间，赵云龙走遍了大半个中国，对各地基层情况进行了详尽考察。纷繁复杂的信息中，赵云龙重点关注三类：地方的发展潜力，例如是否有可发展的空间、整体规划如何、经济发展与当地资源的结合情况等；当地的社会矛盾，例如干群关系、上访情况、社会怨气等；当地公务员的生活状态。通过对以上三个方面的评估，他确定了一些初步的意向。</p> <p>　　投身基层公共服务事业的方式有公务员考试、留校挂职、基层选调等，赵云龙选择的是基层选调。在他看来，选调可以让自己更加全面、深入地了解当地经济、政治、文化、社会的方方面面和点点滴滴，促使自己扎下跟，怀着强烈的归属感踏踏实实地从基层一步步做起。另外，他也可以同地方政府详细沟通，找到可以发挥自己专长的最佳岗位。</p> <p>　　选择工作地点不是一个人的事情，而是整个家庭的事情，需要全体家庭成员达成一致。&ldquo;在选择地方单位时，一定要得到家庭的支持，没有条件也要创造条件，&rdquo;赵云龙说，&ldquo;工作和生活需要协调，从事公共服务是一辈子的事情，不容得重新再来&rdquo;。在赵云龙看来，大城市与小城市，北京与地方，各有各的特色，只要家庭内部达成共识，在哪里奋斗都可以过得很幸福。</p> <p>　　最终，赵云龙选择了适合自己的路：通过选调的方式去往成都龙泉驿区做党政后备干部，在公共服务部门奏响自己新的人生乐章。</p> <p>　　谈到职业规划，赵云龙表达了自己对母校深切的感恩。&ldquo;我们的职业选择是偶然和必然共同作用的结果。它融汇了清华精神的引导，就像呼吸的空气和饮用的水一样，无须高调地喊出，却无时无刻不在发挥作用。如果一定要说，我想这就是我们倚重的思想动力和精神依靠吧。清华精神有时候是难以总结成文字的，但她确确实实在我们每个人的身上留有印记，无时无刻不在影响着我们，左右着我们的选择&rdquo;。他认为，&ldquo;立大志，入主流，做骨干&rdquo;的理念是清华送给毕业生的最宝贵的礼物，能为他们未来的职业发展保驾护航。</p> <p style=\"text-align: center\"><strong>无怨无悔，做一名合格的公共服务工作者</strong></p> <p>　　基层公务员是苦涩和诱惑并存的岗位，需要从业者认清自我，多干实事，坚持原则。抵御不良风气需要智慧的头脑。&ldquo;坚持原则，不该办的事情，不该拿的东西，不该说的话都绝对不能做。&rdquo;赵云龙说，&ldquo;但拒绝诱惑的时候，需要一些合理的方法，既让人明白自己的原则，又不伤害感情。不能像钢一样扎过去，而是要结合具体问题具体分析，找出最优解。&rdquo;廉洁方能聚人，律己方能服人，身正方能带人，无私方能感人。</p> <p>　　在赵云龙眼中，公务员这个职业需要更多的理性而非感性，个人魅力可以作为辅助措施因势利导地散发。这位已经正式入职的基层公务员崇拜毛泽东、邓小平、王守仁和张居正这四位思想家。&ldquo;他们四个人都将不同的思想进行融合，将&lsquo;具体问题具体分析&rsquo;做到了极致，而且成功了。&rdquo;赵云龙解释到。公务员也是一个与时俱进的职业。我们的国家处在改革开放民族复兴的关键时刻，走的是一条前人没有走过的路。作为基层公务人员，需要时刻保持学习的动力，持续不断地接收新理念，学习新东西。&ldquo;如果你想学，时间就一定能安排出来，&rdquo;赵云龙说，&ldquo;关键是要控制住自己，做一个不断学习的人。&rdquo;</p> <p>　　树立不断学习、终身学习的理念，前提是要时刻保持一颗谦虚的心，戒骄戒躁，善于发现别人的优点。清华赋予了我们的毕业生顶尖名校的标签，他们习惯了别人的夸赞和肯定，心中难免存有傲气。赵云龙认为，骄傲也许是清华学生最大的劣势。为此，赵云龙也给出了克服缺点的方法，比如学会主动沟通，广泛与人合作；多看同事的优点，帮助其回避缺点；学会赞美人，乐于给出基本的鼓励和肯定等。海纳百川，有容乃大，历史和当今但凡事业成功的，都有一颗宽容大度、虚怀若谷的心灵。在赵云龙看来，这也是清华学子需要特别注重培养的特质。对他自身而言，在校研团与校研会工作的那段时光是化解傲气的关键阶段。&ldquo;研团、研会里有很多优秀的老师和高年级的学长，看到这么多优秀人才的存在，我时刻以人为师，学习他们的优点，发现自己的不足，自然不会那么高傲了。&rdquo;他讲到，&ldquo;另外，在其中从事大量的沟通性工作，自己必须掌握协调重大问题和团队配合的能力。这一工作的重点是让身边的人喜欢你，可以自信，但绝不可高傲。&rdquo;</p> <p>　　关于自己的未来，赵云龙借用清华前辈的话说：&ldquo;清华人，不求做大官，只求做大事。&rdquo;在他看来，一生中能够做好一两件重要的事情，就是成功的，就不愧于苍天、不愧于人民。&ldquo;重要的关头，做出符合自己价值观的决定。如果一生中都能做出正确的抉择，那是一种巨大的成功。&rdquo;赵云龙说，&ldquo;如果迫于一些压力，做出有违道德、有违价值观的事情，就是失败的。&rdquo;</p> <p>　　&ldquo;我一向要求自己&lsquo;干一行，爱一行&rsquo;。既然走上了这条道路，就扎扎实实的做下去，用我的风格，坚守我的原则，然后由时代和大势去大浪淘沙。&rdquo;但行好事，莫问前程，怀着一颗平常心、自信心和忠诚心，赵云龙正在自己钟爱的岗位上执着前行。他说，自己对未来的预期很简单，&ldquo;积极进取，避免功利熏心，积极地工作，幸福地生活，乐观地走完人生&rdquo;。</p> <p>&nbsp;</p> <p style=\"text-align: right\">编辑：襄桦</p></P>     </div>'),(196,'【启航人物】周佳：以青春奉献科研 许未来投身教坛','http://news.tsinghua.edu.cn/publish/news/4205/20130708143756466141470/zhoujia.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【启航人物】周佳：以青春奉献科研 许未来投身教坛</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><span style=\"font-size: 18px\"><strong><span>以青春奉献科研 许未来投身教坛</span></strong></span></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\"><span>&mdash;&mdash;记清华大学工业工程系2013届博士毕业生周佳</span></span></p> <p style=\"text-align: center\"><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">研通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">孟冬雪</span></strong></span></p> <p style=\"text-align: center\"><img alt=\"\" width=\"340\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130708143756466141470/zhoujia.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为周佳。</span></p> <p>　<span style=\"font-size: 14px\">　<span style=\"font-family: 楷体,楷体_GB2312\">周佳，清华大学工业工程系2007级博士研究生，毕业后赴重庆大学任教。曾荣获3次清华大学一等奖学金、1次清华大学三等奖学金、全国首届大学生交通科技大赛二等奖、国家二等奖学金、2次同济大学一等奖学金、1次同济大学二等奖学金、汉高奖学金、大众奖学金、上海市优秀毕业生、上海市高等学校优秀学生等奖项和荣誉。</span></span></p> <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;赴重庆大学做教师&mdash;&mdash;这是周佳渴望已久的职业，那里，是她的家乡，周佳对那里满怀深情。6年的清华直博生涯，她在勤恳奋斗中度过，当科研成果累累的学生时代落下帷幕之际，周佳选择到最需要自己的地方去，继续科研事业，躬身教育实践。</p> <p style=\"text-align: center\"><strong>做科研：我要付出120%的努力</strong></p> <p>　　周佳从同济大学工业工程系毕业后，被保送到清华大学直接攻读博士学位，从事人机交互研究。这个温柔随和的重庆姑娘在学业上十分要强。刚入校的她因为老师的一句话，选修了3门统计学课程，包括数学系的专业课，而成为实验室里让老师刮目相看的&ldquo;统计牛人&rdquo;。</p> <p>　　博士期间，周佳负责或参与负责了8项科研项目，包括主研欧盟第七框架项目2项，主研横向项目2项，参研横向项目4项。她还以第一作者发表论文10篇，以其他作者顺序发表论文5篇；担任过人机交互国际会议（HCII2011、2013）的分会主持，参加过多次国际学术会议。</p> <p>　　周佳曾于美国威斯康星麦迪逊大学工业工程系进行博士生联合培养，在此期间，她独立负责了一项美国教育部残疾与康复研究项目：基于国家可及性架构的通讯工具的通用设计（Easy-One Communication）。节假日里，当其他同学兴致勃勃的游览美国风光，周佳在异国他乡独自担负起了该项目中用户研究、概念模型、实验设计、现场调研、数据分析等工作，甚至在圣诞节，她还会扛着设备到芝加哥的老年公寓，找到没有电脑使用经历的老年人做实验。</p> <p>　　回顾即将结束的学生时代，周佳说自己是一步一步、踏踏实实走出来的。&ldquo;我对我导师的一句话特别有体会，他说做科研要付出120%的努力，要一直不停的积累。尽管付出不一定有回报，但是只有付出才可能有回报。&rdquo;</p> <p style=\"text-align: center\"><strong>当教师：我从小的梦想</strong></p> <p>　　周佳的父母曾是中学教师，在她的记忆里，父母对教师这份收入不高但十分充实的职业有着深厚的感情，直到现在，许多已经毕业20多年的学生还经常邀请他们参加师生聚会。父母的影响让周佳很早就萌生了成为老师的愿望，而她在求学的每个阶段，也总能遇到恩师相助，这加深了她对教师职业的向往。</p> <p>　　来到清华以后，周佳的导师加弗尔&middot;萨文迪（Gavriel Salvendy）教授和副导师饶培伦教授向她提供了学术和科研上的教导与帮助。在了解周佳的想法之后，饶培伦教授有意支持她担任助教，锻炼她上课、管理学生的能力。在担任饶培伦教授&ldquo;人机交互&rdquo;课的助教时，周佳每天要花至少3个小时准备资料、设计实验流程、购买器材，并且在课上用英文向留学生讲解实验方法，同时指导班上十个小组的课程项目。班里德国留学生严谨认真的学习风格曾让周佳印象深刻，他们针对课堂内容或课程项目中每一个细节的深入探讨都对周佳提出了很高的要求。在这个过程中，饶培伦教授会对周佳讲课的方式和管理学生的方法给出详细指导，比如如何着装、如何有技巧的树立威严等。</p> <p>　　&ldquo;我认为刚做老师时，威严更加重要，但可以随着成果、经验的积累逐渐变得亲和。&rdquo;在周佳的心目中，好老师应该是&ldquo;生活上随和、学术上严格&rdquo;的老师。&ldquo;我希望自己以后不仅能建立好的教学方法，还能多给学生提供人生建议，减少他们碰壁的次数。&rdquo;</p> <p style=\"text-align: center\"><strong>去重庆：我不是没有过纠结</strong></p> <p>　　&nbsp;人机交互研究是一个较为年轻、处在前沿地位的研究方向，周佳的许多师哥师姐都在微软、IBM等大型外企找到了薪水优厚的工作，留在了北京。除了重庆大学，周佳还收到了同济大学、浙江大学和西安交通大学的邀请。她坦言自己不是没有纠结过：她向往名校提供的宽广平台，为大城市集结的优质资源而动心，可是自己能否在这样的平台上得到重视、顺利地进行自己想做的研究，是她更在意的事。</p> <p>　　&ldquo;重庆大学工程系虽然建系久，但在人机交互方向完全空白，一个人都没有，这里需要人才&rdquo;，周佳如是说。在上海、北京绕了一大圈之后，周佳还是回到了最需要她的地方。从清华到重大，从学生到教师，周佳把青春献给了科研，把未来献给了教育事业。</p> <p style=\"text-align: right\">　　编辑：范 丽</p></P>     </div>'),(197,'【启航人物】周源：为了心中的那颗明珠','http://news.tsinghua.edu.cn/publish/news/4205/20130708135514154331752/112.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【启航人物】周源：为了心中的那颗明珠</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">为了心中的那颗明珠</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&mdash;&mdash;记清华大学数学科学系2013届博士毕业生周源</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">研通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">胥泽霞</span></strong></p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130708135514154331752/112.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为周源。</span></p> <p>　　<span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">周源，1986年9月出生于新疆维吾尔自治区奎屯市，中共党员，2013届清华大学数学科学系博士毕业生。周源于2003年8月考入清华大学数学科学系，并获得新生入学二等奖学金。自2009年起，周源多年担任数学系本科生思想政治辅导员、心理辅导员等职务，并在学校就业中心担任辅导员，2010年荣获&ldquo;一二&middot;九&rdquo;辅导员奖，2012年荣获林枫辅导员奖。在学业上，周源严格要求自己，已有一篇论文收录于国际学术期刊（第二作者）。2013年，周源签约新疆乌鲁木齐经济技术开发区，今年夏天将开始他的职业生涯。</span></span></p> <p>　　&ldquo;六日仿佛隔世</p> <p>　　好心人太多，来不及感谢</p> <p>　　只有将感动融在心里，此生铭记</p> <p>　　然而静下心来沉淀时，又热血奋发！</p> <p>　　因为这些可爱的人，怎能不去疯狂的奋斗？&rdquo;</p> <p>　　周源为人低调，上面的话语是他最近的一条校内状态。或许，这句话早已被无数的状态更新，消失在青年人喧哗的圈子里。但是，有的东西，光芒永远不会逝去。在周源心里，家乡永远是那颗闪光的明珠，&ldquo;清华给了我足够一生去回味的财富。我想携带这份财富回到我的家乡&mdash;&mdash;新疆。她现在迎来了历史最好的发展机遇期，我希望去支援她，让她在和谐的环境中变得更加美丽、富饶。&rdquo;</p> <p>　　寻着心中的这份光芒，今年夏天，周源将开启一份全新的征途&mdash;&mdash;奔赴新疆乌鲁木齐经济技术开发区，服务于基层公共部门。</p> <p style=\"text-align: center\"><strong>&ldquo;天时、地利、人和的选择&rdquo;</strong></p> <p>　　暑期，周源会经常离开北京，到外地做些社会实践，四川、浙江、江苏、福建等省，都留下过他的足印。美丽富饶的地方，不免令人流连。但说起自己的职业选择，周源却没有一丝彷徨：&ldquo;我是来自新疆的生源。我的选择是一个集天时、地利、人和的选择。&rdquo;</p> <p>　　近些年来，借力国家政策的扶持，新疆地方经济取得突飞猛进的发展。2012年，新疆全年生产总值（GDP）同比增长12%，高于全国4.2个百分点。谈到自己的故乡奎屯市，周源骄傲的说，这个新型现代化城市是首批90个国家智慧城市试点城市之一。而自己将投身服务的新疆乌鲁木齐经济技术开发区，也正在加速向千亿工业产值园区迈进。用周源的话就是：&ldquo;自己瞄准了家乡经济发展的好势头。&rdquo;</p> <p>　　从北京到乌鲁木齐，乘飞机最快需要4个小时。一头，是满怀希望的父母；另一头，则是依依不舍的朋友。最舍不得周源离开的，或许是他朝夕相处的女友。&ldquo;我的女朋友很早就知道了我的职业选择。不管是准备材料，还是填写表格，她一直都在默默地支持我&rdquo;。为了两人的感情最终开花结果，周源已经开始为即将毕业的女朋友进行职业规划。再聚首，将是天山脚下。</p> <p style=\"text-align: center\"><strong>辅导员的经历对自己影响最大</strong></p> <p>　　在毕业答辩的时候，周源发自肺腑地陈述，&ldquo;我很幸运，自己能进入中国最好的大学学习。更幸运的是，我能到中国最好的大学生就业辅导中心做辅导员。&rdquo;</p> <p>　　从研二开始，周源就一直在清华大学就业辅导中心做兼职辅导员，数学系本科生思想政治和心理辅导员。平时，周源会和同学们掏心地聊天，帮他们排解内心郁结的情绪。&ldquo;我很享受这个过程，这是件有意义的事情，&rdquo;周源说。在帮助别人的同时，他也在虚心向身边的老师学习，&ldquo;就业辅导中心的每位老师都是值得我学习的。他们工作非常有效，都能够独当一面。&rdquo;在这些工作的同时，周源会定期参加系里的学术讨论班，合理安排学习与工作的时间。在周源看来，社会工作不是做不好学术的借口。2012年，周源获得林枫辅导员奖，这是对清华学生工作者的最高荣誉和奖项。</p> <p>　　周源很感谢这段在就业辅导中心工作的经历，正是在这段工作的岁月里，他更加明确了自己的就业方向。在一次剪辑视频的工作过程中，周源遇到了镜头里的他们：一个个奔赴祖国基层，投身西部地区的清华学子，在满怀激情地为实现自己的理想而奋斗！周源被他们奋斗的激情深深感染。而寻梦的开始，往往在梦想被激发的这一刻。</p> <p style=\"text-align: center\"><strong>&ldquo;若说舍不得,真正舍不得的是已成为生活一部分的那些东西&rdquo;</strong></p> <p>　　离开北京，令周源舍不得的，&ldquo;是这里的网速，食堂，还有包邮。那些已经成为生活一部分的东西&rdquo;。</p> <p>　　周源的生活比较规律，一直忙碌在学习和工作这条线上。一次偶然的机会，他邂逅了清华学堂艺术展演的巨幅海报，令他大有相见恨晚的感慨。以后，每次新清华学堂的活动，周源几乎都要参加。最令他怀念的还是去年墨西哥州立交响乐团带来的新年音乐会。在这次新年音乐会上，皮亚佐拉的《遗忘》深深的感染了台下静静聆听的观众。一曲未毕，座位上的周源竟已感动的几乎落泪。</p> <p>　　&ldquo;以后就很少能看到这些艺术表演了，但或许自己会经常去看电影&rdquo;，周源笑着说。对于以后在新疆的生活，周源很乐观，&ldquo;失去了一些东西，才会有机会做得更多。&rdquo;</p> <p style=\"text-align: center\"><strong>摆正自己的位置，做好肩负的工作</strong></p> <p>　　每一颗静静闪烁的星子，总会发出无比耀眼的光芒。周源是个低调的人，他很少谈论梦想或宏大的规划。说到未来的工作，周源最担心是，别人过多关注自己&ldquo;头上的光环&rdquo;。他只希望成为一位踏实工作的地方公务员。</p> <p>　　周源曾经在江苏省昆山市挂职锻炼过。那个城市给他留下的最深刻的印象就是，&ldquo;政府工作人员会把自己的位置摆的特别正，很清楚自己应该做的事情&rdquo;。行动中的齿轮是互相影响的，只有所有的齿轮都摆正位置，整个机器才会啮合的更加紧密，产生更强大的力量。对于未来工作中可能的挑战，周源给自己提出的要求就是&ldquo;隐忍&rdquo;&mdash;&mdash;耐得住寂寞，忍得了困苦。&ldquo;我不会轻易说算了，拍拍屁股走人。答应了的事情，就要做的让自己满意&rdquo;。</p> <p>　　到基层去，到西部去，有人视之为跳板，有人视之为无奈之举。而有的人，则是怀揣着青春的热血与奋斗的激情，向着心中那颗熠熠生辉的明珠前进。7月初，美丽的天山脚下，周源将开启他全新的人生旅途！</p> <p style=\"text-align: right\">&nbsp;编辑：范 丽</p></P>     </div>'),(198,'【人物】王补宣：“热力”不减的九旬老党员','http://news.tsinghua.edu.cn/publish/news/4205/20130708110542810289141/wangbuxuan(1).jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】王补宣：“热力”不减的九旬老党员</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">&ldquo;热力&rdquo;不减的九旬老党员</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&mdash;&mdash;记热能系教授、&ldquo;清华大学优秀共产党员&rdquo;王补宣院士</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">程 曦 </span></strong></p> <p style=\"text-align: center\">&nbsp;<span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"340\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130708110542810289141/wangbuxuan(1).jpg\" /></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为王补宣。</span></p> <p><span style=\"font-family: 楷体,楷体_GB2312\">　　我没想到学校会给我这样的荣誉。我没有作出什么了不起的贡献，只不过是按照入党时的诺言，尽我的一份力量做好岗位工作，保证我接触的群众能够对党带领我们所走的路怀有信心。这是一个普通党员最起码的职责。</span></p> <p style=\"text-align: right\"><span style=\"font-family: 楷体,楷体_GB2312\">&mdash;&mdash;</span><strong><span style=\"font-family: 楷体,楷体_GB2312\">王补宣</span></strong></p> <p>　　<span style=\"font-family: 楷体,楷体_GB2312\">王补宣，热能工程系教授，中国科学院院士。1922年2月出生，江苏无锡人。我国著名的热工教育家，工程热物理学界的开拓者和学术带头人之一。作为学术领导人和组织者，参与国家有关科技发展规划的制定与实施，所主持的多项科研成果获国家级和部委级奖励。已发表学术论文400余篇，专著或教材10部，编辑出版国际学术会议论文集7部，SCI论文他人引用近2000次。他主持的科研项目曾多次获得国家级和省部级奖励，他个人曾获何梁何利基金科学与技术进步奖、亚洲热物性会议终身成就奖、美国普渡大学杰出校友奖等荣誉。2013年6月被评为&ldquo;清华大学优秀共产党员&rdquo;。</span></p> <p>　　91岁的王补宣院士曾获得过无数荣誉，&ldquo;清华大学优秀共产党员&rdquo;是最近的一个，也是特殊的一个。这不是学术称号，而是从基层支部到学校，清华党员同志们对他坚守理想、堪为楷模的一生的褒奖和敬仰。</p> <p>　　在这个时候，王补宣想起了57年前刘仙洲先生的教诲。作为解放后最早入党的知名老教授，刘仙洲在1956年专门找到时任机械系副教授的王补宣，希望他争取加入中国共产党。王补宣告诉刘仙洲，1949年他放弃攻读博士学位的机会从美国普渡大学回国，就是愿意跟党走的，但他还是想专心在学术上做点工作。刘仙洲马上回答：&ldquo;你应该努力！为学术做工作好像没有国界、派别之分，但是为谁服务、追求怎样的制度，这是有差别的。&rdquo;</p> <p>　　&ldquo;我告诉刘先生，我记住了，一定努力。&rdquo;从那时起，王补宣就把加入中国共产党作为自己毕生的追求。1989年4月，王补宣终于光荣入党。如今又过去了24年，91岁的王补宣依然在自己的岗位上为践行入党誓言孜孜不倦地前行。</p> <p style=\"text-align: center\"><strong>万变不离其宗的&ldquo;万金油&rdquo;</strong></p> <p>　　在西南联大，胸怀&ldquo;工业救国&rdquo;志向的王补宣选择就读机械系。在普渡大学留学时，导师安排他主修热力学和传热学，王补宣由此走入&ldquo;热&rdquo;的世界。在新中国高等教育事业和工业发展探索前行的过程中，王补宣承担了多个不同的&ldquo;工种&rdquo;&mdash;&mdash;从北大回到清华，从动力机械系到化工系、电力工程系再到后来组建的热能工程系，几十年时间里王补宣还跟工程数学力学系、电机系、环境系、材料系甚至土木系等院系都有过密切的工作联系，有人开玩笑地说他是&ldquo;百搭&rdquo;的&ldquo;万金油&rdquo;。但是仔细审视他这份看似错综复杂的简历，有两个共同点始终贯穿其中：都和&ldquo;热&rdquo;有关系，都为国家教育和相关产业的需求作出了贡献。</p> <p>　　上世纪50年代，王补宣出版了新中国第一本《工程热力学》教科书，翻译了国内传热学方面的启蒙书&mdash;&mdash;前苏联米海耶夫院士的《传热学基础》，并创建了清华大学热工学教研组。在参与国家十二年长期科学规划、筹建&ldquo;工业热工&rdquo;专业的过程中，王补宣考虑到国家经济建设需要和清华没有理科的实际情况，萌生了在国内创办工理结合的工程热物理专业的想法，以此强化物理热学基础，培养创新热工研究的高层次人才。在学校的大力支持下，王补宣带领教研组培养出基础扎实、科研探索潜力大的国内首批热物理专业学生，1960年一毕业就深受欢迎。</p> <p>　　在化工领域，1963年王补宣带领热工学教研组承担了四川化工厂氨合成塔的技术改造项目，面对苏联撤走专家、所有设计图纸和说明书亦付阙如的困境，他们用3年时间创造了单塔日产量翻番的成绩，被国务院列入当时的100项重大成果之一，达到世界先进水平。</p> <p>　　文革中，为筹建&ldquo;化工设备&rdquo;专业，王补宣在不到两年时间里跑遍了北京市郊所有的化工厂。在那段风雨如晦的岁月里，他每次下厂都坚持仔细记下自己观察到的问题和解决方法，这样的工作日记攒了十几本，后来的《工程传热传质学》教材和很多科研课题都由此而来。王补宣的长子、化学系原副系主任王如骥印象最深的，就是父亲这种任何时候都不放弃追求知识的精神。</p> <p>　　&ldquo;因为这段经历，我做过各个领域中热物性的问题，所以视野相对广一些。这也是党对我的培养和教育。所以跟年轻教师谈心时我总说，机会到处都有，就看你抓不抓得住。我这个&lsquo;万金油&rsquo;里面有共同的点，就是都没有脱离热工。&rdquo;王补宣总结说。</p> <p style=\"text-align: center\"><strong>倾心育才的&ldquo;人师&rdquo;</strong></p> <p>　　每一位王补宣的学生，都会满怀深情地回忆起老师在自己论文上细密的批注。王补宣当年的学生、建筑学院江亿院士这样描述恩师带给自己最初的感动：&ldquo;当时我还是拿笔写的头一篇物理性质测量的文章，王先生每一页都写满了批示，从公式的符号，到什么样的表示方法，直到文字、标点符号，让我学会了到底该怎样做学问，怎样写文章，这样把我一步一步地带入学术界。后来，在我带的第一个研究生论文评审、博士论文答辩时王先生都亲自出席，这些事令我永远难忘。&rdquo;</p> <p>　　为了培养人才，王补宣倾注了非同一般的心力。进入耄耋之年的他担心自己不能全程指导研究生完成学业，给他们带来不便，所以本打算2002年后不再亲自招收新的研究生，只是坚持参加工程热物理研究所所有研究生的论文答辩，尽可能对学生给予指导和帮助。但是2009年暑期，博士毕业留校工作的学生彭晓峰教授遽然辞世，王补宣想到的第一件事就是他留下的学生怎么办？王补宣主动承担了5名博士生的指导工作，其中还包括两位学业上存在一定困难的学生。王补宣想了很多办法对他们进行启发指导，每周一次听取学生的汇报交流，直到2012年最后一名学生顺利如期毕业。博士生赵俊杰还获得校级优秀博士论文奖和&ldquo;教育部学术新人&rdquo;称号。</p> <p>　　高屋建瓴引导学术方向，一丝不苟修正文本细节，王补宣传递给学生的，还远不止这些。热能系李俊明教授回忆说，从他留校工作的第一天起，王补宣就告诉他要学会独立做事。王补宣会仔细帮他们修改各种申请报告和论文文本，但从来不会利用自己的学术地位为学生争取任何资源或名分。&ldquo;或许有人会说，王先生是一个&lsquo;不太合时宜&rsquo;的人。但他是一个地道的学者，我们都很佩服他。怎么做学问，怎么做人，王先生确实给我们作出了很好的榜样。&rdquo;李俊明敬佩地说。</p> <p style=\"text-align: center\"><strong>历久弥新的信念与追求</strong></p> <p>　　王补宣是资深院士，也是一位相对&ldquo;年轻&rdquo;的党员。他把党龄和学术经历&ldquo;分得很清&rdquo;，认为自己入党比较晚，就应该好好学习。重要的支部活动，王补宣从不缺席。他的学生李俊明从1996年博士后出站留校后开始担任工程热物理研究所党支部书记，每次看望老师，王补宣聊得最多的就是两件事：一是学术课题，再就是党和国家的重要方针和理论成果。</p> <p>　　&ldquo;王先生在家中订阅了很多报刊，同时结合亲身经历和体会，学习心得往往比我们更超前、更深刻。&rdquo;李俊明举例说，虽然在文革中也曾受到一些冲击，但王补宣很早就跟支部同志们说，党的本质和核心理念是一脉相承的，应该用连续、正确的眼光评价党90多年的发展历史，不能对某一阶段割裂地加以否定。这与最近习近平总书记明确指出的&ldquo;不能用改革开放后的历史时期否定改革开放前的历史时期，也不能用改革开放前的历史时期否定改革开放后的历史时期&rdquo;的精神是完全相符的。</p> <p>　　从弦歌不辍的西南联大到新中国成立前夕首批踏上归国的邮轮，再到几十年来创造性地完成党和国家赋予的每一项使命，王补宣&ldquo;跟着党走&rdquo;的朴素愿望一步步在实践中得到印证，又在思索中得到升华。&ldquo;我们读书时是要救亡图存，现在我们已经成为世界第二大经济体，这是过去想都不敢想的。不管其中经历过怎样的坎坷，我们应该懂得，中国需要共产党作为领导我们事业的核心力量，需要大家的集体智慧。前进路上总会遇到问题，这是社会从不平衡走向新的平衡过程中积累的问题，只有通过发展来解决。&rdquo;王补宣坚定地说。</p> <p>　　所以他在报纸、杂志中，总能发现世界各个角落与&ldquo;热&rdquo;和能源有关的问题，并且不断思考应该怎样加以解决。他在年近九旬时还亲笔撰写了探索因材施教、启发创新的《工程热力学》新教材，几易其稿。每天深夜家人入睡时，谁也不知道王补宣房里的那盏灯，是什么时候停下来休息的&hellip;&hellip;</p> <p style=\"text-align: left\"><span style=\"font-family: 楷体,楷体_GB2312\">　　来源：新清华&nbsp;&nbsp;2013-07-05</span></p></P>     </div>'),(199,'【启航人物】王忠强：此生屋檐尽荒草，唯思报国解民忧','http://news.tsinghua.edu.cn/publish/news/4205/20130701164332981760211/wang.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【启航人物】王忠强：此生屋檐尽荒草，唯思报国解民忧</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">此生屋檐尽荒草，唯思报国解民忧</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&mdash;&mdash;记清华法学院2013届硕士毕业生王忠强</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">研通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">张鄂</span></strong></p> <p style=\"text-align: center\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"340\" height=\"469\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130701164332981760211/wang.jpg\" /></span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为王忠强。</span></p> <p style=\"text-align: left\">　　<span style=\"font-family: 楷体,楷体_GB2312\">王忠强，吉林长春人，中共党员。清华大学法学院2010级硕士研究生，毕业后即将赴宁夏回族自治区乡镇工作。在清华大学期间曾担任首届清华大学学生基层公共部门发展研究会会长、博士生实践服务团常务副团长、清华大学深圳研究生院社联主席等职。曾获香港清华大学法律之友奖学金、清华大学深圳研究生院&ldquo;学术新秀&rdquo;奖、清华大学社会工作二等奖学金、环境保护部&ldquo;青年环境使者&ldquo;、长春市十佳大学生、长春市自强之星、北京市优秀毕业生等奖项和荣誉。</span></p> <p>　　&ldquo;天贤一人，以解众人之困，非己之贤也；天富一人，以济众人之贫，非己之富也。我想在当下，中国的问题在基层，改革的要点在基层，解决的办法也在基层。作为有担当的清华学子，我们应该选择去基层。&rdquo;这是2012年10月11日王忠强在清华大学学生基层公共部门发展研究会（以下简称基层研究会）成立大会上讲的一段话。如今，他即将奔赴宁夏回族自治区乡镇工作，开始践行自己&ldquo;此生屋檐尽荒草，唯思报国解民忧&rdquo;的庄严承诺。</p> <p style=\"text-align: center\"><strong>学在清华，愈益坚定家国情怀</strong></p> <p>　　在吉林大学读本科的时候，王忠强学习成绩便十分优异，科研能力突出，曾以专业第一的成绩先后获得过国家奖学金、宝钢奖学金等10余项奖学金，先后承担过4个国家级及校级科研项目，出版过图书22册。由于科研成绩优异，先后荣获过吉林大学学术之星、吉林大学学术之星等荣誉。</p> <p>　　本科从吉林大学毕业后，王忠强被免试推荐到清华。入学前，王忠强在清华附近住了一个月。&ldquo;当时就觉得清华的校训特别吸引我，既要刚毅坚卓、奋发图强，又要增厚美德、容载万物&rdquo;。</p> <p>　　在研究生入学教育的时候，清华大学原党委书记方惠坚讲的两句话，&ldquo;知识是有责任属性的&rdquo;，&ldquo;清华人是一定要思考国家未来的&rdquo;，王忠强深镂于心，他也特别喜欢清华校歌里的一句&ldquo;器识其先，文艺其从&rdquo;，他说：&ldquo;这让我更加懂得了理想、视野与知识、能力、的先后关系。&rdquo;</p> <p>　　在清华学习期间，王忠强也非常注重学习科研，他曾荣获过深圳研究生院法学院中的唯一一个&ldquo;学术新秀&rdquo;奖。王忠强的毕业论文方向是国际经济法，硕士论文开题的题目是《中朝共同开发和共同管理罗先经贸区的法律问题研究》。他深感清华治学严谨，鉴于各种原因，论文撰写过程中，朝鲜方面的资料收集工作非常困难，当时王忠强为了更加深入的了解中朝罗先经贸区，专门办理了护照，第一次走出国门就变成了到朝鲜实地考察国际经济法问题。论文撰写过程中，他更是主动走了一步险棋，向导师要求更换毕业论文角度和方向。最后答辩时，他的论文终稿只用了原版中一个300多字的案例。&ldquo;清华确实是&lsquo;追求完美&rsquo;的&rdquo;，他感慨到，&ldquo;而且在追求完美的过程中，又提倡&lsquo;又红又专&rsquo;，提倡&lsquo;双肩挑&rsquo;，全面提高我们的综合素质，这在全国高校中都非常少见。&rdquo;</p> <p>　　2012年10月11日是个特别的日子，这一天是王忠强和其他同学共同发起的基层研究会成立的日子。志同道合的同学们汇聚于此，他始终相信&ldquo;梦想团队&rdquo;的概念，和同样坚守&ldquo;此生屋檐尽荒草，唯思报国解民忧&rdquo;信念的同学们一起，志在基层，研究基层，改变基层。也正是在这天的发言中，他斗志昂扬的呼吁&ldquo;我一定要去基层，我一定要去研究基层&rdquo;。</p> <p>　　&ldquo;我们基层研究会有400多位同学，今年去基层工作的清华毕业生的有一半左右，在清华我寻找到了这么一个团队，她让我的家国情怀愈益浓烈。&rdquo;王忠强坚定地说到。</p> <p style=\"text-align: center\"><strong>走遍中国，切身体会基层民情</strong></p> <p>　　临近毕业，王忠强刚整理完自己的毕业纪念册&mdash;&mdash;《走在中国&mdash;&mdash;我在大学的中国梦》。</p> <p>　　从2006年到现在，王忠强用7年的时间家教赚的钱，和签约吉林省出版集团一个出版项目的资金以及清华大学博士生实践服务团提供的机会，他去过了除台湾以外的所有省级行政地区。</p> <p>　　在接受采访的时候，他告诉记者，&ldquo;想扎根基层、服务祖国，不走走中国是不行的。我已经办完了入台手续，在大学期间走遍中国的夙愿马上会实现的。这也算是我大学时代的中国梦。我是一个拥有强烈爱国主义情怀的人，出生于基层，我便更了解基层的痛楚，我愿意为基层的人民群众服务，用一生的心血为国家和民族工作。我想未来一定会有一天，我会再写一本人生纪念册，名字就叫《服务中国》&rdquo;。</p> <p>　　在他的&ldquo;足迹表格&rdquo;上显示着，王忠强去过了89个地级市，120多个县，200多个镇；去过了约100所大学，50多个博物馆或纪念馆。</p> <p>　　&ldquo;在我去过的地方，我都会去当地的博物馆、大学和农村走走，去博物馆会了解当地的历史传承以及发展的优势，去大学会了解到当地的人才储备及智力资源，去农村会更真切地思考当地发展的关节和可能。&rdquo;王忠强说到。</p> <p>　　在大学的7年间，王忠强没有一个假期是闲着的。短期的假期他会去距离近的地方如河北、天津，而长的假期则基本上是带队实践，在研究生的三年间，他一共带队实践11次，这让他更加了解基层政府的工作状况。</p> <p>　　&ldquo;在飞机上赶着上课，在火车上做作业，在公汽上看市容市貌，在出租车上拍照，有过被偷也有过被助，有过欣喜也有过担忧，有过幸运也有过倒霉&hellip;&hellip;&rdquo;王忠强回忆到。</p> <p>　　在他的笔记中看到，&ldquo;2010年10月1日，从长沙前往深圳的这列车，有无数的打工者，这是个没遇到节假日的时间，但我挤在去往深圳的车上，软卧、硬卧、软座、硬座，包括餐厅和厕所，都满满的挤着南下的人们。无奈，我后来只能以火车过道为铺而眠，有人重复的从我身上迈过，也有人重复的将我叫醒&rdquo;。笔记上工整的字迹记载了他到过地方的感受体悟。</p> <p>　　7年的课外时间，王忠强以自己的方式行走在中国大地上，亲身感受和思考着这片土地的变化。如他所说，&ldquo;明末画家董其昌讲&lsquo;读万卷书，行万里路，胸中脱去尘浊，自然丘壑内营，立成鄄鄂&rsquo;，我想附上一句&lsquo;行万里路，得万民情，心中徐增真知，自然繁衰可辨，以咨明日&rsquo;&rdquo;。</p> <p style=\"text-align: center\"><strong>服务基层，无愧于清华、无愧于青春、无愧于祖国</strong></p> <p>　　硕士一年级下学期，王忠强便决定要去基层、去艰苦地区，时至今日他从未做过求职简历。在今年的毕业选择中，他结合了地方需求、个人特点和专业情况，最终选择了宁夏回族自治区乡镇工作，这算是他毕业前的第一份工作也是最后一份工作。</p> <p>　　王忠强的成长经历深深的影响着他如今的选择。他来自偏远农村，曾是贫困生，父母在浙江打工近十年，这期间由于家庭贫困，他有四年的春节都没和父母一起过。</p> <p>　　接受过社会资助的他也努力着把这份关爱传承下去，作为长春市慈善志愿者，3年资助过3名贫困高中生4000多元人民币。曾作为大学生反哺社会的典型，接受央视《今日观察》栏目的采访。</p> <p>　　&ldquo;我的成长经历让我对基层怀有深深的感情，我理解了什么是农工；我理解了什么是空穴老人；我理解了农业税的改革为什么让那么多的人欢天喜地；我理解了农村合作医疗难以跨省带来的痛苦；我理解了沿海和内陆的差距；我更深切的理解中国的问题在基层，改革的要点在基层，解决的办法也在基层&rdquo;。王忠强动情的说着。</p> <p>　　谈起未来的人生，他说，上大学接受社会资助的时候，就在反思到底什么样的人生是自己想要的，后来写下了这几句话：</p> <p>　　人生在世，数十年而逝。无愧于父母，孝养其终；无愧于梦想，业有所成；无愧于国家，鞠躬尽瘁；无愧于生命，爱于乾坤。</p> <p>　　谈起目前的规划，他说自己没有认为过到基层工作需要规划。反过来，他觉得现在需要做的就是去认真的了解基层，观察基层，研究基层，在具体岗位上倾心倾力推动当地经济社会的发展。没有规划但有要求，要求就是坚持个人修养不变质，坚持个人奋斗不松懈，坚持对梦想的追求不放弃，从容面对苦难和劳碌，不断修学储能，真正服务基层，无愧于清华，无愧于青春，无愧于祖国。</p> <p style=\"text-align: right\">　　编辑：范 丽</p></P>     </div>'),(200,'【人物】杨帆：用梦想书写未来 我的生命不一样','http://news.tsinghua.edu.cn/publish/news/4205/20130626144127286655066/1.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】杨帆：用梦想书写未来 我的生命不一样</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">用梦想书写未来 我的生命不一样</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&mdash;&mdash;&mdash;记清华大学航天航空学院博士生杨帆</span></p> <p style=\"text-align: center\">&nbsp;<span style=\"font-family: 楷体,楷体_GB2312\">记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">赵姝婧</span></strong></p> <p>　　<span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">我记得电影《阿甘正传》里，阿甘的母亲曾经说过：&ldquo;Death is just a part of life.Something we all destined to do&rdquo;。这句话给我的感触很深。我不知道我还能走多远，但是活着的每一天，我都会努力去追逐自己的梦想，用辛勤的汗水焕发生命的光彩，以知识与智慧折射生命之光的璀璨！</span></span></p> <p style=\"text-align: right\"><span style=\"font-family: 楷体,楷体_GB2312\">&mdash;&mdash;</span><strong><span style=\"font-family: 楷体,楷体_GB2312\">杨帆</span></strong></p> <p style=\"text-align: center\">&nbsp;<img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130626144127286655066/1.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为杨帆。</span></p> <p>　<span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　杨帆，</span><span style=\"font-family: 楷体,楷体_GB2312\">清华大学航天航空学院2010级博士生，中共党员。先后获清华大学&ldquo;学术新秀&rdquo;特别奖、清华大学优秀研究生、清华大学研究生特等奖学金、清华大学学生&ldquo;自强之星&rdquo;特别奖、研究生国家奖学金、&ldquo;中国大学生自强之星标兵&rdquo;、第二十四届 &ldquo;北京市五四青年奖章&rdquo;等奖项。近期被评为&ldquo;2012中国大学生年度人物&rdquo;。</span></span></p> <p>&nbsp;　　2008年5月22日，清华大学航天航空学院博士生杨帆结束了长达7个小时的开颅手术。术后刚恢复意识，她忽然说了一句：&ldquo;我觉得我们那个分形图案吧，圆里面可以套一个三角。&rdquo;旁边的母亲吓了一跳，她自己也吓了一跳。</p> <p>　　就在硕士学位论文答辩前的第7天，偶感不适的杨帆被医生告知患有脑肿瘤，这一突如其来的诊断结果打乱了她的人生轨迹。术后大夫告诉杨帆，她余下的生命可能只有两年了。</p> <p>　　谁也没有想到，五年后，这位勇敢乐观的女孩能够继续在清华园里坚持她的学术理想，心存感恩，笑容温暖。截至目前，杨帆已公开发表19篇科研论文，远远超过了学校对博士生发表文章的要求，科研步伐稳扎稳打，研究成果十分出色。今年5月4日，杨帆作为&ldquo;2012中国大学生年度人物&rdquo;，在参加&ldquo;实现中国梦，青春勇担当&rdquo;主题团日活动中受到了习近平总书记的接见。</p> <p>　　&ldquo;现在的我跟其他的同学没有任何区别。我们都在做着自己喜欢的事情，一步步向着心中的理想靠近。人的生命不在于长短，而在于是否绚丽多彩，对社会有所贡献。&rdquo;杨帆说。</p> <p style=\"text-align: center\"><strong>跟病魔赛跑的日子</strong></p> <p>　　杨帆在北大读本科三年级时，就对清华航天航空学院教授殷雅俊的研究领域产生了浓厚兴趣。有一天，她鼓起勇气给殷雅俊发了一封邮件，表明了自己的科研理想。&ldquo;殷老师立即回复了我，给了我很大鼓励，并告诉我可以先到他的实验室了解体验。这完全出乎我的意料，我高兴极了！&rdquo;随着交流的深入，殷雅俊逐渐发现了杨帆出色的科研&ldquo;灵气&rdquo;和&ldquo;悟性&rdquo;，当得知杨帆已在北大获得力学和数学双学位，同时又精通古筝和音乐，有一定的艺术功底，师生两人&ldquo;一拍即合&rdquo;。</p> <p>　　2006年，杨帆凭借优异的成绩从北大保送到清华航天航空学院攻读硕士学位，参与超级碳纳米管力学和超级分形纤维的几何与力学研究，在很短的时间内就取得了多项进展。2008年2月，杨帆顺利拿到了加州理工学院的全额奖学金。她对未来充满了期待。</p> <p>　　可就从2008年5月初的某一天开始，杨帆突然感到头痛，&ldquo;一开始我以为受了风寒，就没在意，但是越来越疼，就像把一个大磨盘压在了头上，实在难以忍受。&rdquo;5月14日，杨帆去校医院进行了检查，随后被诊断出患有脑肿瘤。手术后大夫告诉她，如果病情控制不好，她剩下的时间可能只有两年左右了。</p> <p>　　&ldquo;有时候，医学上对一些东西是很保守的，它会告诉你一个最坏的情况，而不是唯一的情况。&rdquo;说到这里，杨帆笑着紧紧握了一下她眼前的水杯。</p> <p>　　手术后杨帆整整昏迷了三天，她的头部产生了水肿，比正常时足足大了一倍，只有断断续续的短暂性意识。&ldquo;昏迷中，我突然感觉有一张图出现在我眼前，很像当时我做科研的一个思路，所以就赶紧说了出来。那一刻，我觉得自己正在跟病魔赛跑呢。&rdquo;</p> <p>　　即使处在生死边缘，杨帆依旧放不下她的学术理想，也许正是凭借这份坚持和执着，让她获得了新生。</p> <p style=\"text-align: center\"><strong>科学真理令我着迷</strong></p> <p>　　手术后，杨帆共进行了6周放疗与化疗。由于病情严重，当时的用量已经达到了人体极限。杨帆一点都不畏惧，再大的痛苦也都坚强地挺了过来。</p> <p>　　令人没有想到的是，住院后的第13天，杨帆主动提出出院。回忆起那段日子，她没有提一句与病痛有关的话语，而是仅仅用&ldquo;耗&rdquo;这个字去形容那段&ldquo;单调&rdquo;的日子。&ldquo;我在病房里什么事情也做不了，我是一个年轻人，非常不习惯那种生活。也许回到外面的世界，我会好得更快。&rdquo;</p> <p>　　出院那天杨帆依旧非常虚弱，父亲把她一步步背上五楼，回到了家。那些天杨帆夜夜出虚汗，浑身湿透，由于术后无法低头，她只能直立着身子看书，看一会儿又是一身虚汗。</p> <p>　　&ldquo;手术后我有一个愿望，就是能够继续做我的科研。我把这个想法告诉了我的导师，殷老师几次都快流泪了，但他最终还是答应了我。&rdquo;杨帆眼里再次闪过了泪花。</p> <p>　　就这样，坚强的杨帆从2008年7月底放化疗结束之后，又开始了她的科研之路。连同做手术的时间加起来，脚步仅仅停下了两个月。</p> <p>　　&ldquo;谁也不知道将来会怎样，自己的寿命，科研的成果，什么都不知道，不可预知。所以我唯一要做的就是大胆往前走吧！&rdquo;杨帆露出一个灿烂的微笑。</p> <p>　　因为深爱，所以坚持。从出院后不久开始，杨帆每周都来学校与导师讨论学术问题，每个星期讨论两次，除了春节从不间断。这个习惯一直保持到现在。</p> <p>　　殷雅俊多次诚恳地对杨帆说：&ldquo;你就是一个正常人，要有足够的勇气，不要有其他的想法和负担。要保持静到极致的心境，去追逐永恒不变的科学真理，体会本质的东西。因为你发现的每一个真理，都会推动科学进步的脚步，使你的生命变成永恒。&rdquo;</p> <p>　　稍加留心便可发现，杨帆大部分的研究成果都是在生病之后产生的，如今她已有19篇论文公开发表，最高影响因子达到8.479。博士期间的几篇文章也已完成，接下来还将有新成果产生。</p> <p>　　这一令人感慨不已的事实在杨帆看来却是非常自然：&ldquo;因为生病前我正在读硕士，那两三年正是打基础的阶段。如今经过多年量的积累，已经逐渐到了开花结果的时候，产生了质的转变。其实研究过程中最吸引我的是每发现一个科学真理后所带来的惊心动魄的感觉，以及它无法言说的迷人魅力。&rdquo;</p> <p style=\"text-align: center\"><strong>用坚强面对未来</strong></p> <p>　　当很多孩子还在嬉笑玩闹的时候，从小受父母影响的杨帆已经开始学习古筝了。从四岁开始，她便把古筝当成了自己生命的一部分，每当学到一套新的指法，都会像得到一个科学发现一样兴奋不已。如今的杨帆曾多次在人民大会堂演奏，先后出访过台湾、香港和美国等地，并曾为连战、王金平等台湾地区政党领导人演出。</p> <p>　　&ldquo;良好的艺术修养与科学素养相结合，会使杨帆具有独到的感悟力和理解力，我想这与她目前所取得的优秀成果和良好心态是密切相关的。&rdquo;殷雅俊对杨帆的艺术修养赞许有加。</p> <p>　　2009年，校党委副书记史宗恺在看望杨帆时得知她有古筝演奏的特长，提议为她在清华举办一场音乐会。这也恰恰是杨帆儿时的一个梦想，所以她为音乐会取名&ldquo;梦圆清华&rdquo;。2009年7月12日晚，杨帆在音乐会上演奏了《高山流水》、《林冲夜奔》和《满江红》等多支曲子。她精湛的演奏水准和丰富的情感，深深感染了在场的每一位观众。</p> <p>　　史宗恺曾这样评价杨帆：&ldquo;杨帆是一首歌，她用她生命的足迹，谱就一首非常美的旋律，这个旋律当中有乐观，有坚强；杨帆也是一幅画，因为她用艺术和科学凝就的画笔，绘出生命的灿烂，也绘出她对科学、对生活的热爱和执着；杨帆是一面旗帜，这面旗帜是用坚强和勇敢染就的颜色。&rdquo;</p> <p>　　生病后杨帆有很多愿望，&ldquo;很多愿望可能都无法完成，但入党这个愿望一定要实现！&rdquo;</p> <p>　　杨帆回忆说，2008年做完手术后不久的她躺在病床上，看到了电视上播放抗洪抢险救灾的感人画面，&ldquo;党员和战士们为了百姓的生命冲锋陷阵，不怕牺牲，很多场景令我深受触动&hellip;&hellip;我也想成为那样的人！&rdquo;2008年12月，杨帆向党支部提交了入党申请书，2009年成为预备党员。她在入党志愿书中这样写道：&ldquo;活着的每一天，都在努力&rdquo;；&ldquo;未来对于我来说，是个未知数，但是无论怎样，我都会坚强地去面对。&rdquo;</p> <p>　　上学期，杨帆担任了学院研究生课程&mdash;&mdash;&mdash;《张量分析》的助教，这是学院开设的研究生学位课程中难度最大的课程之一，但是杨帆迎难而上，每次都坚持最早到达教室，花大量时间批改作业并解答同学们的疑问。今年5月31日，在第18届清华大学&ldquo;学术新秀&rdquo;颁奖典礼暨分享交流会上，杨帆与同学们分享了她战胜病魔和挑战学术的感人经历，她对学术的热爱和坚强的品格再次感染了每一位同学。</p> <p>　　&ldquo;我常对自己说，这次生病可谓是一次重生，我的生命可以重新算起了。以2008年为新起点的话，现在我还可以过六一儿童节呢。&rdquo;杨帆笑着说。</p> <p>　　&ldquo;拥有梦想，我很快乐！&rdquo;说完之后，杨帆带上了一顶红蓝相间的太阳帽，微笑着挥一挥手，骑车驶入清华园灿烂的初夏阳光中&hellip;&hellip;</p></P>     </div>'),(201,'【特等奖学金】屠环宇：做最好的自己','http://news.tsinghua.edu.cn/publish/news/4205/20130617110722597883042/tuhuanyu.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【特等奖学金】屠环宇：做最好的自己</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">做最好的自己</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&mdash;&mdash;记2012年清华大学本科生特等奖学金得主屠环宇</span></p> <p style=\"text-align: center\">&nbsp;<span style=\"font-family: 楷体,楷体_GB2312\">学通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">孙大伟 苏悦 李鹏飞</span></strong></p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130617110722597883042/tuhuanyu.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为</span><span style=\"font-family: 楷体,楷体_GB2312\">屠环宇。</span></p> <p>　　<span style=\"font-family: 楷体,楷体_GB2312\">屠环宇，男，黑龙江哈尔滨人。2009年保送进入清华大学电子信息工程专业，2012年获得清华大学本科生特等奖学金。三年中，他有15门课程位列班级第一，所有数理基础科和专业课的课程均在90分以上。大三时，他所在的队伍代表清华参加了全国的建模夏令营并位列前三。他参加过很多领域的课外活动，还热心公益，曾获得新加坡科技工程奖学金、一二九奖学金等。</span></p> <p>　　黑框眼镜，黑色毛衣，简单的发型，在桃李园学生食堂地下餐厅的门口，屠环宇的沉稳是他给笔者的第一印象。待坐下和他交谈起来之后，发现他并没有想象中工科男的木讷，没有学霸的刻板，也没有凌人的气场，而是活泼随和。正如他在特奖答辩中所说，&ldquo;我只是一个懂得追梦的清华人&rdquo;。</p> <p style=\"text-align: center\"><strong>&ldquo;永不放弃，做最好的自己&rdquo;</strong></p> <p>　　早在高中时屠环宇的数学和物理成绩就很好，几乎拿遍了大大小小各种竞赛的一等奖，虽然高三时他已经获得清华大学保送生的资格，但追求完美的他依然选择和同学一起参加了高考，并在高考中取得了数学满分的成绩。2009年的夏天，屠环宇同大多数刚入学的新生一样，对即将到来的大学生活既兴奋又迷茫。在短暂的适应期后，他为自己定下了这样目标：&ldquo;以最饱满的热情和最积极的态度迎接生活中的每一件事情，以一颗平常心和宽松的胸怀看待所有的结果，永不放弃，坚持，做最好的自己&rdquo;。三年来，他始终如一。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130617110722597883042/tuhuan.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为</span><span style=\"font-family: 楷体,楷体_GB2312\">屠环宇在中网志愿活动中。</span></p> <p>　　电子系是全校公认的课业繁重的系之一，回忆起自己初入清华园时的情况，屠环宇依然清晰的记得上大学的第一天就有一个很优秀的学长说过，清华是一个奖励勤奋的地方。这句话给屠环宇留下的深刻的印象。为了完成学业的目标，他大一到大三几乎每天都在晚上1点后才休息。除却勤奋，屠环宇觉得良好的学习方法也是必不可少的，与盲目刷题相比，他觉得花功夫梳理课程脉络更为重要，&ldquo;电子系课程很多、很难，但每门课程都有自己的特点，我从来没有刷过什么吉米之类的练习题，我感觉掌握好课程的核心要点，把整体的框架结构理解清楚就足够了。&rdquo;通过自我调节，在电子系巨大的学习压力下，屠环宇依然保持着良好的心态，&ldquo;我学习时很注重调剂，几门知识轮换着学，不仅充分利用时间，自己也不会觉得厌烦。&rdquo;</p> <p>　　此外，班级内良好的学习氛围也给他学习提供了必不可少的外部环境。屠环宇大一时担任过班长，四年里他所在的班级--无94获得了校甲级团支部、校优良学风班等荣誉，连续3年班级学分绩一直都是全年级10个班中的第一名。&ldquo;班里的每位同学都非常上进，而且大家互相督促、互相帮助，感觉在我们班级学习是一件自然而然的事情，也没有很痛苦和无聊。&rdquo;屠环宇说，&ldquo;我们班从来没有为了某个荣誉而做特别的准备，关键在于班里人凝聚力强，班级氛围好。我们的班主任对于班风建设有着很大的帮助。&rdquo;就这样，在242人的电子系，屠环宇一直保持着班级第一，年级前三的成绩。</p> <p>　　周围人的期许有时也会给屠环宇带来压力，&ldquo;在同学眼中比较优秀的人往往不得不承担更多的责任和期待，并且不被允许松懈或失败，因此压力可能更大。&rdquo;有时这种压力并不容易被周围同学理解，但也成为了鞭策他不断向前的动力。</p> <p style=\"text-align: center\"><strong>多尝试没做过的事</strong></p> <p>　　在同学们眼中，屠环宇是一个非常优秀的人，不仅因为他在大学期间保持着优异学习成绩，同时也因为从大一起他就一直在不同的社会工作岗位上积极为同学服务。大一时担任班长，大二、大三先后在系团委和学生会工作，大四时屠环宇还担任学生网络电视台台长，并加入了学生礼仪队。</p> <p>　　尝试不同的领域的社会工作给了屠环宇不同的体验，&ldquo;我最开始就是想接触各种各样的、不一样的工作。因为每种工作都需要一定的能力或者素质，大学本科要尽量多尝试一些不同的东西，完善自己的综合能力。&rdquo;</p> <p>　　在社会工作与学业的关系上，屠环宇总是处理得很好。他自己做了一个日程表，总会把最紧急的事情放在第一位，把该做的事一步一步安排好。&ldquo;平时做事要多去预判，每个任务的截止日期都是提前很久就知道的，要有计划，不要把所有的事情都拖到最后的那个时间点&rdquo;，他一直让自己处于一种比较紧张的状态，不断地在实践中锻炼自己的协调能力。</p> <p>　　他觉得越是忙碌，对于自己能力的提升就会越多。&ldquo;在初中、高中时，我就在同时做很多、很多的事。当我慢慢感觉得心应手、有余力时，就会主动再去承担一些事情。很多方法与能力都是自己一点点去积累的，像有的书教你如何提高效率，光看是没有用的，关键是通过实践去锻炼。&rdquo; 即使这样，他也依然会有那么一段时间忙到崩溃。大三暑假，他曾经在坐了30小时的火车后，不间断工作了5天，而且每天直至凌晨5点。对于这种忙碌，他感觉很充实：&ldquo;有的时候，要想收获，可能先要敢于付出和舍弃。&rdquo;</p> <p>　　大四的第一个学期，屠环宇一直在百度实习，作为一名&ldquo;数据挖掘与分析实习工程师&rdquo;，程序设计、数据统计、产品分析等多个领域都对他提出了很高的要求，而每周三个半工作日的实习，周末的加班，导致他的时间非常紧张。他能将实习与网络电视台的工作，学业等一系列事情协调好，正得益于他优秀的时间规划能力和丰富的社工经验。</p> <p>　　屠环宇觉得自己是一个追求完美的人，&ldquo;每做一件事情我都希望能够尽力做到我能做到的最好，不然怕辜负很多人的期待。&rdquo;正是处于这种对自己的要求。使他很难轻易停下自己的脚步，&ldquo;不要让自己的心永远都停留在那个舒适的状态，要让自己处在紧张的状态中。&rdquo;他觉得最大的难度不是做事本身，而是敢不敢去迎接挑战。&ldquo;开始时可能有些笨拙，但是坚持下来的话收获的就不止是能力，更是信心。&rdquo;</p> <p style=\"text-align: center\"><strong>多一点&nbsp; 广一点</strong></p> <p>　　屠环宇认为，现在社会更需要的是&ldquo;通才&rdquo;，所以他本科期间一直在尝试不同的领域，努力成为一名具备综合素质的复合型人才。</p> <p>　　在大三参加的清华数学建模大赛中，他充分展示了综合性人才的优势。面对电子线路方向的实际问题，他和另外两个同学运用数学的组合优化、图论思想，加入计算机课上学到的分治思想，使整个模型得以建立，而经济学领域中的边际效用概念的使用，大大优化了建模的结果。他们最终取得了全校第一的成绩，并代表清华大学参加了全国数模夏令营。这让屠环宇更加深刻地认识到复合人才的重要性，他说，&ldquo;学科的交叉，全面的知识结构，以及对学问触类旁通的启蒙和追求&rdquo;才是成功的关键。</p> <p>　　&ldquo;我在上大学之前对3件事情最感兴趣：电子、计算机、金融。本科学的是电子，中间有过接触计算机专业领域的经历，现在保研到了五道口金融学院，我感觉人生挺圆满、挺幸福的。&rdquo;屠环宇表示。</p> <p>　　对于未来，屠环宇说：&ldquo;我个人认为很多时候社会更需要一个综合性的人才，所以我希望能让自己懂得多一点、接触的领域广一点，这样能全面地培养自己，给自己一个挑战&rdquo;。在特奖答辩会上，屠环宇以一句话结束他的展示：&ldquo;当一个人真正用心的想要做好一件事情的时候，他就一定能够成功。&rdquo;</p> <p>　　相信这样用心的他，会一直在人生路上，自信的走下去。</p> <p style=\"text-align: right\">　　编辑：范 丽</p></P>     </div>'),(202,'【特等奖学金】冀东星：守土有责','http://news.tsinghua.edu.cn/publish/news/4205/20130617103046069945851/jidongxing.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【特等奖学金】冀东星：守土有责</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">守土有责</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 18px\">&mdash;&mdash;记2012年清华大学本科生特等奖学金得主冀东星</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">鲍涵 戴东杰</span></strong></p> <p style=\"text-align: center\"><strong><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130617103046069945851/jidongxing.jpg\" /></span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为</span><span style=\"font-family: 楷体,楷体_GB2312\">冀东星近照。</span></p> <p style=\"text-align: left\">　　<span style=\"font-family: 楷体,楷体_GB2312\">冀东星，男，山东泰安人。2009年考入清华大学经济管理学院，2012年获得清华大学本科生特等奖学金。三年来，冀东星12门课程获得班级最高分，40%的课程成绩在95分以上。从大一时的成绩不理想、竞选班长失败，到特等奖学金、&ldquo;社工达人&rdquo;，冀东星在成长的路上付出了许多努力，也收获了很多成长。</span></p> <p style=\"text-align: center\"><strong>从&ldquo;差生&rdquo;到&ldquo;大牛&rdquo;的&ldquo;逆袭&rdquo;</strong></p> <p>　　&ldquo;我不高，不帅，也不富。大一竞选班长只得到了2票，想加入学生会却没通过面试，第一年的素质测评只是通过。&rdquo;答辩中冀东星这样描述自己的大一。而现在的他有着一份闪光的简历：12门课程排名第1，其中，3门课程获得满分，40%的课程分数在95分以上；6个学期中，5个学期排名专业第1。这样的两个极端，确确实实地发生在了冀东星身上。</p> <p>　　&ldquo;在大一的第一个学期挺不适应大学的这种生活方式，&rdquo;回想起当时的情况，曾经的&ldquo;差生&rdquo;的冀东星微微皱起了眉头。在他看来，这种不适应不仅源于课程本身的难度和深度，而且与大学和高中截然不同的授课方式也十分相关。&ldquo;大学课程要比高中多很多，很多课程大学讲一遍就这么过去了。我们大一的时候有门课叫线性代数，我当时觉得特别难，以前从来没接触过，感觉就像小学的时候刚接触加减乘除一样。&rdquo;</p> <p>　　经管学院高手如云的环境带给冀东星的不仅是压力，更多也是动力。为了尽快跟上大家的节奏，冀东星付出了比别人更多的努力。&ldquo;大一学年，为了适应清华紧张的学习节奏，我坚持每天7点到教室自习，一般不到十点半教室关门时不回到宿舍，有几次宿舍熄灯后我还到学院不断电的自习室继续学习。&rdquo;</p> <p>　　一份耕耘一份收获，良好的心态加上持之以恒的努力，到了大二，冀东星的班级排名就跃升到了第一。然而单纯完成学院规定的课业并没有使冀东星满足，在本专业之余，他还用多种方式拓宽自己数理基础。&ldquo;经济学研究需要良好的数理基础，所以我特别重视物理和数学，大二时选择了为工科院系开设的大学物理课程。对待书上的每道习题，我至少做过两遍。&rdquo;因此，他获得了很优异的成绩，在《大学物理B(1)》、《大学物理B(2)》两门课程的考试中，他分别获得96分和100分。另外，冀东星还获得全国部分地区大学生物理竞赛（非物理类A组）一等奖。</p> <p>　　在学术科研方面，冀东星三年成绩专业排名第一，并带领团队获得清华大学&ldquo;挑战杯&rdquo;一等奖，同时参与多项研究课题并入选清华大学&ldquo;科技创新，星火燎原&rdquo;学术创新人才培养计划第六期。去年6月，冀东星申请了国家级SRT项目，研究信用评级对企业债券定价的影响。</p> <p style=\"text-align: center\"><strong>&ldquo;守土有责&rdquo;，用心赢得尊重</strong></p> <p>　　可是就是这样一个被同学们称道的人，在大一时也曾陷入&ldquo;人缘不好&rdquo;的苦恼。冀东星回忆起那段时光依然记忆犹新。&ldquo;因为高中是应试教育嘛，跟人说话也较少，到大学以后，和人打交道方面不太熟悉。&rdquo;经验不足加上相对内向。冀东星在大一上学期竞选班长时，并没有顺利入选班长，而且大一期末的素质测评成绩也不是特别理想。</p> <p>　　最初的失败并没有打消冀东星为同学服务的热情，他从最基层的岗位做起，一点一点用自己的行动赢得周围人的信任。&ldquo;我每到一个岗位，都牢记&lsquo;守土有责&rsquo;四个字，踏踏实实地完成本职工作，努力为同学服务。&rdquo;从大一起，冀东星就开始担任班级的学习委员，每学期开学的时候他都主动为同学打印教材，在考试前还会主动为同学找模拟考试题。他的努力也得到了同学们的认可，&ldquo;我大二时候素测成绩升到了E。&rdquo;谈到这里，这个略显羞涩的大男孩微微一笑。</p> <p>　　大一时，冀东星也误打误撞地进入了院系学生组织的宣传部门，然后在一点一滴的任务中慢慢地喜欢上了这方面的工作。冀东星在大四上学期加入了学校团报《紫荆》报社，并担任了副主编一职。</p> <p style=\"text-align: center\"><strong>拥有自己的&ldquo;中国梦&rdquo;</strong></p> <p>　　进入大三后，冀东星面临着工作、读研和出国这新一轮的选择。以冀东星的成绩和能力完全可以申请到国外顶尖高校。但是他选择了在经管学院申请直博，将来为祖国的科研事业做出贡献。 &ldquo;每次走进舜德楼，&lsquo;创造知识、培育领袖、贡献中国、影响世界&rsquo;的学院使命深深激励着我。一次次深入田间地头的社会实践让我感受到肩头沉甸甸的责任，对党史、院史的学习让我看到了经管人&lsquo;经世济民&rsquo;的精神内涵，4年&lsquo;永不卸任的班委&rsquo;经历让我体会到服务集体的快乐。&rdquo;冀东星说，&ldquo;选择清华就是选择了一生的责任&rdquo;。</p> <p>　　3年内，冀东星参加了4次社会实践，在与农民、村医、农民工和基层干部的接触中受教育、长才干。在实践中，他培养了本土情怀，感受着中国力量，对一些社会经济问题也有了更深入的思考。&ldquo;我逐渐认识到，任何一个理论、学说，只有与本国国情相结合，与时代发展同进步，与人民群众共命运，才能焕发出强大的生命力、创造力。&rdquo;冀东星说。</p> <p>　　对于未来，冀东星有了自己的设想，冀东星希望通过在自己熟悉的领域刻苦钻研，为祖国的学术发展做出贡献，&ldquo;希望能够用这种方式为实现整个民族的中国梦做出自己的一份努力。&rdquo;</p> <p style=\"text-align: right\">　　　编辑：范 丽</p></P>     </div>'),(203,'【人物】凌瑞骥：一位老80后的“80”情结','http://news.tsinghua.edu.cn/publish/news/4208/20130608102138392294880/7-2a(2).jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【人物】凌瑞骥：一位老80后的“80”情结</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">一位老80后的&ldquo;80&rdquo;情结</span></strong></p> <p style=\"text-align: center\"><span style=\"font-size: 16px\">&mdash;&mdash;记校关工委委员、计算机系离休教授凌瑞骥</span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">实习记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">张瀛辰</span></strong></p> <p style=\"text-align: center\">　　<img style=\"width: 377px; height: 305px\" alt=\"\" width=\"425\" height=\"349\" src=\"http://news.tsinghua.edu.cn/publish/news/4208/20130608102138392294880/7-2a(2).jpg\" /></p> <p><span style=\"font-size: 14px\"><span style=\"font-family: 楷体,楷体_GB2312\">　　凌瑞骥，1930年出生，我校计算机系教授。1948年考入我校电机系，毕业后留校工作，曾任我校自动控制系首任党总支书记，负责筹建我国第一个电子计算机专业和清华大学自动控制系。1980年起参与创建并随后负责我国高校第一个外向型校办科技企业清华大学技术服务公司，并创建清华大学软件技术中心。离休后，全身心投入&ldquo;关心下一代工作&rdquo;。现任清华大学关工委委员，曾两次荣获清华大学&ldquo;老有所为&rdquo;先进个人称号。</span></span></p> <p>　　&ldquo;按毛主席的话，我们当年参与夺取全国胜利，只是中国革命的序幕，真正的高潮是在50年~100年之后&mdash;&mdash;也就是现在80后、90后挑起历史重担的时候，&lsquo;中国梦&rsquo;需要通过他们的努力来实现，我们老同志要发挥作用。&rdquo;2013年清华102周年校庆、自3班毕业50周年纪念座谈会上，83岁的凌瑞骥对同样已过古稀之年的昔日战友和学生们语重心长地说。</p> <p>　　在凌瑞骥看来，燃烧生命的余热帮助青年一代正确地认识国情、世情，走好未来的发展之路，是一名老党员义不容辞的责任与义务。&ldquo;在信息技术领域，我们有的是&lsquo;老本&rsquo;，是经过实践淬炼的经验；但现在信息技术更新非常快，我们能留给下一代的&lsquo;遗产&rsquo;越来越少，希望我们一生的体验和感悟能帮助他们更好地成长。&rdquo;这位在清华园里工作生活半个多世纪的老人，晚年最大的愿望就是&ldquo;为青年一代做好铺路人&rdquo;。</p> <p style=\"text-align: center\"><strong>机缘巧合　做学生工作的&ldquo;小时工&rdquo;</strong></p> <p>　　1948年，凌瑞骥考入清华大学电机系，毕业后留校工作，从此他与清华结下了一生的缘分。</p> <p>　　1956年，时任校机关党支部书记的凌瑞骥，被抽调进行计算机系的筹备事宜，创建了我国第一个电子计算机专业和清华大学自动控制系。1958年~1965年，根据仅有的一张简单的交流计算台说明书示意图，他在由简易车棚改装成的实验室里，领导建造了我国高校第一台中型通用电子数字计算机（911机）。1966年，由他领导建造的我国最早自行研制并小批量投产的全晶体管小型通用数字计算机（112 机）诞生。1980年，他参与创建并随后负责我国高校第一个外向型校办科技企业&mdash;&mdash;清华大学技术服务公司，并创建清华大学软件技术中心。</p> <p>　　凌瑞骥将自己一生最宝贵的年华都奉献给了祖国的科技事业和清华的建设发展。作为一名老党员，从最初担任清华地下党小组组长，再到主持系里工作全身心投入科研教学，他始终不忘&ldquo;党员&rdquo;二字背后沉甸甸的责任。离休后，他放弃了安逸的晚年生活，选择将关注的目光投向茁壮成长的下一代。而这，还源于一个&ldquo;插曲&rdquo;。</p> <p>　　2006年元旦刚过，凌瑞骥意外地接到了一个陌生女孩的电话，这位生长于红色革命根据地井冈山的老红军后代利用赴美留学的业余时间，创办了一个致力于中美两国文化交流的网站。由于时常对美国网民的一些疑问和误解感到&ldquo;束手无策&rdquo;，她专门向凌瑞骥寻求帮助。</p> <p>　　在国贸酒店门厅里，一老一少进行了长达3小时的促膝长谈，凌瑞骥用自己的亲身经历向她澄清事实，批驳和揭穿了来自西方恶意诽谤和妖魔化中国的流言蜚语。这场谈话不仅让女孩收获颇丰，也让凌瑞骥触动很深。&ldquo;对于我们这些曾参加革命的八旬老人来说，忘记历史就意味着背叛；而现在的年轻人，对历史太缺乏深刻的了解了。&rdquo;在他看来，对祖国历史的无知会让青年人失去精神的武器。即使是老红军后代，怀着一颗朴素的爱国心，在西方媒体的蛊惑和误导面前，也会因为缺乏了解而&ldquo;束手无策&rdquo;。</p> <p>　　&ldquo;80后、90后对改革开放前的历史知之甚少，对改革开放的前20年也是一知半解，面对网络上缺乏历史依据的&lsquo;奇谈怪论&rsquo;，几乎毫无辨别和抵御的能力；而我们这一代人，对抗日战争记忆犹新，更亲身经历了解放战争和建设新中国的日日夜夜，这些真实的所见所闻可以帮助年轻人真正理解自己的祖国，树立起马克思主义的世界观、人生观、价值观。&rdquo;正是抱着这样的想法，那次谈话后，凌瑞骥主动来到计算机系党委报到，志愿成为该系学生工作组和马克思主义学习研究分会（TMS）的一名&ldquo;义工&rdquo;。</p> <p>　　此后，凌瑞骥一心扑在青年工作上，协助系党委学生组、辅导员开展工作。&ldquo;只要学生工作有需要，一个电话，随叫随到。&rdquo;帮助80后、90后学习理论，了解历史，认识国情、社情和世情，凌瑞骥的工作劲头完全不像是已经七八十岁的老人。而他的人生，也仿佛回到了年轻时作为地下党员组织青年学生地下读书会，团结、争取进步青年的时候。人生之趣，仿佛一个圆圈，前后呼应，画龙点睛。</p> <p style=\"text-align: center\"><strong>教学相长　为学生提供理论武器</strong></p> <p>　　2008年9月，我校启动&ldquo;新生导引项目&rdquo;，凌瑞骥成为计81班9名国防新生的导师。</p> <p>　　&ldquo;这些孩子大多来自贫困的农村和山区，来清华前几乎没有接触过计算机。他们一方面在成绩上会存在一定的自卑感，另一方面他们并不真正了解国防生肩负的使命和责任。&rdquo;为了能够帮助新生克服学习上的困难，凌瑞骥为他们联系高年级学长进行辅导，多次与他们单独谈话，鼓励他们克服畏难情绪，奋发学习；为了让他们认识到自己肩负着的光荣使命，凌瑞骥准备了大量的文史材料，结合亲身经历与他们分享，每年寒暑假鼓励他们记录家乡的变化，扎根土地，了解国情。</p> <p>　　经过4年的培养，让他感到欣慰的是，该班学生毕业时几乎全部进入重要国防单位工作，毕业后仍然与他保持着联系。&ldquo;看到这些孩子成长为社会主义建设的接班人，我感到内心很充实。&rdquo;凌瑞骥坦言：&ldquo;自己以前是&lsquo;建设&rsquo;社会主义，现在是&lsquo;吃&rsquo;社会主义。国家提供的免费医疗和离休补贴让我安度晚年，也让我感觉自己成了&lsquo;纯粹的消费者&rsquo;。能够发挥余热为青年成长出一份力，对我来说也是一种安慰。&rdquo;</p> <p>　　&ldquo;我常对学生说，我也是&lsquo;80后&rsquo;&mdash;&mdash;80岁以后，是&lsquo;老80后&rsquo;做&lsquo;新80后&rsquo;的工作。&rdquo;凌瑞骥以一颗&ldquo;80后&rdquo;的心赢得了学生们的爱戴。&ldquo;辅导员制度是清华培养人的一大特色，这些辅导员自己也是80后，相对而言缺乏人生阅历和知识储备，做工作时没有&lsquo;武器&rsquo;；而我可以为他们提供&lsquo;炮弹&rsquo;，让他们去 &lsquo;打仗&rsquo;！去帮助学生解除思想上的各种疑惑。&rdquo;凌瑞骥说。</p> <p>　　谈到目前大学生思想上普遍存在的问题，凌瑞骥说：&ldquo;这些孩子们认为我们这一代人太理想主义，而他们是现实主义。其实，他们的&lsquo;现实主义&rsquo;仅仅只是&lsquo;小现实&rsquo;，看到的是自己眼前的一亩三分地；真正的&lsquo;大现实&rsquo;是应该看到960万平方公里，看到三分之二的人类。&rdquo;在他看来，学生们的困惑多是由于没有全面了解国情、世情，还不能领悟到真正的&ldquo;现实主义&rdquo;是应该把自己的命运和国家、民族的未来联系起来。他希望通过自己的努力，帮助青年学生摆脱思想上的狭隘，站得更高、看得更远。</p> <p style=\"text-align: center\"><strong>鞠躬尽瘁　将毕生余力投入学生工作</strong></p> <p>　　近两年由于听力、视力都有所下降，凌瑞骥不得已&ldquo;退居二线&rdquo;，但他仍然时刻不忘为学生工作作贡献。&ldquo;我现在看到国外一些有参考价值的文章就会翻译出来，发给辅导员们看看。就像当年毛主席决定扩大发行《参考消息》，让大学生不仅接触&lsquo;香花&rsquo;也要接触&lsquo;毒草&rsquo;一样，希望同学们通过阅读原汁原味的报道，多接触西方的评论，培养在复杂现实中的辨别能力和判断能力。&rdquo;凌瑞骥说。</p> <p>　　对于已是耄耋之年的凌瑞骥而言，翻译并非易事。为了翻译的准确性，哪怕是一个小标题，他都要反复斟酌。有一次，他在报纸上看到一篇文章叫《美国民主没什么可教给中国》，他觉得翻译可能存在问题，于是找来原文，发现是美国霍布金斯大学教授弗朗西斯?福山（Francis Fukuyama）发表在英国《金融时报》上的一篇评论，原题为U.S. Democracy has little to teach China。经过仔细阅读，凌瑞骥发现在原文结尾处，福山指出中国的制度比美国更能&ldquo;适者生存&rdquo;，主张美国应该借鉴中国经验。显然，国内报纸只是简单直译标题，而且存在美国是&ldquo;老师&rdquo;、 中国是&ldquo;学生&rdquo;的误读，因此经过反复推敲之后，他将标题改译为《对中国，美国民主乏善可陈》，不仅保留了作者原意，还避免了学生误解。这样的翻译工作耗费大量心力，但他仍然坚持着。</p> <p>　　&ldquo;我现在听力、视力、记忆力都不如从前了，但还没有worn out（丧尽），只是decay（衰退），所以我还能尽力做一点。只要听力、视力、记忆力还剩一点，我都会坚持下去，做好青年一代的铺路人。&rdquo;凌瑞骥坚定地说。</p> <p><span style=\"font-family: 楷体,楷体_GB2312\">　　来源：新清华2013-06-07</span></p></P>     </div>'),(204,'【特等奖学金】江汉臣：责任是前进的动力','http://news.tsinghua.edu.cn/publish/news/4205/20130604132723592713599/jianghanchen.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【特等奖学金】江汉臣：责任是前进的动力</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">责任是前进的动力</span></strong></p> <p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">&mdash;&mdash;访2012年清华大学本科生特等奖学金获得者江汉臣</span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学通社记者&nbsp; </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">魏阳&nbsp; 李栋楠</span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130604132723592713599/jianghanchen.jpg\" /></span></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为江汉臣近照。</span></p> <p><span style=\"font-family: 楷体,楷体_GB2312\">　　江汉臣，清华大学水利系水工92班本科生，2012年获得清华大学本科生特等奖学金。生活中的他学业成绩优异，在水利系团委担任副书记，也是系棒球队主力队员，同时还参与数个创业项目的运营，获得过多个奖学金和各类奖励。</span></p> <p>　　江汉臣很忙，周四下午他参加了2字班同学的主题团日，晚上一直在忙着创业项目，10点钟他又跟同学讨论系团委组织工作，接受我们采访的时候，已是晚上10点40分。这样忙碌的生活，对江汉臣来已是常态，他早已游刃有余。</p> <p style=\"text-align: center\"><strong>从不完美开始</strong></p> <p>　　回忆起自己前3年的大学生涯，江汉臣用8个字进行了概括：&ldquo;跌宕起伏，难以名状。&rdquo;其实，他的大学生活并没有一个&ldquo;完美的开端&rdquo;。&ldquo;我一直很喜欢清华，但是高考分数下来的时候大家都觉得上清华比较悬，不过我还是第一志愿填了清华。&rdquo;江汉臣说，当他得知自己的分数恰好是清华在安徽的分数线时，一方面觉得自己很幸运，另一方面也为自己未来的学习生活而感到担心。</p> <p>　　这种压力很快转化成为江汉臣学习的动力，&ldquo;大一我每天会自习到10点半才回寝室，不仅做教材上的习题，还会找一些主要是数学方面的考研资料来做。&rdquo;回想起当时的情景，班级同学间的相互帮助也让江汉臣影响深刻，&ldquo;大一时有一门数学课作业特别难，我每天自习完回到寝室就和同学一起交流讨论作业方面的问题，这种讨论给我的帮助很大。&rdquo;通过不断努力，到大一上学期期末时，江汉臣已经能够很好适应清华的学习节奏，&ldquo;那时候班级同学已经会常常来问我一些学习方面的问题，我也在这方面找回了一些自信。&rdquo;</p> <p>　　江汉臣认为学习中最为关键的就在于有效利用时间，&ldquo;该做某件事的时候就去做某件事。我绝不会因为社工或其他事情翘课或是拖作业。只有把能提前完成的事情都做完了，才能在做其他事情时给自己一个相对轻松的环境。&rdquo;</p> <p>　　虽然大二以后的创业和社会工作占用了他许多时间，但江汉臣从不在学习时间上打折扣，专业学习对他而言始终是最重要的，&ldquo;我相信只要功夫下到，成绩一定不会令你失望。&rdquo;他三年的成绩一直名列前茅，《工程力学1》《工程力学2》两门专业课还得了满分。</p> <p style=\"text-align: center\"><strong>&ldquo;在集体中成长是一种莫大的幸福&rdquo;</strong></p> <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 同学眼中的江汉臣是一个责任感和执行力都很强，又很有亲和力的人，因此在大二的时候，大家推举他担任了团支书。虽然社会工作经历的开始有些戏剧化，却并不妨碍江汉臣用心做好每一件事。在大二一年中他负责开展的主题团日、素拓活动都给班级同学留下了深刻的印象。此后他还陆续担任了系团委组织组组长、系团委组织副书记等工作。</p> <p>　　&ldquo;从大二到大四，三年我负责的工作实质其实都是一样的。主要就是团的思想方面的工作。&rdquo;从组织自己班级的主题团日，到统筹全系的主题教育活动，江汉臣觉得这些工作带给他的，不仅是工作能力的锻炼，更重要的是让他学会了站在他人的角度上看待问题，思考同学们长远发展的需求，以一颗服务的心对待这些工作。</p> <p>　　江汉臣的努力也得到了班级同学的认可，大学三年他的素测成绩都排前列。江汉臣说觉得班级是最让他最有归属感的地方：&ldquo;在集体中成长是一种莫大的幸福。&rdquo;</p> <p style=\"text-align: center\"><strong>创业学习两手抓</strong></p> <p style=\"text-align: left\">　　在江汉臣的大学生活中，&ldquo;创业&rdquo;二字也占据了非常重要的位置。&ldquo;我一直对创业很感兴趣，但这其实也是一个巧合，我在那个时间点上遇到了这个机会。&rdquo;大二时的江汉臣在一个偶然的机会下，认识了一位热心创业的研究生学长，两人在讨论中对&ldquo;高中生专业选择&rdquo;这一问题产生了共同兴趣，他们很快组织起了一个创业团队，&ldquo;当时团队之所以聚在一起，是因为我们发现中国的高中生在高考填报志愿的时候比较草率，没有科学的方法进行指导。我自己当时在填志愿的时候也没有考虑太多。因此觉得这方面的工作既有意义，又有市场。&rdquo;</p> <p>　　经过初期的筹备，江汉臣与同事们在2010年11月组建北京华一至尚文化传媒有限责任公司。和很多新创建的公司一样，创业的开始总充满了痛苦和挑战。&ldquo;我经历过付出大量心血却没有一丝回报的惨痛情况。&rdquo;江汉臣坦言之所以坚持下来，除了兴趣之外更多是因为责任，&ldquo;公司其他人都是全职工作，他们已经为公司付出很多了，我不能全身心投入公司的运营，已经很对不起大家了，所以必须把属于我的这部分工作做好。&rdquo;</p> <p>　　作为团队内唯一一名&ldquo;本科在读&rdquo;成员，在面临巨大的学业和社会工作压力的情况下，他依然坚持担任团队内的重要角色。在整个团队的共同努力下，目前公司状况良好，江汉臣觉得自己今后在公司中的角色可能会从&ldquo;做市场，做细活&rdquo;转换为&ldquo;提供知识和技术支持&rdquo;。</p> <p>　　这段创业的经历给了江汉臣很多收获，也让他萌生了要用自己的经验去帮助更多有类似需求的同学的想法。现在，江汉臣担任了清华大学启创计划一期的学生骨干，这是一个正在筹措的旨在培养和服务学校创业人才的计划。提到这个工作，江汉臣笑着说：&ldquo;我的工作就是为更多的想要创业的同学、团队提供服务。&rdquo;最近他正在和校团委创业中心的辅导员们一起探讨这个计划的具体实施形式，努力在学校中营造一个良好的创业氛围，同时也尽力为现有的创业团队争取资源。</p> <p>　　回首已经过去的三年时光，江汉臣觉得自己三年内最开心的事情就是自己在保持良好成绩的同时，学到了很多其他方面的知识，&ldquo;现在我可以承担一些其他人承担不了的工作，算是一名合格的水利毕业生了。&rdquo;江汉臣自豪地说。</p> <p>　　今年，江汉臣以学分绩第二，综合排名第一的成绩获得了系内直接推荐攻读免试博士生的资格，对于未来的生活，他也有自己的设想：&ldquo;博士生阶段我会专注科研，争取掌握专业内的核心的知识，创造一些核心技术。有可能我毕业后还会继续进行创业。&rdquo;他相信无论未来自己遇到什么样的挑战，自己都将满怀信心的走下去。</p> <p style=\"text-align: right\">　　供稿：校团委&nbsp; 编辑：范 丽</p> <p>&nbsp;</p></P>     </div>'),(205,'【特等奖学金】杨知方：找到最适合自己的路','http://news.tsinghua.edu.cn/publish/news/4205/20130603162237305754976/yagnzhifang1.jpg','<div id=\"datalist_detail\">       <script language=\"javascript\" type=\"text/javascript\">       //var str_next=document.getElementById(\"hidden_detail\").innerHTML;       //var i=str_next.search(\"[Hh][0-9] [Aa][Ll][Ii][Gg][Nn]\");       //if(i==-1)       //{       // document.write(\"<H3 align=center>【特等奖学金】杨知方：找到最适合自己的路</H3>\");       // document.write(\"<P align=center><FONT size=2></FONT></P>\");       //}       </script>    <p><p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">找到最适合自己的路</span></strong></p> <p style=\"text-align: center\"><strong><span style=\"font-size: 18px\">&mdash;&mdash;记2012年清华大学本科生特等奖学金获得者杨知方</span></strong></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">学通社记者 </span><strong><span style=\"font-family: 楷体,楷体_GB2312\">李赞 戴东杰</span></strong></p> <p style=\"text-align: center\"><img style=\"width: 310px; height: 393px\" alt=\"\" width=\"340\" height=\"432\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130603162237305754976/yagnzhifang1.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为杨知方近照。</span></p> <p><span style=\"font-family: 楷体,楷体_GB2312\">&nbsp;&nbsp;&nbsp; 杨知方，河南省平顶山市人，清华大学电机系2009级本科生。他是老师眼中&ldquo;低调&rdquo;的尖子生，他是同学眼中&ldquo;知行合一&rdquo;的榜样，他是女友眼中略微有些不解风情的&ldquo;工科男&rdquo;。在学习生活中，他知道前方路漫漫，但他坚信要找到最适合自己的路。</span></p> <p>　　2012年的本科生特等奖学金得主、来自电机系九字班的杨知方并不是大家想象中不解风情的&ldquo;工科学霸&rdquo;，相反，运动场上有他飞奔的身影，书海泛舟也是他闲时的消遣。</p> <p>　　&ldquo;找到最适合自己的路&rdquo;，这是在与杨知方的交流中，不断被他提到的一句话。正是这样的人生标准，让他赢得了大家的肯定；也正是这样的坚定信念，他才走出了一条&ldquo;清华工科男非典型之路&rdquo;。</p> <p style=\"text-align: center\"><strong>&ldquo;找到最适合自己的路&rdquo;</strong></p> <p>　　提及特等奖学金，首先联想到的是获得者傲人的成绩，因而他们学习的方法也就格外引人关注。聊到学习，杨知方原本略显紧张的脸上浮现起一丝笑容，他觉得自己能取得比较好的成绩是来自他的独特的学习方法，&ldquo;我是走了一条不寻常的路&rdquo;。</p> <p>　　2009年8月，17岁的杨知方怀着对未来的憧憬迈入了清华大学的校门，&ldquo;我高中的班主任是负责学科竞赛的老师，他有个上清华电机系的得意门生，老在我们夸奖那个学生。&rdquo;也许是受到了这位学长的影响，获得保送资格后的杨知方也决定选择电机系作为自己的专业。</p> <p style=\"text-align: center\"><img alt=\"\" width=\"425\" height=\"283\" src=\"http://news.tsinghua.edu.cn/publish/news/4205/20130603162237305754976/yagnzhifang2.jpg\" /></p> <p style=\"text-align: center\"><span style=\"font-family: 楷体,楷体_GB2312\">图为杨知方。</span></p> <p>　　在传统的工科院系，&ldquo;刷题&rdquo;是一些学生的习惯做法，尤其是微积分和大学物理这两门课。初入清华时的杨知方，对&ldquo;刷题&rdquo;的作风感到很不认同，&ldquo;我们在高中的时候就是在不断地做题，做到最后发现其实题都是差不多的，就那么多类型。做到一定程度，就成了一种惯性思维，这对我们训练自己没有多大帮助。&rdquo;带着这些想法，他开始实践自己与众不同的&ldquo;学习理念&rdquo;。在有些人&ldquo;刷题&rdquo;的时候，他在钻研课本；在有些人&ldquo;刷题&rdquo;的时候，他在学习课程要求以外的数学和物理知识。用他的话说，这样的做法是&ldquo;看本质&rdquo;、&ldquo;看自己喜欢看的&rdquo;。在今天看来，他这些看似无助考试成绩的做法不仅给他后来的科研打下了坚实的基础，对于他当时的学习成绩也有很大的帮助。大一学年结束时，他在微积分和大学物理两门课上的成绩都在班级前3名，4年的整体学分绩也在院系中名列前茅。</p> <p>　　几乎每一名清华的工科生心中都有一个科研梦。在杨知方心中，科研是一件非常严谨的事情，&ldquo;我觉得自己大一、大二参加的都只能算是科技活动，应该算不上真正的科研。&rdquo;在他眼中，自己的科研之路开始于大三暑假，&ldquo;我真正开始接触科研是大三暑假去加拿大交流的时候。&rdquo;初到加拿大时，杨知方不仅要克服语言上的困难，还有不一样的工作氛围，不知道从何开始做起的研究课题，这些都曾给他带来过困扰和迷茫。但是他身上严谨踏实的特点很快开始发挥作用，他在老师的指导下开始了研究。&ldquo;从查找文献开始，再到设计方案、实施方案。遇到问题就得改正方案，甚至重新设计。这样的循环不知重复了多少次。&rdquo;正是这样一个痛苦与快乐兼具的过程让他更加喜欢上了科研：&ldquo;即使最后只出了一个小的成果，也是自己不断努力的回报。&rdquo;</p> <p>　　社会工作也曾经是杨知方在寻路过程中的一个尝试。他大一时担任班级体育委员，大二时担任系学生会体育部部长。在工作量特别大的阶段，十分辛苦。到了大三之后，杨知方渐渐退出了社会工作。当被问到退出社会工作有没有什么遗憾时，杨知方说：&ldquo;没有，每个人都有自己的喜好吧，至少我体验过了社工。&rdquo;他觉得参加一个活动、一个社团，就要踏踏实实地投入精力，&ldquo;重要的不是奖项，而是你能真的从中获得些什么，如果你想从一件事情中有所收获，那么你必须投入精力。&rdquo;</p> <p style=\"text-align: center\"><strong>老师和同学眼中的他很低调</strong></p> <p>　　在特奖答辩现场介绍杨知方时，他的老师用了这样的描述：&ldquo;非常低调&rdquo;。当被问及如何理解&ldquo;低调&rdquo;一词时，杨知方说：&ldquo;做自己就好了，我不喜欢炫耀。&rdquo;他觉得这样的个性源于自己的个人经历。虽然认为自己是个低调的人，但杨知方觉得&ldquo;喜欢表现自己也是一件非常好的事，因为将来当我们走上社时会非常需要这种能力。人不能永远活在自己的小世界里，还是需要别人赏识你的。&rdquo;他也觉得自己也需要加强自我表达的能力。</p> <p>　　而低调的他，也给老师留下了深刻的印象，这是为什么呢？对此他想了一会才缓缓说：&ldquo;可能是我和老师在课外讨论的一些问题让老师觉得非常深刻吧。&rdquo;他依然记得他大一上微积分时，曾经问了任课老师一道课本之外的问题，老师当时没有立即回答出来。后来老师还把那个问题放到课程上公开讲了一下，让学生进行了讨论。提到这段经历，杨知方认为：&ldquo;我比较喜欢提问，我关注的问题也能让老师记住我。可能这是让老师觉得我很有特点的地方。&rdquo; 　　</p> <p style=\"text-align: center\"><strong>&ldquo;我喜欢留在自己喜欢的这片土地上&rdquo;</strong></p> <p style=\"text-align: left\">　　杨知方不仅是学习上的佼佼者，在生活中也能随处找到自己的兴趣点。令很多人意外的是，这位特等奖学金获得者不是整天以书本为伴的人，他同时还是运动达人。&ldquo;基本上所有的运动项目我都参加，所有球类，乒乓球、羽毛球、足球、篮球和排球我都玩。&rdquo;杨知方说。</p> <p>　　除此之外，杨知方还特别喜欢看文学类的书籍。高中的他因为天天忙竞赛，多少有点忽视了文科素养的培养。到了大学，他就开始刻意的研读一些文学作品。到后来慢慢的他也喜欢上了阅读。&ldquo;文学名著、武侠、网络小说我都看，也挺喜欢的。&rdquo;</p> <p>　　凭借在学业和科研上的出色表现，杨知方已经免试保送了本系的博士生。谈到博士毕业之后的打算，杨知方显出了些许犹豫。他说，可能会去一些电力部门工作，但是也可能留在实验室里做研究，但是无论如何都要坚持自己的专业，而且会留在祖国发展自己的事业，对此他说：&ldquo;我喜欢留在自己喜欢的这片土地上。&rdquo;</p> <p style=\"text-align: right\">&nbsp;供稿：校团委　编辑：范丽</p></P>     </div>');
