INSERT INTO `TuanTuanApp_news` VALUES (2016,'本科生选课时间安排','','2014-02-23','选课调整阶段（补退选）：2014年2月26日(星期三) 13:00 ～ 3月4日(星期二) 16:00','<p style=\"background:none;\">网上选课请使用win7及以下操作系统，且浏览器IE8及以下版本。若出现学生自己的电脑环境不支持选课系统的情况，请及时到中央主楼开放实验室机房进行选课操作。 </p><p style=\"background:none;\">使用校外网络进行选课的同学，请务必按照附件中的操作步骤，安装VPN客户端后方可进行选课操作。<br/><br/>-----------------------------------------------------------------------------<br/>选课报名阶段（预选）：12月13日(星期五) 13:00 ～ 12月16日(星期一) 16:00<br/>1、报名阶段需填报志愿选课，报名结束后，系统进行抽签处理。同学们可在正选前查看抽签结果。<br/>2、建议同学们在预选时选重修课程，选重修课不需填报志愿。除数学课程以外，重修选课不受课容量限制。<br/>3、重（补）修体育课，请务必在预选或正选时选课，补退选时不再开放。<br/>-----------------------------------------------------------------------------<br/>选课调整阶段（正选）：12月20日(星期五) 13:00 ～ 12月23日(星期一) 16:00<br/>-----------------------------------------------------------------------------<br/>实验课二级选课（第一次）：12月30日(星期一) 13:00 ～ 2014年1月3日(星期五) 16:00<br/>-----------------------------------------------------------------------------<br/>选课调整阶段（补退选）：2014年2月26日(星期三) 13:00 ～ 3月4日(星期二) 16:00<br/>-----------------------------------------------------------------------------<br/>实验课二级选课（第二次）：2014年2月26日(星期三) 13:00 ～ 3月4日(星期二) 16:00<br/>-----------------------------------------------------------------------------<br/>中期退课阶段：2014年4月28日(星期一) 8:00 ～ 5月5日(星期一) 16:00<br/>前8周已结束的课程不参加中期退课。<br/><br/>【请注意】退课时间因五一小长假顺延！<br/>-----------------------------------------------------------------------------<br/><br/>每学期的选课时间安排可在教学门户 <a href=\"http://oars.tsinghua.edu.cn/\"><span style=\"color:#000000;font-size:12px;\">http://oars.tsinghua.edu.cn</span>'),(2017,'关于公共教学楼开馆的敬告','','2014-02-23','','<table cellpadding=\"0\" cellspacing=\"0\" width=\"100%\"><tbody><tr><td colspan=\"2\" style=\"padding:0px;text-align:center;line-height:22px;font-size:18px;font-weight:bold;\"><span id=\"News_notice_DetailCtrl1_lblTitle\" style=\"margin:0px;padding:0px;border:0px currentcolor;color:#942C94;\">关于公共教学楼开馆的敬告</span></td></tr><tr><td colspan=\"2\" style=\"padding:0px;text-align:center;color:gray;line-height:22px;font-size:12px;vertical-align:middle;\"><span id=\"News_notice_DetailCtrl1_lbladd_time\" style=\"margin:0px;padding:0px;border:0px currentcolor;\">教学办公区事务科 发布于 2014年02月21日 15:21</span></td></tr><tr><td class=\"content1 content2\" colspan=\"2\" style=\"padding:0px;text-align:left;line-height:24px;font-size:12px;\" width=\"641\"><span id=\"News_notice_DetailCtrl1_lblquality_content\" style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;-ms-word-wrap:break-word;\"><p style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;; background:none;\"><span id=\"News_notice_DetailCtrl1_lblquality_content\" style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;-ms-word-wrap:break-word;\"><span style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;\">各位同学：</span><span style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;\"></span></span></p><div align=\"left\" style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;\"><span style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;\">公共教室楼设备设施检修和卫生清扫工作已经结束，根据学校统一安排，校管公共教室将于<span style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;\">2</span>月<span style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;\">23</span>日（周日）起全面恢复正常开放，教学楼开放时间为<span style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;\">7:00——22:30</span>。衷心祝愿同学们在新学期身体健康、生活愉快、学习进步。</span><span style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;\"></span></div><div align=\"left\" style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;\"><span style=\"margin:0px;padding:0px;border:0px currentcolor;text-indent:2em;\"><br style=\"text-indent:2em;\"/>                                                                      物业管理中心<br style=\"text-indent:2em;\"/>                                                                     2014年2月21日</span></div></span>'),(2018,'热情紫荆志愿者温馨西站春运潮','http://student.tsinghua.edu.cn/upload/20140225/2731393310452059.jpg','2014-02-25','清华大学紫荆志愿者春运期间在北京西站开展旅客引导服务','<p style=\"text-align:center;; background:none;\"><strong><span style=\"font-family:楷体;font-size:19px;\">热情紫荆志愿者温馨西站春运潮</span></strong></p><p style=\"text-align:center;; background:none;\"><strong><span style=\"font-family:楷体;\">——清华大学紫荆志愿者春运期间在北京西站开展旅客引导服务</span></strong></p><p style=\"background:none;\"><span style=\"font-family:宋体;\">【通讯员 </span><span style=\"font-family:宋体;\">潘朝强 </span><span style=\"font-family:宋体;\">摄影 </span><span style=\"font-family:宋体;\">黄俊】</span><span style=\"font-family:宋体;\">为促进清华学子对首都社会发展的了解，帮助铁路客运部门缓解北京西站春运压力，贡献紫荆志愿者们奉献青春的热忱，清华大学紫荆志愿者服务总队于</span><span style=\"font-family:;\">2014</span><span style=\"font-family:宋体;\">年春运返程高峰期间，在</span><span style=\"font-family:;\">2</span><span style=\"font-family:宋体;\">月</span><span style=\"font-family:;\">8</span><span style=\"font-family:宋体;\">日、</span><span style=\"font-family:;\">9</span><span style=\"font-family:宋体;\">日、</span><span style=\"font-family:;\">15</span><span style=\"font-family:宋体;\">日和</span><span style=\"font-family:;\">16</span><span style=\"font-family:宋体;\">日组织志愿者三十余人次</span><span style=\"font-family:宋体;\">，在寒假休息时间，到北京西站地下出站系统问询处为来往旅客提供指路咨询、扶老携幼、疏导出站客流等志愿服务，为保障今年春运期间北京西站旅客的畅通出行做出了积极贡献，展示出了清华紫荆志愿者的风采。</span></p><p style=\"line-height: 125%; text-align: center;\"><span style=\"font-family:宋体;\"><img height=\"\" src=\"http://student.tsinghua.edu.cn/upload/20140225/2731393310452059.jpg\" style=\"width:95%; border-radius: 8px; text-align: center;\" title=\"?? �?????�?.jpg\" width=\"\"/></span></p><p style=\"background:none;\"><span style=\"font-family:宋体;\"></span><span style=\"font-family:宋体;\">                           图</span>1 <span style=\"font-family:宋体;\">参与活动部分志愿者合影</span></p><p style=\"background:none;\"><span style=\"font-family:宋体;\">    经过北京西站工作人员的详细培训后，紫荆志愿者们在位于南北进站口附近的两个问询台开展了认真细致的工作。他们戴着小红帽，身着统一的志愿者制服，为出站和接站的旅客们提供指路引导。恰逢春运返程高峰期，志愿者们在岗位上服务少则半天，多则全天，尽管在旅客客流十分密集的压力下，他们几乎没有休息的空档，甚至半天连水都来不及喝一口，但他们脸上依然挂着热情的笑容，积极为旅客们提供最贴心的服务，告诉他们出行的方向和交通方式，提供接站信息，帮助旅客出站。有些旅客的方言较重，志愿者们听不懂对方的方言，他们会微笑着请对方再说一遍，然后指着地图给对方仔细作答，直到旅客们满意地离开。</span></p><p style=\"line-height: 125%; text-align: center;\"><span style=\"font-family:宋体;\"><img height=\"\" src=\"http://student.tsinghua.edu.cn/upload/20140225/27411393310210350.jpg\" style=\"width:95%; border-radius: 8px; text-align: center;\" title=\"?? �?????�?���??客�?�?.jpg\" width=\"\"/></span></p><p style=\"background:none;\"><span style=\"font-family:宋体;\"></span><span style=\"font-family:宋体;\">                           图</span>2 <span style=\"font-family:宋体;\">志愿者细心解答旅客问题</span></p><p style=\"text-indent:28px;; background:none;\"><span style=\"font-family:宋体;\">虽然工作辛苦，但志愿者真切地感受到了铁路客运工作者们的辛苦，从服务春运出行的旅客中收获了满满的快乐，在忙碌中，值班时间不知不觉间就过去了，但为了帮助旅客解决困难，很多志愿者仍然一直坚守在岗位上。志愿者们在服务旅客的同时也认真观察、深入思考，发现了“地铁到进站口候车室的指示标志不明显，导致大量旅客需要帮助才能找到进站口</span>”<span style=\"font-family:宋体;\">、“地铁进站口购票地点设置不合理，大量排队购票的乘客可能会堵塞通道，导致地铁进站缓慢</span>”<span style=\"font-family:宋体;\">、“离京旅客办理退卡手续不便</span>”<span style=\"font-family:宋体;\">等问题，并及时向西站管委会工作人员进行了反馈。</span><span style=\"font-family:宋体;\">北京西站管委会文明办张丽华处长对志愿者们的表现也表示了充分的肯定，她在看望志愿者们时说，欢迎同学们们利用课余时间，多参加志愿服务，并在志愿服务过程中，细心观察服务的场所、区域所存在的问题，体会公共服务管理过程中需要注意的内涵，并对北京西站的服务管理提出意见和建议。</span></p><p style=\"line-height: 125%; text-align: center;\"><span style=\"font-family:宋体;\"><img height=\"\" src=\"http://student.tsinghua.edu.cn/upload/20140225/35781393310283729.jpg\" style=\"width:95%; border-radius: 8px; text-align: center;\" title=\"?? �????��???????��?1.jpg\" width=\"\"/></span></p><p style=\"text-indent:28px;; background:none;\"><span style=\"font-family:宋体;\"></span><span style=\"font-family:宋体;\">                        图</span>3 <span style=\"font-family:宋体;\">志愿者为旅客指引方向</span></p><p style=\"text-indent:28px;; background:none;\"><span style=\"font-family:宋体;\">清华大学紫荆志愿者服务总队是校内最大的志愿者组织，不仅积极组织同学参与校内志愿服务，还鼓励同学们走出校园，参与了</span>2013<span style=\"font-family:宋体;\">年北京园博会、中网、清华园街道敬老院等周边社区等社会志愿服务。为进一步促进清华学子了解首都社会经济发展的现状，为首都社会文明建设贡献自己的热情和力量，紫荆志愿者服务总队与多家社会单位联系洽谈，积极鼓励志愿者们走出校园，走向社会，参与到社会志愿服务。在</span>2013<span style=\"font-family:宋体;\">年“十一”国庆节假期期间开展的西站志愿服务基础上，清华大学紫荆志愿者服务总队和北京西站地区管委会文明办达成合作意向，并签署合作备忘录，在客流高峰期间帮助提供咨询引导服务，和西站驻区武警、消防官兵组织军民共建活动，在社会服务中继续充分展示着紫荆志愿者的风采。</span></p><p style=\"margin:10px 0px 0px;text-align:right;; background:none;\"><span style=\"font-family:宋体;\">（供稿：清华大学紫荆志愿者服务总队）</span>'),(2019,'学生社团骨干参与“星空计划”开展寒假社会实践活动','http://student.tsinghua.edu.cn/upload/20140226/10221393397819127.jpg','2014-02-26','​2月18日至22日，清华大学“星空”学生社团骨干培养计划（简称“星空计划”）第一期30名同学在京开展了为期5天的寒假社会实践活动。','<p style=\"text-indent:2em;; background:none;\"><span style=\"line-height:150%;color:#303030;font-family:宋体,simsun;font-size:14px;\">2</span><span style=\"line-height:150%;color:#303030;font-family:宋体,simsun;font-size:14px;\">月18日至22日，清华大学“星空”学生社团骨干培养计划（简称“星空计划”）第一期30名同学在京开展了为期5天的寒假社会实践活动。</span></p><p style=\"line-height:150%;margin-bottom:0;; background:none;\"><span style=\"line-height:150%;color:#303030;font-family:宋体,simsun;font-size:14px;\">　　他们走访调研了中国青少年发展基金会新工场协力中心、美丽中国、南都公益基金会、北京公益服务发展促进会、北京地球村环境教育中心等5家公益社会组织，与“全国优秀慈善工作者”、北京公益服务发展促进会会长塔林夫、南都公益基金会副秘书长彭艳妮等社会公益人士及部分在公益社会组织工作的清华校友进行交流；参观未来科技城，并在密云进行团队素质拓展训练。</span></p><p style=\"line-height: 125%; text-align: center;\"><span style=\"line-height:150%;color:#303030;font-family:宋体,simsun;font-size:14px;\"><img border=\"0\" height=\"\" hspace=\"0\" src=\"http://student.tsinghua.edu.cn/upload/20140226/10221393397819127.jpg\" style=\"width:95%; border-radius: 8px; text-align: center;\" title=\"?�为????��??��???????�??�?????影�??????jpg\" vspace=\"0\" width=\"\"/></span></p><p style=\"text-align:center;line-height:150%; background:none;\"><span style=\"line-height:150%;color:#303030;font-size:14px;font-family:楷体,楷体_gb2312,simkai;\">图为同学在南都公益基金会学习调研 王瑞琰 <span style=\"line-height:150%;color:#303030;font-size:14px;font-family:楷体,楷体_gb2312,simkai;\">摄</span></span></p><p style=\"text-indent:28px;line-height:150%;margin-bottom:0;; background:none;\"><span style=\"line-height:150%;color:#303030;font-family:宋体,simsun;font-size:14px;\">在公益社会组织学习调研的过程中，同学们就公益社会组织的运营管理、制度建设、人才培养、持续创新、理念推广与资源引入及整合等话题与相关负责人进行交流，一方面旨在借鉴社会组织的先进管理经验，进一步推动学校学生社团协会的科学建设与发展；另一方面希望探寻大学生参与社会公益事业的新模式，更好地传递正能量、贡献新力量。</span></p><p style=\"line-height:150%;margin-bottom:0;; background:none;\"><span style=\"line-height:150%;color:#303030;font-family:宋体,simsun;font-size:14px;\">　　来自爱心公益协会的吕安安同学在调研总结会上谈到：“前辈们投身公益、无私奉献的感人故事，使我和同学们坚定了进一步参与公益事业的信心；在社会组织的参观学习经历，使大家充分认识到社会组织在国家治理、社会建设中发挥的重要作用，为我们未来的成长发展选择打开了思路。”</span></p><p style=\"line-height: 125%; text-align: center;\"><span style=\"line-height:150%;color:#303030;font-family:宋体,simsun;font-size:14px;\"><img border=\"0\" height=\"\" hspace=\"0\" src=\"http://student.tsinghua.edu.cn/upload/20140226/61621393397888572.jpg\" style=\"width:95%; border-radius: 8px; text-align: center;\" title=\"?�为????��??��??????????影�????.jpg\" vspace=\"0\" width=\"\"/></span></p><p style=\"text-align:center;line-height:150%;margin-bottom:0;; background:none;\"><span style=\"line-height:150%;color:#303030;font-size:14px;font-family:楷体,楷体_gb2312,simkai;\">图为同学在未来科技城参观 张博<span style=\"line-height:150%;color:#303030;font-size:14px;font-family:楷体,楷体_gb2312,simkai;\"> 摄</span></span></p><p style=\"line-height:150%;margin-bottom:0;; background:none;\"><span style=\"line-height:150%;color:#303030;font-family:宋体,simsun;font-size:14px;\">　　未来科技城是中组部和国资委为深入贯彻落实建设创新型国家和中央引进海外高层次人才“千人计划”而建设的人才创新创业基地和研发机构集群。同学通过对未来科技城的参观，进一步了解了高新技术的发展前景、国家发展对创新创业的需求和高新技术向产业转化的过程，拓宽了视野。</span></p><p style=\"line-height:150%;margin-bottom:0;; background:none;\"><span style=\"line-height:150%;color:#303030;font-family:宋体,simsun;font-size:14px;\">　　参观、学习、调研以外，“星空计划”同学在密云进行团队拓展训练，邀请专业教练进行指导，旨在培养合作意识、责任意识和开拓精神，充分激发个人和团队的潜能。</span></p><p style=\"line-height:150%;margin-bottom:0;; background:none;\"><span style=\"line-height:150%;color:#303030;font-family:宋体,simsun;font-size:14px;\">　　寒假社会实践结束后，“星空计划”一期学员召开2014年春季学期首次班会暨寒假社会实践总结会，分享了寒假实践中的收获与感悟，并结合所在社团的工作内容与经验，交流了新学期的工作规划。</span></p><p style=\"line-height:150%;margin-bottom:0;; background:none;\"><span style=\"line-height:150%;color:#303030;font-family:宋体,simsun;font-size:14px;\">“星空”学生社团骨干培养计划设立于2014年1月，一期面向全校学生社团协会骨干选拔学员30人，旨在通过为期一年的系统性强化培养锻炼，培养“清华社团制造”的未来领军人才、兴趣酷玩达人和创业先锋人才。</span></p><p style=\"text-align:right;; background:none;\"><span style=\"font-size:14px;font-family:宋体,simsun;\">（供稿：社团协会部）   编辑：未央<br/></span>'),(2020,'关于撤除教学、科研和办公区违规横幅的紧急通知','','2014-03-05','','<p style=\"background:none;\"><span style=\"font-size:19px;font-family:宋体\">    根据《清华大学校园内告示类宣传品管理办法》（</span><span style=\"font-size:19px;font-family:宋体\">经</span><span style=\"font-size:19px\">2011</span><span style=\"font-size:19px;font-family:宋体\">～</span><span style=\"font-size:19px\">2012</span><span style=\"font-size:19px;font-family:宋体\">学年度第</span><span style=\"font-size:19px\">9</span><span style=\"font-size:19px;font-family:宋体\">次校务会议审议通过</span><span style=\"font-size:19px;font-family:宋体\">）规定，学生组织不能违规在校内悬挂横幅等宣传品。</span></p><p style=\"background:none;\"><span style=\"font-size:19px;font-family:宋体\">    随着“女生节”临近，校内出现大量横幅，影响了正常的校园秩序。请在教学、科研和办公区（含南北主干道）悬挂横幅的组织及个人，于</span><span style=\"font-size:19px\">3</span><span style=\"font-size:19px;font-family:宋体\">月</span><span style=\"font-size:19px\">6</span><span style=\"font-size:19px;font-family:宋体\">日（周四）上午</span><span style=\"font-size:19px\">10:00</span><span style=\"font-size:19px;font-family:宋体\">前自行撤除。在紫荆学生公寓区悬挂的横幅于</span><span style=\"font-size:19px\">3</span><span style=\"font-size:19px;font-family:宋体\">月</span><span style=\"font-size:19px\">9</span><span style=\"font-size:19px;font-family:宋体\">日（周日）中午</span><span style=\"font-size:19px\">12:00</span><span style=\"font-size:19px;font-family:宋体\">前自行撤除。未按时撤除的横幅，将由学校有关部门统一清理。</span></p><p style=\"text-indent:36px; background:none;\"><span style=\"font-size:19px;font-family:宋体\">希望广大同学给予理解和配合，共同维护校园环境。</span></p><p style=\"text-indent:36px; background:none;\"><br/></p><p style=\"text-indent:36px; background:none;\"><span style=\"font-size:19px;font-family:宋体\">联系电话：</span><span style=\"font-size:19px\">62786244 </span></p><p style=\"text-indent:36px; background:none;\"><span style=\"font-size:19px;font-family:宋体\">如有问题，请及时和我们联系。</span></p><p style=\"text-align:right;; background:none;\"><span style=\"font-size:19px;font-family:宋体\">                                                              校团委</span></p><p style=\"text-align:right;; background:none;\"><span style=\"font-family:宋体;font-size:19px;\">                                                              环保办</span></p><p style=\"text-align:right;; background:none;\"><span style=\"font-size:19px\">                                      2014</span><span style=\"font-size:19px;font-family:宋体\">年</span><span style=\"font-size:19px\">3</span><span style=\"font-size:19px;font-family:宋体\">月</span><span style=\"font-size:19px\">5</span><span style=\"font-size:19px;font-family:宋体\">日</span>'),(2021,'撤除违规横幅的紧急通知','','2014-03-05','','<p style=\"background:none;\"><span style=\"font-family:宋体;font-size:19px;\">    根据《清华大学校园内告示类宣传品管理办法》（</span><span style=\"font-family:宋体;font-size:19px;\">经</span><span style=\"font-size:19px;\">2011</span><span style=\"font-family:宋体;font-size:19px;\">～</span><span style=\"font-size:19px;\">2012</span><span style=\"font-family:宋体;font-size:19px;\">学年度第</span><span style=\"font-size:19px;\">9</span><span style=\"font-family:宋体;font-size:19px;\">次校务会议审议通过</span><span style=\"font-family:宋体;font-size:19px;\">）规定，学生组织不能违规在校内悬挂横幅等宣传品。</span></p><p style=\"background:none;\"><span style=\"font-family:宋体;font-size:19px;\">    随着“女生节”临近，校内出现大量横幅，影响了正常的校园秩序。请在教学、科研和办公区（含南北主干道）悬挂横幅的组织及个人，于</span><span style=\"font-size:19px;\">3</span><span style=\"font-family:宋体;font-size:19px;\">月</span><span style=\"font-size:19px;\">6</span><span style=\"font-family:宋体;font-size:19px;\">日（周四）上午</span><span style=\"font-size:19px;\">10:00</span><span style=\"font-family:宋体;font-size:19px;\">前自行撤除。在紫荆学生公寓区悬挂的横幅于</span><span style=\"font-size:19px;\">3</span><span style=\"font-family:宋体;font-size:19px;\">月</span><span style=\"font-size:19px;\">9</span><span style=\"font-family:宋体;font-size:19px;\">日（周日）中午</span><span style=\"font-size:19px;\">12:00</span><span style=\"font-family:宋体;font-size:19px;\">前自行撤除。未按时撤除的横幅，将由学校有关部门统一清理。</span></p><p style=\"text-indent:36px;; background:none;\"><span style=\"font-family:宋体;font-size:19px;\">希望广大同学给予理解和配合，共同维护校园环境。</span></p><p style=\"text-indent:36px;; background:none;\"><br/></p><p style=\"text-indent:36px;; background:none;\"><span style=\"font-family:宋体;font-size:19px;\">联系电话：</span><span style=\"font-size:19px;\">62786244 </span></p><p style=\"text-indent:36px;; background:none;\"><span style=\"font-family:宋体;font-size:19px;\">如有问题，请及时和我们联系。</span></p><p style=\"text-align:right;; background:none;\"><span style=\"font-family:宋体;font-size:19px;\">                                                              校团委</span></p><p style=\"text-align:right;; background:none;\"><span style=\"font-family:宋体;font-size:19px;\">                                                              环保办</span></p><p style=\"text-align:right;; background:none;\"><span style=\"font-size:19px;\">                                      2014</span><span style=\"font-family:宋体;font-size:19px;\">年</span><span style=\"font-size:19px;\">3</span><span style=\"font-family:宋体;font-size:19px;\">月</span><span style=\"font-size:19px;\">5</span><span style=\"font-family:宋体;font-size:19px;\">日</span>'),(2022,'思源计划第十三期公开选拔报名','','2014-03-06','','<p styl'),(2023,'筑一片砖瓦 撑一方蓝天','','2014-03-07','孙启力，男，辽宁瓦房店人，清华大学土木工程系结01班本科生。本科期间，他发表的论文《吊轨式立体停车成套系统的设计》被收录于《“第二届全国高校土木工程专业大学生论坛”成果与论文集》中。曾获清华大学十八届结构设计竞赛特等奖、第二届北京市交通科技竞赛一等奖第一名、“交运之星”杯第七届全国大学生交通科技竞赛二等奖、第三十一届清华大学挑战杯二等奖。被评为清华大学优秀共青团员、北京“先锋杯”优秀基层团干部。','<p style=\"text-indent:28px; background:none;\"><span style=\"font-family:宋体;font-size:14px;\"></span></p><p style=\"text-align:center;text-indent:48px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:20px;font-family:宋体, simsun;color:#000000;\">筑一片砖瓦 </span><span style=\"font-size:20px;font-family:宋体, simsun;color:#000000;\">撑一方蓝天</span></strong></p><p style=\"text-align:right;text-indent:37px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:20px;font-family:宋体, simsun;color:#000000;\">——访</span><span style=\"font-size:20px;font-family:宋体, simsun;color:#000000;\">2013</span><span style=\"font-size:20px;font-family:宋体, simsun;color:#000000;\">年清华大学本科生特等奖学金获得者孙启力</span></strong></p><p style=\"text-align:center;text-indent:37px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:20px;font-family:宋体, simsun;color:#000000;\"><br/></span></strong></p><p style=\"text-align:left;text-indent:32px;line-height:1.5em;; background:none;\"><span style=\"line-height:1.5em;text-indent:28px;font-family:宋体, simsun;font-size:14px;\">“喝启力，添动力!</span><span style=\"line-height:1.5em;text-indent:28px;font-family:宋体, simsun;font-size:14px;\">”孙启力在本科生特等奖学金答辩时如此风趣地形容自己。接受采访时，已完成免试攻读博士生学位手续的他，却没有半点清闲和松懈。作为清华大学校团委社团部办公室组长，孙启力此时正忙碌于即将开始的清华大学社团协会联合招新。</span><br/></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">“每学期都有‘百团大战’，这学期做得比往常更火。”谈到自己的工作，孙启力显得成竹在胸。他的活力不仅体现在社工方面，在学习、科研、公益上，孙启力也用行动诠释着土木人“不断进取，敢于挑战”的精神。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\"><br/></span></p><p style=\"text-align:center;text-indent:32px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:14px;font-family:宋体, simsun;color:#000000;\">一年的班长，永恒的情谊</span></strong></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">初到清华园，虽然环境很陌生，但待人热情的孙启力很快就和同学们打成一片，并顺利当选为班长。班级里许多同学并不能很快融入集体当中，孙启力就组织集体生日等活动，增进同学彼此间的感情。每逢节假日，孙启力都会组织班级集体出游，八角游乐园、鹫峰森林公园，许多地方都留下了结01</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">班的足迹。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">大一的女生节成为了结01</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">班同学共同珍藏的美好回忆。“那天晚上，全班男生在女生宿舍楼下用蜡烛围成一个圈，一位男生坐在中间弹着吉他，其他的男生就一起唱《彩虹》，”回忆起那一年的女生节，孙启力仍然记忆犹新，“女生们当时也十分感动，穿着睡衣就跑下了楼，第二天还主动请缨给男生送早餐。那种感觉真是太赞了！”</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">院系学生节是班级文艺成果展示的窗口。大一时，尽管缺少经验，同学们还是很希望班级节目能够登上学生节的舞台。作为班长的孙启力组织了一个编剧团，和大家一起出谋划策、写剧本。第一版剧本在一审“被毙”之后，孙启力主动对剧本进行了修改，但还是被苛刻的评审们挡在了学生节门外。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">“二审结束那天晚上，我们班一起去翅香园聚餐。孙启力一直在道歉，说自己做得不够好，才导致最后没上学生节，”结01</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">班的许松建依然记得那天晚上孙启力的心情十分低落，“吃完饭之后，我们几个好朋友还安慰他、陪他散心。孙启力就是这样一个人，责任感很强，对自己要求很高。”</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">有了大一失败的经验，大二到大四，结01</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">班三次登上了学生节的舞台。大三时，身为文艺委员的孙启力编写了剧本《我的高地你不懂》，据此拍成的DV</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">节目在土木建管系学生节上大获好评，并被选为了院系评估期间向住房和城乡建设部专家展示的汇报表演节目。而观众也在DV</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">结束后的演职人员表中发现，导演、编剧、剪辑、字幕全都有孙启力的名字。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">虽然只是一年的班长，但孙启力始终是班级的“活力之源”，他每学期都会担任一门课程的课代表。在他的带动下，结01</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">班连续三年获得“土木建管系甲级团支部”称号。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\"><br/></span></p><p style=\"text-align:center;text-indent:32px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:14px;font-family:宋体, simsun;color:#000000;\">质疑，可以是一种习惯</span></strong></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">如果说清华园的生活是一幅色彩斑斓的水彩画，那么学习生活是就是这幅画的底色。来到土木系的孙启力并没有被动学习课本上的知识，而是用实际行动告诉我们，独立思考，大胆质疑也是一种优秀的习惯。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">《混凝土结构设计》是土木建管系的一门专业课。这门课程在讲授楼板楼盖设计时，采用忽略纵向受力的方法，将复杂建筑简化为平面结构。老师在讲课过程中提到，这样的设计更为保守安全。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">“我当时对这个说法产生了怀疑，就主动去和老师交流。”孙启力说道。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">《混凝土结构设计》任课教师、孙启力未来的博士生导师樊建生对此十分赞赏：“他自学了有限元的方法，而这个方法一般到了研究生阶段才会使用。虽然最终证明了现有的设计方法没有问题，但我非常欣赏这种提出问题并解决问题的能力。”</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">同样，在其他课程中，孙启力也经常会和老师交流，提出一些在别人看来似乎没有讨论价值的问题。正是凭借着这种质疑的习惯和持之以恒的努力，孙启力的成绩在年级始终名列前茅。更重要的是，这种习惯让他在科研中，能够站在更新的角度，能够发现别人察觉不到的问题。</span></p><p style=\"text-indent:28px; background:none;\"><br/></p><p style=\"text-align:center;text-indent:32px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:14px;font-family:宋体, simsun;color:#000000;\">关注工程实践，科技结合民生</span></strong></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">谈起自己做过的大大小小的课题，孙启力表示，自己收获的不仅是科研能力，还有关注工程实践，科技结合民生的意识。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">在清华大学第十八届结构设计大赛中，孙启力团队以哈尔滨阳明滩大桥倾覆事件为背景，在数值模拟和结构制作中反复调整结构形式，优化截面参数，最终，他们设计的结构承载了300</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">倍自重的偏心荷载，荣获全校唯一的特等奖。</span></p><p style=\"text-indent:28px;line-height:1.5em;text-align:left;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;line-height:1.5em;\">大二下学期，孙启力等人组成的团队针对大城市日益严重的停车问题，进行了深入而系统的调研，提出了成本更低、效率更高的“吊轨式立体停车系统”，并进行了自动化模型的制作。电钻、电砂轮、传感器，这些本不会与土木系本科生有交集的工具成了孙启力的好伙伴。“我们在车间里做的工作，算是抢了自动化系和机械系的活。”孙启力笑着说道。</span><br/></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">功夫不负有心人，经过在东南大学的答辩，孙启力团队的论文《吊轨式立体停车成套系统的设计》获得全国高校土木工程专业大学生论坛论文一等奖，并被收录于《“第二届全国高校土木工程专业大学生论坛”成果与论文集》中。面对成功，孙启力表现得很谦虚，“这个成功是属于团队的，我只是承担了一部分工作，我从其他成员身上也学到很多。”</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">“孙启力是一个技术水平均衡、领导能力很强的人。不管是调研、设计，还是最后的模型制作，他都完成得很不错。”同在“吊轨式立体停车系统”研究团队的汪家继这样评价自己曾经的队友。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">孙启力和他的团队并没有止步不前，他们对这个系统进行了进一步的完善与改进，目前正在申请专利。孙启力说：“做了这么长时间，和项目都有感情了。作为土木人，我更希望看到自己的设计能够应用到实际中，让更多人因为这个设计而受益。”</span></p><p style=\"text-indent:28px; background:none;\"><br/></p><p style=\"text-align:center;text-indent:32px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:14px;font-family:宋体, simsun;color:#000000;\">带着土木工程师的责任感做公益</span></strong></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">本科四年，孙启力先后前往五省十余乡镇进行社会实践。丰富的实践经验开阔了孙启力的视野，也让他更加了解国家发展的实际情况和需求。在学习了许多土木方面的技术知识之后，孙启力觉得，应该用自己的知识为生活在经济落后地区的人们做点什么。于是，他加入了“茅以升公益桥”项目。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">“茅以升公益桥”项目是茅以升基金会的发起的一个资助高校学生进行桥梁自主规划设计施工的项目，项目的主力为本科生。作为团队的一员，孙启力进行了大量前期工作，包括桥址的调研，施工方案的比对，以及实地考察。不过在项目开工前，却突然遇到了资金周转的问题，不得不推迟建设。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">“抗压抗折，大概是我们土木人的特质吧。”孙启力略显无奈地说道。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">为了弥补这个遗憾，孙启力又加入了“无止桥”公益项目团队，并担任了首席技术官（CTO</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">），牵头组织团队解决设计施工过程中的技术问题，而他们选择的建桥地点都是那些需求最迫切的偏远山区。孙启力实地勘测多次，村民们的淳朴、热情给孙启力留下了深刻的印象：“他们对我们所有人都非常好。当时我们有一个同学的手机丢了，村民带着我们满山的找啊，最后在一条河沟里找到了，我们都觉得特别感动。”</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">今年，孙启力和他的“无止桥”团队准备建两座桥，分别位于云南和四川。其中位于云南新平的桥今年“五一”就可以开工建设。“其实桥梁技术上没有什么困难，最大的困难是经费不足。山区里需要太多的桥，我们却很难满足他们的需求。”在亲自参与桥梁修建过后，孙启力表达了希望让更多的偏远山区拥有桥梁的愿望。</span></p><p style=\"text-indent:28px; background:none;\"><br/></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">有人说，土木工程师从事的事业很辛苦，也很踏实。他们的心血凝成的硕果就矗立在那里，十年、五十年，一直在那里。而孙启力会用他的付出和坚持告诉我们，十年、五十年，他也一直在这里，为祖国的土木事业发展尽一份力量，为更多人筑一片砖瓦，撑一方蓝天。</span></p><p style=\"text-indent:28px;line-height:1.5em;text-align:right;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">编辑：叶帅<br/></span>'),(2024,'学生社会实践梦想计划招募通知','','2014-03-07','','<p styl'),(2025,'清华大学学生社团协会联合招新成功举办','http://student.tsinghua.edu.cn/upload/20140308/77601394261191313.jpg','2014-03-08','3月5日至6日，2014年春季学期清华大学学生社团协会联合招新活动在紫荆学生公寓区举行，共有志愿公益、科技创业、文化、体育、艺术和素质拓展6大类别的近150家学生社团协会和学生组织参与，逾万人次现场关注。','<p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-size:14px;line-height:150%;font-family:宋体;color:#000000;\">3</span><span style=\"font-size:14px;line-height:150%;font-family:宋体;color:#000000;\">月5日至6日，2014年春季学期清华大学学生社团协会联合招新活动在紫荆学生公寓区举行，共有志愿公益、科技创业、文化、体育、艺术和素质拓展6大类别的近150家学生社团协会和学生组织参与，逾万人次现场关注。</span></p><p style=\"line-height: 125%; text-align: center;\"><span style=\"font-size:14px;line-height:150%;font-family:宋体;color:#000000;\"><img height=\"\" src=\"http://student.tsinghua.edu.cn/upload/20140308/77601394261191313.jpg\" style=\"width:95%; border-radius: 8px; text-align: center;\" title=\"~1.jpg\" width=\"\"/></span></p><p style=\"text-indent:28px;line-height:1.5em;text-align:center;; background:none;\"><span style=\"font-size:14px;line-height:150%;font-family:宋体;color:#000000;\"><span style=\"font-size:16px;font-family:宋体;\"><span style=\"font-size:14px;line-height:150%;font-family:楷体, 楷体_gb2312, simkai;color:#000000;\">图为俯瞰联合招新活动现场 摄影记者：</span><span style=\"font-family:楷体, 楷体_gb2312, simkai;font-size:14px;line-height:16px;background-color:#FFFFFF;\">谭庆俞 </span></span></span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-size:14px;line-height:150%;font-family:宋体;color:#000000;\">联合招新活动既是学生社团协会吸纳新成员的平台，也是展示社团文化魅力的舞台。各社团纷纷拿出“看家绝活”：舞蹈协会的同学们用一曲“摇摆舞”点燃了现场的欢乐热情；素食协会用花草装扮的小屋让同学们感到温馨惬意；天文协会、滑雪协会也分别摆出了望远镜和滑雪装具吸引大家的眼球；科技教育交流协会的同学手持一块写有“支教吧少年”的宣传板，既显得亲切可爱，又展现出了清华学子服务社会的情怀。</span></p><p style=\"line-height: 125%; text-align: center;\"><span style=\"font-size:14px;line-height:150%;font-family:宋体;color:#000000;\"><img height=\"\" src=\"http://student.tsinghua.edu.cn/upload/20140308/3411394261421553.jpg\" style=\"width:95%; border-radius: 8px; text-align: center;\" title=\"~2.jpg\" width=\"\"/></span></p><p style=\"text-indent:28px;line-height:1.5em;text-align:center;; background:none;\"><span style=\"font-size:14px;line-height:150%;font-family:宋体;color:#000000;\"><span style=\"font-size:16px;font-family:宋体;\"><span style=\"font-size:14px;line-height:150%;font-family:楷体, 楷体_gb2312, simkai;color:#000000;\">图为空手道协会招新现场 摄影记者：</span><span style=\"font-family:楷体, 楷体_gb2312, simkai;font-size:14px;line-height:16px;background-color:#FFFFFF;\">张弘扬</span></span></span></p><p style=\"text-indent:32px;line-height:1.5em;; background:none;\"><span style=\"font-size:14px;line-height:150%;font-family:宋体;color:#000000;\">联合招新活动举办首日正值第51个“学雷锋纪念日”，来自建筑学院的许晓佳同学与几位好友相约共同加入粉刷匠工作室，“为乡村学校粉刷墙壁、装饰空间的活动既新颖又有意义，我想当个‘粉刷匠’，从今天开始传递自己的‘彩色公益梦想’！”绿色协会的刘涛同学在招新活动结束后高兴地说：“今年协会又有了近百名小伙伴的加入，力量更强大了！在新的时代背景下，倡导绿色生活、贡献环保事业是对‘雷锋精神’的新传承、新诠释。”</span></p><p style=\"line-height: 125%; text-align: center;\"><span style=\"font-size:14px;line-height:150%;font-family:宋体;color:#000000;\"><img height=\"\" src=\"http://student.tsinghua.edu.cn/upload/20140308/9591394261458116.jpg\" style=\"width:95%; border-radius: 8px; text-align: center;\" title=\"~3.jpg\" width=\"\"/></span></p><p style=\"text-indent:32px;line-height:1.5em;text-align:center;; background:none;\"><span style=\"font-size:14px;line-height:150%;font-family:宋体;color:#000000;\"><span style=\"font-size:16px;font-family:宋体;\"><span style=\"font-size:14px;line-height:150%;font-family:楷体, 楷体_gb2312, simkai;color:#000000;\">图为同学聆听社团协会的招新介绍 </span><span style=\"line-height:21px;text-align:center;text-indent:28px;font-size:14px;font-family:楷体, 楷体_gb2312, simkai;\">摄影记者：</span><span style=\"text-align:center;text-indent:28px;font-family:楷体, 楷体_gb2312, simkai;font-size:14px;line-height:16px;background-color:#FFFFFF;\">张弘扬</span></span></span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-size:14px;line-height:150%;font-family:宋体;color:#000000;\">清华大学学生社团协会具有悠久历史和传统，是同学们成长发展的第二课堂。目前，全校共有学生社团协会近200家，丰富多彩的社团活动为同学们的课余文化生活提供了多样化选择，为同学的全面发展提供了平台和助力。</span></p><p style=\"text-align:right;; background:none;\"><span style=\"font-size:14px;\">编辑：叶帅</span>'),(2026,'【特等奖学金】孙启力：筑一片砖瓦 撑一方蓝天','http://student.tsinghua.edu.cn/upload/20140308/70491394291840164.jpg','2014-03-07','孙启力，男，辽宁瓦房店人，清华大学土木工程系结01班本科生。本科期间，他发表的论文《吊轨式立体停车成套系统的设计》被收录于《“第二届全国高校土木工程专业大学生论坛”成果与论文集》中。曾获清华大学十八届结构设计竞赛特等奖、第二届北京市交通科技竞赛一等奖第一名、“交运之星”杯第七届全国大学生交通科技竞赛二等奖、第三十一届清华大学挑战杯二等奖。被评为清华大学优秀共青团员、北京“先锋杯”优秀基层团干部。','<p style=\"text-indent:28px; background:none;\"><span style=\"font-family:宋体;font-size:14px;\"></span></p><p style=\"text-align:center;text-indent:48px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:20px;font-family:宋体, simsun;color:#000000;\">筑一片砖瓦 </span><span style=\"font-size:20px;font-family:宋体, simsun;color:#000000;\">撑一方蓝天</span></strong></p><p style=\"text-align:right;text-indent:37px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:18px;font-family:宋体, simsun;color:#000000;\">——访</span><span style=\"font-size:18px;font-family:宋体, simsun;color:#000000;\">2013</span><span style=\"font-size:18px;font-family:宋体, simsun;color:#000000;\">年清华大学本科生特等奖学金获得者孙启力</span></strong></p><p style=\"text-align:center;text-indent:37px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:20px;font-family:宋体, simsun;color:#000000;\"><br/></span></strong></p><p style=\"text-align:center;text-indent:37px;line-height:1.5em;; background:none;; text-indent:0px\"><strong style=\"line-height: 125%; text-align: center;\"><span style=\"font-size:20px;font-family:宋体, simsun;color:#000000;\"><img height=\"\" src=\"http://student.tsinghua.edu.cn/upload/20140308/70491394291840164.jpg\" style=\"width:95%; border-radius: 8px; text-align: center;\" title=\"~5.工�?�??_�????jpg\" width=\"\"/></span></strong></p><p style=\"text-align:center;text-indent:37px;line-height:1.5em;; background:none;\"><span style=\"font-size:20px;font-family:宋体, simsun;color:#000000;\"><span style=\"font-size:14px;\"><span style=\"font-family:楷体, 楷体_gb2312;\">图为孙启力在工地实习</span></span></span></p><p style=\"text-align:left;text-indent:32px;line-height:1.5em;; background:none;\"><strong style=\"line-height:1.5em;\"><span style=\"line-height:1.5em;text-indent:28px;font-family:宋体, simsun;font-size:14px;\"><span style=\"font-family:楷体, 楷体_gb2312;\">孙启力，男，辽宁瓦房店人，清华大学土木工程系结01班本科生。本科期间，他发表的论文《吊轨式立体停车成套系统的设计》被收录于《“第二届全国高校土木工程专业大学生论坛”成果与论文集》中。曾获清华大学十八届结构设计竞赛特等奖、第二届北京市交通科技竞赛一等奖第一名、“交运之星”杯第七届全国大学生交通科技竞赛二等奖、第三十一届清华大学挑战杯二等奖。被评为清华大学优秀共青团员、北京“先锋杯”优秀基层团干部。</span></span></strong><br/></p><p style=\"text-align:left;text-indent:32px;line-height:1.5em;; background:none;\"><span style=\"line-height:1.5em;text-indent:28px;font-family:宋体, simsun;font-size:14px;\">“喝启力，添动力!</span><span style=\"line-height:1.5em;text-indent:28px;font-family:宋体, simsun;font-size:14px;\">”孙启力在本科生特等奖学金答辩时如此风趣地形容自己。接受采访时，已完成免试攻读博士生学位手续的他，却没有半点清闲和松懈。作为清华大学校团委社团部办公室组长，孙启力此时正忙碌于即将开始的清华大学社团协会联合招新。</span><br/></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">“每学期都有‘百团大战’，这学期做得比往常更火。”谈到自己的工作，孙启力显得成竹在胸。他的活力不仅体现在社工方面，在学习、科研、公益上，孙启力也用行动诠释着土木人“不断进取，敢于挑战”的精神。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\"></span></p><p style=\"text-align:center;text-indent:32px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:14px;font-family:宋体, simsun;\">质疑，可以是一种习惯</span></strong></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;\">如果说清华园的生活是一幅色彩斑斓的水彩画，那么学习生活是就是这幅画的底色。来到土木系的孙启力并没有被动学习课本上的知识，而是用实际行动告诉我们，独立思考，大胆质疑也是一种优秀的习惯。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;\">《混凝土结构设计》是土木建管系的一门专业课。这门课程在讲授楼板楼盖设计时，采用忽略纵向受力的方法，将复杂建筑简化为平面结构。老师在讲课过程中提到，这样的设计更为保守安全。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;\">“我当时对这个说法产生了怀疑，就主动去和老师交流。”孙启力说道。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;\">《混凝土结构设计》任课教师、孙启力未来的博士生导师樊建生对此十分赞赏：“他自学了有限元的方法，而这个方法一般到了研究生阶段才会使用。虽然最终证明了现有的设计方法没有问题，但我非常欣赏这种提出问题并解决问题的能力。”</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;\">同样，在其他课程中，孙启力也经常会和老师交流，提出一些在别人看来似乎没有讨论价值的问题。正是凭借着这种质疑的习惯和持之以恒的努力，孙启力的成绩在年级始终名列前茅。更重要的是，这种习惯让他在科研中，能够站在更新的角度，能够发现别人察觉不到的问题。</span></p><p style=\"text-align:center;text-indent:32px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:14px;font-family:宋体, simsun;color:#000000;\">一年的班长，永恒的情谊</span></strong></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">初到清华园，虽然环境很陌生，但待人热情的孙启力很快就和同学们打成一片，并顺利当选为班长。班级里许多同学并不能很快融入集体当中，孙启力就组织集体生日等活动，增进同学彼此间的感情。每逢节假日，孙启力都会组织班级集体出游，八角游乐园、鹫峰森林公园，许多地方都留下了结01</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">班的足迹。</span></p><p style=\"line-height: 125%; text-align: center;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\"><img height=\"\" src=\"http://student.tsinghua.edu.cn/upload/20140308/36481394291971212.jpg\" style=\"width:95%; border-radius: 8px; text-align: center;\" title=\"~3.?�年?��?表�?_�????jpg\" width=\"\"/></span></p><p style=\"text-indent:28px;line-height:1.5em;text-align:center;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\"><span style=\"font-size:14px;\"><span style=\"font-family:楷体, 楷体_gb2312;\">图为孙启力参加百年校庆表演</span></span></span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">大一的女生节成为了结01</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">班同学共同珍藏的美好回忆。“那天晚上，全班男生在女生宿舍楼下用蜡烛围成一个圈，一位男生坐在中间弹着吉他，其他的男生就一起唱《彩虹》，”回忆起那一年的女生节，孙启力仍然记忆犹新，“女生们当时也十分感动，穿着睡衣就跑下了楼，第二天还主动请缨给男生送早餐。那种感觉真是太赞了！”</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">院系学生节是班级文艺成果展示的窗口。大一时，尽管缺少经验，同学们还是很希望班级节目能够登上学生节的舞台。作为班长的孙启力组织了一个编剧团，和大家一起出谋划策、写剧本。第一版剧本在一审“被毙”之后，孙启力主动对剧本进行了修改，但还是被苛刻的评审们挡在了学生节门外。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">“二审结束那天晚上，我们班一起去翅香园聚餐。孙启力一直在道歉，说自己做得不够好，才导致最后没上学生节，”结01</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">班的许松建依然记得那天晚上孙启力的心情十分低落，“吃完饭之后，我们几个好朋友还安慰他、陪他散心。孙启力就是这样一个人，责任感很强，对自己要求很高。”</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">有了大一失败的经验，大二到大四，结01</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">班三次登上了学生节的舞台。大三时，身为文艺委员的孙启力编写了剧本《我的高地你不懂》，据此拍成的DV</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">节目在土木建管系学生节上大获好评，并被选为了院系评估期间向住房和城乡建设部专家展示的汇报表演节目。而观众也在DV</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">结束后的演职人员表中发现，导演、编剧、剪辑、字幕全都有孙启力的名字。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">虽然只是一年的班长，但孙启力始终是班级的“活力之源”，他每学期都会担任一门课程的课代表。在他的带动下，结01</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">班连续三年获得“土木建管系甲级团支部”称号。</span></p><p style=\"text-align:center;text-indent:32px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:14px;font-family:宋体, simsun;color:#000000;\">关注工程实践，科技结合民生</span></strong></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">谈起自己做过的大大小小的课题，孙启力表示，自己收获的不仅是科研能力，还有关注工程实践，科技结合民生的意识。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">在清华大学第十八届结构设计大赛中，孙启力团队以哈尔滨阳明滩大桥倾覆事件为背景，在数值模拟和结构制作中反复调整结构形式，优化截面参数，最终，他们设计的结构承载了300</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">倍自重的偏心荷载，荣获全校唯一的特等奖。</span></p><p style=\"text-indent:28px;line-height:1.5em;text-align:left;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;line-height:1.5em;\">大二下学期，孙启力等人组成的团队针对大城市日益严重的停车问题，进行了深入而系统的调研，提出了成本更低、效率更高的“吊轨式立体停车系统”，并进行了自动化模型的制作。电钻、电砂轮、传感器，这些本不会与土木系本科生有交集的工具成了孙启力的好伙伴。“我们在车间里做的工作，算是抢了自动化系和机械系的活。”孙启力笑着说道。</span><br/></p><p style=\"line-height: 125%; text-align: center;\"><span style=\"font-family:宋体, simsun;font-size:14px;line-height:1.5em;\"><img height=\"\" src=\"http://student.tsinghua.edu.cn/upload/20140308/87491394292002376.jpg\" style=\"width:95%; border-radius: 8px; text-align: center;\" title=\"~6.�??设�?大�?_�????jpg\" width=\"\"/></span></p><p style=\"text-indent:28px;line-height:1.5em;text-align:center;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;line-height:1.5em;\"><span style=\"font-family:楷体, 楷体_gb2312;\">图为孙启力参加结构设计大赛</span></span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">功夫不负有心人，经过在东南大学的答辩，孙启力团队的论文《吊轨式立体停车成套系统的设计》获得全国高校土木工程专业大学生论坛论文一等奖，并被收录于《“第二届全国高校土木工程专业大学生论坛”成果与论文集》中。面对成功，孙启力表现得很谦虚，“这个成功是属于团队的，我只是承担了一部分工作，我从其他成员身上也学到很多。”</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">“孙启力是一个技术水平均衡、领导能力很强的人。不管是调研、设计，还是最后的模型制作，他都完成得很不错。”同在“吊轨式立体停车系统”研究团队的汪家继这样评价自己曾经的队友。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">孙启力和他的团队并没有止步不前，他们对这个系统进行了进一步的完善与改进，目前正在申请专利。孙启力说：“做了这么长时间，和项目都有感情了。作为土木人，我更希望看到自己的设计能够应用到实际中，让更多人因为这个设计而受益。”</span></p><p style=\"text-align:center;text-indent:32px;line-height:1.5em;; background:none;\"><strong><span style=\"font-size:14px;font-family:宋体, simsun;color:#000000;\">带着土木工程师的责任感做公益</span></strong></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">本科四年，孙启力先后前往五省十余乡镇进行社会实践。丰富的实践经验开阔了孙启力的视野，也让他更加了解国家发展的实际情况和需求。在学习了许多土木方面的技术知识之后，孙启力觉得，应该用自己的知识为生活在经济落后地区的人们做点什么。于是，他加入了“茅以升公益桥”项目。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">“茅以升公益桥”项目是茅以升基金会的发起的一个资助高校学生进行桥梁自主规划设计施工的项目，项目的主力为本科生。作为团队的一员，孙启力进行了大量前期工作，包括桥址的调研，施工方案的比对，以及实地考察。不过在项目开工前，却突然遇到了资金周转的问题，不得不推迟建设。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">“抗压抗折，大概是我们土木人的特质吧。”孙启力略显无奈地说道。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">为了弥补这个遗憾，孙启力又加入了“无止桥”公益项目团队，并担任了首席技术官（CTO</span><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">），牵头组织团队解决设计施工过程中的技术问题，而他们选择的建桥地点都是那些需求最迫切的偏远山区。孙启力实地勘测多次，村民们的淳朴、热情给孙启力留下了深刻的印象：“他们对我们所有人都非常好。当时我们有一个同学的手机丢了，村民带着我们满山的找啊，最后在一条河沟里找到了，我们都觉得特别感动。”</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">今年，孙启力和他的“无止桥”团队准备建两座桥，分别位于云南和四川。其中位于云南新平的桥今年“五一”就可以开工建设。“其实桥梁技术上没有什么困难，最大的困难是经费不足。山区里需要太多的桥，我们却很难满足他们的需求。”在亲自参与桥梁修建过后，孙启力表达了希望让更多的偏远山区拥有桥梁的愿望。</span></p><p style=\"text-indent:28px;line-height:1.5em;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">有人说，土木工程师从事的事业很辛苦，也很踏实。他们的心血凝成的硕果就矗立在那里，十年、五十年，一直在那里。而孙启力会用他的付出和坚持告诉我们，十年、五十年，他也一直在这里，为祖国的土木事业发展尽一份力量，为更多人筑一片砖瓦，撑一方蓝天。</span></p><p style=\"text-indent:28px;line-height:1.5em;text-align:right;; background:none;\"><span style=\"font-family:宋体, simsun;font-size:14px;color:#000000;\">编辑：叶帅<br/></span>');
/*!40000 ALTER TABLE `TuanTuanApp_news` ENABLE KEYS */;
UNLOCK TABLES;

