INSERT INTO `TuanTuanApp_studentactivity` VALUES (1,'星星雨路演暨爱心义卖活动','','2013-12-15 11:00:00','2013-12-15 19:00:00','生物紫荆','<p style=\"line-height: 16.0px;\">\n  <img src=\"/ueditor/dialogs/attachment/fileTypeImages/icon_doc.gif\" />\n  <a href=\"/upload/20131122/63911385083976071.docx\">星星雨路演暨爱心义卖策划 .docx</a></p>\n<p>说明活动的主要内容，如内容较多请使用上传附件功能。<br /></p>'),(2,'“岁末愿望清单”全血捐献专场活动','','2013-12-14 08:00:00','2013-12-14 18:00:00','清华大学红十字会学生分会','<p>       在2013年年末，以年末愿望的形式呼吁没有参加过献血活动且有能力参加的同学积极加入到献血活动中来，完成自己的人生第一次鲜血。一方面是自己学会关心他人，回报社会；另一方面，也充分发挥同学们投身公益的热情。</p>'),(3,'不做吸尘器——每日空气质量公示','','2013-12-11 20:44:00','2013-12-19 20:44:00','陈宇军','<p style=\"line-height: 16.0px;\">\n  <img src=\"/ueditor/dialogs/attachment/fileTypeImages/icon_doc.gif\" />\n  <a href=\"/upload/20131130/75671385815218430.docx\">项目背景.docx</a></p>\n<p>我们计划通过在紫操前的这样一块大展板增加同学们对于活动的关注度。提高影响力.每日数据都会更新。<br /></p>');
/*!40000 ALTER TABLE `TuanTuanApp_studentactivity` ENABLE KEYS */;
UNLOCK TABLES;

